insert  into `tblmodule_data`(`id`,`fid`,`chpt`,`lesn`,`ttle`,`nfo`) values (1,2,'Chapter 1','Bayani ng Lahi','Himagsikan','<p><strong>Jose Rizal</strong></p>\r\n<p><strong>Andres Bonifacio</strong></p>\r\n<p><strong>Juan Luna</strong></p>\r\n<p><strong>Apolinario Mabini</strong></p>'),(3,2,'Chapter 1','Pandiwa','Mga Pandiwa','<p>abakada</p>'),(4,2,'Chapter 2','Panlapi','Uri  ng Panlapi','<p>Mga Panlapi</p>'),(9,2,'Chapter 2','qewqweqwe','qweqweqweqw','<p>qweqweqweqweqwe</p>'),(10,46,'ARALIN 3','PERSWEYSIB','PERSWEYSIB','<p>mayroon ka ba bang natatandaan mga linya sa patalastas na tumatak sa iyong isipan&nbsp; at humikayat sa iyong bumili ng produkto? Ibahagi sa klase ang iyong nalalaman?_______________</p>\r\n<p>Masasabi mo bang naging epektbo ang paaan ng panghihikayat kaya tumatatak sa iyong isipan at humikaya sa iyong bumili?</p>\r\n<p>____________________________________________________________________________________________</p>\r\n<p><strong>ALAM MO BA?</strong></p>\r\n<p>Mga Propaganda Device</p>\r\n<ol>\r\n<li><strong>NAME CALLING </strong>&ndash; Ito ay may pagbibigay ng hindi magandang taguri sa isang produkto o katunggaling politiko upang hindi tangkilikin. Karaniwang ginagamit ito sa mundo ng politiko.</li>\r\n</ol>\r\n<p><strong>HALIMBAWA: </strong>ang pekeng sabon, bagitong kandidato,tropa( traditional politician)</p>\r\n<ol start=\"2\">\r\n<li><strong>GLITTERING GENERALITIES </strong>&ndash; Ito ay ang magaganda at nakakasilaw na pahayag ukol sa isang produktong tumutugon sa mga paniniwala at pagpapahalaga ng mambabasa.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Mas makatitipid sa bagong ________. Ang iyong damit ay mas magiging maputi sa _________ puting puti. Bossing sa kaputian.</p>\r\n<ol start=\"3\">\r\n<li><strong>TRANSFER </strong>&ndash; Ang paggamit ng isang sikat na personalidad upang mailipat sa isang produkto o tao ang kasikatan.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Ipagpapatuloy ko ang sinimulan ni<strong> FPJ. &ndash; Grace Poe ; </strong>Manny Pacquaio gumagamit ng ________ kapag nasasaktan<strong>.</strong></p>\r\n<ol start=\"4\">\r\n<li><strong>TESTIMONIAL &ndash; </strong>Kapag ang isang sikat na personalidad ay tuwirang nag-endorso ng isang tao o produkto.</li>\r\n</ol>\r\n<ol start=\"5\">\r\n<li><strong>PLAIN FOLKS &ndash; </strong>Karaniwan itong ginagamit sa kampanya o komersiyal kung saan ang mga kilala o tanyag na tao ay pinalalabas na ordinaryong taong nanghihikayat sa boto, produkto, o serbisyo.</li>\r\n</ol>\r\n<ol start=\"6\">\r\n<li><strong>CARD STACKING</strong> &ndash; Ipinakikita nito ang lahat ng magagandang katangian ng produkto ngunit hindi binabanggit ang hindi magandang katangian. <strong>HALIMBAWA:</strong> Ang instant noodles na ito ay nakapagbubuklod ng pamilya, nakatitipid ng oras , mura na , masarap pa.( Ngunit hindi nito sinasabing kakaunti lang ang sustansiyang taglay, maraming tagong asin at kung araw-araw itong kakainin ay maaring magdulot ng sakit.)</li>\r\n</ol>\r\n<ol start=\"7\">\r\n<li>BANDWAGON &ndash; Panghihikayat kung saan hinihimok ang lahat na gamitin ang isang produkto o sumali sa isang pangkat dahil ang lahat ay sumali na. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;HALIMBAWA: Buong bayan ay nag-peso padala na.</li>\r\n</ol>\r\n<p><strong>ANG TEKSTONG PERSUWEYSIB</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Layunin ng isang tekstong&nbsp; persuweysib ang manghikayat sa babasa ng teksto. Isinusulat ang tekstong persuweysib uapng mabago ang takbo ng isip ng mambabasa at makumbinsi na ang punto ng manunulat, at hindi sa iba, ang siyang tama.Hinihikayat din nito ang mambabasang tanggapin ang posisyong pinaniniwalaan o ineendorso ng teksto.</p>\r\n<p><strong>TEKSTONG PERSUWEYSIB </strong></p>\r\n<p>-ay may subhetibong tono sapagkat malayang ipinahahayag ng manunulat ang kanyang paniniwala at pagkiling tungkol sa isang isyung may ilang panig.Taglay nito ang personal na opinyon at paniniwala ng may akda.</p>\r\n<p>Inilarawan ng Griyegong pilosopona si Aristotle ang tatlong paraan ng panghihikayat o pangungumbinsi .Ito ang mga sumusunod:</p>\r\n<p><strong>ETHOS</strong></p>\r\n<p><strong>-</strong>Ito ay tumutukoy sa kredibilidad ng isang manunulat.Dapat makumbinsi ng isang manunulat ang mambabasa na siya ay may malawak na kaalaman at karanasan tungkol sa kanyang sinusulat, kung hindi ay baka hindi sila mahikayat na maniwala rito.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang isang taong nanghihikayat ng mga turista upang bisitahin ang isang isla sa pilipinas gayong hindi pa sya nakakapunta rito ay maaaring maging kaduda-duda.Gayunpaman, may iba pang paraan upang magkaroon ng kredibilida.</p>\r\n<ul>\r\n<li>Ang estilo ng pagsulat ay mahalaga upang magkaroon ng kredibilidad.</li>\r\n<li>Dapat na masulat nang malinaw at wasto ang teksto upang lumabas na hitik sa kaalaman at mahusay ang sumusulat.Ang paraan ng pagsisipi ng sanggunian ay maaaring makatulong sa pagpapatibay ng kredibilidad.Kailangang mapatunayan sa mga mambabasa na ang mga datos at impormasyon ay wasto at napapanahon upang makumbinsi na ang isinulat ay tama at mapagkakatiwalaan.</li>\r\n</ul>\r\n<p><strong>PATHOS</strong></p>\r\n<p><strong>-</strong>Tumutukoy ito sa gamit ng emosyon o damdamin upang mahikayat ang mambabasa.Ayon kay Aristotle,karamihan sa mga mambabasa ay madaling madala ng kanilang emosyon.Ang paggamit ng pagpapahalaga at paniniwala ng mambabasa ay isang ay isang epektibong paraan upang makumbinsi sila.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang pagsasalaysay ng isang kuwentong makakaantig ng galit o awa ay isang mabisang paraan upang mahikayat silang pumanig sa manunulat.</p>\r\n<p><strong>LOGOS</strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp; -</strong>Ito ay tumutukoy sa gamit ng lohika upang makumbinsi ang mambabasa.Kailangang mapatunayan ng manunulat sa mga mambabasa na batay sa mga impormasyon at datos na kanyang inilatag ang kanyang pananaw o punto ang siyang dapat paniwalaan.Gayunpaman,isa sa mga madalas na pagkakamali ng mga manunulat ang paggamit ng<strong> <em>ad hominem fallacy</em></strong>, kung saan ang manunulat ay sumasalungat sa personalidad ng katunggali at hindi sa pinaniniwalaan nito.</p>\r\n<table style=\"width: 729px; height: 208px;\" width=\"1153\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 719px;\">\r\n<p><strong>GAWAIN I</strong></p>\r\n<p>Tukuyin ang katangian ng tekstong persuweysib</p>\r\n<p>Lagyan ng (/) tsek ang mga pahayag na naglalarawan ng tekstong persweysib. Ekis (x) naman ang ilagay kung hindi.</p>\r\n<ol>\r\n<li>Layunin ng teksto ang mahikayat o makumbinsi ang babasa.</li>\r\n<li>Nais nitong mabago ang takbo ng isip ng mambabasa at tanggapin ang posisyon ng may-akda</li>\r\n<li>Karaniwang obhetibo ang tono ng tekstong persuweysib</li>\r\n<li>Naglalarawan ito ng katangian at kalikasan ng paksa</li>\r\n<li>Isinaalang-alang nito ang uri ng mambabasa upang mahikayat silang pumanig sa manunulat.</li>\r\n</ol>\r\n<p><strong>&nbsp;Basahin ang pahayag na bahagi ng isang tekstong persweysib. Tukuyin kung anong paraan ng panghihikayat ang ginamit. Isulat kung ito ethos, pathos o logos. Pagkatapos, isulat ang paliwanag kung bakit ito ang paraang napili. (10 pts)</strong></p>\r\n<p>Doon&nbsp; nagsimula ang buhay ko bilang lingkod-bayan. Sa maraming taon sa serbisyo, namulat ako sa mga hamon , sa requirements, sa tama at makaturangang diskarte at pagpaplano para masigurong aabot sa taumbayan ang nararapat na serbisyo. Kasama dito ang pagpapasa ng makabuluhang batas, ang pagpapatibay ng ugnayan sa pribadong sektor, ang pagbuo ng concensus na patas, kung saan tanging taumbayan lang ang panalo.</p>\r\n<p>Sa pagiging lingkod-bayan, ang pinakamahalagang natutunan ko -sa pagpunta ko sa iba\'t ibang&nbsp; mga lalawigan, at sa pakikipag-usap ko sa mga kapwa nating Pilipino, magsasaka man o informal settler , nagtatrabho sa call center o ordinaryong mamamayan: Binigkas tayo ng ating mga pangarap. Hindi iba ang pangarap ko sa pangrap ng bawat Pilipino; I wish for the Filipino people only what I would wish for myselp, after all, who are we if not our dream?</p>\r\n<p>mula sa talumpati ni DILG Sec Mar Roxas</p>\r\n<p>Paraan ng panghihikayat: __________________________________</p>\r\n<p>Paliwanag : ______________________________________________</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"height: 250px; width: 732px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 250px;\">\r\n<td style=\"height: 250px; width: 722px;\">\r\n<p><strong>GAWAIN II (5 PTS)</strong></p>\r\n<p>Magbigay reaksyon sa maraming mga produkto, balita, propaganda at maging politiko na nakilala natin dahil sa matatamis ang kanilang dila at mahusay maghabi ng salita. Sa madaling salita mahusay silang manghikayat at mangumbinsi, hindi tuloy natin alam kung ano talaga ang totoo at dapat paniwalaan. Mayroon ka bang tatandaang ganitong tekstong persweysib.</p>\r\n<p>Isulat sa isang buong papel ang iyong sagot. Pagkatapos ay sagutin ang sumusunod na tanong.</p>\r\n<ol>\r\n<li>Sa unang pagkakaataong nabasa mo ito, nagdududa k aba agad? Ipaliwanag ang iyong sagot?</li>\r\n<li>Ano-anong dahilan ang iyong naisip at hindi ka nakumbinsi ng tekstong ito?</li>\r\n<li>Sa ngayon ay laganap pa rin ang mga tekstong persweysib na nagtataglay ng mga huwad na pangako na nagliligaw sa madla. Sa iyong palagay, ano ang nararapat mong gawin bilag isang mapanuring mambabasa o matalinong botante at mamimili.</li>\r\n<li>Anong aral ang iyong natutunan at nais ibahagi sa iba pagdating sa mga ganitong uri ng teksto</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>PANGKATANG GAWAIN</strong></p>\r\n<table style=\"width: 841px; height: 940px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 940px;\">\r\n<td style=\"width: 831px; height: 940px;\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table style=\"width: 268px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"198\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Hindi malinaw ang isinulat na tagline. Maligoy at hindi gumamit ng paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),(11,47,'ARALIN 3','PERSWEYSIB','PERSWEYSIB','<p>ayroon ka ba bang natatandaan mga linya sa patalastas na tumatak sa iyong isipan&nbsp; at humikayat sa iyong bumili ng produkto? Ibahagi sa klase ang iyong nalalaman?_______________</p>\r\n<p>Masasabi mo bang naging epektbo ang paaan ng panghihikayat kaya tumatatak sa iyong isipan at humikaya sa iyong bumili?</p>\r\n<p>____________________________________________________________________________________________</p>\r\n<p><strong>ALAM MO BA?</strong></p>\r\n<p>Mga Propaganda Device</p>\r\n<ol>\r\n<li><strong>NAME CALLING </strong>&ndash; Ito ay may pagbibigay ng hindi magandang taguri sa isang produkto o katunggaling politiko upang hindi tangkilikin. Karaniwang ginagamit ito sa mundo ng politiko.</li>\r\n</ol>\r\n<p><strong>HALIMBAWA: </strong>ang pekeng sabon, bagitong kandidato,tropa( traditional politician)</p>\r\n<ol start=\"2\">\r\n<li><strong>GLITTERING GENERALITIES </strong>&ndash; Ito ay ang magaganda at nakakasilaw na pahayag ukol sa isang produktong tumutugon sa mga paniniwala at pagpapahalaga ng mambabasa.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Mas makatitipid sa bagong ________. Ang iyong damit ay mas magiging maputi sa _________ puting puti. Bossing sa kaputian.</p>\r\n<ol start=\"3\">\r\n<li><strong>TRANSFER </strong>&ndash; Ang paggamit ng isang sikat na personalidad upang mailipat sa isang produkto o tao ang kasikatan.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Ipagpapatuloy ko ang sinimulan ni<strong> FPJ. &ndash; Grace Poe ; </strong>Manny Pacquaio gumagamit ng ________ kapag nasasaktan<strong>.</strong></p>\r\n<ol start=\"4\">\r\n<li><strong>TESTIMONIAL &ndash; </strong>Kapag ang isang sikat na personalidad ay tuwirang nag-endorso ng isang tao o produkto.</li>\r\n</ol>\r\n<ol start=\"5\">\r\n<li><strong>PLAIN FOLKS &ndash; </strong>Karaniwan itong ginagamit sa kampanya o komersiyal kung saan ang mga kilala o tanyag na tao ay pinalalabas na ordinaryong taong nanghihikayat sa boto, produkto, o serbisyo.</li>\r\n</ol>\r\n<ol start=\"6\">\r\n<li><strong>CARD STACKING</strong> &ndash; Ipinakikita nito ang lahat ng magagandang katangian ng produkto ngunit hindi binabanggit ang hindi magandang katangian. <strong>HALIMBAWA:</strong> Ang instant noodles na ito ay nakapagbubuklod ng pamilya, nakatitipid ng oras , mura na , masarap pa.( Ngunit hindi nito sinasabing kakaunti lang ang sustansiyang taglay, maraming tagong asin at kung araw-araw itong kakainin ay maaring magdulot ng sakit.)</li>\r\n</ol>\r\n<ol start=\"7\">\r\n<li>BANDWAGON &ndash; Panghihikayat kung saan hinihimok ang lahat na gamitin ang isang produkto o sumali sa isang pangkat dahil ang lahat ay sumali na. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;HALIMBAWA: Buong bayan ay nag-peso padala na.</li>\r\n</ol>\r\n<p><strong>ANG TEKSTONG PERSUWEYSIB</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Layunin ng isang tekstong&nbsp; persuweysib ang manghikayat sa babasa ng teksto. Isinusulat ang tekstong persuweysib uapng mabago ang takbo ng isip ng mambabasa at makumbinsi na ang punto ng manunulat, at hindi sa iba, ang siyang tama.Hinihikayat din nito ang mambabasang tanggapin ang posisyong pinaniniwalaan o ineendorso ng teksto.</p>\r\n<p><strong>TEKSTONG PERSUWEYSIB </strong></p>\r\n<p>-ay may subhetibong tono sapagkat malayang ipinahahayag ng manunulat ang kanyang paniniwala at pagkiling tungkol sa isang isyung may ilang panig.Taglay nito ang personal na opinyon at paniniwala ng may akda.</p>\r\n<p>Inilarawan ng Griyegong pilosopona si Aristotle ang tatlong paraan ng panghihikayat o pangungumbinsi .Ito ang mga sumusunod:</p>\r\n<p><strong>ETHOS</strong></p>\r\n<p><strong>-</strong>Ito ay tumutukoy sa kredibilidad ng isang manunulat.Dapat makumbinsi ng isang manunulat ang mambabasa na siya ay may malawak na kaalaman at karanasan tungkol sa kanyang sinusulat, kung hindi ay baka hindi sila mahikayat na maniwala rito.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang isang taong nanghihikayat ng mga turista upang bisitahin ang isang isla sa pilipinas gayong hindi pa sya nakakapunta rito ay maaaring maging kaduda-duda.Gayunpaman, may iba pang paraan upang magkaroon ng kredibilida.</p>\r\n<ul>\r\n<li>Ang estilo ng pagsulat ay mahalaga upang magkaroon ng kredibilidad.</li>\r\n<li>Dapat na masulat nang malinaw at wasto ang teksto upang lumabas na hitik sa kaalaman at mahusay ang sumusulat.Ang paraan ng pagsisipi ng sanggunian ay maaaring makatulong sa pagpapatibay ng kredibilidad.Kailangang mapatunayan sa mga mambabasa na ang mga datos at impormasyon ay wasto at napapanahon upang makumbinsi na ang isinulat ay tama at mapagkakatiwalaan.</li>\r\n</ul>\r\n<p><strong>PATHOS</strong></p>\r\n<p><strong>-</strong>Tumutukoy ito sa gamit ng emosyon o damdamin upang mahikayat ang mambabasa.Ayon kay Aristotle,karamihan sa mga mambabasa ay madaling madala ng kanilang emosyon.Ang paggamit ng pagpapahalaga at paniniwala ng mambabasa ay isang ay isang epektibong paraan upang makumbinsi sila.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang pagsasalaysay ng isang kuwentong makakaantig ng galit o awa ay isang mabisang paraan upang mahikayat silang pumanig sa manunulat.</p>\r\n<p><strong>LOGOS</strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp; -</strong>Ito ay tumutukoy sa gamit ng lohika upang makumbinsi ang mambabasa.Kailangang mapatunayan ng manunulat sa mga mambabasa na batay sa mga impormasyon at datos na kanyang inilatag ang kanyang pananaw o punto ang siyang dapat paniwalaan.Gayunpaman,isa sa mga madalas na pagkakamali ng mga manunulat ang paggamit ng<strong> <em>ad hominem fallacy</em></strong>, kung saan ang manunulat ay sumasalungat sa personalidad ng katunggali at hindi sa pinaniniwalaan nito.</p>\r\n<table style=\"width: 729px; height: 208px;\" width=\"1153\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 719px;\">\r\n<p><strong>GAWAIN I</strong></p>\r\n<p>Tukuyin ang katangian ng tekstong persuweysib</p>\r\n<p>Lagyan ng (/) tsek ang mga pahayag na naglalarawan ng tekstong persweysib. Ekis (x) naman ang ilagay kung hindi.</p>\r\n<ol>\r\n<li>Layunin ng teksto ang mahikayat o makumbinsi ang babasa.</li>\r\n<li>Nais nitong mabago ang takbo ng isip ng mambabasa at tanggapin ang posisyon ng may-akda</li>\r\n<li>Karaniwang obhetibo ang tono ng tekstong persuweysib</li>\r\n<li>Naglalarawan ito ng katangian at kalikasan ng paksa</li>\r\n<li>Isinaalang-alang nito ang uri ng mambabasa upang mahikayat silang pumanig sa manunulat.</li>\r\n</ol>\r\n<p><strong>&nbsp;Basahin ang pahayag na bahagi ng isang tekstong persweysib. Tukuyin kung anong paraan ng panghihikayat ang ginamit. Isulat kung ito ethos, pathos o logos. Pagkatapos, isulat ang paliwanag kung bakit ito ang paraang napili. (10 pts)</strong></p>\r\n<p>Doon&nbsp; nagsimula ang buhay ko bilang lingkod-bayan. Sa maraming taon sa serbisyo, namulat ako sa mga hamon , sa requirements, sa tama at makaturangang diskarte at pagpaplano para masigurong aabot sa taumbayan ang nararapat na serbisyo. Kasama dito ang pagpapasa ng makabuluhang batas, ang pagpapatibay ng ugnayan sa pribadong sektor, ang pagbuo ng concensus na patas, kung saan tanging taumbayan lang ang panalo.</p>\r\n<p>Sa pagiging lingkod-bayan, ang pinakamahalagang natutunan ko -sa pagpunta ko sa iba\'t ibang&nbsp; mga lalawigan, at sa pakikipag-usap ko sa mga kapwa nating Pilipino, magsasaka man o informal settler , nagtatrabho sa call center o ordinaryong mamamayan: Binigkas tayo ng ating mga pangarap. Hindi iba ang pangarap ko sa pangrap ng bawat Pilipino; I wish for the Filipino people only what I would wish for myselp, after all, who are we if not our dream?</p>\r\n<p>mula sa talumpati ni DILG Sec Mar Roxas</p>\r\n<p>Paraan ng panghihikayat: __________________________________</p>\r\n<p>Paliwanag : ______________________________________________</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"height: 250px; width: 732px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 250px;\">\r\n<td style=\"height: 250px; width: 722px;\">\r\n<p><strong>GAWAIN II (5 PTS)</strong></p>\r\n<p>Magbigay reaksyon sa maraming mga produkto, balita, propaganda at maging politiko na nakilala natin dahil sa matatamis ang kanilang dila at mahusay maghabi ng salita. Sa madaling salita mahusay silang manghikayat at mangumbinsi, hindi tuloy natin alam kung ano talaga ang totoo at dapat paniwalaan. Mayroon ka bang tatandaang ganitong tekstong persweysib.</p>\r\n<p>Isulat sa isang buong papel ang iyong sagot. Pagkatapos ay sagutin ang sumusunod na tanong.</p>\r\n<ol>\r\n<li>Sa unang pagkakaataong nabasa mo ito, nagdududa k aba agad? Ipaliwanag ang iyong sagot?</li>\r\n<li>Ano-anong dahilan ang iyong naisip at hindi ka nakumbinsi ng tekstong ito?</li>\r\n<li>Sa ngayon ay laganap pa rin ang mga tekstong persweysib na nagtataglay ng mga huwad na pangako na nagliligaw sa madla. Sa iyong palagay, ano ang nararapat mong gawin bilag isang mapanuring mambabasa o matalinong botante at mamimili.</li>\r\n<li>Anong aral ang iyong natutunan at nais ibahagi sa iba pagdating sa mga ganitong uri ng teksto</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>PANGKATANG GAWAIN</strong></p>\r\n<table style=\"width: 841px; height: 940px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 940px;\">\r\n<td style=\"width: 831px; height: 940px;\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table style=\"width: 268px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"198\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Hindi malinaw ang isinulat na tagline. Maligoy at hindi gumamit ng paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),(12,50,'ARALIN 3','PERSWEYSIB','PERSWEYSIB','<p>ayroon ka ba bang natatandaan mga linya sa patalastas na tumatak sa iyong isipan&nbsp; at humikayat sa iyong bumili ng produkto? Ibahagi sa klase ang iyong nalalaman?_______________</p>\r\n<p>Masasabi mo bang naging epektbo ang paaan ng panghihikayat kaya tumatatak sa iyong isipan at humikaya sa iyong bumili?</p>\r\n<p>____________________________________________________________________________________________</p>\r\n<p><strong>ALAM MO BA?</strong></p>\r\n<p>Mga Propaganda Device</p>\r\n<ol>\r\n<li><strong>NAME CALLING </strong>&ndash; Ito ay may pagbibigay ng hindi magandang taguri sa isang produkto o katunggaling politiko upang hindi tangkilikin. Karaniwang ginagamit ito sa mundo ng politiko.</li>\r\n</ol>\r\n<p><strong>HALIMBAWA: </strong>ang pekeng sabon, bagitong kandidato,tropa( traditional politician)</p>\r\n<ol start=\"2\">\r\n<li><strong>GLITTERING GENERALITIES </strong>&ndash; Ito ay ang magaganda at nakakasilaw na pahayag ukol sa isang produktong tumutugon sa mga paniniwala at pagpapahalaga ng mambabasa.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Mas makatitipid sa bagong ________. Ang iyong damit ay mas magiging maputi sa _________ puting puti. Bossing sa kaputian.</p>\r\n<ol start=\"3\">\r\n<li><strong>TRANSFER </strong>&ndash; Ang paggamit ng isang sikat na personalidad upang mailipat sa isang produkto o tao ang kasikatan.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Ipagpapatuloy ko ang sinimulan ni<strong> FPJ. &ndash; Grace Poe ; </strong>Manny Pacquaio gumagamit ng ________ kapag nasasaktan<strong>.</strong></p>\r\n<ol start=\"4\">\r\n<li><strong>TESTIMONIAL &ndash; </strong>Kapag ang isang sikat na personalidad ay tuwirang nag-endorso ng isang tao o produkto.</li>\r\n</ol>\r\n<ol start=\"5\">\r\n<li><strong>PLAIN FOLKS &ndash; </strong>Karaniwan itong ginagamit sa kampanya o komersiyal kung saan ang mga kilala o tanyag na tao ay pinalalabas na ordinaryong taong nanghihikayat sa boto, produkto, o serbisyo.</li>\r\n</ol>\r\n<ol start=\"6\">\r\n<li><strong>CARD STACKING</strong> &ndash; Ipinakikita nito ang lahat ng magagandang katangian ng produkto ngunit hindi binabanggit ang hindi magandang katangian. <strong>HALIMBAWA:</strong> Ang instant noodles na ito ay nakapagbubuklod ng pamilya, nakatitipid ng oras , mura na , masarap pa.( Ngunit hindi nito sinasabing kakaunti lang ang sustansiyang taglay, maraming tagong asin at kung araw-araw itong kakainin ay maaring magdulot ng sakit.)</li>\r\n</ol>\r\n<ol start=\"7\">\r\n<li>BANDWAGON &ndash; Panghihikayat kung saan hinihimok ang lahat na gamitin ang isang produkto o sumali sa isang pangkat dahil ang lahat ay sumali na. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;HALIMBAWA: Buong bayan ay nag-peso padala na.</li>\r\n</ol>\r\n<p><strong>ANG TEKSTONG PERSUWEYSIB</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Layunin ng isang tekstong&nbsp; persuweysib ang manghikayat sa babasa ng teksto. Isinusulat ang tekstong persuweysib uapng mabago ang takbo ng isip ng mambabasa at makumbinsi na ang punto ng manunulat, at hindi sa iba, ang siyang tama.Hinihikayat din nito ang mambabasang tanggapin ang posisyong pinaniniwalaan o ineendorso ng teksto.</p>\r\n<p><strong>TEKSTONG PERSUWEYSIB </strong></p>\r\n<p>-ay may subhetibong tono sapagkat malayang ipinahahayag ng manunulat ang kanyang paniniwala at pagkiling tungkol sa isang isyung may ilang panig.Taglay nito ang personal na opinyon at paniniwala ng may akda.</p>\r\n<p>Inilarawan ng Griyegong pilosopona si Aristotle ang tatlong paraan ng panghihikayat o pangungumbinsi .Ito ang mga sumusunod:</p>\r\n<p><strong>ETHOS</strong></p>\r\n<p><strong>-</strong>Ito ay tumutukoy sa kredibilidad ng isang manunulat.Dapat makumbinsi ng isang manunulat ang mambabasa na siya ay may malawak na kaalaman at karanasan tungkol sa kanyang sinusulat, kung hindi ay baka hindi sila mahikayat na maniwala rito.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang isang taong nanghihikayat ng mga turista upang bisitahin ang isang isla sa pilipinas gayong hindi pa sya nakakapunta rito ay maaaring maging kaduda-duda.Gayunpaman, may iba pang paraan upang magkaroon ng kredibilida.</p>\r\n<ul>\r\n<li>Ang estilo ng pagsulat ay mahalaga upang magkaroon ng kredibilidad.</li>\r\n<li>Dapat na masulat nang malinaw at wasto ang teksto upang lumabas na hitik sa kaalaman at mahusay ang sumusulat.Ang paraan ng pagsisipi ng sanggunian ay maaaring makatulong sa pagpapatibay ng kredibilidad.Kailangang mapatunayan sa mga mambabasa na ang mga datos at impormasyon ay wasto at napapanahon upang makumbinsi na ang isinulat ay tama at mapagkakatiwalaan.</li>\r\n</ul>\r\n<p><strong>PATHOS</strong></p>\r\n<p><strong>-</strong>Tumutukoy ito sa gamit ng emosyon o damdamin upang mahikayat ang mambabasa.Ayon kay Aristotle,karamihan sa mga mambabasa ay madaling madala ng kanilang emosyon.Ang paggamit ng pagpapahalaga at paniniwala ng mambabasa ay isang ay isang epektibong paraan upang makumbinsi sila.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang pagsasalaysay ng isang kuwentong makakaantig ng galit o awa ay isang mabisang paraan upang mahikayat silang pumanig sa manunulat.</p>\r\n<p><strong>LOGOS</strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp; -</strong>Ito ay tumutukoy sa gamit ng lohika upang makumbinsi ang mambabasa.Kailangang mapatunayan ng manunulat sa mga mambabasa na batay sa mga impormasyon at datos na kanyang inilatag ang kanyang pananaw o punto ang siyang dapat paniwalaan.Gayunpaman,isa sa mga madalas na pagkakamali ng mga manunulat ang paggamit ng<strong> <em>ad hominem fallacy</em></strong>, kung saan ang manunulat ay sumasalungat sa personalidad ng katunggali at hindi sa pinaniniwalaan nito.</p>\r\n<table style=\"width: 729px; height: 208px;\" width=\"1153\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 719px;\">\r\n<p><strong>GAWAIN I</strong></p>\r\n<p>Tukuyin ang katangian ng tekstong persuweysib</p>\r\n<p>Lagyan ng (/) tsek ang mga pahayag na naglalarawan ng tekstong persweysib. Ekis (x) naman ang ilagay kung hindi.</p>\r\n<ol>\r\n<li>Layunin ng teksto ang mahikayat o makumbinsi ang babasa.</li>\r\n<li>Nais nitong mabago ang takbo ng isip ng mambabasa at tanggapin ang posisyon ng may-akda</li>\r\n<li>Karaniwang obhetibo ang tono ng tekstong persuweysib</li>\r\n<li>Naglalarawan ito ng katangian at kalikasan ng paksa</li>\r\n<li>Isinaalang-alang nito ang uri ng mambabasa upang mahikayat silang pumanig sa manunulat.</li>\r\n</ol>\r\n<p><strong>&nbsp;Basahin ang pahayag na bahagi ng isang tekstong persweysib. Tukuyin kung anong paraan ng panghihikayat ang ginamit. Isulat kung ito ethos, pathos o logos. Pagkatapos, isulat ang paliwanag kung bakit ito ang paraang napili. (10 pts)</strong></p>\r\n<p>Doon&nbsp; nagsimula ang buhay ko bilang lingkod-bayan. Sa maraming taon sa serbisyo, namulat ako sa mga hamon , sa requirements, sa tama at makaturangang diskarte at pagpaplano para masigurong aabot sa taumbayan ang nararapat na serbisyo. Kasama dito ang pagpapasa ng makabuluhang batas, ang pagpapatibay ng ugnayan sa pribadong sektor, ang pagbuo ng concensus na patas, kung saan tanging taumbayan lang ang panalo.</p>\r\n<p>Sa pagiging lingkod-bayan, ang pinakamahalagang natutunan ko -sa pagpunta ko sa iba\'t ibang&nbsp; mga lalawigan, at sa pakikipag-usap ko sa mga kapwa nating Pilipino, magsasaka man o informal settler , nagtatrabho sa call center o ordinaryong mamamayan: Binigkas tayo ng ating mga pangarap. Hindi iba ang pangarap ko sa pangrap ng bawat Pilipino; I wish for the Filipino people only what I would wish for myselp, after all, who are we if not our dream?</p>\r\n<p>mula sa talumpati ni DILG Sec Mar Roxas</p>\r\n<p>Paraan ng panghihikayat: __________________________________</p>\r\n<p>Paliwanag : ______________________________________________</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"height: 250px; width: 732px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 250px;\">\r\n<td style=\"height: 250px; width: 722px;\">\r\n<p><strong>GAWAIN II (5 PTS)</strong></p>\r\n<p>Magbigay reaksyon sa maraming mga produkto, balita, propaganda at maging politiko na nakilala natin dahil sa matatamis ang kanilang dila at mahusay maghabi ng salita. Sa madaling salita mahusay silang manghikayat at mangumbinsi, hindi tuloy natin alam kung ano talaga ang totoo at dapat paniwalaan. Mayroon ka bang tatandaang ganitong tekstong persweysib.</p>\r\n<p>Isulat sa isang buong papel ang iyong sagot. Pagkatapos ay sagutin ang sumusunod na tanong.</p>\r\n<ol>\r\n<li>Sa unang pagkakaataong nabasa mo ito, nagdududa k aba agad? Ipaliwanag ang iyong sagot?</li>\r\n<li>Ano-anong dahilan ang iyong naisip at hindi ka nakumbinsi ng tekstong ito?</li>\r\n<li>Sa ngayon ay laganap pa rin ang mga tekstong persweysib na nagtataglay ng mga huwad na pangako na nagliligaw sa madla. Sa iyong palagay, ano ang nararapat mong gawin bilag isang mapanuring mambabasa o matalinong botante at mamimili.</li>\r\n<li>Anong aral ang iyong natutunan at nais ibahagi sa iba pagdating sa mga ganitong uri ng teksto</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>PANGKATANG GAWAIN</strong></p>\r\n<table style=\"width: 841px; height: 940px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 940px;\">\r\n<td style=\"width: 831px; height: 940px;\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table style=\"width: 268px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"198\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Hindi malinaw ang isinulat na tagline. Maligoy at hindi gumamit ng paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),(13,48,'ARALIN 3','PERSWEYSIB','PERSWEYSIB','<p>Mayroon ka ba bang natatandaan mga linya sa patalastas na tumatak sa iyong isipan&nbsp; at humikayat sa iyong bumili ng produkto? Ibahagi sa klase ang iyong nalalaman?_______________</p>\r\n<p>Masasabi mo bang naging epektbo ang paaan ng panghihikayat kaya tumatatak sa iyong isipan at humikaya sa iyong bumili?</p>\r\n<p>____________________________________________________________________________________________</p>\r\n<p><strong>ALAM MO BA?</strong></p>\r\n<p>Mga Propaganda Device</p>\r\n<ol>\r\n<li><strong>NAME CALLING </strong>&ndash; Ito ay may pagbibigay ng hindi magandang taguri sa isang produkto o katunggaling politiko upang hindi tangkilikin. Karaniwang ginagamit ito sa mundo ng politiko.</li>\r\n</ol>\r\n<p><strong>HALIMBAWA: </strong>ang pekeng sabon, bagitong kandidato,tropa( traditional politician)</p>\r\n<ol start=\"2\">\r\n<li><strong>GLITTERING GENERALITIES </strong>&ndash; Ito ay ang magaganda at nakakasilaw na pahayag ukol sa isang produktong tumutugon sa mga paniniwala at pagpapahalaga ng mambabasa.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Mas makatitipid sa bagong ________. Ang iyong damit ay mas magiging maputi sa _________ puting puti. Bossing sa kaputian.</p>\r\n<ol start=\"3\">\r\n<li><strong>TRANSFER </strong>&ndash; Ang paggamit ng isang sikat na personalidad upang mailipat sa isang produkto o tao ang kasikatan.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Ipagpapatuloy ko ang sinimulan ni<strong> FPJ. &ndash; Grace Poe ; </strong>Manny Pacquaio gumagamit ng ________ kapag nasasaktan<strong>.</strong></p>\r\n<ol start=\"4\">\r\n<li><strong>TESTIMONIAL &ndash; </strong>Kapag ang isang sikat na personalidad ay tuwirang nag-endorso ng isang tao o produkto.</li>\r\n</ol>\r\n<ol start=\"5\">\r\n<li><strong>PLAIN FOLKS &ndash; </strong>Karaniwan itong ginagamit sa kampanya o komersiyal kung saan ang mga kilala o tanyag na tao ay pinalalabas na ordinaryong taong nanghihikayat sa boto, produkto, o serbisyo.</li>\r\n</ol>\r\n<ol start=\"6\">\r\n<li><strong>CARD STACKING</strong> &ndash; Ipinakikita nito ang lahat ng magagandang katangian ng produkto ngunit hindi binabanggit ang hindi magandang katangian. <strong>HALIMBAWA:</strong> Ang instant noodles na ito ay nakapagbubuklod ng pamilya, nakatitipid ng oras , mura na , masarap pa.( Ngunit hindi nito sinasabing kakaunti lang ang sustansiyang taglay, maraming tagong asin at kung araw-araw itong kakainin ay maaring magdulot ng sakit.)</li>\r\n</ol>\r\n<ol start=\"7\">\r\n<li>BANDWAGON &ndash; Panghihikayat kung saan hinihimok ang lahat na gamitin ang isang produkto o sumali sa isang pangkat dahil ang lahat ay sumali na. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;HALIMBAWA: Buong bayan ay nag-peso padala na.</li>\r\n</ol>\r\n<p><strong>ANG TEKSTONG PERSUWEYSIB</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Layunin ng isang tekstong&nbsp; persuweysib ang manghikayat sa babasa ng teksto. Isinusulat ang tekstong persuweysib uapng mabago ang takbo ng isip ng mambabasa at makumbinsi na ang punto ng manunulat, at hindi sa iba, ang siyang tama.Hinihikayat din nito ang mambabasang tanggapin ang posisyong pinaniniwalaan o ineendorso ng teksto.</p>\r\n<p><strong>TEKSTONG PERSUWEYSIB </strong></p>\r\n<p>-ay may subhetibong tono sapagkat malayang ipinahahayag ng manunulat ang kanyang paniniwala at pagkiling tungkol sa isang isyung may ilang panig.Taglay nito ang personal na opinyon at paniniwala ng may akda.</p>\r\n<p>Inilarawan ng Griyegong pilosopona si Aristotle ang tatlong paraan ng panghihikayat o pangungumbinsi .Ito ang mga sumusunod:</p>\r\n<p><strong>ETHOS</strong></p>\r\n<p><strong>-</strong>Ito ay tumutukoy sa kredibilidad ng isang manunulat.Dapat makumbinsi ng isang manunulat ang mambabasa na siya ay may malawak na kaalaman at karanasan tungkol sa kanyang sinusulat, kung hindi ay baka hindi sila mahikayat na maniwala rito.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang isang taong nanghihikayat ng mga turista upang bisitahin ang isang isla sa pilipinas gayong hindi pa sya nakakapunta rito ay maaaring maging kaduda-duda.Gayunpaman, may iba pang paraan upang magkaroon ng kredibilida.</p>\r\n<ul>\r\n<li>Ang estilo ng pagsulat ay mahalaga upang magkaroon ng kredibilidad.</li>\r\n<li>Dapat na masulat nang malinaw at wasto ang teksto upang lumabas na hitik sa kaalaman at mahusay ang sumusulat.Ang paraan ng pagsisipi ng sanggunian ay maaaring makatulong sa pagpapatibay ng kredibilidad.Kailangang mapatunayan sa mga mambabasa na ang mga datos at impormasyon ay wasto at napapanahon upang makumbinsi na ang isinulat ay tama at mapagkakatiwalaan.</li>\r\n</ul>\r\n<p><strong>PATHOS</strong></p>\r\n<p><strong>-</strong>Tumutukoy ito sa gamit ng emosyon o damdamin upang mahikayat ang mambabasa.Ayon kay Aristotle,karamihan sa mga mambabasa ay madaling madala ng kanilang emosyon.Ang paggamit ng pagpapahalaga at paniniwala ng mambabasa ay isang ay isang epektibong paraan upang makumbinsi sila.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang pagsasalaysay ng isang kuwentong makakaantig ng galit o awa ay isang mabisang paraan upang mahikayat silang pumanig sa manunulat.</p>\r\n<p><strong>LOGOS</strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp; -</strong>Ito ay tumutukoy sa gamit ng lohika upang makumbinsi ang mambabasa.Kailangang mapatunayan ng manunulat sa mga mambabasa na batay sa mga impormasyon at datos na kanyang inilatag ang kanyang pananaw o punto ang siyang dapat paniwalaan.Gayunpaman,isa sa mga madalas na pagkakamali ng mga manunulat ang paggamit ng<strong> <em>ad hominem fallacy</em></strong>, kung saan ang manunulat ay sumasalungat sa personalidad ng katunggali at hindi sa pinaniniwalaan nito.</p>\r\n<table style=\"width: 729px; height: 208px;\" width=\"1153\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 719px;\">\r\n<p><strong>GAWAIN I</strong></p>\r\n<p>Tukuyin ang katangian ng tekstong persuweysib</p>\r\n<p>Lagyan ng (/) tsek ang mga pahayag na naglalarawan ng tekstong persweysib. Ekis (x) naman ang ilagay kung hindi.</p>\r\n<ol>\r\n<li>Layunin ng teksto ang mahikayat o makumbinsi ang babasa.</li>\r\n<li>Nais nitong mabago ang takbo ng isip ng mambabasa at tanggapin ang posisyon ng may-akda</li>\r\n<li>Karaniwang obhetibo ang tono ng tekstong persuweysib</li>\r\n<li>Naglalarawan ito ng katangian at kalikasan ng paksa</li>\r\n<li>Isinaalang-alang nito ang uri ng mambabasa upang mahikayat silang pumanig sa manunulat.</li>\r\n</ol>\r\n<p><strong>&nbsp;Basahin ang pahayag na bahagi ng isang tekstong persweysib. Tukuyin kung anong paraan ng panghihikayat ang ginamit. Isulat kung ito ethos, pathos o logos. Pagkatapos, isulat ang paliwanag kung bakit ito ang paraang napili. (10 pts)</strong></p>\r\n<p>Doon&nbsp; nagsimula ang buhay ko bilang lingkod-bayan. Sa maraming taon sa serbisyo, namulat ako sa mga hamon , sa requirements, sa tama at makaturangang diskarte at pagpaplano para masigurong aabot sa taumbayan ang nararapat na serbisyo. Kasama dito ang pagpapasa ng makabuluhang batas, ang pagpapatibay ng ugnayan sa pribadong sektor, ang pagbuo ng concensus na patas, kung saan tanging taumbayan lang ang panalo.</p>\r\n<p>Sa pagiging lingkod-bayan, ang pinakamahalagang natutunan ko -sa pagpunta ko sa iba\'t ibang&nbsp; mga lalawigan, at sa pakikipag-usap ko sa mga kapwa nating Pilipino, magsasaka man o informal settler , nagtatrabho sa call center o ordinaryong mamamayan: Binigkas tayo ng ating mga pangarap. Hindi iba ang pangarap ko sa pangrap ng bawat Pilipino; I wish for the Filipino people only what I would wish for myselp, after all, who are we if not our dream?</p>\r\n<p>mula sa talumpati ni DILG Sec Mar Roxas</p>\r\n<p>Paraan ng panghihikayat: __________________________________</p>\r\n<p>Paliwanag : ______________________________________________</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"height: 250px; width: 732px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 250px;\">\r\n<td style=\"height: 250px; width: 722px;\">\r\n<p><strong>GAWAIN II (5 PTS)</strong></p>\r\n<p>Magbigay reaksyon sa maraming mga produkto, balita, propaganda at maging politiko na nakilala natin dahil sa matatamis ang kanilang dila at mahusay maghabi ng salita. Sa madaling salita mahusay silang manghikayat at mangumbinsi, hindi tuloy natin alam kung ano talaga ang totoo at dapat paniwalaan. Mayroon ka bang tatandaang ganitong tekstong persweysib.</p>\r\n<p>Isulat sa isang buong papel ang iyong sagot. Pagkatapos ay sagutin ang sumusunod na tanong.</p>\r\n<ol>\r\n<li>Sa unang pagkakaataong nabasa mo ito, nagdududa k aba agad? Ipaliwanag ang iyong sagot?</li>\r\n<li>Ano-anong dahilan ang iyong naisip at hindi ka nakumbinsi ng tekstong ito?</li>\r\n<li>Sa ngayon ay laganap pa rin ang mga tekstong persweysib na nagtataglay ng mga huwad na pangako na nagliligaw sa madla. Sa iyong palagay, ano ang nararapat mong gawin bilag isang mapanuring mambabasa o matalinong botante at mamimili.</li>\r\n<li>Anong aral ang iyong natutunan at nais ibahagi sa iba pagdating sa mga ganitong uri ng teksto</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>PANGKATANG GAWAIN</strong></p>\r\n<table style=\"width: 841px; height: 940px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 940px;\">\r\n<td style=\"width: 831px; height: 940px;\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table style=\"width: 268px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"198\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Hindi malinaw ang isinulat na tagline. Maligoy at hindi gumamit ng paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),(14,49,'ARALIN 3','PERSWEYSIB','PERSWEYSIB','<p>ayroon ka ba bang natatandaan mga linya sa patalastas na tumatak sa iyong isipan&nbsp; at humikayat sa iyong bumili ng produkto? Ibahagi sa klase ang iyong nalalaman?_______________</p>\r\n<p>Masasabi mo bang naging epektbo ang paaan ng panghihikayat kaya tumatatak sa iyong isipan at humikaya sa iyong bumili?</p>\r\n<p>____________________________________________________________________________________________</p>\r\n<p><strong>ALAM MO BA?</strong></p>\r\n<p>Mga Propaganda Device</p>\r\n<ol>\r\n<li><strong>NAME CALLING </strong>&ndash; Ito ay may pagbibigay ng hindi magandang taguri sa isang produkto o katunggaling politiko upang hindi tangkilikin. Karaniwang ginagamit ito sa mundo ng politiko.</li>\r\n</ol>\r\n<p><strong>HALIMBAWA: </strong>ang pekeng sabon, bagitong kandidato,tropa( traditional politician)</p>\r\n<ol start=\"2\">\r\n<li><strong>GLITTERING GENERALITIES </strong>&ndash; Ito ay ang magaganda at nakakasilaw na pahayag ukol sa isang produktong tumutugon sa mga paniniwala at pagpapahalaga ng mambabasa.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Mas makatitipid sa bagong ________. Ang iyong damit ay mas magiging maputi sa _________ puting puti. Bossing sa kaputian.</p>\r\n<ol start=\"3\">\r\n<li><strong>TRANSFER </strong>&ndash; Ang paggamit ng isang sikat na personalidad upang mailipat sa isang produkto o tao ang kasikatan.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Ipagpapatuloy ko ang sinimulan ni<strong> FPJ. &ndash; Grace Poe ; </strong>Manny Pacquaio gumagamit ng ________ kapag nasasaktan<strong>.</strong></p>\r\n<ol start=\"4\">\r\n<li><strong>TESTIMONIAL &ndash; </strong>Kapag ang isang sikat na personalidad ay tuwirang nag-endorso ng isang tao o produkto.</li>\r\n</ol>\r\n<ol start=\"5\">\r\n<li><strong>PLAIN FOLKS &ndash; </strong>Karaniwan itong ginagamit sa kampanya o komersiyal kung saan ang mga kilala o tanyag na tao ay pinalalabas na ordinaryong taong nanghihikayat sa boto, produkto, o serbisyo.</li>\r\n</ol>\r\n<ol start=\"6\">\r\n<li><strong>CARD STACKING</strong> &ndash; Ipinakikita nito ang lahat ng magagandang katangian ng produkto ngunit hindi binabanggit ang hindi magandang katangian. <strong>HALIMBAWA:</strong> Ang instant noodles na ito ay nakapagbubuklod ng pamilya, nakatitipid ng oras , mura na , masarap pa.( Ngunit hindi nito sinasabing kakaunti lang ang sustansiyang taglay, maraming tagong asin at kung araw-araw itong kakainin ay maaring magdulot ng sakit.)</li>\r\n</ol>\r\n<ol start=\"7\">\r\n<li>BANDWAGON &ndash; Panghihikayat kung saan hinihimok ang lahat na gamitin ang isang produkto o sumali sa isang pangkat dahil ang lahat ay sumali na. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;HALIMBAWA: Buong bayan ay nag-peso padala na.</li>\r\n</ol>\r\n<p><strong>ANG TEKSTONG PERSUWEYSIB</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Layunin ng isang tekstong&nbsp; persuweysib ang manghikayat sa babasa ng teksto. Isinusulat ang tekstong persuweysib uapng mabago ang takbo ng isip ng mambabasa at makumbinsi na ang punto ng manunulat, at hindi sa iba, ang siyang tama.Hinihikayat din nito ang mambabasang tanggapin ang posisyong pinaniniwalaan o ineendorso ng teksto.</p>\r\n<p><strong>TEKSTONG PERSUWEYSIB </strong></p>\r\n<p>-ay may subhetibong tono sapagkat malayang ipinahahayag ng manunulat ang kanyang paniniwala at pagkiling tungkol sa isang isyung may ilang panig.Taglay nito ang personal na opinyon at paniniwala ng may akda.</p>\r\n<p>Inilarawan ng Griyegong pilosopona si Aristotle ang tatlong paraan ng panghihikayat o pangungumbinsi .Ito ang mga sumusunod:</p>\r\n<p><strong>ETHOS</strong></p>\r\n<p><strong>-</strong>Ito ay tumutukoy sa kredibilidad ng isang manunulat.Dapat makumbinsi ng isang manunulat ang mambabasa na siya ay may malawak na kaalaman at karanasan tungkol sa kanyang sinusulat, kung hindi ay baka hindi sila mahikayat na maniwala rito.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang isang taong nanghihikayat ng mga turista upang bisitahin ang isang isla sa pilipinas gayong hindi pa sya nakakapunta rito ay maaaring maging kaduda-duda.Gayunpaman, may iba pang paraan upang magkaroon ng kredibilida.</p>\r\n<ul>\r\n<li>Ang estilo ng pagsulat ay mahalaga upang magkaroon ng kredibilidad.</li>\r\n<li>Dapat na masulat nang malinaw at wasto ang teksto upang lumabas na hitik sa kaalaman at mahusay ang sumusulat.Ang paraan ng pagsisipi ng sanggunian ay maaaring makatulong sa pagpapatibay ng kredibilidad.Kailangang mapatunayan sa mga mambabasa na ang mga datos at impormasyon ay wasto at napapanahon upang makumbinsi na ang isinulat ay tama at mapagkakatiwalaan.</li>\r\n</ul>\r\n<p><strong>PATHOS</strong></p>\r\n<p><strong>-</strong>Tumutukoy ito sa gamit ng emosyon o damdamin upang mahikayat ang mambabasa.Ayon kay Aristotle,karamihan sa mga mambabasa ay madaling madala ng kanilang emosyon.Ang paggamit ng pagpapahalaga at paniniwala ng mambabasa ay isang ay isang epektibong paraan upang makumbinsi sila.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang pagsasalaysay ng isang kuwentong makakaantig ng galit o awa ay isang mabisang paraan upang mahikayat silang pumanig sa manunulat.</p>\r\n<p><strong>LOGOS</strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp; -</strong>Ito ay tumutukoy sa gamit ng lohika upang makumbinsi ang mambabasa.Kailangang mapatunayan ng manunulat sa mga mambabasa na batay sa mga impormasyon at datos na kanyang inilatag ang kanyang pananaw o punto ang siyang dapat paniwalaan.Gayunpaman,isa sa mga madalas na pagkakamali ng mga manunulat ang paggamit ng<strong> <em>ad hominem fallacy</em></strong>, kung saan ang manunulat ay sumasalungat sa personalidad ng katunggali at hindi sa pinaniniwalaan nito.</p>\r\n<table style=\"width: 729px; height: 208px;\" width=\"1153\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 719px;\">\r\n<p><strong>GAWAIN I</strong></p>\r\n<p>Tukuyin ang katangian ng tekstong persuweysib</p>\r\n<p>Lagyan ng (/) tsek ang mga pahayag na naglalarawan ng tekstong persweysib. Ekis (x) naman ang ilagay kung hindi.</p>\r\n<ol>\r\n<li>Layunin ng teksto ang mahikayat o makumbinsi ang babasa.</li>\r\n<li>Nais nitong mabago ang takbo ng isip ng mambabasa at tanggapin ang posisyon ng may-akda</li>\r\n<li>Karaniwang obhetibo ang tono ng tekstong persuweysib</li>\r\n<li>Naglalarawan ito ng katangian at kalikasan ng paksa</li>\r\n<li>Isinaalang-alang nito ang uri ng mambabasa upang mahikayat silang pumanig sa manunulat.</li>\r\n</ol>\r\n<p><strong>&nbsp;Basahin ang pahayag na bahagi ng isang tekstong persweysib. Tukuyin kung anong paraan ng panghihikayat ang ginamit. Isulat kung ito ethos, pathos o logos. Pagkatapos, isulat ang paliwanag kung bakit ito ang paraang napili. (10 pts)</strong></p>\r\n<p>Doon&nbsp; nagsimula ang buhay ko bilang lingkod-bayan. Sa maraming taon sa serbisyo, namulat ako sa mga hamon , sa requirements, sa tama at makaturangang diskarte at pagpaplano para masigurong aabot sa taumbayan ang nararapat na serbisyo. Kasama dito ang pagpapasa ng makabuluhang batas, ang pagpapatibay ng ugnayan sa pribadong sektor, ang pagbuo ng concensus na patas, kung saan tanging taumbayan lang ang panalo.</p>\r\n<p>Sa pagiging lingkod-bayan, ang pinakamahalagang natutunan ko -sa pagpunta ko sa iba\'t ibang&nbsp; mga lalawigan, at sa pakikipag-usap ko sa mga kapwa nating Pilipino, magsasaka man o informal settler , nagtatrabho sa call center o ordinaryong mamamayan: Binigkas tayo ng ating mga pangarap. Hindi iba ang pangarap ko sa pangrap ng bawat Pilipino; I wish for the Filipino people only what I would wish for myselp, after all, who are we if not our dream?</p>\r\n<p>mula sa talumpati ni DILG Sec Mar Roxas</p>\r\n<p>Paraan ng panghihikayat: __________________________________</p>\r\n<p>Paliwanag : ______________________________________________</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"height: 250px; width: 732px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 250px;\">\r\n<td style=\"height: 250px; width: 722px;\">\r\n<p><strong>GAWAIN II (5 PTS)</strong></p>\r\n<p>Magbigay reaksyon sa maraming mga produkto, balita, propaganda at maging politiko na nakilala natin dahil sa matatamis ang kanilang dila at mahusay maghabi ng salita. Sa madaling salita mahusay silang manghikayat at mangumbinsi, hindi tuloy natin alam kung ano talaga ang totoo at dapat paniwalaan. Mayroon ka bang tatandaang ganitong tekstong persweysib.</p>\r\n<p>Isulat sa isang buong papel ang iyong sagot. Pagkatapos ay sagutin ang sumusunod na tanong.</p>\r\n<ol>\r\n<li>Sa unang pagkakaataong nabasa mo ito, nagdududa k aba agad? Ipaliwanag ang iyong sagot?</li>\r\n<li>Ano-anong dahilan ang iyong naisip at hindi ka nakumbinsi ng tekstong ito?</li>\r\n<li>Sa ngayon ay laganap pa rin ang mga tekstong persweysib na nagtataglay ng mga huwad na pangako na nagliligaw sa madla. Sa iyong palagay, ano ang nararapat mong gawin bilag isang mapanuring mambabasa o matalinong botante at mamimili.</li>\r\n<li>Anong aral ang iyong natutunan at nais ibahagi sa iba pagdating sa mga ganitong uri ng teksto</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>PANGKATANG GAWAIN</strong></p>\r\n<table style=\"width: 841px; height: 940px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 940px;\">\r\n<td style=\"width: 831px; height: 940px;\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table style=\"width: 268px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"198\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Hindi malinaw ang isinulat na tagline. Maligoy at hindi gumamit ng paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),(15,46,'ARALIN 4','NARATIBO','NARATIBO','<table style=\"width: 628px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 618px;\">\r\n<p><strong>Likha mo Kwento mo!</strong></p>\r\n<p>Tatawag ang guro isang mag-aaral para magkwento ng kanyang pang-araw araw na karanasan sa buhay?</p>\r\n<p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tungkol saan ang isinadula ng kanilang pangkat?</p>\r\n<p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anong pamagat ng mga ito?</p>\r\n<p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ito ba ay isang maikling kuwento? nobela? alamat? pabula?</p>\r\n<p>d.&nbsp;&nbsp;&nbsp;&nbsp; Ano ang pinakapaborito mong kwento?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kahulugan at Katangian ng Tekstong Naratibo</strong></p>\r\n<p><strong>&hearts; </strong>Layunin ng tekstong naratibo ang magsalaysay o magkwento batay sa isang tiyak na pangyayari, totoo man o hindi. Layunin rin nitong mang-aliw o manlibang sa mga mambabasa kaya naman kahit ito\'y nakabase sa katotohanan ay higit itong nakatuon sa katotohanang may kaugnayan sa emosyonal at moral na anggulo sa halip na sa paghahanap ng katotohanan sa lahat ng detalye na kailangan pang gamitin ng pananaliksik na siya namang taglay ng isang tekstong impormatibo.</p>\r\n<p>&hearts; Ang <strong>tekstong naratibo</strong> ay nagkukuwento ng mga serye ng pangyayari na maaaring piksyon ( nobela, maikling kuwento, tula) o di fiksyon (memoir, biyograpiya, balita, maikling kuwento , sanaysay) Kapwa gumagamit ng imahinasyon, nakapagpahayag ng emosyon, kumakasangkapan ng iba\'t ibang imahen, metapora at simbolo upang maging malikhain.</p>\r\n<p><strong>Tekstong Naratibo</strong> ay pagsasalaysay o pagkukuwento ng mga pangyayari sa isang tao o mga tauhan, nangyri sa isang lugar at panahon o isang tagpuan nang maayos na pagkakasunod-sunod mula sa simula hanggang katapusan.</p>\r\n<p><strong>May iba\'t ibang Pananaw o Punto de Vista (Point of View) sa Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong> Unang Panauhan- </strong>sa pananaw na ito, isa sa mga tauhan ang nagsasalaysay ng mga bagay na kanyang nararanasan, naaalala o naririnig kaya gumagamit ng panghalip na ako. Karaniwang ginagamit ng manunulat sa pagsulat ng iba\'t ibang kuwento.</li>\r\n<li><strong> Ikalawang Panauhan- </strong>Dito mistulang kinakausap ng manunulat ang tauhang pinagagalaw niya sa kuwento kaya\'t gumagamit siya ng mga panghalip na ka o ikaw &nbsp;subalit tulad ng unang nasabi, hindi ito gaanong ginagamit &nbsp;ng mga manunulat sa kanilang pagsasalaysay.</li>\r\n<li><strong> Ikatlong Panauhan- </strong>ang mga pangyayari sa pananaw na ito ay isinasalaysay ng isang taong walang relasyon sa tauhan kaya ang panghalip na ginagamit niya sa pagsasalaysay ay<strong> siya.</strong></li>\r\n</ol>\r\n<p><strong>3 Pananaw ng ikatlong panauhan</strong></p>\r\n<ol>\r\n<li><strong> Maladiyos na panauhan- </strong>nababatid niya ang galaw at iniisip ng lahat ng mga tauhan.Napapasok niya ang isipanng bawat tauhan at naipapahayag niya ang iniisip,damdamin at paniniwala ng mga ito sa mga mambabasa.</li>\r\n<li><strong> Limitadong panauha</strong>n- nababatid niya ang iniisip at ikinikilos &nbsp;ng isa sa mga tauhan subalit hindi ang ibang tauhan.</li>\r\n<li><strong> tagaobserbang panauhan</strong>- hindi niya napapasok o nababatid ang nilalaman ng isip at damdamin ng mga tauhan. Tanging nakikita o naririnig niyang mga pangyayari , kilos o sinasabi lang ang kanyang isinasalaysay</li>\r\n<li><strong>Kombinasyong Pananaw o Paningin- </strong>Dito ay hindi lang iisa ang tagapagsalaysay kaya&rsquo;t iba&rsquo;t ibang pananaw o paningin ang nagagamit sa pagsasalaysay. Karaniwan itong nangyayari sa isang nobela kung saan ang mga pangyayari ay sumasakop sa mas mahabang panahon at mas maraming tauhan ang nagipakilala sa bawat kabanata.</li>\r\n<li>\r\n<p><strong>Mga Paraan ng Pagpapahayag ng Diyalogo, Saloobin o Damdamin sa Tekstong Naratibo.</strong></p>\r\n<ol>\r\n<li><strong>Direkta o Tuwirang Pagpapahayag</strong>.-ang tauhan ay direkta o tuwirangg nagsasaad o nagsasabi ng kanyang diyalogo, saloobin o damdamin. Ito ay ginagamitan ng panipi. Sa ganitong paraan ng pagpapahayag ay nagiging natural at lalong lumulutang ang katangiang taglay ng tauhan.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo; Donato, kakain na, Anak&rdquo; tawag ni Aling Guada sa anak na noo&rsquo;y&nbsp; abalang abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. &ldquo; Aba&rsquo;t kayganda naman nireng ginagawa mo, Anak! Ay ano ba talaga ang balak mo, ha?</p>\r\n<ol start=\"2\">\r\n<li><strong>Di direkta o Di tuwirang Pagpapahayag</strong>- ang tagapagsalaysay ang naglalahad sa sinasabi, iniisip o nararamdaman ng tauhan sa ganitong uri ng pagpapahayag. Hindi na ito ginagamitan ng panipi.</li>\r\n</ol>\r\n<p>Halimbwa: Tinawag ni Aling Guada ang anak dahil kakain na habang ito&rsquo;y abalang-abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. Sinabo niyang kayganda ng ginagawa ng anak at tinanong din niya kung ano baa ng balak niya.</p>\r\n<p><strong>&nbsp;May mga Elemento ang mga Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong>Tauhan &ndash;</strong>may dalawang paraan ng pagpapakilala ng tauhan- ang expository at ang dramatiko.</li>\r\n</ol>\r\n<p><strong>Expository</strong>- ang tagapagsalaysay ang magpapakilala o maglalarawan sa pagkatao ng tauhan</p>\r\n<p><strong>Dramatiko</strong>- kung kusang mabubunyag ang karakter dahil sa kanyang pagkilos o pagpapahayag.</p>\r\n<p><strong>Karaniwang Tauhan</strong>:</p>\r\n<ol>\r\n<li><strong>Pangunahing tauhan-</strong> tinatawag na bida, umiikot ang mga pangyayari sa kuwento mula sa simula hanggang katapusan. Karaniwang iisa lamang ang pangunahing tauhan.</li>\r\n<li><strong>Katungaling tauhan</strong>- tinatawag na kontrabida na siyang sumasalungat o kalaban ng pangunahing tauhan. Mahalaga ang papel ng tauhang ito sapagkat sa mga tunggaliang nangyayari sa pagitan nila, nabubuhay ang mga pangyayari sa kuwento at higit na napatitingkad ang mga katangian ng pangunahing tauhan.</li>\r\n<li><strong>Kasamang tauhan</strong>- gaya ng ipinahihiwatig ng katawagan , ang kasamang tauhan ay karaniwang kasama o kasangga ng pangunahing tauhan. Ang pangunahing papel o tungkulin niya ay sumuporta, magsilbing hingahan, o kapalagayang-loob ng pangunahing tauhan.</li>\r\n<li><strong>May Akda</strong>- sinasabing ang pangunahing tauhan at ang may akda ay lagi nang magkasama sa kabuoan ng akda.</li>\r\n</ol>\r\n<p><strong>Dalawang uri ng tauhan</strong></p>\r\n<ol>\r\n<li><strong>Tauhang Bilog- (</strong>round character) isang tauhang may multidimensional o maraming saklaw ang personalidad. Tulad ng isang tunay na katauhan, nagbabago ang kanyang pananaw, katangian at damdamin ayon sa pangangailangan. Ang isang tahimik at mapagtimping tauhan, halimbawa ay maaaring sumambulat kapag hinihingi ng sitwasyon o pangyayari sa kuwento.</li>\r\n<li><strong>Tauhang Lapad </strong>(flat character) ito ang tauhang nagtataglay ng iisa o dadalawang katangiang madaling matukoy o predictable.</li>\r\n</ol>\r\n<p><strong>Halimbawa</strong>; mapang-aping madrasta, mapagmahal na ina, tin-edyer na hindi sumusunod sa magulang</p>\r\n<ol start=\"2\">\r\n<li><strong>Tagpuan at Panahon-</strong> tumutukoy hindi lang sa lugar kung saan nagana pang mga pangyayari sa akda kundi gayundin sa panahon (oras, petsa, taon) at maging sa damdaming umiiral sa kapaligiran nang maganap ang mga pangyayari tulad ng kasaysayang dala ng pagdiriwang sa isang kaarawan, takot sa umiiral dahil sa malakas na hampas ng hangin at ulang dala ng bagyo, romantikong paligid sanhi ng maliwanag na buwang nakatunghay sa magkasingtahang naghahapunan sa isang hardin, matinding pagod ng magsasakang nag-aararo sa lilim na tirik na araw, kalungkutan ng pamilyang nakatunghay habang ibinababa sa kanyang huling hantungan ang isang minamahal.</li>\r\n<li><strong>Banghay-</strong> ito ang tawag sa maayos o daloy o pagkakasunod-sunod ng mga pangyayari sa mga tekstong naratibo upang mabigyang linaw ang temang taglay</li>\r\n</ol>\r\n<p>Karaniwang banghay o balangkas ng isang naratibo.</p>\r\n<ul>\r\n<li>Pagkakaroon ng isang epektibong simula kung saan maipakikilala ang mga tauhan, tagpuan at tema (orientation o introduction)</li>\r\n<li>Pagpapakilala sa suliraning ihahanap ng kalutasan ng mga tauhan particular ang pangunahing tauhan (problem)</li>\r\n<li>Pagkakaroon ng saglit na kasiglang hahantong sa pagpapakita ng aksyong gagawin ng tauhan tungo sa paglutas sa suliranin (rising action)</li>\r\n<li>Patuloy sa pagtaas ang pangyayaring humahantong sa isang resolusyon o kakalasan (falling action)</li>\r\n<li>Pagkakaroon ng isang makabuluhang wakas (ending)</li>\r\n</ul>\r\n<p>3 pagkakaayos ng banghay ayon sa anachrony</p>\r\n<ol>\r\n<ol>\r\n<li>Analepsis (Flashback) dito ipinapasok ang mga pangyayaring naganap sa nakalipas</li>\r\n<li>Prolepsis (Flash-forward) ditto nama&rsquo;y ipinapasok ang mga pangyayaring magaganap pa lang sa hinaharap</li>\r\n<li>Ellipsis &ndash; may mga puwang o patlang sa pagkakasunod-sunod ng mga pangyayari na nagpapakitang may bahagi sa pagsasalaysay sa tinanggal o hindi isinama.</li>\r\n<li>Paksa o Tema- ito ang sentral na ideya kung saan umiikot ang mga pangyayari sa tekstong naratibo. Mahalagang malinang ito nang husto sa kabuoan ng akda upang mapalutang ng may akda ang pinakamahalagang mensaheng nais na niyang iparating sa kanyang mambabasa.</li>\r\n</ol>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><strong>GAWAIN I- Isigaw ang salitang Pawer kung ang pahayag ay tekstong naratibo.</strong></p>\r\n<p><strong>Sagutin ang mga katanungan.</strong></p>\r\n<ol>\r\n<li>Bigla akong napatigil sa aking paglalakad nakita ko ang isang anino na papalapit sa akin. Pilit kong huwag matakot pero nakita ko may hawak siyang patalim. Nanginig ako sa takot kaya naman tumatakbo ako ng matulin. Hanggang marating ko ang aming bahay. Napaiyak ako ng sobra dahil sa pangambang napahamak ako ng oras na iyon. Napaisip ako sa nangyari kung hindi sana ako umalis ng bahay namin hindi sana nangyari sa akin ito. Panglawang buhay ko na maituturing ang aking naranasan . Niyakap ko ang aking ina habang umiiyak na hindi ko masagot ang kanyang mga tanong dahil hindi niya alam na tumakas ako at naglakwatsa.</li>\r\n</ol>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento?</li>\r\n</ol>\r\n<p>&nbsp;2. Walang imposible sa Diyos (Panoorin ang video)</p>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento</li>\r\n</ol>\r\n<p><strong>Ipaliwanag:</strong></p>\r\n<p>&ldquo;Tiyak na maraming aliw at saya para sa mga mahilig magbasa,</p>\r\n<p>Mga tekstong naratibo&rsquo;y di lang nakalilibang kundi may aral pang dala.&rdquo;</p>\r\n<p><strong>Gawain 2 Basahin ang tekstong \"Mabangis na Lungsod\"</strong></p>\r\n<table style=\"width: 928px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 918px;\">\r\n<p>Ano ang paksa o temang tinalakay ng akda? Tukuyin at lagyan ng tsek (&radic;) ang sagot mo at saka ipaliwanag ang napiling sagot.</p>\r\n<p>__ Dapat lang maparusahan ang mga taong nang-api sa kapwa.</p>\r\n<p>__ Dapat gumawa ang pamahalaan ng makakaya upang maibsan ang kahirapan sa iba&rsquo;t ibang bahagi ng bansa.</p>\r\n<p>__ Mananatiling biktima ang mahihina hanggat nagbubulag-bulagan ang lipunan sa ganitong kalakaran.</p>\r\n<p>__ Nangangailangan ng kandili at pagmamahal ang mga batang walang magulang.</p>\r\n<p>__ Walang mang-aalipin kung walang magpapaalipin.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 926px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 916px;\">\r\n<p>Paano mo iuugnay ang mga aral sa tekstong naratibo sa iyong sarili, pamilya, komunidad o at bansa?</p>\r\n<p>&nbsp;</p>\r\n<p>Mga Katanungan:</p>\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nakita moa ng paghihirap ni Adong para lamang makaipon ng mga baryang inililimos upang may maipanlaman sa kumakalam na sikmura. Tiyak na hindi mo kailanman naranasang mamalimos para lang may makain. Paano mo magagamit ang aral na ito sa iyong sarili?</p>\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sadyang mahirap ang walang pamilya at ito&rsquo;y napatunayan ni Adong. walang magulang at mga kapatid na nagmalasakit sa kanya sa panahon ng kanyang pangangailangan. Mapalad ka sa pagkakaroon nng pamilya kahit pa sabihing hindi perpekto ang pamilya mo. Paano mo maipapakita ang pagpapahalaga sa iyong pamilya?</p>\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mabangis na lungsod ang komunidad ni Adong, Maihahalintulad ito sa kagubatang ang mahihina ay nagiging lamang-tiyan ng mga mas malalakas at makapangyarihan. Ano ang magagawa mo upang kapag nakakita ka ng ganitong pang-aapi sa maas mahihina sa iyong paligid ay mahadlangan mo ito?</p>\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang kahirapan ay talamak hindi lang sa Quiapo kundi sa iba&rsquo;t ibang panig ng ating bansa. Kung hihintayin lang lagi ang pagkilos ng pamahalaan upang matugunan ang kahirapang ito ay matagal at malayo pa ang lalakbayin ng bayan upag ito ay maibsan. Ano ang magagawa mo sa iyong munting paraan upang makatulong sa pagsugpo ng kahirapan sa bansa?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ang mga mag-aaral ay susulat ng sariling halimbawa ng tekstong naratibo sa pamamagitan ng komiks. Ang paksa ay may kaugnayan sa pamilya, o di kaya naman sa komunidad o bansa o sarili</p>\r\n<p><strong><em>Pamantayan sa Paggawa (25 puntos)</em></strong></p>\r\n<ol>\r\n<li>Kapupulutan ng magandang asal ang tekstong naratibong nabuo.</li>\r\n<li>Malinis ang kabuuang gawa ng tekstong naratibo.</li>\r\n<li>Maliwanag at organisado ang mga pangungusap o ideya sa binuong tekstong naratibo.</li>\r\n<li>Sumasalamin sa sarili o pamilya o bansa ang nabuong teksto.</li>\r\n<li>Wasto ang pagkakagamit ng wika tulad ng bantas at wastong gamit ng mga salita</li>\r\n</ol>'),(16,49,'ARALIN 4','NARATIBO','NARATIBO','<table style=\"width: 628px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 618px;\">\r\n<p><strong>Likha mo Kwento mo!</strong></p>\r\n<p>Tatawag ang guro isang mag-aaral para magkwento ng kanyang pang-araw araw na karanasan sa buhay?</p>\r\n<p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tungkol saan ang isinadula ng kanilang pangkat?</p>\r\n<p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anong pamagat ng mga ito?</p>\r\n<p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ito ba ay isang maikling kuwento? nobela? alamat? pabula?</p>\r\n<p>d.&nbsp;&nbsp;&nbsp;&nbsp; Ano ang pinakapaborito mong kwento?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kahulugan at Katangian ng Tekstong Naratibo</strong></p>\r\n<p><strong>&hearts; </strong>Layunin ng tekstong naratibo ang magsalaysay o magkwento batay sa isang tiyak na pangyayari, totoo man o hindi. Layunin rin nitong mang-aliw o manlibang sa mga mambabasa kaya naman kahit ito\'y nakabase sa katotohanan ay higit itong nakatuon sa katotohanang may kaugnayan sa emosyonal at moral na anggulo sa halip na sa paghahanap ng katotohanan sa lahat ng detalye na kailangan pang gamitin ng pananaliksik na siya namang taglay ng isang tekstong impormatibo.</p>\r\n<p>&hearts; Ang <strong>tekstong naratibo</strong> ay nagkukuwento ng mga serye ng pangyayari na maaaring piksyon ( nobela, maikling kuwento, tula) o di fiksyon (memoir, biyograpiya, balita, maikling kuwento , sanaysay) Kapwa gumagamit ng imahinasyon, nakapagpahayag ng emosyon, kumakasangkapan ng iba\'t ibang imahen, metapora at simbolo upang maging malikhain.</p>\r\n<p><strong>Tekstong Naratibo</strong> ay pagsasalaysay o pagkukuwento ng mga pangyayari sa isang tao o mga tauhan, nangyri sa isang lugar at panahon o isang tagpuan nang maayos na pagkakasunod-sunod mula sa simula hanggang katapusan.</p>\r\n<p><strong>May iba\'t ibang Pananaw o Punto de Vista (Point of View) sa Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong> Unang Panauhan- </strong>sa pananaw na ito, isa sa mga tauhan ang nagsasalaysay ng mga bagay na kanyang nararanasan, naaalala o naririnig kaya gumagamit ng panghalip na ako. Karaniwang ginagamit ng manunulat sa pagsulat ng iba\'t ibang kuwento.</li>\r\n<li><strong> Ikalawang Panauhan- </strong>Dito mistulang kinakausap ng manunulat ang tauhang pinagagalaw niya sa kuwento kaya\'t gumagamit siya ng mga panghalip na ka o ikaw &nbsp;subalit tulad ng unang nasabi, hindi ito gaanong ginagamit &nbsp;ng mga manunulat sa kanilang pagsasalaysay.</li>\r\n<li><strong> Ikatlong Panauhan- </strong>ang mga pangyayari sa pananaw na ito ay isinasalaysay ng isang taong walang relasyon sa tauhan kaya ang panghalip na ginagamit niya sa pagsasalaysay ay<strong> siya.</strong></li>\r\n</ol>\r\n<p><strong>3 Pananaw ng ikatlong panauhan</strong></p>\r\n<ol>\r\n<li><strong> Maladiyos na panauhan- </strong>nababatid niya ang galaw at iniisip ng lahat ng mga tauhan.Napapasok niya ang isipanng bawat tauhan at naipapahayag niya ang iniisip,damdamin at paniniwala ng mga ito sa mga mambabasa.</li>\r\n<li><strong> Limitadong panauha</strong>n- nababatid niya ang iniisip at ikinikilos &nbsp;ng isa sa mga tauhan subalit hindi ang ibang tauhan.</li>\r\n<li><strong> tagaobserbang panauhan</strong>- hindi niya napapasok o nababatid ang nilalaman ng isip at damdamin ng mga tauhan. Tanging nakikita o naririnig niyang mga pangyayari , kilos o sinasabi lang ang kanyang isinasalaysay</li>\r\n<li><strong>Kombinasyong Pananaw o Paningin- </strong>Dito ay hindi lang iisa ang tagapagsalaysay kaya&rsquo;t iba&rsquo;t ibang pananaw o paningin ang nagagamit sa pagsasalaysay. Karaniwan itong nangyayari sa isang nobela kung saan ang mga pangyayari ay sumasakop sa mas mahabang panahon at mas maraming tauhan ang nagipakilala sa bawat kabanata.</li>\r\n<li>\r\n<p><strong>Mga Paraan ng Pagpapahayag ng Diyalogo, Saloobin o Damdamin sa Tekstong Naratibo.</strong></p>\r\n<ol>\r\n<li><strong>Direkta o Tuwirang Pagpapahayag</strong>.-ang tauhan ay direkta o tuwirangg nagsasaad o nagsasabi ng kanyang diyalogo, saloobin o damdamin. Ito ay ginagamitan ng panipi. Sa ganitong paraan ng pagpapahayag ay nagiging natural at lalong lumulutang ang katangiang taglay ng tauhan.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo; Donato, kakain na, Anak&rdquo; tawag ni Aling Guada sa anak na noo&rsquo;y&nbsp; abalang abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. &ldquo; Aba&rsquo;t kayganda naman nireng ginagawa mo, Anak! Ay ano ba talaga ang balak mo, ha?</p>\r\n<ol start=\"2\">\r\n<li><strong>Di direkta o Di tuwirang Pagpapahayag</strong>- ang tagapagsalaysay ang naglalahad sa sinasabi, iniisip o nararamdaman ng tauhan sa ganitong uri ng pagpapahayag. Hindi na ito ginagamitan ng panipi.</li>\r\n</ol>\r\n<p>Halimbwa: Tinawag ni Aling Guada ang anak dahil kakain na habang ito&rsquo;y abalang-abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. Sinabo niyang kayganda ng ginagawa ng anak at tinanong din niya kung ano baa ng balak niya.</p>\r\n<p><strong>&nbsp;May mga Elemento ang mga Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong>Tauhan &ndash;</strong>may dalawang paraan ng pagpapakilala ng tauhan- ang expository at ang dramatiko.</li>\r\n</ol>\r\n<p><strong>Expository</strong>- ang tagapagsalaysay ang magpapakilala o maglalarawan sa pagkatao ng tauhan</p>\r\n<p><strong>Dramatiko</strong>- kung kusang mabubunyag ang karakter dahil sa kanyang pagkilos o pagpapahayag.</p>\r\n<p><strong>Karaniwang Tauhan</strong>:</p>\r\n<ol>\r\n<li><strong>Pangunahing tauhan-</strong> tinatawag na bida, umiikot ang mga pangyayari sa kuwento mula sa simula hanggang katapusan. Karaniwang iisa lamang ang pangunahing tauhan.</li>\r\n<li><strong>Katungaling tauhan</strong>- tinatawag na kontrabida na siyang sumasalungat o kalaban ng pangunahing tauhan. Mahalaga ang papel ng tauhang ito sapagkat sa mga tunggaliang nangyayari sa pagitan nila, nabubuhay ang mga pangyayari sa kuwento at higit na napatitingkad ang mga katangian ng pangunahing tauhan.</li>\r\n<li><strong>Kasamang tauhan</strong>- gaya ng ipinahihiwatig ng katawagan , ang kasamang tauhan ay karaniwang kasama o kasangga ng pangunahing tauhan. Ang pangunahing papel o tungkulin niya ay sumuporta, magsilbing hingahan, o kapalagayang-loob ng pangunahing tauhan.</li>\r\n<li><strong>May Akda</strong>- sinasabing ang pangunahing tauhan at ang may akda ay lagi nang magkasama sa kabuoan ng akda.</li>\r\n</ol>\r\n<p><strong>Dalawang uri ng tauhan</strong></p>\r\n<ol>\r\n<li><strong>Tauhang Bilog- (</strong>round character) isang tauhang may multidimensional o maraming saklaw ang personalidad. Tulad ng isang tunay na katauhan, nagbabago ang kanyang pananaw, katangian at damdamin ayon sa pangangailangan. Ang isang tahimik at mapagtimping tauhan, halimbawa ay maaaring sumambulat kapag hinihingi ng sitwasyon o pangyayari sa kuwento.</li>\r\n<li><strong>Tauhang Lapad </strong>(flat character) ito ang tauhang nagtataglay ng iisa o dadalawang katangiang madaling matukoy o predictable.</li>\r\n</ol>\r\n<p><strong>Halimbawa</strong>; mapang-aping madrasta, mapagmahal na ina, tin-edyer na hindi sumusunod sa magulang</p>\r\n<ol start=\"2\">\r\n<li><strong>Tagpuan at Panahon-</strong> tumutukoy hindi lang sa lugar kung saan nagana pang mga pangyayari sa akda kundi gayundin sa panahon (oras, petsa, taon) at maging sa damdaming umiiral sa kapaligiran nang maganap ang mga pangyayari tulad ng kasaysayang dala ng pagdiriwang sa isang kaarawan, takot sa umiiral dahil sa malakas na hampas ng hangin at ulang dala ng bagyo, romantikong paligid sanhi ng maliwanag na buwang nakatunghay sa magkasingtahang naghahapunan sa isang hardin, matinding pagod ng magsasakang nag-aararo sa lilim na tirik na araw, kalungkutan ng pamilyang nakatunghay habang ibinababa sa kanyang huling hantungan ang isang minamahal.</li>\r\n<li><strong>Banghay-</strong> ito ang tawag sa maayos o daloy o pagkakasunod-sunod ng mga pangyayari sa mga tekstong naratibo upang mabigyang linaw ang temang taglay</li>\r\n</ol>\r\n<p>Karaniwang banghay o balangkas ng isang naratibo.</p>\r\n<ul>\r\n<li>Pagkakaroon ng isang epektibong simula kung saan maipakikilala ang mga tauhan, tagpuan at tema (orientation o introduction)</li>\r\n<li>Pagpapakilala sa suliraning ihahanap ng kalutasan ng mga tauhan particular ang pangunahing tauhan (problem)</li>\r\n<li>Pagkakaroon ng saglit na kasiglang hahantong sa pagpapakita ng aksyong gagawin ng tauhan tungo sa paglutas sa suliranin (rising action)</li>\r\n<li>Patuloy sa pagtaas ang pangyayaring humahantong sa isang resolusyon o kakalasan (falling action)</li>\r\n<li>Pagkakaroon ng isang makabuluhang wakas (ending)</li>\r\n</ul>\r\n<p>3 pagkakaayos ng banghay ayon sa anachrony</p>\r\n<ol>\r\n<ol>\r\n<li>Analepsis (Flashback) dito ipinapasok ang mga pangyayaring naganap sa nakalipas</li>\r\n<li>Prolepsis (Flash-forward) ditto nama&rsquo;y ipinapasok ang mga pangyayaring magaganap pa lang sa hinaharap</li>\r\n<li>Ellipsis &ndash; may mga puwang o patlang sa pagkakasunod-sunod ng mga pangyayari na nagpapakitang may bahagi sa pagsasalaysay sa tinanggal o hindi isinama.</li>\r\n<li>Paksa o Tema- ito ang sentral na ideya kung saan umiikot ang mga pangyayari sa tekstong naratibo. Mahalagang malinang ito nang husto sa kabuoan ng akda upang mapalutang ng may akda ang pinakamahalagang mensaheng nais na niyang iparating sa kanyang mambabasa.</li>\r\n</ol>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><strong>GAWAIN I- Isigaw ang salitang Pawer kung ang pahayag ay tekstong naratibo.</strong></p>\r\n<p><strong>Sagutin ang mga katanungan.</strong></p>\r\n<ol>\r\n<li>Bigla akong napatigil sa aking paglalakad nakita ko ang isang anino na papalapit sa akin. Pilit kong huwag matakot pero nakita ko may hawak siyang patalim. Nanginig ako sa takot kaya naman tumatakbo ako ng matulin. Hanggang marating ko ang aming bahay. Napaiyak ako ng sobra dahil sa pangambang napahamak ako ng oras na iyon. Napaisip ako sa nangyari kung hindi sana ako umalis ng bahay namin hindi sana nangyari sa akin ito. Panglawang buhay ko na maituturing ang aking naranasan . Niyakap ko ang aking ina habang umiiyak na hindi ko masagot ang kanyang mga tanong dahil hindi niya alam na tumakas ako at naglakwatsa.</li>\r\n</ol>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento?</li>\r\n</ol>\r\n<p>&nbsp;2. Walang imposible sa Diyos (Panoorin ang video)</p>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento</li>\r\n</ol>\r\n<p><strong>Ipaliwanag:</strong></p>\r\n<p>&ldquo;Tiyak na maraming aliw at saya para sa mga mahilig magbasa,</p>\r\n<p>Mga tekstong naratibo&rsquo;y di lang nakalilibang kundi may aral pang dala.&rdquo;</p>\r\n<p><strong>Gawain 2 Basahin ang tekstong \"Mabangis na Lungsod\"</strong></p>\r\n<table style=\"width: 928px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 918px;\">\r\n<p>Ano ang paksa o temang tinalakay ng akda? Tukuyin at lagyan ng tsek (&radic;) ang sagot mo at saka ipaliwanag ang napiling sagot.</p>\r\n<p>__ Dapat lang maparusahan ang mga taong nang-api sa kapwa.</p>\r\n<p>__ Dapat gumawa ang pamahalaan ng makakaya upang maibsan ang kahirapan sa iba&rsquo;t ibang bahagi ng bansa.</p>\r\n<p>__ Mananatiling biktima ang mahihina hanggat nagbubulag-bulagan ang lipunan sa ganitong kalakaran.</p>\r\n<p>__ Nangangailangan ng kandili at pagmamahal ang mga batang walang magulang.</p>\r\n<p>__ Walang mang-aalipin kung walang magpapaalipin.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 926px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 916px;\">\r\n<p>Paano mo iuugnay ang mga aral sa tekstong naratibo sa iyong sarili, pamilya, komunidad o at bansa?</p>\r\n<p>&nbsp;</p>\r\n<p>Mga Katanungan:</p>\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nakita moa ng paghihirap ni Adong para lamang makaipon ng mga baryang inililimos upang may maipanlaman sa kumakalam na sikmura. Tiyak na hindi mo kailanman naranasang mamalimos para lang may makain. Paano mo magagamit ang aral na ito sa iyong sarili?</p>\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sadyang mahirap ang walang pamilya at ito&rsquo;y napatunayan ni Adong. walang magulang at mga kapatid na nagmalasakit sa kanya sa panahon ng kanyang pangangailangan. Mapalad ka sa pagkakaroon nng pamilya kahit pa sabihing hindi perpekto ang pamilya mo. Paano mo maipapakita ang pagpapahalaga sa iyong pamilya?</p>\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mabangis na lungsod ang komunidad ni Adong, Maihahalintulad ito sa kagubatang ang mahihina ay nagiging lamang-tiyan ng mga mas malalakas at makapangyarihan. Ano ang magagawa mo upang kapag nakakita ka ng ganitong pang-aapi sa maas mahihina sa iyong paligid ay mahadlangan mo ito?</p>\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang kahirapan ay talamak hindi lang sa Quiapo kundi sa iba&rsquo;t ibang panig ng ating bansa. Kung hihintayin lang lagi ang pagkilos ng pamahalaan upang matugunan ang kahirapang ito ay matagal at malayo pa ang lalakbayin ng bayan upag ito ay maibsan. Ano ang magagawa mo sa iyong munting paraan upang makatulong sa pagsugpo ng kahirapan sa bansa?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ang mga mag-aaral ay susulat ng sariling halimbawa ng tekstong naratibo sa pamamagitan ng komiks. Ang paksa ay may kaugnayan sa pamilya, o di kaya naman sa komunidad o bansa o sarili</p>\r\n<p><strong><em>Pamantayan sa Paggawa (25 puntos)</em></strong></p>\r\n<ol>\r\n<li>Kapupulutan ng magandang asal ang tekstong naratibong nabuo.</li>\r\n<li>Malinis ang kabuuang gawa ng tekstong naratibo.</li>\r\n<li>Maliwanag at organisado ang mga pangungusap o ideya sa binuong tekstong naratibo.</li>\r\n<li>Sumasalamin sa sarili o pamilya o bansa ang nabuong teksto.</li>\r\n<li>Wasto ang pagkakagamit ng wika tulad ng bantas at wastong gamit ng mga salita</li>\r\n</ol>'),(17,47,'ARALIN 4','NARATIBO','NARATIBO','<table style=\"width: 628px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 618px;\">\r\n<p><strong>Likha mo Kwento mo!</strong></p>\r\n<p>Tatawag ang guro isang mag-aaral para magkwento ng kanyang pang-araw araw na karanasan sa buhay?</p>\r\n<p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tungkol saan ang isinadula ng kanilang pangkat?</p>\r\n<p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anong pamagat ng mga ito?</p>\r\n<p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ito ba ay isang maikling kuwento? nobela? alamat? pabula?</p>\r\n<p>d.&nbsp;&nbsp;&nbsp;&nbsp; Ano ang pinakapaborito mong kwento?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kahulugan at Katangian ng Tekstong Naratibo</strong></p>\r\n<p><strong>&hearts; </strong>Layunin ng tekstong naratibo ang magsalaysay o magkwento batay sa isang tiyak na pangyayari, totoo man o hindi. Layunin rin nitong mang-aliw o manlibang sa mga mambabasa kaya naman kahit ito\'y nakabase sa katotohanan ay higit itong nakatuon sa katotohanang may kaugnayan sa emosyonal at moral na anggulo sa halip na sa paghahanap ng katotohanan sa lahat ng detalye na kailangan pang gamitin ng pananaliksik na siya namang taglay ng isang tekstong impormatibo.</p>\r\n<p>&hearts; Ang <strong>tekstong naratibo</strong> ay nagkukuwento ng mga serye ng pangyayari na maaaring piksyon ( nobela, maikling kuwento, tula) o di fiksyon (memoir, biyograpiya, balita, maikling kuwento , sanaysay) Kapwa gumagamit ng imahinasyon, nakapagpahayag ng emosyon, kumakasangkapan ng iba\'t ibang imahen, metapora at simbolo upang maging malikhain.</p>\r\n<p><strong>Tekstong Naratibo</strong> ay pagsasalaysay o pagkukuwento ng mga pangyayari sa isang tao o mga tauhan, nangyri sa isang lugar at panahon o isang tagpuan nang maayos na pagkakasunod-sunod mula sa simula hanggang katapusan.</p>\r\n<p><strong>May iba\'t ibang Pananaw o Punto de Vista (Point of View) sa Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong> Unang Panauhan- </strong>sa pananaw na ito, isa sa mga tauhan ang nagsasalaysay ng mga bagay na kanyang nararanasan, naaalala o naririnig kaya gumagamit ng panghalip na ako. Karaniwang ginagamit ng manunulat sa pagsulat ng iba\'t ibang kuwento.</li>\r\n<li><strong> Ikalawang Panauhan- </strong>Dito mistulang kinakausap ng manunulat ang tauhang pinagagalaw niya sa kuwento kaya\'t gumagamit siya ng mga panghalip na ka o ikaw &nbsp;subalit tulad ng unang nasabi, hindi ito gaanong ginagamit &nbsp;ng mga manunulat sa kanilang pagsasalaysay.</li>\r\n<li><strong> Ikatlong Panauhan- </strong>ang mga pangyayari sa pananaw na ito ay isinasalaysay ng isang taong walang relasyon sa tauhan kaya ang panghalip na ginagamit niya sa pagsasalaysay ay<strong> siya.</strong></li>\r\n</ol>\r\n<p><strong>3 Pananaw ng ikatlong panauhan</strong></p>\r\n<ol>\r\n<li><strong> Maladiyos na panauhan- </strong>nababatid niya ang galaw at iniisip ng lahat ng mga tauhan.Napapasok niya ang isipanng bawat tauhan at naipapahayag niya ang iniisip,damdamin at paniniwala ng mga ito sa mga mambabasa.</li>\r\n<li><strong> Limitadong panauha</strong>n- nababatid niya ang iniisip at ikinikilos &nbsp;ng isa sa mga tauhan subalit hindi ang ibang tauhan.</li>\r\n<li><strong> tagaobserbang panauhan</strong>- hindi niya napapasok o nababatid ang nilalaman ng isip at damdamin ng mga tauhan. Tanging nakikita o naririnig niyang mga pangyayari , kilos o sinasabi lang ang kanyang isinasalaysay</li>\r\n<li><strong>Kombinasyong Pananaw o Paningin- </strong>Dito ay hindi lang iisa ang tagapagsalaysay kaya&rsquo;t iba&rsquo;t ibang pananaw o paningin ang nagagamit sa pagsasalaysay. Karaniwan itong nangyayari sa isang nobela kung saan ang mga pangyayari ay sumasakop sa mas mahabang panahon at mas maraming tauhan ang nagipakilala sa bawat kabanata.</li>\r\n<li>\r\n<p><strong>Mga Paraan ng Pagpapahayag ng Diyalogo, Saloobin o Damdamin sa Tekstong Naratibo.</strong></p>\r\n<ol>\r\n<li><strong>Direkta o Tuwirang Pagpapahayag</strong>.-ang tauhan ay direkta o tuwirangg nagsasaad o nagsasabi ng kanyang diyalogo, saloobin o damdamin. Ito ay ginagamitan ng panipi. Sa ganitong paraan ng pagpapahayag ay nagiging natural at lalong lumulutang ang katangiang taglay ng tauhan.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo; Donato, kakain na, Anak&rdquo; tawag ni Aling Guada sa anak na noo&rsquo;y&nbsp; abalang abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. &ldquo; Aba&rsquo;t kayganda naman nireng ginagawa mo, Anak! Ay ano ba talaga ang balak mo, ha?</p>\r\n<ol start=\"2\">\r\n<li><strong>Di direkta o Di tuwirang Pagpapahayag</strong>- ang tagapagsalaysay ang naglalahad sa sinasabi, iniisip o nararamdaman ng tauhan sa ganitong uri ng pagpapahayag. Hindi na ito ginagamitan ng panipi.</li>\r\n</ol>\r\n<p>Halimbwa: Tinawag ni Aling Guada ang anak dahil kakain na habang ito&rsquo;y abalang-abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. Sinabo niyang kayganda ng ginagawa ng anak at tinanong din niya kung ano baa ng balak niya.</p>\r\n<p><strong>&nbsp;May mga Elemento ang mga Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong>Tauhan &ndash;</strong>may dalawang paraan ng pagpapakilala ng tauhan- ang expository at ang dramatiko.</li>\r\n</ol>\r\n<p><strong>Expository</strong>- ang tagapagsalaysay ang magpapakilala o maglalarawan sa pagkatao ng tauhan</p>\r\n<p><strong>Dramatiko</strong>- kung kusang mabubunyag ang karakter dahil sa kanyang pagkilos o pagpapahayag.</p>\r\n<p><strong>Karaniwang Tauhan</strong>:</p>\r\n<ol>\r\n<li><strong>Pangunahing tauhan-</strong> tinatawag na bida, umiikot ang mga pangyayari sa kuwento mula sa simula hanggang katapusan. Karaniwang iisa lamang ang pangunahing tauhan.</li>\r\n<li><strong>Katungaling tauhan</strong>- tinatawag na kontrabida na siyang sumasalungat o kalaban ng pangunahing tauhan. Mahalaga ang papel ng tauhang ito sapagkat sa mga tunggaliang nangyayari sa pagitan nila, nabubuhay ang mga pangyayari sa kuwento at higit na napatitingkad ang mga katangian ng pangunahing tauhan.</li>\r\n<li><strong>Kasamang tauhan</strong>- gaya ng ipinahihiwatig ng katawagan , ang kasamang tauhan ay karaniwang kasama o kasangga ng pangunahing tauhan. Ang pangunahing papel o tungkulin niya ay sumuporta, magsilbing hingahan, o kapalagayang-loob ng pangunahing tauhan.</li>\r\n<li><strong>May Akda</strong>- sinasabing ang pangunahing tauhan at ang may akda ay lagi nang magkasama sa kabuoan ng akda.</li>\r\n</ol>\r\n<p><strong>Dalawang uri ng tauhan</strong></p>\r\n<ol>\r\n<li><strong>Tauhang Bilog- (</strong>round character) isang tauhang may multidimensional o maraming saklaw ang personalidad. Tulad ng isang tunay na katauhan, nagbabago ang kanyang pananaw, katangian at damdamin ayon sa pangangailangan. Ang isang tahimik at mapagtimping tauhan, halimbawa ay maaaring sumambulat kapag hinihingi ng sitwasyon o pangyayari sa kuwento.</li>\r\n<li><strong>Tauhang Lapad </strong>(flat character) ito ang tauhang nagtataglay ng iisa o dadalawang katangiang madaling matukoy o predictable.</li>\r\n</ol>\r\n<p><strong>Halimbawa</strong>; mapang-aping madrasta, mapagmahal na ina, tin-edyer na hindi sumusunod sa magulang</p>\r\n<ol start=\"2\">\r\n<li><strong>Tagpuan at Panahon-</strong> tumutukoy hindi lang sa lugar kung saan nagana pang mga pangyayari sa akda kundi gayundin sa panahon (oras, petsa, taon) at maging sa damdaming umiiral sa kapaligiran nang maganap ang mga pangyayari tulad ng kasaysayang dala ng pagdiriwang sa isang kaarawan, takot sa umiiral dahil sa malakas na hampas ng hangin at ulang dala ng bagyo, romantikong paligid sanhi ng maliwanag na buwang nakatunghay sa magkasingtahang naghahapunan sa isang hardin, matinding pagod ng magsasakang nag-aararo sa lilim na tirik na araw, kalungkutan ng pamilyang nakatunghay habang ibinababa sa kanyang huling hantungan ang isang minamahal.</li>\r\n<li><strong>Banghay-</strong> ito ang tawag sa maayos o daloy o pagkakasunod-sunod ng mga pangyayari sa mga tekstong naratibo upang mabigyang linaw ang temang taglay</li>\r\n</ol>\r\n<p>Karaniwang banghay o balangkas ng isang naratibo.</p>\r\n<ul>\r\n<li>Pagkakaroon ng isang epektibong simula kung saan maipakikilala ang mga tauhan, tagpuan at tema (orientation o introduction)</li>\r\n<li>Pagpapakilala sa suliraning ihahanap ng kalutasan ng mga tauhan particular ang pangunahing tauhan (problem)</li>\r\n<li>Pagkakaroon ng saglit na kasiglang hahantong sa pagpapakita ng aksyong gagawin ng tauhan tungo sa paglutas sa suliranin (rising action)</li>\r\n<li>Patuloy sa pagtaas ang pangyayaring humahantong sa isang resolusyon o kakalasan (falling action)</li>\r\n<li>Pagkakaroon ng isang makabuluhang wakas (ending)</li>\r\n</ul>\r\n<p>3 pagkakaayos ng banghay ayon sa anachrony</p>\r\n<ol>\r\n<ol>\r\n<li>Analepsis (Flashback) dito ipinapasok ang mga pangyayaring naganap sa nakalipas</li>\r\n<li>Prolepsis (Flash-forward) ditto nama&rsquo;y ipinapasok ang mga pangyayaring magaganap pa lang sa hinaharap</li>\r\n<li>Ellipsis &ndash; may mga puwang o patlang sa pagkakasunod-sunod ng mga pangyayari na nagpapakitang may bahagi sa pagsasalaysay sa tinanggal o hindi isinama.</li>\r\n<li>Paksa o Tema- ito ang sentral na ideya kung saan umiikot ang mga pangyayari sa tekstong naratibo. Mahalagang malinang ito nang husto sa kabuoan ng akda upang mapalutang ng may akda ang pinakamahalagang mensaheng nais na niyang iparating sa kanyang mambabasa.</li>\r\n</ol>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><strong>GAWAIN I- Isigaw ang salitang Pawer kung ang pahayag ay tekstong naratibo.</strong></p>\r\n<p><strong>Sagutin ang mga katanungan.</strong></p>\r\n<ol>\r\n<li>Bigla akong napatigil sa aking paglalakad nakita ko ang isang anino na papalapit sa akin. Pilit kong huwag matakot pero nakita ko may hawak siyang patalim. Nanginig ako sa takot kaya naman tumatakbo ako ng matulin. Hanggang marating ko ang aming bahay. Napaiyak ako ng sobra dahil sa pangambang napahamak ako ng oras na iyon. Napaisip ako sa nangyari kung hindi sana ako umalis ng bahay namin hindi sana nangyari sa akin ito. Panglawang buhay ko na maituturing ang aking naranasan . Niyakap ko ang aking ina habang umiiyak na hindi ko masagot ang kanyang mga tanong dahil hindi niya alam na tumakas ako at naglakwatsa.</li>\r\n</ol>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento?</li>\r\n</ol>\r\n<p>&nbsp;2. Walang imposible sa Diyos (Panoorin ang video)</p>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento</li>\r\n</ol>\r\n<p><strong>Ipaliwanag:</strong></p>\r\n<p>&ldquo;Tiyak na maraming aliw at saya para sa mga mahilig magbasa,</p>\r\n<p>Mga tekstong naratibo&rsquo;y di lang nakalilibang kundi may aral pang dala.&rdquo;</p>\r\n<p><strong>Gawain 2 Basahin ang tekstong \"Mabangis na Lungsod\"</strong></p>\r\n<table style=\"width: 928px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 918px;\">\r\n<p>Ano ang paksa o temang tinalakay ng akda? Tukuyin at lagyan ng tsek (&radic;) ang sagot mo at saka ipaliwanag ang napiling sagot.</p>\r\n<p>__ Dapat lang maparusahan ang mga taong nang-api sa kapwa.</p>\r\n<p>__ Dapat gumawa ang pamahalaan ng makakaya upang maibsan ang kahirapan sa iba&rsquo;t ibang bahagi ng bansa.</p>\r\n<p>__ Mananatiling biktima ang mahihina hanggat nagbubulag-bulagan ang lipunan sa ganitong kalakaran.</p>\r\n<p>__ Nangangailangan ng kandili at pagmamahal ang mga batang walang magulang.</p>\r\n<p>__ Walang mang-aalipin kung walang magpapaalipin.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 926px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 916px;\">\r\n<p>Paano mo iuugnay ang mga aral sa tekstong naratibo sa iyong sarili, pamilya, komunidad o at bansa?</p>\r\n<p>&nbsp;</p>\r\n<p>Mga Katanungan:</p>\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nakita moa ng paghihirap ni Adong para lamang makaipon ng mga baryang inililimos upang may maipanlaman sa kumakalam na sikmura. Tiyak na hindi mo kailanman naranasang mamalimos para lang may makain. Paano mo magagamit ang aral na ito sa iyong sarili?</p>\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sadyang mahirap ang walang pamilya at ito&rsquo;y napatunayan ni Adong. walang magulang at mga kapatid na nagmalasakit sa kanya sa panahon ng kanyang pangangailangan. Mapalad ka sa pagkakaroon nng pamilya kahit pa sabihing hindi perpekto ang pamilya mo. Paano mo maipapakita ang pagpapahalaga sa iyong pamilya?</p>\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mabangis na lungsod ang komunidad ni Adong, Maihahalintulad ito sa kagubatang ang mahihina ay nagiging lamang-tiyan ng mga mas malalakas at makapangyarihan. Ano ang magagawa mo upang kapag nakakita ka ng ganitong pang-aapi sa maas mahihina sa iyong paligid ay mahadlangan mo ito?</p>\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang kahirapan ay talamak hindi lang sa Quiapo kundi sa iba&rsquo;t ibang panig ng ating bansa. Kung hihintayin lang lagi ang pagkilos ng pamahalaan upang matugunan ang kahirapang ito ay matagal at malayo pa ang lalakbayin ng bayan upag ito ay maibsan. Ano ang magagawa mo sa iyong munting paraan upang makatulong sa pagsugpo ng kahirapan sa bansa?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ang mga mag-aaral ay susulat ng sariling halimbawa ng tekstong naratibo sa pamamagitan ng komiks. Ang paksa ay may kaugnayan sa pamilya, o di kaya naman sa komunidad o bansa o sarili</p>\r\n<p><strong><em>Pamantayan sa Paggawa (25 puntos)</em></strong></p>\r\n<ol>\r\n<li>Kapupulutan ng magandang asal ang tekstong naratibong nabuo.</li>\r\n<li>Malinis ang kabuuang gawa ng tekstong naratibo.</li>\r\n<li>Maliwanag at organisado ang mga pangungusap o ideya sa binuong tekstong naratibo.</li>\r\n<li>Sumasalamin sa sarili o pamilya o bansa ang nabuong teksto.</li>\r\n<li>Wasto ang pagkakagamit ng wika tulad ng bantas at wastong gamit ng mga salita</li>\r\n</ol>'),(18,48,'ARALIN 4','NARATIBO','NARATIBO','<table style=\"width: 628px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 618px;\">\r\n<p><strong>Likha mo Kwento mo!</strong></p>\r\n<p>Tatawag ang guro isang mag-aaral para magkwento ng kanyang pang-araw araw na karanasan sa buhay?</p>\r\n<p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tungkol saan ang isinadula ng kanilang pangkat?</p>\r\n<p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anong pamagat ng mga ito?</p>\r\n<p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ito ba ay isang maikling kuwento? nobela? alamat? pabula?</p>\r\n<p>d.&nbsp;&nbsp;&nbsp;&nbsp; Ano ang pinakapaborito mong kwento?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kahulugan at Katangian ng Tekstong Naratibo</strong></p>\r\n<p><strong>&hearts; </strong>Layunin ng tekstong naratibo ang magsalaysay o magkwento batay sa isang tiyak na pangyayari, totoo man o hindi. Layunin rin nitong mang-aliw o manlibang sa mga mambabasa kaya naman kahit ito\'y nakabase sa katotohanan ay higit itong nakatuon sa katotohanang may kaugnayan sa emosyonal at moral na anggulo sa halip na sa paghahanap ng katotohanan sa lahat ng detalye na kailangan pang gamitin ng pananaliksik na siya namang taglay ng isang tekstong impormatibo.</p>\r\n<p>&hearts; Ang <strong>tekstong naratibo</strong> ay nagkukuwento ng mga serye ng pangyayari na maaaring piksyon ( nobela, maikling kuwento, tula) o di fiksyon (memoir, biyograpiya, balita, maikling kuwento , sanaysay) Kapwa gumagamit ng imahinasyon, nakapagpahayag ng emosyon, kumakasangkapan ng iba\'t ibang imahen, metapora at simbolo upang maging malikhain.</p>\r\n<p><strong>Tekstong Naratibo</strong> ay pagsasalaysay o pagkukuwento ng mga pangyayari sa isang tao o mga tauhan, nangyri sa isang lugar at panahon o isang tagpuan nang maayos na pagkakasunod-sunod mula sa simula hanggang katapusan.</p>\r\n<p><strong>May iba\'t ibang Pananaw o Punto de Vista (Point of View) sa Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong> Unang Panauhan- </strong>sa pananaw na ito, isa sa mga tauhan ang nagsasalaysay ng mga bagay na kanyang nararanasan, naaalala o naririnig kaya gumagamit ng panghalip na ako. Karaniwang ginagamit ng manunulat sa pagsulat ng iba\'t ibang kuwento.</li>\r\n<li><strong> Ikalawang Panauhan- </strong>Dito mistulang kinakausap ng manunulat ang tauhang pinagagalaw niya sa kuwento kaya\'t gumagamit siya ng mga panghalip na ka o ikaw &nbsp;subalit tulad ng unang nasabi, hindi ito gaanong ginagamit &nbsp;ng mga manunulat sa kanilang pagsasalaysay.</li>\r\n<li><strong> Ikatlong Panauhan- </strong>ang mga pangyayari sa pananaw na ito ay isinasalaysay ng isang taong walang relasyon sa tauhan kaya ang panghalip na ginagamit niya sa pagsasalaysay ay<strong> siya.</strong></li>\r\n</ol>\r\n<p><strong>3 Pananaw ng ikatlong panauhan</strong></p>\r\n<ol>\r\n<li><strong> Maladiyos na panauhan- </strong>nababatid niya ang galaw at iniisip ng lahat ng mga tauhan.Napapasok niya ang isipanng bawat tauhan at naipapahayag niya ang iniisip,damdamin at paniniwala ng mga ito sa mga mambabasa.</li>\r\n<li><strong> Limitadong panauha</strong>n- nababatid niya ang iniisip at ikinikilos &nbsp;ng isa sa mga tauhan subalit hindi ang ibang tauhan.</li>\r\n<li><strong> tagaobserbang panauhan</strong>- hindi niya napapasok o nababatid ang nilalaman ng isip at damdamin ng mga tauhan. Tanging nakikita o naririnig niyang mga pangyayari , kilos o sinasabi lang ang kanyang isinasalaysay</li>\r\n<li><strong>Kombinasyong Pananaw o Paningin- </strong>Dito ay hindi lang iisa ang tagapagsalaysay kaya&rsquo;t iba&rsquo;t ibang pananaw o paningin ang nagagamit sa pagsasalaysay. Karaniwan itong nangyayari sa isang nobela kung saan ang mga pangyayari ay sumasakop sa mas mahabang panahon at mas maraming tauhan ang nagipakilala sa bawat kabanata.</li>\r\n<li>\r\n<p><strong>Mga Paraan ng Pagpapahayag ng Diyalogo, Saloobin o Damdamin sa Tekstong Naratibo.</strong></p>\r\n<ol>\r\n<li><strong>Direkta o Tuwirang Pagpapahayag</strong>.-ang tauhan ay direkta o tuwirangg nagsasaad o nagsasabi ng kanyang diyalogo, saloobin o damdamin. Ito ay ginagamitan ng panipi. Sa ganitong paraan ng pagpapahayag ay nagiging natural at lalong lumulutang ang katangiang taglay ng tauhan.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo; Donato, kakain na, Anak&rdquo; tawag ni Aling Guada sa anak na noo&rsquo;y&nbsp; abalang abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. &ldquo; Aba&rsquo;t kayganda naman nireng ginagawa mo, Anak! Ay ano ba talaga ang balak mo, ha?</p>\r\n<ol start=\"2\">\r\n<li><strong>Di direkta o Di tuwirang Pagpapahayag</strong>- ang tagapagsalaysay ang naglalahad sa sinasabi, iniisip o nararamdaman ng tauhan sa ganitong uri ng pagpapahayag. Hindi na ito ginagamitan ng panipi.</li>\r\n</ol>\r\n<p>Halimbwa: Tinawag ni Aling Guada ang anak dahil kakain na habang ito&rsquo;y abalang-abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. Sinabo niyang kayganda ng ginagawa ng anak at tinanong din niya kung ano baa ng balak niya.</p>\r\n<p><strong>&nbsp;May mga Elemento ang mga Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong>Tauhan &ndash;</strong>may dalawang paraan ng pagpapakilala ng tauhan- ang expository at ang dramatiko.</li>\r\n</ol>\r\n<p><strong>Expository</strong>- ang tagapagsalaysay ang magpapakilala o maglalarawan sa pagkatao ng tauhan</p>\r\n<p><strong>Dramatiko</strong>- kung kusang mabubunyag ang karakter dahil sa kanyang pagkilos o pagpapahayag.</p>\r\n<p><strong>Karaniwang Tauhan</strong>:</p>\r\n<ol>\r\n<li><strong>Pangunahing tauhan-</strong> tinatawag na bida, umiikot ang mga pangyayari sa kuwento mula sa simula hanggang katapusan. Karaniwang iisa lamang ang pangunahing tauhan.</li>\r\n<li><strong>Katungaling tauhan</strong>- tinatawag na kontrabida na siyang sumasalungat o kalaban ng pangunahing tauhan. Mahalaga ang papel ng tauhang ito sapagkat sa mga tunggaliang nangyayari sa pagitan nila, nabubuhay ang mga pangyayari sa kuwento at higit na napatitingkad ang mga katangian ng pangunahing tauhan.</li>\r\n<li><strong>Kasamang tauhan</strong>- gaya ng ipinahihiwatig ng katawagan , ang kasamang tauhan ay karaniwang kasama o kasangga ng pangunahing tauhan. Ang pangunahing papel o tungkulin niya ay sumuporta, magsilbing hingahan, o kapalagayang-loob ng pangunahing tauhan.</li>\r\n<li><strong>May Akda</strong>- sinasabing ang pangunahing tauhan at ang may akda ay lagi nang magkasama sa kabuoan ng akda.</li>\r\n</ol>\r\n<p><strong>Dalawang uri ng tauhan</strong></p>\r\n<ol>\r\n<li><strong>Tauhang Bilog- (</strong>round character) isang tauhang may multidimensional o maraming saklaw ang personalidad. Tulad ng isang tunay na katauhan, nagbabago ang kanyang pananaw, katangian at damdamin ayon sa pangangailangan. Ang isang tahimik at mapagtimping tauhan, halimbawa ay maaaring sumambulat kapag hinihingi ng sitwasyon o pangyayari sa kuwento.</li>\r\n<li><strong>Tauhang Lapad </strong>(flat character) ito ang tauhang nagtataglay ng iisa o dadalawang katangiang madaling matukoy o predictable.</li>\r\n</ol>\r\n<p><strong>Halimbawa</strong>; mapang-aping madrasta, mapagmahal na ina, tin-edyer na hindi sumusunod sa magulang</p>\r\n<ol start=\"2\">\r\n<li><strong>Tagpuan at Panahon-</strong> tumutukoy hindi lang sa lugar kung saan nagana pang mga pangyayari sa akda kundi gayundin sa panahon (oras, petsa, taon) at maging sa damdaming umiiral sa kapaligiran nang maganap ang mga pangyayari tulad ng kasaysayang dala ng pagdiriwang sa isang kaarawan, takot sa umiiral dahil sa malakas na hampas ng hangin at ulang dala ng bagyo, romantikong paligid sanhi ng maliwanag na buwang nakatunghay sa magkasingtahang naghahapunan sa isang hardin, matinding pagod ng magsasakang nag-aararo sa lilim na tirik na araw, kalungkutan ng pamilyang nakatunghay habang ibinababa sa kanyang huling hantungan ang isang minamahal.</li>\r\n<li><strong>Banghay-</strong> ito ang tawag sa maayos o daloy o pagkakasunod-sunod ng mga pangyayari sa mga tekstong naratibo upang mabigyang linaw ang temang taglay</li>\r\n</ol>\r\n<p>Karaniwang banghay o balangkas ng isang naratibo.</p>\r\n<ul>\r\n<li>Pagkakaroon ng isang epektibong simula kung saan maipakikilala ang mga tauhan, tagpuan at tema (orientation o introduction)</li>\r\n<li>Pagpapakilala sa suliraning ihahanap ng kalutasan ng mga tauhan particular ang pangunahing tauhan (problem)</li>\r\n<li>Pagkakaroon ng saglit na kasiglang hahantong sa pagpapakita ng aksyong gagawin ng tauhan tungo sa paglutas sa suliranin (rising action)</li>\r\n<li>Patuloy sa pagtaas ang pangyayaring humahantong sa isang resolusyon o kakalasan (falling action)</li>\r\n<li>Pagkakaroon ng isang makabuluhang wakas (ending)</li>\r\n</ul>\r\n<p>3 pagkakaayos ng banghay ayon sa anachrony</p>\r\n<ol>\r\n<ol>\r\n<li>Analepsis (Flashback) dito ipinapasok ang mga pangyayaring naganap sa nakalipas</li>\r\n<li>Prolepsis (Flash-forward) ditto nama&rsquo;y ipinapasok ang mga pangyayaring magaganap pa lang sa hinaharap</li>\r\n<li>Ellipsis &ndash; may mga puwang o patlang sa pagkakasunod-sunod ng mga pangyayari na nagpapakitang may bahagi sa pagsasalaysay sa tinanggal o hindi isinama.</li>\r\n<li>Paksa o Tema- ito ang sentral na ideya kung saan umiikot ang mga pangyayari sa tekstong naratibo. Mahalagang malinang ito nang husto sa kabuoan ng akda upang mapalutang ng may akda ang pinakamahalagang mensaheng nais na niyang iparating sa kanyang mambabasa.</li>\r\n</ol>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><strong>GAWAIN I- Isigaw ang salitang Pawer kung ang pahayag ay tekstong naratibo.</strong></p>\r\n<p><strong>Sagutin ang mga katanungan.</strong></p>\r\n<ol>\r\n<li>Bigla akong napatigil sa aking paglalakad nakita ko ang isang anino na papalapit sa akin. Pilit kong huwag matakot pero nakita ko may hawak siyang patalim. Nanginig ako sa takot kaya naman tumatakbo ako ng matulin. Hanggang marating ko ang aming bahay. Napaiyak ako ng sobra dahil sa pangambang napahamak ako ng oras na iyon. Napaisip ako sa nangyari kung hindi sana ako umalis ng bahay namin hindi sana nangyari sa akin ito. Panglawang buhay ko na maituturing ang aking naranasan . Niyakap ko ang aking ina habang umiiyak na hindi ko masagot ang kanyang mga tanong dahil hindi niya alam na tumakas ako at naglakwatsa.</li>\r\n</ol>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento?</li>\r\n</ol>\r\n<p>&nbsp;2. Walang imposible sa Diyos (Panoorin ang video)</p>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento</li>\r\n</ol>\r\n<p><strong>Ipaliwanag:</strong></p>\r\n<p>&ldquo;Tiyak na maraming aliw at saya para sa mga mahilig magbasa,</p>\r\n<p>Mga tekstong naratibo&rsquo;y di lang nakalilibang kundi may aral pang dala.&rdquo;</p>\r\n<p><strong>Gawain 2 Basahin ang tekstong \"Mabangis na Lungsod\"</strong></p>\r\n<table style=\"width: 928px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 918px;\">\r\n<p>Ano ang paksa o temang tinalakay ng akda? Tukuyin at lagyan ng tsek (&radic;) ang sagot mo at saka ipaliwanag ang napiling sagot.</p>\r\n<p>__ Dapat lang maparusahan ang mga taong nang-api sa kapwa.</p>\r\n<p>__ Dapat gumawa ang pamahalaan ng makakaya upang maibsan ang kahirapan sa iba&rsquo;t ibang bahagi ng bansa.</p>\r\n<p>__ Mananatiling biktima ang mahihina hanggat nagbubulag-bulagan ang lipunan sa ganitong kalakaran.</p>\r\n<p>__ Nangangailangan ng kandili at pagmamahal ang mga batang walang magulang.</p>\r\n<p>__ Walang mang-aalipin kung walang magpapaalipin.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 926px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 916px;\">\r\n<p>Paano mo iuugnay ang mga aral sa tekstong naratibo sa iyong sarili, pamilya, komunidad o at bansa?</p>\r\n<p>&nbsp;</p>\r\n<p>Mga Katanungan:</p>\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nakita moa ng paghihirap ni Adong para lamang makaipon ng mga baryang inililimos upang may maipanlaman sa kumakalam na sikmura. Tiyak na hindi mo kailanman naranasang mamalimos para lang may makain. Paano mo magagamit ang aral na ito sa iyong sarili?</p>\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sadyang mahirap ang walang pamilya at ito&rsquo;y napatunayan ni Adong. walang magulang at mga kapatid na nagmalasakit sa kanya sa panahon ng kanyang pangangailangan. Mapalad ka sa pagkakaroon nng pamilya kahit pa sabihing hindi perpekto ang pamilya mo. Paano mo maipapakita ang pagpapahalaga sa iyong pamilya?</p>\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mabangis na lungsod ang komunidad ni Adong, Maihahalintulad ito sa kagubatang ang mahihina ay nagiging lamang-tiyan ng mga mas malalakas at makapangyarihan. Ano ang magagawa mo upang kapag nakakita ka ng ganitong pang-aapi sa maas mahihina sa iyong paligid ay mahadlangan mo ito?</p>\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang kahirapan ay talamak hindi lang sa Quiapo kundi sa iba&rsquo;t ibang panig ng ating bansa. Kung hihintayin lang lagi ang pagkilos ng pamahalaan upang matugunan ang kahirapang ito ay matagal at malayo pa ang lalakbayin ng bayan upag ito ay maibsan. Ano ang magagawa mo sa iyong munting paraan upang makatulong sa pagsugpo ng kahirapan sa bansa?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ang mga mag-aaral ay susulat ng sariling halimbawa ng tekstong naratibo sa pamamagitan ng komiks. Ang paksa ay may kaugnayan sa pamilya, o di kaya naman sa komunidad o bansa o sarili</p>\r\n<p><strong><em>Pamantayan sa Paggawa (25 puntos)</em></strong></p>\r\n<ol>\r\n<li>Kapupulutan ng magandang asal ang tekstong naratibong nabuo.</li>\r\n<li>Malinis ang kabuuang gawa ng tekstong naratibo.</li>\r\n<li>Maliwanag at organisado ang mga pangungusap o ideya sa binuong tekstong naratibo.</li>\r\n<li>Sumasalamin sa sarili o pamilya o bansa ang nabuong teksto.</li>\r\n<li>Wasto ang pagkakagamit ng wika tulad ng bantas at wastong gamit ng mga salita</li>\r\n</ol>'),(19,50,'ARALIN 4','NARATIBO','NARATIBO','<table style=\"width: 628px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 618px;\">\r\n<p><strong>Likha mo Kwento mo!</strong></p>\r\n<p>Tatawag ang guro isang mag-aaral para magkwento ng kanyang pang-araw araw na karanasan sa buhay?</p>\r\n<p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tungkol saan ang isinadula ng kanilang pangkat?</p>\r\n<p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anong pamagat ng mga ito?</p>\r\n<p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ito ba ay isang maikling kuwento? nobela? alamat? pabula?</p>\r\n<p>d.&nbsp;&nbsp;&nbsp;&nbsp; Ano ang pinakapaborito mong kwento?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kahulugan at Katangian ng Tekstong Naratibo</strong></p>\r\n<p><strong>&hearts; </strong>Layunin ng tekstong naratibo ang magsalaysay o magkwento batay sa isang tiyak na pangyayari, totoo man o hindi. Layunin rin nitong mang-aliw o manlibang sa mga mambabasa kaya naman kahit ito\'y nakabase sa katotohanan ay higit itong nakatuon sa katotohanang may kaugnayan sa emosyonal at moral na anggulo sa halip na sa paghahanap ng katotohanan sa lahat ng detalye na kailangan pang gamitin ng pananaliksik na siya namang taglay ng isang tekstong impormatibo.</p>\r\n<p>&hearts; Ang <strong>tekstong naratibo</strong> ay nagkukuwento ng mga serye ng pangyayari na maaaring piksyon ( nobela, maikling kuwento, tula) o di fiksyon (memoir, biyograpiya, balita, maikling kuwento , sanaysay) Kapwa gumagamit ng imahinasyon, nakapagpahayag ng emosyon, kumakasangkapan ng iba\'t ibang imahen, metapora at simbolo upang maging malikhain.</p>\r\n<p><strong>Tekstong Naratibo</strong> ay pagsasalaysay o pagkukuwento ng mga pangyayari sa isang tao o mga tauhan, nangyri sa isang lugar at panahon o isang tagpuan nang maayos na pagkakasunod-sunod mula sa simula hanggang katapusan.</p>\r\n<p><strong>May iba\'t ibang Pananaw o Punto de Vista (Point of View) sa Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong> Unang Panauhan- </strong>sa pananaw na ito, isa sa mga tauhan ang nagsasalaysay ng mga bagay na kanyang nararanasan, naaalala o naririnig kaya gumagamit ng panghalip na ako. Karaniwang ginagamit ng manunulat sa pagsulat ng iba\'t ibang kuwento.</li>\r\n<li><strong> Ikalawang Panauhan- </strong>Dito mistulang kinakausap ng manunulat ang tauhang pinagagalaw niya sa kuwento kaya\'t gumagamit siya ng mga panghalip na ka o ikaw &nbsp;subalit tulad ng unang nasabi, hindi ito gaanong ginagamit &nbsp;ng mga manunulat sa kanilang pagsasalaysay.</li>\r\n<li><strong> Ikatlong Panauhan- </strong>ang mga pangyayari sa pananaw na ito ay isinasalaysay ng isang taong walang relasyon sa tauhan kaya ang panghalip na ginagamit niya sa pagsasalaysay ay<strong> siya.</strong></li>\r\n</ol>\r\n<p><strong>3 Pananaw ng ikatlong panauhan</strong></p>\r\n<ol>\r\n<li><strong> Maladiyos na panauhan- </strong>nababatid niya ang galaw at iniisip ng lahat ng mga tauhan.Napapasok niya ang isipanng bawat tauhan at naipapahayag niya ang iniisip,damdamin at paniniwala ng mga ito sa mga mambabasa.</li>\r\n<li><strong> Limitadong panauha</strong>n- nababatid niya ang iniisip at ikinikilos &nbsp;ng isa sa mga tauhan subalit hindi ang ibang tauhan.</li>\r\n<li><strong> tagaobserbang panauhan</strong>- hindi niya napapasok o nababatid ang nilalaman ng isip at damdamin ng mga tauhan. Tanging nakikita o naririnig niyang mga pangyayari , kilos o sinasabi lang ang kanyang isinasalaysay</li>\r\n<li><strong>Kombinasyong Pananaw o Paningin- </strong>Dito ay hindi lang iisa ang tagapagsalaysay kaya&rsquo;t iba&rsquo;t ibang pananaw o paningin ang nagagamit sa pagsasalaysay. Karaniwan itong nangyayari sa isang nobela kung saan ang mga pangyayari ay sumasakop sa mas mahabang panahon at mas maraming tauhan ang nagipakilala sa bawat kabanata.</li>\r\n<li>\r\n<p><strong>Mga Paraan ng Pagpapahayag ng Diyalogo, Saloobin o Damdamin sa Tekstong Naratibo.</strong></p>\r\n<ol>\r\n<li><strong>Direkta o Tuwirang Pagpapahayag</strong>.-ang tauhan ay direkta o tuwirangg nagsasaad o nagsasabi ng kanyang diyalogo, saloobin o damdamin. Ito ay ginagamitan ng panipi. Sa ganitong paraan ng pagpapahayag ay nagiging natural at lalong lumulutang ang katangiang taglay ng tauhan.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo; Donato, kakain na, Anak&rdquo; tawag ni Aling Guada sa anak na noo&rsquo;y&nbsp; abalang abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. &ldquo; Aba&rsquo;t kayganda naman nireng ginagawa mo, Anak! Ay ano ba talaga ang balak mo, ha?</p>\r\n<ol start=\"2\">\r\n<li><strong>Di direkta o Di tuwirang Pagpapahayag</strong>- ang tagapagsalaysay ang naglalahad sa sinasabi, iniisip o nararamdaman ng tauhan sa ganitong uri ng pagpapahayag. Hindi na ito ginagamitan ng panipi.</li>\r\n</ol>\r\n<p>Halimbwa: Tinawag ni Aling Guada ang anak dahil kakain na habang ito&rsquo;y abalang-abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. Sinabo niyang kayganda ng ginagawa ng anak at tinanong din niya kung ano baa ng balak niya.</p>\r\n<p><strong>&nbsp;May mga Elemento ang mga Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong>Tauhan &ndash;</strong>may dalawang paraan ng pagpapakilala ng tauhan- ang expository at ang dramatiko.</li>\r\n</ol>\r\n<p><strong>Expository</strong>- ang tagapagsalaysay ang magpapakilala o maglalarawan sa pagkatao ng tauhan</p>\r\n<p><strong>Dramatiko</strong>- kung kusang mabubunyag ang karakter dahil sa kanyang pagkilos o pagpapahayag.</p>\r\n<p><strong>Karaniwang Tauhan</strong>:</p>\r\n<ol>\r\n<li><strong>Pangunahing tauhan-</strong> tinatawag na bida, umiikot ang mga pangyayari sa kuwento mula sa simula hanggang katapusan. Karaniwang iisa lamang ang pangunahing tauhan.</li>\r\n<li><strong>Katungaling tauhan</strong>- tinatawag na kontrabida na siyang sumasalungat o kalaban ng pangunahing tauhan. Mahalaga ang papel ng tauhang ito sapagkat sa mga tunggaliang nangyayari sa pagitan nila, nabubuhay ang mga pangyayari sa kuwento at higit na napatitingkad ang mga katangian ng pangunahing tauhan.</li>\r\n<li><strong>Kasamang tauhan</strong>- gaya ng ipinahihiwatig ng katawagan , ang kasamang tauhan ay karaniwang kasama o kasangga ng pangunahing tauhan. Ang pangunahing papel o tungkulin niya ay sumuporta, magsilbing hingahan, o kapalagayang-loob ng pangunahing tauhan.</li>\r\n<li><strong>May Akda</strong>- sinasabing ang pangunahing tauhan at ang may akda ay lagi nang magkasama sa kabuoan ng akda.</li>\r\n</ol>\r\n<p><strong>Dalawang uri ng tauhan</strong></p>\r\n<ol>\r\n<li><strong>Tauhang Bilog- (</strong>round character) isang tauhang may multidimensional o maraming saklaw ang personalidad. Tulad ng isang tunay na katauhan, nagbabago ang kanyang pananaw, katangian at damdamin ayon sa pangangailangan. Ang isang tahimik at mapagtimping tauhan, halimbawa ay maaaring sumambulat kapag hinihingi ng sitwasyon o pangyayari sa kuwento.</li>\r\n<li><strong>Tauhang Lapad </strong>(flat character) ito ang tauhang nagtataglay ng iisa o dadalawang katangiang madaling matukoy o predictable.</li>\r\n</ol>\r\n<p><strong>Halimbawa</strong>; mapang-aping madrasta, mapagmahal na ina, tin-edyer na hindi sumusunod sa magulang</p>\r\n<ol start=\"2\">\r\n<li><strong>Tagpuan at Panahon-</strong> tumutukoy hindi lang sa lugar kung saan nagana pang mga pangyayari sa akda kundi gayundin sa panahon (oras, petsa, taon) at maging sa damdaming umiiral sa kapaligiran nang maganap ang mga pangyayari tulad ng kasaysayang dala ng pagdiriwang sa isang kaarawan, takot sa umiiral dahil sa malakas na hampas ng hangin at ulang dala ng bagyo, romantikong paligid sanhi ng maliwanag na buwang nakatunghay sa magkasingtahang naghahapunan sa isang hardin, matinding pagod ng magsasakang nag-aararo sa lilim na tirik na araw, kalungkutan ng pamilyang nakatunghay habang ibinababa sa kanyang huling hantungan ang isang minamahal.</li>\r\n<li><strong>Banghay-</strong> ito ang tawag sa maayos o daloy o pagkakasunod-sunod ng mga pangyayari sa mga tekstong naratibo upang mabigyang linaw ang temang taglay</li>\r\n</ol>\r\n<p>Karaniwang banghay o balangkas ng isang naratibo.</p>\r\n<ul>\r\n<li>Pagkakaroon ng isang epektibong simula kung saan maipakikilala ang mga tauhan, tagpuan at tema (orientation o introduction)</li>\r\n<li>Pagpapakilala sa suliraning ihahanap ng kalutasan ng mga tauhan particular ang pangunahing tauhan (problem)</li>\r\n<li>Pagkakaroon ng saglit na kasiglang hahantong sa pagpapakita ng aksyong gagawin ng tauhan tungo sa paglutas sa suliranin (rising action)</li>\r\n<li>Patuloy sa pagtaas ang pangyayaring humahantong sa isang resolusyon o kakalasan (falling action)</li>\r\n<li>Pagkakaroon ng isang makabuluhang wakas (ending)</li>\r\n</ul>\r\n<p>3 pagkakaayos ng banghay ayon sa anachrony</p>\r\n<ol>\r\n<ol>\r\n<li>Analepsis (Flashback) dito ipinapasok ang mga pangyayaring naganap sa nakalipas</li>\r\n<li>Prolepsis (Flash-forward) ditto nama&rsquo;y ipinapasok ang mga pangyayaring magaganap pa lang sa hinaharap</li>\r\n<li>Ellipsis &ndash; may mga puwang o patlang sa pagkakasunod-sunod ng mga pangyayari na nagpapakitang may bahagi sa pagsasalaysay sa tinanggal o hindi isinama.</li>\r\n<li>Paksa o Tema- ito ang sentral na ideya kung saan umiikot ang mga pangyayari sa tekstong naratibo. Mahalagang malinang ito nang husto sa kabuoan ng akda upang mapalutang ng may akda ang pinakamahalagang mensaheng nais na niyang iparating sa kanyang mambabasa.</li>\r\n</ol>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><strong>GAWAIN I- Isigaw ang salitang Pawer kung ang pahayag ay tekstong naratibo.</strong></p>\r\n<p><strong>Sagutin ang mga katanungan.</strong></p>\r\n<ol>\r\n<li>Bigla akong napatigil sa aking paglalakad nakita ko ang isang anino na papalapit sa akin. Pilit kong huwag matakot pero nakita ko may hawak siyang patalim. Nanginig ako sa takot kaya naman tumatakbo ako ng matulin. Hanggang marating ko ang aming bahay. Napaiyak ako ng sobra dahil sa pangambang napahamak ako ng oras na iyon. Napaisip ako sa nangyari kung hindi sana ako umalis ng bahay namin hindi sana nangyari sa akin ito. Panglawang buhay ko na maituturing ang aking naranasan . Niyakap ko ang aking ina habang umiiyak na hindi ko masagot ang kanyang mga tanong dahil hindi niya alam na tumakas ako at naglakwatsa.</li>\r\n</ol>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento?</li>\r\n</ol>\r\n<p>&nbsp;2. Walang imposible sa Diyos (Panoorin ang video)</p>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento</li>\r\n</ol>\r\n<p><strong>Ipaliwanag:</strong></p>\r\n<p>&ldquo;Tiyak na maraming aliw at saya para sa mga mahilig magbasa,</p>\r\n<p>Mga tekstong naratibo&rsquo;y di lang nakalilibang kundi may aral pang dala.&rdquo;</p>\r\n<p><strong>Gawain 2 Basahin ang tekstong \"Mabangis na Lungsod\"</strong></p>\r\n<table style=\"width: 928px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 918px;\">\r\n<p>Ano ang paksa o temang tinalakay ng akda? Tukuyin at lagyan ng tsek (&radic;) ang sagot mo at saka ipaliwanag ang napiling sagot.</p>\r\n<p>__ Dapat lang maparusahan ang mga taong nang-api sa kapwa.</p>\r\n<p>__ Dapat gumawa ang pamahalaan ng makakaya upang maibsan ang kahirapan sa iba&rsquo;t ibang bahagi ng bansa.</p>\r\n<p>__ Mananatiling biktima ang mahihina hanggat nagbubulag-bulagan ang lipunan sa ganitong kalakaran.</p>\r\n<p>__ Nangangailangan ng kandili at pagmamahal ang mga batang walang magulang.</p>\r\n<p>__ Walang mang-aalipin kung walang magpapaalipin.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 926px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 916px;\">\r\n<p>Paano mo iuugnay ang mga aral sa tekstong naratibo sa iyong sarili, pamilya, komunidad o at bansa?</p>\r\n<p>&nbsp;</p>\r\n<p>Mga Katanungan:</p>\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nakita moa ng paghihirap ni Adong para lamang makaipon ng mga baryang inililimos upang may maipanlaman sa kumakalam na sikmura. Tiyak na hindi mo kailanman naranasang mamalimos para lang may makain. Paano mo magagamit ang aral na ito sa iyong sarili?</p>\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sadyang mahirap ang walang pamilya at ito&rsquo;y napatunayan ni Adong. walang magulang at mga kapatid na nagmalasakit sa kanya sa panahon ng kanyang pangangailangan. Mapalad ka sa pagkakaroon nng pamilya kahit pa sabihing hindi perpekto ang pamilya mo. Paano mo maipapakita ang pagpapahalaga sa iyong pamilya?</p>\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mabangis na lungsod ang komunidad ni Adong, Maihahalintulad ito sa kagubatang ang mahihina ay nagiging lamang-tiyan ng mga mas malalakas at makapangyarihan. Ano ang magagawa mo upang kapag nakakita ka ng ganitong pang-aapi sa maas mahihina sa iyong paligid ay mahadlangan mo ito?</p>\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang kahirapan ay talamak hindi lang sa Quiapo kundi sa iba&rsquo;t ibang panig ng ating bansa. Kung hihintayin lang lagi ang pagkilos ng pamahalaan upang matugunan ang kahirapang ito ay matagal at malayo pa ang lalakbayin ng bayan upag ito ay maibsan. Ano ang magagawa mo sa iyong munting paraan upang makatulong sa pagsugpo ng kahirapan sa bansa?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ang mga mag-aaral ay susulat ng sariling halimbawa ng tekstong naratibo sa pamamagitan ng komiks. Ang paksa ay may kaugnayan sa pamilya, o di kaya naman sa komunidad o bansa o sarili</p>\r\n<p><strong><em>Pamantayan sa Paggawa (25 puntos)</em></strong></p>\r\n<ol>\r\n<li>Kapupulutan ng magandang asal ang tekstong naratibong nabuo.</li>\r\n<li>Malinis ang kabuuang gawa ng tekstong naratibo.</li>\r\n<li>Maliwanag at organisado ang mga pangungusap o ideya sa binuong tekstong naratibo.</li>\r\n<li>Sumasalamin sa sarili o pamilya o bansa ang nabuong teksto.</li>\r\n<li>Wasto ang pagkakagamit ng wika tulad ng bantas at wastong gamit ng mga salita</li>\r\n</ol>'),(20,47,'ARALIN 3','PERSWEYSIB','PERSWEYSIB','<p>mayroon ka ba bang natatandaan mga linya sa patalastas na tumatak sa iyong isipan&nbsp; at humikayat sa iyong bumili ng produkto? Ibahagi sa klase ang iyong nalalaman?_______________</p>\r\n<p>Masasabi mo bang naging epektbo ang paaan ng panghihikayat kaya tumatatak sa iyong isipan at humikaya sa iyong bumili?</p>\r\n<p>____________________________________________________________________________________________</p>\r\n<p><strong>ALAM MO BA?</strong></p>\r\n<p>Mga Propaganda Device</p>\r\n<ol>\r\n<li><strong>NAME CALLING </strong>&ndash; Ito ay may pagbibigay ng hindi magandang taguri sa isang produkto o katunggaling politiko upang hindi tangkilikin. Karaniwang ginagamit ito sa mundo ng politiko.</li>\r\n</ol>\r\n<p><strong>HALIMBAWA: </strong>ang pekeng sabon, bagitong kandidato,tropa( traditional politician)</p>\r\n<ol start=\"2\">\r\n<li><strong>GLITTERING GENERALITIES </strong>&ndash; Ito ay ang magaganda at nakakasilaw na pahayag ukol sa isang produktong tumutugon sa mga paniniwala at pagpapahalaga ng mambabasa.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Mas makatitipid sa bagong ________. Ang iyong damit ay mas magiging maputi sa _________ puting puti. Bossing sa kaputian.</p>\r\n<ol start=\"3\">\r\n<li><strong>TRANSFER </strong>&ndash; Ang paggamit ng isang sikat na personalidad upang mailipat sa isang produkto o tao ang kasikatan.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Ipagpapatuloy ko ang sinimulan ni<strong> FPJ. &ndash; Grace Poe ; </strong>Manny Pacquaio gumagamit ng ________ kapag nasasaktan<strong>.</strong></p>\r\n<ol start=\"4\">\r\n<li><strong>TESTIMONIAL &ndash; </strong>Kapag ang isang sikat na personalidad ay tuwirang nag-endorso ng isang tao o produkto.</li>\r\n</ol>\r\n<ol start=\"5\">\r\n<li><strong>PLAIN FOLKS &ndash; </strong>Karaniwan itong ginagamit sa kampanya o komersiyal kung saan ang mga kilala o tanyag na tao ay pinalalabas na ordinaryong taong nanghihikayat sa boto, produkto, o serbisyo.</li>\r\n</ol>\r\n<ol start=\"6\">\r\n<li><strong>CARD STACKING</strong> &ndash; Ipinakikita nito ang lahat ng magagandang katangian ng produkto ngunit hindi binabanggit ang hindi magandang katangian. <strong>HALIMBAWA:</strong> Ang instant noodles na ito ay nakapagbubuklod ng pamilya, nakatitipid ng oras , mura na , masarap pa.( Ngunit hindi nito sinasabing kakaunti lang ang sustansiyang taglay, maraming tagong asin at kung araw-araw itong kakainin ay maaring magdulot ng sakit.)</li>\r\n</ol>\r\n<ol start=\"7\">\r\n<li>BANDWAGON &ndash; Panghihikayat kung saan hinihimok ang lahat na gamitin ang isang produkto o sumali sa isang pangkat dahil ang lahat ay sumali na. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;HALIMBAWA: Buong bayan ay nag-peso padala na.</li>\r\n</ol>\r\n<p><strong>ANG TEKSTONG PERSUWEYSIB</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Layunin ng isang tekstong&nbsp; persuweysib ang manghikayat sa babasa ng teksto. Isinusulat ang tekstong persuweysib uapng mabago ang takbo ng isip ng mambabasa at makumbinsi na ang punto ng manunulat, at hindi sa iba, ang siyang tama.Hinihikayat din nito ang mambabasang tanggapin ang posisyong pinaniniwalaan o ineendorso ng teksto.</p>\r\n<p><strong>TEKSTONG PERSUWEYSIB </strong></p>\r\n<p>-ay may subhetibong tono sapagkat malayang ipinahahayag ng manunulat ang kanyang paniniwala at pagkiling tungkol sa isang isyung may ilang panig.Taglay nito ang personal na opinyon at paniniwala ng may akda.</p>\r\n<p>Inilarawan ng Griyegong pilosopona si Aristotle ang tatlong paraan ng panghihikayat o pangungumbinsi .Ito ang mga sumusunod:</p>\r\n<p><strong>ETHOS</strong></p>\r\n<p><strong>-</strong>Ito ay tumutukoy sa kredibilidad ng isang manunulat.Dapat makumbinsi ng isang manunulat ang mambabasa na siya ay may malawak na kaalaman at karanasan tungkol sa kanyang sinusulat, kung hindi ay baka hindi sila mahikayat na maniwala rito.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang isang taong nanghihikayat ng mga turista upang bisitahin ang isang isla sa pilipinas gayong hindi pa sya nakakapunta rito ay maaaring maging kaduda-duda.Gayunpaman, may iba pang paraan upang magkaroon ng kredibilida.</p>\r\n<ul>\r\n<li>Ang estilo ng pagsulat ay mahalaga upang magkaroon ng kredibilidad.</li>\r\n<li>Dapat na masulat nang malinaw at wasto ang teksto upang lumabas na hitik sa kaalaman at mahusay ang sumusulat.Ang paraan ng pagsisipi ng sanggunian ay maaaring makatulong sa pagpapatibay ng kredibilidad.Kailangang mapatunayan sa mga mambabasa na ang mga datos at impormasyon ay wasto at napapanahon upang makumbinsi na ang isinulat ay tama at mapagkakatiwalaan.</li>\r\n</ul>\r\n<p><strong>PATHOS</strong></p>\r\n<p><strong>-</strong>Tumutukoy ito sa gamit ng emosyon o damdamin upang mahikayat ang mambabasa.Ayon kay Aristotle,karamihan sa mga mambabasa ay madaling madala ng kanilang emosyon.Ang paggamit ng pagpapahalaga at paniniwala ng mambabasa ay isang ay isang epektibong paraan upang makumbinsi sila.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang pagsasalaysay ng isang kuwentong makakaantig ng galit o awa ay isang mabisang paraan upang mahikayat silang pumanig sa manunulat.</p>\r\n<p><strong>LOGOS</strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp; -</strong>Ito ay tumutukoy sa gamit ng lohika upang makumbinsi ang mambabasa.Kailangang mapatunayan ng manunulat sa mga mambabasa na batay sa mga impormasyon at datos na kanyang inilatag ang kanyang pananaw o punto ang siyang dapat paniwalaan.Gayunpaman,isa sa mga madalas na pagkakamali ng mga manunulat ang paggamit ng<strong> <em>ad hominem fallacy</em></strong>, kung saan ang manunulat ay sumasalungat sa personalidad ng katunggali at hindi sa pinaniniwalaan nito.</p>\r\n<table style=\"width: 729px; height: 208px;\" width=\"1153\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 719px;\">\r\n<p><strong>GAWAIN I</strong></p>\r\n<p>Tukuyin ang katangian ng tekstong persuweysib</p>\r\n<p>Lagyan ng (/) tsek ang mga pahayag na naglalarawan ng tekstong persweysib. Ekis (x) naman ang ilagay kung hindi.</p>\r\n<ol>\r\n<li>Layunin ng teksto ang mahikayat o makumbinsi ang babasa.</li>\r\n<li>Nais nitong mabago ang takbo ng isip ng mambabasa at tanggapin ang posisyon ng may-akda</li>\r\n<li>Karaniwang obhetibo ang tono ng tekstong persuweysib</li>\r\n<li>Naglalarawan ito ng katangian at kalikasan ng paksa</li>\r\n<li>Isinaalang-alang nito ang uri ng mambabasa upang mahikayat silang pumanig sa manunulat.</li>\r\n</ol>\r\n<p><strong>&nbsp;Basahin ang pahayag na bahagi ng isang tekstong persweysib. Tukuyin kung anong paraan ng panghihikayat ang ginamit. Isulat kung ito ethos, pathos o logos. Pagkatapos, isulat ang paliwanag kung bakit ito ang paraang napili. (10 pts)</strong></p>\r\n<p>Doon&nbsp; nagsimula ang buhay ko bilang lingkod-bayan. Sa maraming taon sa serbisyo, namulat ako sa mga hamon , sa requirements, sa tama at makaturangang diskarte at pagpaplano para masigurong aabot sa taumbayan ang nararapat na serbisyo. Kasama dito ang pagpapasa ng makabuluhang batas, ang pagpapatibay ng ugnayan sa pribadong sektor, ang pagbuo ng concensus na patas, kung saan tanging taumbayan lang ang panalo.</p>\r\n<p>Sa pagiging lingkod-bayan, ang pinakamahalagang natutunan ko -sa pagpunta ko sa iba\'t ibang&nbsp; mga lalawigan, at sa pakikipag-usap ko sa mga kapwa nating Pilipino, magsasaka man o informal settler , nagtatrabho sa call center o ordinaryong mamamayan: Binigkas tayo ng ating mga pangarap. Hindi iba ang pangarap ko sa pangrap ng bawat Pilipino; I wish for the Filipino people only what I would wish for myselp, after all, who are we if not our dream?</p>\r\n<p>mula sa talumpati ni DILG Sec Mar Roxas</p>\r\n<p>Paraan ng panghihikayat: __________________________________</p>\r\n<p>Paliwanag : ______________________________________________</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"height: 250px; width: 732px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 250px;\">\r\n<td style=\"height: 250px; width: 722px;\">\r\n<p><strong>GAWAIN II (5 PTS)</strong></p>\r\n<p>Magbigay reaksyon sa maraming mga produkto, balita, propaganda at maging politiko na nakilala natin dahil sa matatamis ang kanilang dila at mahusay maghabi ng salita. Sa madaling salita mahusay silang manghikayat at mangumbinsi, hindi tuloy natin alam kung ano talaga ang totoo at dapat paniwalaan. Mayroon ka bang tatandaang ganitong tekstong persweysib.</p>\r\n<p>Isulat sa isang buong papel ang iyong sagot. Pagkatapos ay sagutin ang sumusunod na tanong.</p>\r\n<ol>\r\n<li>Sa unang pagkakaataong nabasa mo ito, nagdududa k aba agad? Ipaliwanag ang iyong sagot?</li>\r\n<li>Ano-anong dahilan ang iyong naisip at hindi ka nakumbinsi ng tekstong ito?</li>\r\n<li>Sa ngayon ay laganap pa rin ang mga tekstong persweysib na nagtataglay ng mga huwad na pangako na nagliligaw sa madla. Sa iyong palagay, ano ang nararapat mong gawin bilag isang mapanuring mambabasa o matalinong botante at mamimili.</li>\r\n<li>Anong aral ang iyong natutunan at nais ibahagi sa iba pagdating sa mga ganitong uri ng teksto</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>PANGKATANG GAWAIN</strong></p>\r\n<table style=\"width: 841px; height: 940px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 940px;\">\r\n<td style=\"width: 831px; height: 940px;\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table style=\"width: 268px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"198\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Hindi malinaw ang isinulat na tagline. Maligoy at hindi gumamit ng paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),(21,47,'ARALIN4','NARATIBO','NARATIBO','<table style=\"width: 628px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 618px;\">\r\n<p><strong>ha mo Kwento mo!</strong></p>\r\n<p>Tatawag ang guro isang mag-aaral para magkwento ng kanyang pang-araw araw na karanasan sa buhay?</p>\r\n<p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tungkol saan ang isinadula ng kanilang pangkat?</p>\r\n<p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anong pamagat ng mga ito?</p>\r\n<p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ito ba ay isang maikling kuwento? nobela? alamat? pabula?</p>\r\n<p>d.&nbsp;&nbsp;&nbsp;&nbsp; Ano ang pinakapaborito mong kwento?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kahulugan at Katangian ng Tekstong Naratibo</strong></p>\r\n<p><strong>&hearts; </strong>Layunin ng tekstong naratibo ang magsalaysay o magkwento batay sa isang tiyak na pangyayari, totoo man o hindi. Layunin rin nitong mang-aliw o manlibang sa mga mambabasa kaya naman kahit ito\'y nakabase sa katotohanan ay higit itong nakatuon sa katotohanang may kaugnayan sa emosyonal at moral na anggulo sa halip na sa paghahanap ng katotohanan sa lahat ng detalye na kailangan pang gamitin ng pananaliksik na siya namang taglay ng isang tekstong impormatibo.</p>\r\n<p>&hearts; Ang <strong>tekstong naratibo</strong> ay nagkukuwento ng mga serye ng pangyayari na maaaring piksyon ( nobela, maikling kuwento, tula) o di fiksyon (memoir, biyograpiya, balita, maikling kuwento , sanaysay) Kapwa gumagamit ng imahinasyon, nakapagpahayag ng emosyon, kumakasangkapan ng iba\'t ibang imahen, metapora at simbolo upang maging malikhain.</p>\r\n<p><strong>Tekstong Naratibo</strong> ay pagsasalaysay o pagkukuwento ng mga pangyayari sa isang tao o mga tauhan, nangyri sa isang lugar at panahon o isang tagpuan nang maayos na pagkakasunod-sunod mula sa simula hanggang katapusan.</p>\r\n<p><strong>May iba\'t ibang Pananaw o Punto de Vista (Point of View) sa Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong> Unang Panauhan- </strong>sa pananaw na ito, isa sa mga tauhan ang nagsasalaysay ng mga bagay na kanyang nararanasan, naaalala o naririnig kaya gumagamit ng panghalip na ako. Karaniwang ginagamit ng manunulat sa pagsulat ng iba\'t ibang kuwento.</li>\r\n<li><strong> Ikalawang Panauhan- </strong>Dito mistulang kinakausap ng manunulat ang tauhang pinagagalaw niya sa kuwento kaya\'t gumagamit siya ng mga panghalip na ka o ikaw &nbsp;subalit tulad ng unang nasabi, hindi ito gaanong ginagamit &nbsp;ng mga manunulat sa kanilang pagsasalaysay.</li>\r\n<li><strong> Ikatlong Panauhan- </strong>ang mga pangyayari sa pananaw na ito ay isinasalaysay ng isang taong walang relasyon sa tauhan kaya ang panghalip na ginagamit niya sa pagsasalaysay ay<strong> siya.</strong></li>\r\n</ol>\r\n<p><strong>3 Pananaw ng ikatlong panauhan</strong></p>\r\n<ol>\r\n<li><strong> Maladiyos na panauhan- </strong>nababatid niya ang galaw at iniisip ng lahat ng mga tauhan.Napapasok niya ang isipanng bawat tauhan at naipapahayag niya ang iniisip,damdamin at paniniwala ng mga ito sa mga mambabasa.</li>\r\n<li><strong> Limitadong panauha</strong>n- nababatid niya ang iniisip at ikinikilos &nbsp;ng isa sa mga tauhan subalit hindi ang ibang tauhan.</li>\r\n<li><strong> tagaobserbang panauhan</strong>- hindi niya napapasok o nababatid ang nilalaman ng isip at damdamin ng mga tauhan. Tanging nakikita o naririnig niyang mga pangyayari , kilos o sinasabi lang ang kanyang isinasalaysay</li>\r\n<li><strong>Kombinasyong Pananaw o Paningin- </strong>Dito ay hindi lang iisa ang tagapagsalaysay kaya&rsquo;t iba&rsquo;t ibang pananaw o paningin ang nagagamit sa pagsasalaysay. Karaniwan itong nangyayari sa isang nobela kung saan ang mga pangyayari ay sumasakop sa mas mahabang panahon at mas maraming tauhan ang nagipakilala sa bawat kabanata.</li>\r\n<li>\r\n<p><strong>Mga Paraan ng Pagpapahayag ng Diyalogo, Saloobin o Damdamin sa Tekstong Naratibo.</strong></p>\r\n<ol>\r\n<li><strong>Direkta o Tuwirang Pagpapahayag</strong>.-ang tauhan ay direkta o tuwirangg nagsasaad o nagsasabi ng kanyang diyalogo, saloobin o damdamin. Ito ay ginagamitan ng panipi. Sa ganitong paraan ng pagpapahayag ay nagiging natural at lalong lumulutang ang katangiang taglay ng tauhan.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo; Donato, kakain na, Anak&rdquo; tawag ni Aling Guada sa anak na noo&rsquo;y&nbsp; abalang abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. &ldquo; Aba&rsquo;t kayganda naman nireng ginagawa mo, Anak! Ay ano ba talaga ang balak mo, ha?</p>\r\n<ol start=\"2\">\r\n<li><strong>Di direkta o Di tuwirang Pagpapahayag</strong>- ang tagapagsalaysay ang naglalahad sa sinasabi, iniisip o nararamdaman ng tauhan sa ganitong uri ng pagpapahayag. Hindi na ito ginagamitan ng panipi.</li>\r\n</ol>\r\n<p>Halimbwa: Tinawag ni Aling Guada ang anak dahil kakain na habang ito&rsquo;y abalang-abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. Sinabo niyang kayganda ng ginagawa ng anak at tinanong din niya kung ano baa ng balak niya.</p>\r\n<p><strong>&nbsp;May mga Elemento ang mga Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong>Tauhan &ndash;</strong>may dalawang paraan ng pagpapakilala ng tauhan- ang expository at ang dramatiko.</li>\r\n</ol>\r\n<p><strong>Expository</strong>- ang tagapagsalaysay ang magpapakilala o maglalarawan sa pagkatao ng tauhan</p>\r\n<p><strong>Dramatiko</strong>- kung kusang mabubunyag ang karakter dahil sa kanyang pagkilos o pagpapahayag.</p>\r\n<p><strong>Karaniwang Tauhan</strong>:</p>\r\n<ol>\r\n<li><strong>Pangunahing tauhan-</strong> tinatawag na bida, umiikot ang mga pangyayari sa kuwento mula sa simula hanggang katapusan. Karaniwang iisa lamang ang pangunahing tauhan.</li>\r\n<li><strong>Katungaling tauhan</strong>- tinatawag na kontrabida na siyang sumasalungat o kalaban ng pangunahing tauhan. Mahalaga ang papel ng tauhang ito sapagkat sa mga tunggaliang nangyayari sa pagitan nila, nabubuhay ang mga pangyayari sa kuwento at higit na napatitingkad ang mga katangian ng pangunahing tauhan.</li>\r\n<li><strong>Kasamang tauhan</strong>- gaya ng ipinahihiwatig ng katawagan , ang kasamang tauhan ay karaniwang kasama o kasangga ng pangunahing tauhan. Ang pangunahing papel o tungkulin niya ay sumuporta, magsilbing hingahan, o kapalagayang-loob ng pangunahing tauhan.</li>\r\n<li><strong>May Akda</strong>- sinasabing ang pangunahing tauhan at ang may akda ay lagi nang magkasama sa kabuoan ng akda.</li>\r\n</ol>\r\n<p><strong>Dalawang uri ng tauhan</strong></p>\r\n<ol>\r\n<li><strong>Tauhang Bilog- (</strong>round character) isang tauhang may multidimensional o maraming saklaw ang personalidad. Tulad ng isang tunay na katauhan, nagbabago ang kanyang pananaw, katangian at damdamin ayon sa pangangailangan. Ang isang tahimik at mapagtimping tauhan, halimbawa ay maaaring sumambulat kapag hinihingi ng sitwasyon o pangyayari sa kuwento.</li>\r\n<li><strong>Tauhang Lapad </strong>(flat character) ito ang tauhang nagtataglay ng iisa o dadalawang katangiang madaling matukoy o predictable.</li>\r\n</ol>\r\n<p><strong>Halimbawa</strong>; mapang-aping madrasta, mapagmahal na ina, tin-edyer na hindi sumusunod sa magulang</p>\r\n<ol start=\"2\">\r\n<li><strong>Tagpuan at Panahon-</strong> tumutukoy hindi lang sa lugar kung saan nagana pang mga pangyayari sa akda kundi gayundin sa panahon (oras, petsa, taon) at maging sa damdaming umiiral sa kapaligiran nang maganap ang mga pangyayari tulad ng kasaysayang dala ng pagdiriwang sa isang kaarawan, takot sa umiiral dahil sa malakas na hampas ng hangin at ulang dala ng bagyo, romantikong paligid sanhi ng maliwanag na buwang nakatunghay sa magkasingtahang naghahapunan sa isang hardin, matinding pagod ng magsasakang nag-aararo sa lilim na tirik na araw, kalungkutan ng pamilyang nakatunghay habang ibinababa sa kanyang huling hantungan ang isang minamahal.</li>\r\n<li><strong>Banghay-</strong> ito ang tawag sa maayos o daloy o pagkakasunod-sunod ng mga pangyayari sa mga tekstong naratibo upang mabigyang linaw ang temang taglay</li>\r\n</ol>\r\n<p>Karaniwang banghay o balangkas ng isang naratibo.</p>\r\n<ul>\r\n<li>Pagkakaroon ng isang epektibong simula kung saan maipakikilala ang mga tauhan, tagpuan at tema (orientation o introduction)</li>\r\n<li>Pagpapakilala sa suliraning ihahanap ng kalutasan ng mga tauhan particular ang pangunahing tauhan (problem)</li>\r\n<li>Pagkakaroon ng saglit na kasiglang hahantong sa pagpapakita ng aksyong gagawin ng tauhan tungo sa paglutas sa suliranin (rising action)</li>\r\n<li>Patuloy sa pagtaas ang pangyayaring humahantong sa isang resolusyon o kakalasan (falling action)</li>\r\n<li>Pagkakaroon ng isang makabuluhang wakas (ending)</li>\r\n</ul>\r\n<p>3 pagkakaayos ng banghay ayon sa anachrony</p>\r\n<ol>\r\n<ol>\r\n<li>Analepsis (Flashback) dito ipinapasok ang mga pangyayaring naganap sa nakalipas</li>\r\n<li>Prolepsis (Flash-forward) ditto nama&rsquo;y ipinapasok ang mga pangyayaring magaganap pa lang sa hinaharap</li>\r\n<li>Ellipsis &ndash; may mga puwang o patlang sa pagkakasunod-sunod ng mga pangyayari na nagpapakitang may bahagi sa pagsasalaysay sa tinanggal o hindi isinama.</li>\r\n<li>Paksa o Tema- ito ang sentral na ideya kung saan umiikot ang mga pangyayari sa tekstong naratibo. Mahalagang malinang ito nang husto sa kabuoan ng akda upang mapalutang ng may akda ang pinakamahalagang mensaheng nais na niyang iparating sa kanyang mambabasa.</li>\r\n</ol>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><strong>GAWAIN I- Isigaw ang salitang Pawer kung ang pahayag ay tekstong naratibo.</strong></p>\r\n<p><strong>Sagutin ang mga katanungan.</strong></p>\r\n<ol>\r\n<li>Bigla akong napatigil sa aking paglalakad nakita ko ang isang anino na papalapit sa akin. Pilit kong huwag matakot pero nakita ko may hawak siyang patalim. Nanginig ako sa takot kaya naman tumatakbo ako ng matulin. Hanggang marating ko ang aming bahay. Napaiyak ako ng sobra dahil sa pangambang napahamak ako ng oras na iyon. Napaisip ako sa nangyari kung hindi sana ako umalis ng bahay namin hindi sana nangyari sa akin ito. Panglawang buhay ko na maituturing ang aking naranasan . Niyakap ko ang aking ina habang umiiyak na hindi ko masagot ang kanyang mga tanong dahil hindi niya alam na tumakas ako at naglakwatsa.</li>\r\n</ol>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento?</li>\r\n</ol>\r\n<p>&nbsp;2. Walang imposible sa Diyos (Panoorin ang video)</p>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento</li>\r\n</ol>\r\n<p><strong>Ipaliwanag:</strong></p>\r\n<p>&ldquo;Tiyak na maraming aliw at saya para sa mga mahilig magbasa,</p>\r\n<p>Mga tekstong naratibo&rsquo;y di lang nakalilibang kundi may aral pang dala.&rdquo;</p>\r\n<p><strong>Gawain 2 Basahin ang tekstong \"Mabangis na Lungsod\"</strong></p>\r\n<table style=\"width: 928px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 918px;\">\r\n<p>Ano ang paksa o temang tinalakay ng akda? Tukuyin at lagyan ng tsek (&radic;) ang sagot mo at saka ipaliwanag ang napiling sagot.</p>\r\n<p>__ Dapat lang maparusahan ang mga taong nang-api sa kapwa.</p>\r\n<p>__ Dapat gumawa ang pamahalaan ng makakaya upang maibsan ang kahirapan sa iba&rsquo;t ibang bahagi ng bansa.</p>\r\n<p>__ Mananatiling biktima ang mahihina hanggat nagbubulag-bulagan ang lipunan sa ganitong kalakaran.</p>\r\n<p>__ Nangangailangan ng kandili at pagmamahal ang mga batang walang magulang.</p>\r\n<p>__ Walang mang-aalipin kung walang magpapaalipin.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 926px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 916px;\">\r\n<p>Paano mo iuugnay ang mga aral sa tekstong naratibo sa iyong sarili, pamilya, komunidad o at bansa?</p>\r\n<p>&nbsp;</p>\r\n<p>Mga Katanungan:</p>\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nakita moa ng paghihirap ni Adong para lamang makaipon ng mga baryang inililimos upang may maipanlaman sa kumakalam na sikmura. Tiyak na hindi mo kailanman naranasang mamalimos para lang may makain. Paano mo magagamit ang aral na ito sa iyong sarili?</p>\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sadyang mahirap ang walang pamilya at ito&rsquo;y napatunayan ni Adong. walang magulang at mga kapatid na nagmalasakit sa kanya sa panahon ng kanyang pangangailangan. Mapalad ka sa pagkakaroon nng pamilya kahit pa sabihing hindi perpekto ang pamilya mo. Paano mo maipapakita ang pagpapahalaga sa iyong pamilya?</p>\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mabangis na lungsod ang komunidad ni Adong, Maihahalintulad ito sa kagubatang ang mahihina ay nagiging lamang-tiyan ng mga mas malalakas at makapangyarihan. Ano ang magagawa mo upang kapag nakakita ka ng ganitong pang-aapi sa maas mahihina sa iyong paligid ay mahadlangan mo ito?</p>\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang kahirapan ay talamak hindi lang sa Quiapo kundi sa iba&rsquo;t ibang panig ng ating bansa. Kung hihintayin lang lagi ang pagkilos ng pamahalaan upang matugunan ang kahirapang ito ay matagal at malayo pa ang lalakbayin ng bayan upag ito ay maibsan. Ano ang magagawa mo sa iyong munting paraan upang makatulong sa pagsugpo ng kahirapan sa bansa?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ang mga mag-aaral ay susulat ng sariling halimbawa ng tekstong naratibo sa pamamagitan ng komiks. Ang paksa ay may kaugnayan sa pamilya, o di kaya naman sa komunidad o bansa o sarili</p>\r\n<p><strong><em>Pamantayan sa Paggawa (25 puntos)</em></strong></p>\r\n<ol>\r\n<li>Kapupulutan ng magandang asal ang tekstong naratibong nabuo.</li>\r\n<li>Malinis ang kabuuang gawa ng tekstong naratibo.</li>\r\n<li>Maliwanag at organisado ang mga pangungusap o ideya sa binuong tekstong naratibo.</li>\r\n<li>Sumasalamin sa sarili o pamilya o bansa ang nabuong teksto.</li>\r\n<li>Wasto ang pagkakagamit ng wika tulad ng bantas at wastong gamit ng mga salita</li>\r\n</ol>'),(22,47,'ARALIN 4','NARATIBO','NARATIBO','<table style=\"width: 628px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 618px;\">\r\n<p><strong>Likha mo Kwento mo!</strong></p>\r\n<p>Tatawag ang guro isang mag-aaral para magkwento ng kanyang pang-araw araw na karanasan sa buhay?</p>\r\n<p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tungkol saan ang isinadula ng kanilang pangkat?</p>\r\n<p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anong pamagat ng mga ito?</p>\r\n<p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ito ba ay isang maikling kuwento? nobela? alamat? pabula?</p>\r\n<p>d.&nbsp;&nbsp;&nbsp;&nbsp; Ano ang pinakapaborito mong kwento?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kahulugan at Katangian ng Tekstong Naratibo</strong></p>\r\n<p><strong>&hearts; </strong>Layunin ng tekstong naratibo ang magsalaysay o magkwento batay sa isang tiyak na pangyayari, totoo man o hindi. Layunin rin nitong mang-aliw o manlibang sa mga mambabasa kaya naman kahit ito\'y nakabase sa katotohanan ay higit itong nakatuon sa katotohanang may kaugnayan sa emosyonal at moral na anggulo sa halip na sa paghahanap ng katotohanan sa lahat ng detalye na kailangan pang gamitin ng pananaliksik na siya namang taglay ng isang tekstong impormatibo.</p>\r\n<p>&hearts; Ang <strong>tekstong naratibo</strong> ay nagkukuwento ng mga serye ng pangyayari na maaaring piksyon ( nobela, maikling kuwento, tula) o di fiksyon (memoir, biyograpiya, balita, maikling kuwento , sanaysay) Kapwa gumagamit ng imahinasyon, nakapagpahayag ng emosyon, kumakasangkapan ng iba\'t ibang imahen, metapora at simbolo upang maging malikhain.</p>\r\n<p><strong>Tekstong Naratibo</strong> ay pagsasalaysay o pagkukuwento ng mga pangyayari sa isang tao o mga tauhan, nangyri sa isang lugar at panahon o isang tagpuan nang maayos na pagkakasunod-sunod mula sa simula hanggang katapusan.</p>\r\n<p><strong>May iba\'t ibang Pananaw o Punto de Vista (Point of View) sa Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong> Unang Panauhan- </strong>sa pananaw na ito, isa sa mga tauhan ang nagsasalaysay ng mga bagay na kanyang nararanasan, naaalala o naririnig kaya gumagamit ng panghalip na ako. Karaniwang ginagamit ng manunulat sa pagsulat ng iba\'t ibang kuwento.</li>\r\n<li><strong> Ikalawang Panauhan- </strong>Dito mistulang kinakausap ng manunulat ang tauhang pinagagalaw niya sa kuwento kaya\'t gumagamit siya ng mga panghalip na ka o ikaw &nbsp;subalit tulad ng unang nasabi, hindi ito gaanong ginagamit &nbsp;ng mga manunulat sa kanilang pagsasalaysay.</li>\r\n<li><strong> Ikatlong Panauhan- </strong>ang mga pangyayari sa pananaw na ito ay isinasalaysay ng isang taong walang relasyon sa tauhan kaya ang panghalip na ginagamit niya sa pagsasalaysay ay<strong> siya.</strong></li>\r\n</ol>\r\n<p><strong>3 Pananaw ng ikatlong panauhan</strong></p>\r\n<ol>\r\n<li><strong> Maladiyos na panauhan- </strong>nababatid niya ang galaw at iniisip ng lahat ng mga tauhan.Napapasok niya ang isipanng bawat tauhan at naipapahayag niya ang iniisip,damdamin at paniniwala ng mga ito sa mga mambabasa.</li>\r\n<li><strong> Limitadong panauha</strong>n- nababatid niya ang iniisip at ikinikilos &nbsp;ng isa sa mga tauhan subalit hindi ang ibang tauhan.</li>\r\n<li><strong> tagaobserbang panauhan</strong>- hindi niya napapasok o nababatid ang nilalaman ng isip at damdamin ng mga tauhan. Tanging nakikita o naririnig niyang mga pangyayari , kilos o sinasabi lang ang kanyang isinasalaysay</li>\r\n<li><strong>Kombinasyong Pananaw o Paningin- </strong>Dito ay hindi lang iisa ang tagapagsalaysay kaya&rsquo;t iba&rsquo;t ibang pananaw o paningin ang nagagamit sa pagsasalaysay. Karaniwan itong nangyayari sa isang nobela kung saan ang mga pangyayari ay sumasakop sa mas mahabang panahon at mas maraming tauhan ang nagipakilala sa bawat kabanata.</li>\r\n<li>\r\n<p><strong>Mga Paraan ng Pagpapahayag ng Diyalogo, Saloobin o Damdamin sa Tekstong Naratibo.</strong></p>\r\n<ol>\r\n<li><strong>Direkta o Tuwirang Pagpapahayag</strong>.-ang tauhan ay direkta o tuwirangg nagsasaad o nagsasabi ng kanyang diyalogo, saloobin o damdamin. Ito ay ginagamitan ng panipi. Sa ganitong paraan ng pagpapahayag ay nagiging natural at lalong lumulutang ang katangiang taglay ng tauhan.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo; Donato, kakain na, Anak&rdquo; tawag ni Aling Guada sa anak na noo&rsquo;y&nbsp; abalang abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. &ldquo; Aba&rsquo;t kayganda naman nireng ginagawa mo, Anak! Ay ano ba talaga ang balak mo, ha?</p>\r\n<ol start=\"2\">\r\n<li><strong>Di direkta o Di tuwirang Pagpapahayag</strong>- ang tagapagsalaysay ang naglalahad sa sinasabi, iniisip o nararamdaman ng tauhan sa ganitong uri ng pagpapahayag. Hindi na ito ginagamitan ng panipi.</li>\r\n</ol>\r\n<p>Halimbwa: Tinawag ni Aling Guada ang anak dahil kakain na habang ito&rsquo;y abalang-abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. Sinabo niyang kayganda ng ginagawa ng anak at tinanong din niya kung ano baa ng balak niya.</p>\r\n<p><strong>&nbsp;May mga Elemento ang mga Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong>Tauhan &ndash;</strong>may dalawang paraan ng pagpapakilala ng tauhan- ang expository at ang dramatiko.</li>\r\n</ol>\r\n<p><strong>Expository</strong>- ang tagapagsalaysay ang magpapakilala o maglalarawan sa pagkatao ng tauhan</p>\r\n<p><strong>Dramatiko</strong>- kung kusang mabubunyag ang karakter dahil sa kanyang pagkilos o pagpapahayag.</p>\r\n<p><strong>Karaniwang Tauhan</strong>:</p>\r\n<ol>\r\n<li><strong>Pangunahing tauhan-</strong> tinatawag na bida, umiikot ang mga pangyayari sa kuwento mula sa simula hanggang katapusan. Karaniwang iisa lamang ang pangunahing tauhan.</li>\r\n<li><strong>Katungaling tauhan</strong>- tinatawag na kontrabida na siyang sumasalungat o kalaban ng pangunahing tauhan. Mahalaga ang papel ng tauhang ito sapagkat sa mga tunggaliang nangyayari sa pagitan nila, nabubuhay ang mga pangyayari sa kuwento at higit na napatitingkad ang mga katangian ng pangunahing tauhan.</li>\r\n<li><strong>Kasamang tauhan</strong>- gaya ng ipinahihiwatig ng katawagan , ang kasamang tauhan ay karaniwang kasama o kasangga ng pangunahing tauhan. Ang pangunahing papel o tungkulin niya ay sumuporta, magsilbing hingahan, o kapalagayang-loob ng pangunahing tauhan.</li>\r\n<li><strong>May Akda</strong>- sinasabing ang pangunahing tauhan at ang may akda ay lagi nang magkasama sa kabuoan ng akda.</li>\r\n</ol>\r\n<p><strong>Dalawang uri ng tauhan</strong></p>\r\n<ol>\r\n<li><strong>Tauhang Bilog- (</strong>round character) isang tauhang may multidimensional o maraming saklaw ang personalidad. Tulad ng isang tunay na katauhan, nagbabago ang kanyang pananaw, katangian at damdamin ayon sa pangangailangan. Ang isang tahimik at mapagtimping tauhan, halimbawa ay maaaring sumambulat kapag hinihingi ng sitwasyon o pangyayari sa kuwento.</li>\r\n<li><strong>Tauhang Lapad </strong>(flat character) ito ang tauhang nagtataglay ng iisa o dadalawang katangiang madaling matukoy o predictable.</li>\r\n</ol>\r\n<p><strong>Halimbawa</strong>; mapang-aping madrasta, mapagmahal na ina, tin-edyer na hindi sumusunod sa magulang</p>\r\n<ol start=\"2\">\r\n<li><strong>Tagpuan at Panahon-</strong> tumutukoy hindi lang sa lugar kung saan nagana pang mga pangyayari sa akda kundi gayundin sa panahon (oras, petsa, taon) at maging sa damdaming umiiral sa kapaligiran nang maganap ang mga pangyayari tulad ng kasaysayang dala ng pagdiriwang sa isang kaarawan, takot sa umiiral dahil sa malakas na hampas ng hangin at ulang dala ng bagyo, romantikong paligid sanhi ng maliwanag na buwang nakatunghay sa magkasingtahang naghahapunan sa isang hardin, matinding pagod ng magsasakang nag-aararo sa lilim na tirik na araw, kalungkutan ng pamilyang nakatunghay habang ibinababa sa kanyang huling hantungan ang isang minamahal.</li>\r\n<li><strong>Banghay-</strong> ito ang tawag sa maayos o daloy o pagkakasunod-sunod ng mga pangyayari sa mga tekstong naratibo upang mabigyang linaw ang temang taglay</li>\r\n</ol>\r\n<p>Karaniwang banghay o balangkas ng isang naratibo.</p>\r\n<ul>\r\n<li>Pagkakaroon ng isang epektibong simula kung saan maipakikilala ang mga tauhan, tagpuan at tema (orientation o introduction)</li>\r\n<li>Pagpapakilala sa suliraning ihahanap ng kalutasan ng mga tauhan particular ang pangunahing tauhan (problem)</li>\r\n<li>Pagkakaroon ng saglit na kasiglang hahantong sa pagpapakita ng aksyong gagawin ng tauhan tungo sa paglutas sa suliranin (rising action)</li>\r\n<li>Patuloy sa pagtaas ang pangyayaring humahantong sa isang resolusyon o kakalasan (falling action)</li>\r\n<li>Pagkakaroon ng isang makabuluhang wakas (ending)</li>\r\n</ul>\r\n<p>3 pagkakaayos ng banghay ayon sa anachrony</p>\r\n<ol>\r\n<ol>\r\n<li>Analepsis (Flashback) dito ipinapasok ang mga pangyayaring naganap sa nakalipas</li>\r\n<li>Prolepsis (Flash-forward) ditto nama&rsquo;y ipinapasok ang mga pangyayaring magaganap pa lang sa hinaharap</li>\r\n<li>Ellipsis &ndash; may mga puwang o patlang sa pagkakasunod-sunod ng mga pangyayari na nagpapakitang may bahagi sa pagsasalaysay sa tinanggal o hindi isinama.</li>\r\n<li>Paksa o Tema- ito ang sentral na ideya kung saan umiikot ang mga pangyayari sa tekstong naratibo. Mahalagang malinang ito nang husto sa kabuoan ng akda upang mapalutang ng may akda ang pinakamahalagang mensaheng nais na niyang iparating sa kanyang mambabasa.</li>\r\n</ol>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><strong>GAWAIN I- Isigaw ang salitang Pawer kung ang pahayag ay tekstong naratibo.</strong></p>\r\n<p><strong>Sagutin ang mga katanungan.</strong></p>\r\n<ol>\r\n<li>Bigla akong napatigil sa aking paglalakad nakita ko ang isang anino na papalapit sa akin. Pilit kong huwag matakot pero nakita ko may hawak siyang patalim. Nanginig ako sa takot kaya naman tumatakbo ako ng matulin. Hanggang marating ko ang aming bahay. Napaiyak ako ng sobra dahil sa pangambang napahamak ako ng oras na iyon. Napaisip ako sa nangyari kung hindi sana ako umalis ng bahay namin hindi sana nangyari sa akin ito. Panglawang buhay ko na maituturing ang aking naranasan . Niyakap ko ang aking ina habang umiiyak na hindi ko masagot ang kanyang mga tanong dahil hindi niya alam na tumakas ako at naglakwatsa.</li>\r\n</ol>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento?</li>\r\n</ol>\r\n<p>&nbsp;2. Walang imposible sa Diyos (Panoorin ang video)</p>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento</li>\r\n</ol>\r\n<p><strong>Ipaliwanag:</strong></p>\r\n<p>&ldquo;Tiyak na maraming aliw at saya para sa mga mahilig magbasa,</p>\r\n<p>Mga tekstong naratibo&rsquo;y di lang nakalilibang kundi may aral pang dala.&rdquo;</p>\r\n<p><strong>Gawain 2 Basahin ang tekstong \"Mabangis na Lungsod\"</strong></p>\r\n<table style=\"width: 928px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 918px;\">\r\n<p>Ano ang paksa o temang tinalakay ng akda? Tukuyin at lagyan ng tsek (&radic;) ang sagot mo at saka ipaliwanag ang napiling sagot.</p>\r\n<p>__ Dapat lang maparusahan ang mga taong nang-api sa kapwa.</p>\r\n<p>__ Dapat gumawa ang pamahalaan ng makakaya upang maibsan ang kahirapan sa iba&rsquo;t ibang bahagi ng bansa.</p>\r\n<p>__ Mananatiling biktima ang mahihina hanggat nagbubulag-bulagan ang lipunan sa ganitong kalakaran.</p>\r\n<p>__ Nangangailangan ng kandili at pagmamahal ang mga batang walang magulang.</p>\r\n<p>__ Walang mang-aalipin kung walang magpapaalipin.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 926px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 916px;\">\r\n<p>Paano mo iuugnay ang mga aral sa tekstong naratibo sa iyong sarili, pamilya, komunidad o at bansa?</p>\r\n<p>&nbsp;</p>\r\n<p>Mga Katanungan:</p>\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nakita moa ng paghihirap ni Adong para lamang makaipon ng mga baryang inililimos upang may maipanlaman sa kumakalam na sikmura. Tiyak na hindi mo kailanman naranasang mamalimos para lang may makain. Paano mo magagamit ang aral na ito sa iyong sarili?</p>\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sadyang mahirap ang walang pamilya at ito&rsquo;y napatunayan ni Adong. walang magulang at mga kapatid na nagmalasakit sa kanya sa panahon ng kanyang pangangailangan. Mapalad ka sa pagkakaroon nng pamilya kahit pa sabihing hindi perpekto ang pamilya mo. Paano mo maipapakita ang pagpapahalaga sa iyong pamilya?</p>\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mabangis na lungsod ang komunidad ni Adong, Maihahalintulad ito sa kagubatang ang mahihina ay nagiging lamang-tiyan ng mga mas malalakas at makapangyarihan. Ano ang magagawa mo upang kapag nakakita ka ng ganitong pang-aapi sa maas mahihina sa iyong paligid ay mahadlangan mo ito?</p>\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang kahirapan ay talamak hindi lang sa Quiapo kundi sa iba&rsquo;t ibang panig ng ating bansa. Kung hihintayin lang lagi ang pagkilos ng pamahalaan upang matugunan ang kahirapang ito ay matagal at malayo pa ang lalakbayin ng bayan upag ito ay maibsan. Ano ang magagawa mo sa iyong munting paraan upang makatulong sa pagsugpo ng kahirapan sa bansa?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ang mga mag-aaral ay susulat ng sariling halimbawa ng tekstong naratibo sa pamamagitan ng komiks. Ang paksa ay may kaugnayan sa pamilya, o di kaya naman sa komunidad o bansa o sarili</p>\r\n<p><strong><em>Pamantayan sa Paggawa (25 puntos)</em></strong></p>\r\n<ol>\r\n<li>Kapupulutan ng magandang asal ang tekstong naratibong nabuo.</li>\r\n<li>Malinis ang kabuuang gawa ng tekstong naratibo.</li>\r\n<li>Maliwanag at organisado ang mga pangungusap o ideya sa binuong tekstong naratibo.</li>\r\n<li>Sumasalamin sa sarili o pamilya o bansa ang nabuong teksto.</li>\r\n<li>Wasto ang pagkakagamit ng wika tulad ng bantas at wastong gamit ng mga salita</li>\r\n</ol>'),(23,50,'ARALIN 4','NARATIBO','NARATIBO','<table style=\"width: 628px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 618px;\">\r\n<p><strong>ikha mo Kwento mo!</strong></p>\r\n<p>Tatawag ang guro isang mag-aaral para magkwento ng kanyang pang-araw araw na karanasan sa buhay?</p>\r\n<p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tungkol saan ang isinadula ng kanilang pangkat?</p>\r\n<p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anong pamagat ng mga ito?</p>\r\n<p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ito ba ay isang maikling kuwento? nobela? alamat? pabula?</p>\r\n<p>d.&nbsp;&nbsp;&nbsp;&nbsp; Ano ang pinakapaborito mong kwento?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kahulugan at Katangian ng Tekstong Naratibo</strong></p>\r\n<p><strong>&hearts; </strong>Layunin ng tekstong naratibo ang magsalaysay o magkwento batay sa isang tiyak na pangyayari, totoo man o hindi. Layunin rin nitong mang-aliw o manlibang sa mga mambabasa kaya naman kahit ito\'y nakabase sa katotohanan ay higit itong nakatuon sa katotohanang may kaugnayan sa emosyonal at moral na anggulo sa halip na sa paghahanap ng katotohanan sa lahat ng detalye na kailangan pang gamitin ng pananaliksik na siya namang taglay ng isang tekstong impormatibo.</p>\r\n<p>&hearts; Ang <strong>tekstong naratibo</strong> ay nagkukuwento ng mga serye ng pangyayari na maaaring piksyon ( nobela, maikling kuwento, tula) o di fiksyon (memoir, biyograpiya, balita, maikling kuwento , sanaysay) Kapwa gumagamit ng imahinasyon, nakapagpahayag ng emosyon, kumakasangkapan ng iba\'t ibang imahen, metapora at simbolo upang maging malikhain.</p>\r\n<p><strong>Tekstong Naratibo</strong> ay pagsasalaysay o pagkukuwento ng mga pangyayari sa isang tao o mga tauhan, nangyri sa isang lugar at panahon o isang tagpuan nang maayos na pagkakasunod-sunod mula sa simula hanggang katapusan.</p>\r\n<p><strong>May iba\'t ibang Pananaw o Punto de Vista (Point of View) sa Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong> Unang Panauhan- </strong>sa pananaw na ito, isa sa mga tauhan ang nagsasalaysay ng mga bagay na kanyang nararanasan, naaalala o naririnig kaya gumagamit ng panghalip na ako. Karaniwang ginagamit ng manunulat sa pagsulat ng iba\'t ibang kuwento.</li>\r\n<li><strong> Ikalawang Panauhan- </strong>Dito mistulang kinakausap ng manunulat ang tauhang pinagagalaw niya sa kuwento kaya\'t gumagamit siya ng mga panghalip na ka o ikaw &nbsp;subalit tulad ng unang nasabi, hindi ito gaanong ginagamit &nbsp;ng mga manunulat sa kanilang pagsasalaysay.</li>\r\n<li><strong> Ikatlong Panauhan- </strong>ang mga pangyayari sa pananaw na ito ay isinasalaysay ng isang taong walang relasyon sa tauhan kaya ang panghalip na ginagamit niya sa pagsasalaysay ay<strong> siya.</strong></li>\r\n</ol>\r\n<p><strong>3 Pananaw ng ikatlong panauhan</strong></p>\r\n<ol>\r\n<li><strong> Maladiyos na panauhan- </strong>nababatid niya ang galaw at iniisip ng lahat ng mga tauhan.Napapasok niya ang isipanng bawat tauhan at naipapahayag niya ang iniisip,damdamin at paniniwala ng mga ito sa mga mambabasa.</li>\r\n<li><strong> Limitadong panauha</strong>n- nababatid niya ang iniisip at ikinikilos &nbsp;ng isa sa mga tauhan subalit hindi ang ibang tauhan.</li>\r\n<li><strong> tagaobserbang panauhan</strong>- hindi niya napapasok o nababatid ang nilalaman ng isip at damdamin ng mga tauhan. Tanging nakikita o naririnig niyang mga pangyayari , kilos o sinasabi lang ang kanyang isinasalaysay</li>\r\n<li><strong>Kombinasyong Pananaw o Paningin- </strong>Dito ay hindi lang iisa ang tagapagsalaysay kaya&rsquo;t iba&rsquo;t ibang pananaw o paningin ang nagagamit sa pagsasalaysay. Karaniwan itong nangyayari sa isang nobela kung saan ang mga pangyayari ay sumasakop sa mas mahabang panahon at mas maraming tauhan ang nagipakilala sa bawat kabanata.</li>\r\n<li>\r\n<p><strong>Mga Paraan ng Pagpapahayag ng Diyalogo, Saloobin o Damdamin sa Tekstong Naratibo.</strong></p>\r\n<ol>\r\n<li><strong>Direkta o Tuwirang Pagpapahayag</strong>.-ang tauhan ay direkta o tuwirangg nagsasaad o nagsasabi ng kanyang diyalogo, saloobin o damdamin. Ito ay ginagamitan ng panipi. Sa ganitong paraan ng pagpapahayag ay nagiging natural at lalong lumulutang ang katangiang taglay ng tauhan.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo; Donato, kakain na, Anak&rdquo; tawag ni Aling Guada sa anak na noo&rsquo;y&nbsp; abalang abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. &ldquo; Aba&rsquo;t kayganda naman nireng ginagawa mo, Anak! Ay ano ba talaga ang balak mo, ha?</p>\r\n<ol start=\"2\">\r\n<li><strong>Di direkta o Di tuwirang Pagpapahayag</strong>- ang tagapagsalaysay ang naglalahad sa sinasabi, iniisip o nararamdaman ng tauhan sa ganitong uri ng pagpapahayag. Hindi na ito ginagamitan ng panipi.</li>\r\n</ol>\r\n<p>Halimbwa: Tinawag ni Aling Guada ang anak dahil kakain na habang ito&rsquo;y abalang-abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. Sinabo niyang kayganda ng ginagawa ng anak at tinanong din niya kung ano baa ng balak niya.</p>\r\n<p><strong>&nbsp;May mga Elemento ang mga Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong>Tauhan &ndash;</strong>may dalawang paraan ng pagpapakilala ng tauhan- ang expository at ang dramatiko.</li>\r\n</ol>\r\n<p><strong>Expository</strong>- ang tagapagsalaysay ang magpapakilala o maglalarawan sa pagkatao ng tauhan</p>\r\n<p><strong>Dramatiko</strong>- kung kusang mabubunyag ang karakter dahil sa kanyang pagkilos o pagpapahayag.</p>\r\n<p><strong>Karaniwang Tauhan</strong>:</p>\r\n<ol>\r\n<li><strong>Pangunahing tauhan-</strong> tinatawag na bida, umiikot ang mga pangyayari sa kuwento mula sa simula hanggang katapusan. Karaniwang iisa lamang ang pangunahing tauhan.</li>\r\n<li><strong>Katungaling tauhan</strong>- tinatawag na kontrabida na siyang sumasalungat o kalaban ng pangunahing tauhan. Mahalaga ang papel ng tauhang ito sapagkat sa mga tunggaliang nangyayari sa pagitan nila, nabubuhay ang mga pangyayari sa kuwento at higit na napatitingkad ang mga katangian ng pangunahing tauhan.</li>\r\n<li><strong>Kasamang tauhan</strong>- gaya ng ipinahihiwatig ng katawagan , ang kasamang tauhan ay karaniwang kasama o kasangga ng pangunahing tauhan. Ang pangunahing papel o tungkulin niya ay sumuporta, magsilbing hingahan, o kapalagayang-loob ng pangunahing tauhan.</li>\r\n<li><strong>May Akda</strong>- sinasabing ang pangunahing tauhan at ang may akda ay lagi nang magkasama sa kabuoan ng akda.</li>\r\n</ol>\r\n<p><strong>Dalawang uri ng tauhan</strong></p>\r\n<ol>\r\n<li><strong>Tauhang Bilog- (</strong>round character) isang tauhang may multidimensional o maraming saklaw ang personalidad. Tulad ng isang tunay na katauhan, nagbabago ang kanyang pananaw, katangian at damdamin ayon sa pangangailangan. Ang isang tahimik at mapagtimping tauhan, halimbawa ay maaaring sumambulat kapag hinihingi ng sitwasyon o pangyayari sa kuwento.</li>\r\n<li><strong>Tauhang Lapad </strong>(flat character) ito ang tauhang nagtataglay ng iisa o dadalawang katangiang madaling matukoy o predictable.</li>\r\n</ol>\r\n<p><strong>Halimbawa</strong>; mapang-aping madrasta, mapagmahal na ina, tin-edyer na hindi sumusunod sa magulang</p>\r\n<ol start=\"2\">\r\n<li><strong>Tagpuan at Panahon-</strong> tumutukoy hindi lang sa lugar kung saan nagana pang mga pangyayari sa akda kundi gayundin sa panahon (oras, petsa, taon) at maging sa damdaming umiiral sa kapaligiran nang maganap ang mga pangyayari tulad ng kasaysayang dala ng pagdiriwang sa isang kaarawan, takot sa umiiral dahil sa malakas na hampas ng hangin at ulang dala ng bagyo, romantikong paligid sanhi ng maliwanag na buwang nakatunghay sa magkasingtahang naghahapunan sa isang hardin, matinding pagod ng magsasakang nag-aararo sa lilim na tirik na araw, kalungkutan ng pamilyang nakatunghay habang ibinababa sa kanyang huling hantungan ang isang minamahal.</li>\r\n<li><strong>Banghay-</strong> ito ang tawag sa maayos o daloy o pagkakasunod-sunod ng mga pangyayari sa mga tekstong naratibo upang mabigyang linaw ang temang taglay</li>\r\n</ol>\r\n<p>Karaniwang banghay o balangkas ng isang naratibo.</p>\r\n<ul>\r\n<li>Pagkakaroon ng isang epektibong simula kung saan maipakikilala ang mga tauhan, tagpuan at tema (orientation o introduction)</li>\r\n<li>Pagpapakilala sa suliraning ihahanap ng kalutasan ng mga tauhan particular ang pangunahing tauhan (problem)</li>\r\n<li>Pagkakaroon ng saglit na kasiglang hahantong sa pagpapakita ng aksyong gagawin ng tauhan tungo sa paglutas sa suliranin (rising action)</li>\r\n<li>Patuloy sa pagtaas ang pangyayaring humahantong sa isang resolusyon o kakalasan (falling action)</li>\r\n<li>Pagkakaroon ng isang makabuluhang wakas (ending)</li>\r\n</ul>\r\n<p>3 pagkakaayos ng banghay ayon sa anachrony</p>\r\n<ol>\r\n<ol>\r\n<li>Analepsis (Flashback) dito ipinapasok ang mga pangyayaring naganap sa nakalipas</li>\r\n<li>Prolepsis (Flash-forward) ditto nama&rsquo;y ipinapasok ang mga pangyayaring magaganap pa lang sa hinaharap</li>\r\n<li>Ellipsis &ndash; may mga puwang o patlang sa pagkakasunod-sunod ng mga pangyayari na nagpapakitang may bahagi sa pagsasalaysay sa tinanggal o hindi isinama.</li>\r\n<li>Paksa o Tema- ito ang sentral na ideya kung saan umiikot ang mga pangyayari sa tekstong naratibo. Mahalagang malinang ito nang husto sa kabuoan ng akda upang mapalutang ng may akda ang pinakamahalagang mensaheng nais na niyang iparating sa kanyang mambabasa.</li>\r\n</ol>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><strong>GAWAIN I- Isigaw ang salitang Pawer kung ang pahayag ay tekstong naratibo.</strong></p>\r\n<p><strong>Sagutin ang mga katanungan.</strong></p>\r\n<ol>\r\n<li>Bigla akong napatigil sa aking paglalakad nakita ko ang isang anino na papalapit sa akin. Pilit kong huwag matakot pero nakita ko may hawak siyang patalim. Nanginig ako sa takot kaya naman tumatakbo ako ng matulin. Hanggang marating ko ang aming bahay. Napaiyak ako ng sobra dahil sa pangambang napahamak ako ng oras na iyon. Napaisip ako sa nangyari kung hindi sana ako umalis ng bahay namin hindi sana nangyari sa akin ito. Panglawang buhay ko na maituturing ang aking naranasan . Niyakap ko ang aking ina habang umiiyak na hindi ko masagot ang kanyang mga tanong dahil hindi niya alam na tumakas ako at naglakwatsa.</li>\r\n</ol>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento?</li>\r\n</ol>\r\n<p>&nbsp;2. Walang imposible sa Diyos (Panoorin ang video)</p>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento</li>\r\n</ol>\r\n<p><strong>Ipaliwanag:</strong></p>\r\n<p>&ldquo;Tiyak na maraming aliw at saya para sa mga mahilig magbasa,</p>\r\n<p>Mga tekstong naratibo&rsquo;y di lang nakalilibang kundi may aral pang dala.&rdquo;</p>\r\n<p><strong>Gawain 2 Basahin ang tekstong \"Mabangis na Lungsod\"</strong></p>\r\n<table style=\"width: 928px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 918px;\">\r\n<p>Ano ang paksa o temang tinalakay ng akda? Tukuyin at lagyan ng tsek (&radic;) ang sagot mo at saka ipaliwanag ang napiling sagot.</p>\r\n<p>__ Dapat lang maparusahan ang mga taong nang-api sa kapwa.</p>\r\n<p>__ Dapat gumawa ang pamahalaan ng makakaya upang maibsan ang kahirapan sa iba&rsquo;t ibang bahagi ng bansa.</p>\r\n<p>__ Mananatiling biktima ang mahihina hanggat nagbubulag-bulagan ang lipunan sa ganitong kalakaran.</p>\r\n<p>__ Nangangailangan ng kandili at pagmamahal ang mga batang walang magulang.</p>\r\n<p>__ Walang mang-aalipin kung walang magpapaalipin.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 926px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 916px;\">\r\n<p>Paano mo iuugnay ang mga aral sa tekstong naratibo sa iyong sarili, pamilya, komunidad o at bansa?</p>\r\n<p>&nbsp;</p>\r\n<p>Mga Katanungan:</p>\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nakita moa ng paghihirap ni Adong para lamang makaipon ng mga baryang inililimos upang may maipanlaman sa kumakalam na sikmura. Tiyak na hindi mo kailanman naranasang mamalimos para lang may makain. Paano mo magagamit ang aral na ito sa iyong sarili?</p>\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sadyang mahirap ang walang pamilya at ito&rsquo;y napatunayan ni Adong. walang magulang at mga kapatid na nagmalasakit sa kanya sa panahon ng kanyang pangangailangan. Mapalad ka sa pagkakaroon nng pamilya kahit pa sabihing hindi perpekto ang pamilya mo. Paano mo maipapakita ang pagpapahalaga sa iyong pamilya?</p>\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mabangis na lungsod ang komunidad ni Adong, Maihahalintulad ito sa kagubatang ang mahihina ay nagiging lamang-tiyan ng mga mas malalakas at makapangyarihan. Ano ang magagawa mo upang kapag nakakita ka ng ganitong pang-aapi sa maas mahihina sa iyong paligid ay mahadlangan mo ito?</p>\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang kahirapan ay talamak hindi lang sa Quiapo kundi sa iba&rsquo;t ibang panig ng ating bansa. Kung hihintayin lang lagi ang pagkilos ng pamahalaan upang matugunan ang kahirapang ito ay matagal at malayo pa ang lalakbayin ng bayan upag ito ay maibsan. Ano ang magagawa mo sa iyong munting paraan upang makatulong sa pagsugpo ng kahirapan sa bansa?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ang mga mag-aaral ay susulat ng sariling halimbawa ng tekstong naratibo sa pamamagitan ng komiks. Ang paksa ay may kaugnayan sa pamilya, o di kaya naman sa komunidad o bansa o sarili</p>\r\n<p><strong><em>Pamantayan sa Paggawa (25 puntos)</em></strong></p>\r\n<ol>\r\n<li>Kapupulutan ng magandang asal ang tekstong naratibong nabuo.</li>\r\n<li>Malinis ang kabuuang gawa ng tekstong naratibo.</li>\r\n<li>Maliwanag at organisado ang mga pangungusap o ideya sa binuong tekstong naratibo.</li>\r\n<li>Sumasalamin sa sarili o pamilya o bansa ang nabuong teksto.</li>\r\n<li>Wasto ang pagkakagamit ng wika tulad ng bantas at wastong gamit ng mga salita</li>\r\n</ol>'),(24,50,'ARALIN 3','PERSWEYSIB','PERSWEYSIB','<p>mayroon ka ba bang natatandaan mga linya sa patalastas na tumatak sa iyong isipan&nbsp; at humikayat sa iyong bumili ng produkto? Ibahagi sa klase ang iyong nalalaman?_______________</p>\r\n<p>Masasabi mo bang naging epektbo ang paaan ng panghihikayat kaya tumatatak sa iyong isipan at humikaya sa iyong bumili?</p>\r\n<p>____________________________________________________________________________________________</p>\r\n<p><strong>ALAM MO BA?</strong></p>\r\n<p>Mga Propaganda Device</p>\r\n<ol>\r\n<li><strong>NAME CALLING </strong>&ndash; Ito ay may pagbibigay ng hindi magandang taguri sa isang produkto o katunggaling politiko upang hindi tangkilikin. Karaniwang ginagamit ito sa mundo ng politiko.</li>\r\n</ol>\r\n<p><strong>HALIMBAWA: </strong>ang pekeng sabon, bagitong kandidato,tropa( traditional politician)</p>\r\n<ol start=\"2\">\r\n<li><strong>GLITTERING GENERALITIES </strong>&ndash; Ito ay ang magaganda at nakakasilaw na pahayag ukol sa isang produktong tumutugon sa mga paniniwala at pagpapahalaga ng mambabasa.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Mas makatitipid sa bagong ________. Ang iyong damit ay mas magiging maputi sa _________ puting puti. Bossing sa kaputian.</p>\r\n<ol start=\"3\">\r\n<li><strong>TRANSFER </strong>&ndash; Ang paggamit ng isang sikat na personalidad upang mailipat sa isang produkto o tao ang kasikatan.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Ipagpapatuloy ko ang sinimulan ni<strong> FPJ. &ndash; Grace Poe ; </strong>Manny Pacquaio gumagamit ng ________ kapag nasasaktan<strong>.</strong></p>\r\n<ol start=\"4\">\r\n<li><strong>TESTIMONIAL &ndash; </strong>Kapag ang isang sikat na personalidad ay tuwirang nag-endorso ng isang tao o produkto.</li>\r\n</ol>\r\n<ol start=\"5\">\r\n<li><strong>PLAIN FOLKS &ndash; </strong>Karaniwan itong ginagamit sa kampanya o komersiyal kung saan ang mga kilala o tanyag na tao ay pinalalabas na ordinaryong taong nanghihikayat sa boto, produkto, o serbisyo.</li>\r\n</ol>\r\n<ol start=\"6\">\r\n<li><strong>CARD STACKING</strong> &ndash; Ipinakikita nito ang lahat ng magagandang katangian ng produkto ngunit hindi binabanggit ang hindi magandang katangian. <strong>HALIMBAWA:</strong> Ang instant noodles na ito ay nakapagbubuklod ng pamilya, nakatitipid ng oras , mura na , masarap pa.( Ngunit hindi nito sinasabing kakaunti lang ang sustansiyang taglay, maraming tagong asin at kung araw-araw itong kakainin ay maaring magdulot ng sakit.)</li>\r\n</ol>\r\n<ol start=\"7\">\r\n<li>BANDWAGON &ndash; Panghihikayat kung saan hinihimok ang lahat na gamitin ang isang produkto o sumali sa isang pangkat dahil ang lahat ay sumali na. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;HALIMBAWA: Buong bayan ay nag-peso padala na.</li>\r\n</ol>\r\n<p><strong>ANG TEKSTONG PERSUWEYSIB</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Layunin ng isang tekstong&nbsp; persuweysib ang manghikayat sa babasa ng teksto. Isinusulat ang tekstong persuweysib uapng mabago ang takbo ng isip ng mambabasa at makumbinsi na ang punto ng manunulat, at hindi sa iba, ang siyang tama.Hinihikayat din nito ang mambabasang tanggapin ang posisyong pinaniniwalaan o ineendorso ng teksto.</p>\r\n<p><strong>TEKSTONG PERSUWEYSIB </strong></p>\r\n<p>-ay may subhetibong tono sapagkat malayang ipinahahayag ng manunulat ang kanyang paniniwala at pagkiling tungkol sa isang isyung may ilang panig.Taglay nito ang personal na opinyon at paniniwala ng may akda.</p>\r\n<p>Inilarawan ng Griyegong pilosopona si Aristotle ang tatlong paraan ng panghihikayat o pangungumbinsi .Ito ang mga sumusunod:</p>\r\n<p><strong>ETHOS</strong></p>\r\n<p><strong>-</strong>Ito ay tumutukoy sa kredibilidad ng isang manunulat.Dapat makumbinsi ng isang manunulat ang mambabasa na siya ay may malawak na kaalaman at karanasan tungkol sa kanyang sinusulat, kung hindi ay baka hindi sila mahikayat na maniwala rito.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang isang taong nanghihikayat ng mga turista upang bisitahin ang isang isla sa pilipinas gayong hindi pa sya nakakapunta rito ay maaaring maging kaduda-duda.Gayunpaman, may iba pang paraan upang magkaroon ng kredibilida.</p>\r\n<ul>\r\n<li>Ang estilo ng pagsulat ay mahalaga upang magkaroon ng kredibilidad.</li>\r\n<li>Dapat na masulat nang malinaw at wasto ang teksto upang lumabas na hitik sa kaalaman at mahusay ang sumusulat.Ang paraan ng pagsisipi ng sanggunian ay maaaring makatulong sa pagpapatibay ng kredibilidad.Kailangang mapatunayan sa mga mambabasa na ang mga datos at impormasyon ay wasto at napapanahon upang makumbinsi na ang isinulat ay tama at mapagkakatiwalaan.</li>\r\n</ul>\r\n<p><strong>PATHOS</strong></p>\r\n<p><strong>-</strong>Tumutukoy ito sa gamit ng emosyon o damdamin upang mahikayat ang mambabasa.Ayon kay Aristotle,karamihan sa mga mambabasa ay madaling madala ng kanilang emosyon.Ang paggamit ng pagpapahalaga at paniniwala ng mambabasa ay isang ay isang epektibong paraan upang makumbinsi sila.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang pagsasalaysay ng isang kuwentong makakaantig ng galit o awa ay isang mabisang paraan upang mahikayat silang pumanig sa manunulat.</p>\r\n<p><strong>LOGOS</strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp; -</strong>Ito ay tumutukoy sa gamit ng lohika upang makumbinsi ang mambabasa.Kailangang mapatunayan ng manunulat sa mga mambabasa na batay sa mga impormasyon at datos na kanyang inilatag ang kanyang pananaw o punto ang siyang dapat paniwalaan.Gayunpaman,isa sa mga madalas na pagkakamali ng mga manunulat ang paggamit ng<strong> <em>ad hominem fallacy</em></strong>, kung saan ang manunulat ay sumasalungat sa personalidad ng katunggali at hindi sa pinaniniwalaan nito.</p>\r\n<table style=\"width: 729px; height: 208px;\" width=\"1153\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 719px;\">\r\n<p><strong>GAWAIN I</strong></p>\r\n<p>Tukuyin ang katangian ng tekstong persuweysib</p>\r\n<p>Lagyan ng (/) tsek ang mga pahayag na naglalarawan ng tekstong persweysib. Ekis (x) naman ang ilagay kung hindi.</p>\r\n<ol>\r\n<li>Layunin ng teksto ang mahikayat o makumbinsi ang babasa.</li>\r\n<li>Nais nitong mabago ang takbo ng isip ng mambabasa at tanggapin ang posisyon ng may-akda</li>\r\n<li>Karaniwang obhetibo ang tono ng tekstong persuweysib</li>\r\n<li>Naglalarawan ito ng katangian at kalikasan ng paksa</li>\r\n<li>Isinaalang-alang nito ang uri ng mambabasa upang mahikayat silang pumanig sa manunulat.</li>\r\n</ol>\r\n<p><strong>&nbsp;Basahin ang pahayag na bahagi ng isang tekstong persweysib. Tukuyin kung anong paraan ng panghihikayat ang ginamit. Isulat kung ito ethos, pathos o logos. Pagkatapos, isulat ang paliwanag kung bakit ito ang paraang napili. (10 pts)</strong></p>\r\n<p>Doon&nbsp; nagsimula ang buhay ko bilang lingkod-bayan. Sa maraming taon sa serbisyo, namulat ako sa mga hamon , sa requirements, sa tama at makaturangang diskarte at pagpaplano para masigurong aabot sa taumbayan ang nararapat na serbisyo. Kasama dito ang pagpapasa ng makabuluhang batas, ang pagpapatibay ng ugnayan sa pribadong sektor, ang pagbuo ng concensus na patas, kung saan tanging taumbayan lang ang panalo.</p>\r\n<p>Sa pagiging lingkod-bayan, ang pinakamahalagang natutunan ko -sa pagpunta ko sa iba\'t ibang&nbsp; mga lalawigan, at sa pakikipag-usap ko sa mga kapwa nating Pilipino, magsasaka man o informal settler , nagtatrabho sa call center o ordinaryong mamamayan: Binigkas tayo ng ating mga pangarap. Hindi iba ang pangarap ko sa pangrap ng bawat Pilipino; I wish for the Filipino people only what I would wish for myselp, after all, who are we if not our dream?</p>\r\n<p>mula sa talumpati ni DILG Sec Mar Roxas</p>\r\n<p>Paraan ng panghihikayat: __________________________________</p>\r\n<p>Paliwanag : ______________________________________________</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"height: 250px; width: 732px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 250px;\">\r\n<td style=\"height: 250px; width: 722px;\">\r\n<p><strong>GAWAIN II (5 PTS)</strong></p>\r\n<p>Magbigay reaksyon sa maraming mga produkto, balita, propaganda at maging politiko na nakilala natin dahil sa matatamis ang kanilang dila at mahusay maghabi ng salita. Sa madaling salita mahusay silang manghikayat at mangumbinsi, hindi tuloy natin alam kung ano talaga ang totoo at dapat paniwalaan. Mayroon ka bang tatandaang ganitong tekstong persweysib.</p>\r\n<p>Isulat sa isang buong papel ang iyong sagot. Pagkatapos ay sagutin ang sumusunod na tanong.</p>\r\n<ol>\r\n<li>Sa unang pagkakaataong nabasa mo ito, nagdududa k aba agad? Ipaliwanag ang iyong sagot?</li>\r\n<li>Ano-anong dahilan ang iyong naisip at hindi ka nakumbinsi ng tekstong ito?</li>\r\n<li>Sa ngayon ay laganap pa rin ang mga tekstong persweysib na nagtataglay ng mga huwad na pangako na nagliligaw sa madla. Sa iyong palagay, ano ang nararapat mong gawin bilag isang mapanuring mambabasa o matalinong botante at mamimili.</li>\r\n<li>Anong aral ang iyong natutunan at nais ibahagi sa iba pagdating sa mga ganitong uri ng teksto</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>PANGKATANG GAWAIN</strong></p>\r\n<table style=\"width: 841px; height: 940px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 940px;\">\r\n<td style=\"width: 831px; height: 940px;\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table style=\"width: 268px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"198\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Hindi malinaw ang isinulat na tagline. Maligoy at hindi gumamit ng paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>'),(25,49,'ARALIN 3','PERSWEYSIB','PERSWEYSIB','<p>mayroon ka ba bang natatandaan mga linya sa patalastas na tumatak sa iyong isipan&nbsp; at humikayat sa iyong bumili ng produkto? Ibahagi sa klase ang iyong nalalaman?_______________</p>\r\n<p>Masasabi mo bang naging epektbo ang paaan ng panghihikayat kaya tumatatak sa iyong isipan at humikaya sa iyong bumili?</p>\r\n<p>____________________________________________________________________________________________</p>\r\n<p><strong>ALAM MO BA?</strong></p>\r\n<p>Mga Propaganda Device</p>\r\n<ol>\r\n<li><strong>NAME CALLING </strong>&ndash; Ito ay may pagbibigay ng hindi magandang taguri sa isang produkto o katunggaling politiko upang hindi tangkilikin. Karaniwang ginagamit ito sa mundo ng politiko.</li>\r\n</ol>\r\n<p><strong>HALIMBAWA: </strong>ang pekeng sabon, bagitong kandidato,tropa( traditional politician)</p>\r\n<ol start=\"2\">\r\n<li><strong>GLITTERING GENERALITIES </strong>&ndash; Ito ay ang magaganda at nakakasilaw na pahayag ukol sa isang produktong tumutugon sa mga paniniwala at pagpapahalaga ng mambabasa.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Mas makatitipid sa bagong ________. Ang iyong damit ay mas magiging maputi sa _________ puting puti. Bossing sa kaputian.</p>\r\n<ol start=\"3\">\r\n<li><strong>TRANSFER </strong>&ndash; Ang paggamit ng isang sikat na personalidad upang mailipat sa isang produkto o tao ang kasikatan.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Ipagpapatuloy ko ang sinimulan ni<strong> FPJ. &ndash; Grace Poe ; </strong>Manny Pacquaio gumagamit ng ________ kapag nasasaktan<strong>.</strong></p>\r\n<ol start=\"4\">\r\n<li><strong>TESTIMONIAL &ndash; </strong>Kapag ang isang sikat na personalidad ay tuwirang nag-endorso ng isang tao o produkto.</li>\r\n</ol>\r\n<ol start=\"5\">\r\n<li><strong>PLAIN FOLKS &ndash; </strong>Karaniwan itong ginagamit sa kampanya o komersiyal kung saan ang mga kilala o tanyag na tao ay pinalalabas na ordinaryong taong nanghihikayat sa boto, produkto, o serbisyo.</li>\r\n</ol>\r\n<ol start=\"6\">\r\n<li><strong>CARD STACKING</strong> &ndash; Ipinakikita nito ang lahat ng magagandang katangian ng produkto ngunit hindi binabanggit ang hindi magandang katangian. <strong>HALIMBAWA:</strong> Ang instant noodles na ito ay nakapagbubuklod ng pamilya, nakatitipid ng oras , mura na , masarap pa.( Ngunit hindi nito sinasabing kakaunti lang ang sustansiyang taglay, maraming tagong asin at kung araw-araw itong kakainin ay maaring magdulot ng sakit.)</li>\r\n</ol>\r\n<ol start=\"7\">\r\n<li>BANDWAGON &ndash; Panghihikayat kung saan hinihimok ang lahat na gamitin ang isang produkto o sumali sa isang pangkat dahil ang lahat ay sumali na. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;HALIMBAWA: Buong bayan ay nag-peso padala na.</li>\r\n</ol>\r\n<p><strong>ANG TEKSTONG PERSUWEYSIB</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Layunin ng isang tekstong&nbsp; persuweysib ang manghikayat sa babasa ng teksto. Isinusulat ang tekstong persuweysib uapng mabago ang takbo ng isip ng mambabasa at makumbinsi na ang punto ng manunulat, at hindi sa iba, ang siyang tama.Hinihikayat din nito ang mambabasang tanggapin ang posisyong pinaniniwalaan o ineendorso ng teksto.</p>\r\n<p><strong>TEKSTONG PERSUWEYSIB </strong></p>\r\n<p>-ay may subhetibong tono sapagkat malayang ipinahahayag ng manunulat ang kanyang paniniwala at pagkiling tungkol sa isang isyung may ilang panig.Taglay nito ang personal na opinyon at paniniwala ng may akda.</p>\r\n<p>Inilarawan ng Griyegong pilosopona si Aristotle ang tatlong paraan ng panghihikayat o pangungumbinsi .Ito ang mga sumusunod:</p>\r\n<p><strong>ETHOS</strong></p>\r\n<p><strong>-</strong>Ito ay tumutukoy sa kredibilidad ng isang manunulat.Dapat makumbinsi ng isang manunulat ang mambabasa na siya ay may malawak na kaalaman at karanasan tungkol sa kanyang sinusulat, kung hindi ay baka hindi sila mahikayat na maniwala rito.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang isang taong nanghihikayat ng mga turista upang bisitahin ang isang isla sa pilipinas gayong hindi pa sya nakakapunta rito ay maaaring maging kaduda-duda.Gayunpaman, may iba pang paraan upang magkaroon ng kredibilida.</p>\r\n<ul>\r\n<li>Ang estilo ng pagsulat ay mahalaga upang magkaroon ng kredibilidad.</li>\r\n<li>Dapat na masulat nang malinaw at wasto ang teksto upang lumabas na hitik sa kaalaman at mahusay ang sumusulat.Ang paraan ng pagsisipi ng sanggunian ay maaaring makatulong sa pagpapatibay ng kredibilidad.Kailangang mapatunayan sa mga mambabasa na ang mga datos at impormasyon ay wasto at napapanahon upang makumbinsi na ang isinulat ay tama at mapagkakatiwalaan.</li>\r\n</ul>\r\n<p><strong>PATHOS</strong></p>\r\n<p><strong>-</strong>Tumutukoy ito sa gamit ng emosyon o damdamin upang mahikayat ang mambabasa.Ayon kay Aristotle,karamihan sa mga mambabasa ay madaling madala ng kanilang emosyon.Ang paggamit ng pagpapahalaga at paniniwala ng mambabasa ay isang ay isang epektibong paraan upang makumbinsi sila.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang pagsasalaysay ng isang kuwentong makakaantig ng galit o awa ay isang mabisang paraan upang mahikayat silang pumanig sa manunulat.</p>\r\n<p><strong>LOGOS</strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp; -</strong>Ito ay tumutukoy sa gamit ng lohika upang makumbinsi ang mambabasa.Kailangang mapatunayan ng manunulat sa mga mambabasa na batay sa mga impormasyon at datos na kanyang inilatag ang kanyang pananaw o punto ang siyang dapat paniwalaan.Gayunpaman,isa sa mga madalas na pagkakamali ng mga manunulat ang paggamit ng<strong> <em>ad hominem fallacy</em></strong>, kung saan ang manunulat ay sumasalungat sa personalidad ng katunggali at hindi sa pinaniniwalaan nito.</p>\r\n<table style=\"width: 729px; height: 208px;\" width=\"1153\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 719px;\">\r\n<p><strong>GAWAIN I</strong></p>\r\n<p>Tukuyin ang katangian ng tekstong persuweysib</p>\r\n<p>Lagyan ng (/) tsek ang mga pahayag na naglalarawan ng tekstong persweysib. Ekis (x) naman ang ilagay kung hindi.</p>\r\n<ol>\r\n<li>Layunin ng teksto ang mahikayat o makumbinsi ang babasa.</li>\r\n<li>Nais nitong mabago ang takbo ng isip ng mambabasa at tanggapin ang posisyon ng may-akda</li>\r\n<li>Karaniwang obhetibo ang tono ng tekstong persuweysib</li>\r\n<li>Naglalarawan ito ng katangian at kalikasan ng paksa</li>\r\n<li>Isinaalang-alang nito ang uri ng mambabasa upang mahikayat silang pumanig sa manunulat.</li>\r\n</ol>\r\n<p><strong>&nbsp;Basahin ang pahayag na bahagi ng isang tekstong persweysib. Tukuyin kung anong paraan ng panghihikayat ang ginamit. Isulat kung ito ethos, pathos o logos. Pagkatapos, isulat ang paliwanag kung bakit ito ang paraang napili. (10 pts)</strong></p>\r\n<p>Doon&nbsp; nagsimula ang buhay ko bilang lingkod-bayan. Sa maraming taon sa serbisyo, namulat ako sa mga hamon , sa requirements, sa tama at makaturangang diskarte at pagpaplano para masigurong aabot sa taumbayan ang nararapat na serbisyo. Kasama dito ang pagpapasa ng makabuluhang batas, ang pagpapatibay ng ugnayan sa pribadong sektor, ang pagbuo ng concensus na patas, kung saan tanging taumbayan lang ang panalo.</p>\r\n<p>Sa pagiging lingkod-bayan, ang pinakamahalagang natutunan ko -sa pagpunta ko sa iba\'t ibang&nbsp; mga lalawigan, at sa pakikipag-usap ko sa mga kapwa nating Pilipino, magsasaka man o informal settler , nagtatrabho sa call center o ordinaryong mamamayan: Binigkas tayo ng ating mga pangarap. Hindi iba ang pangarap ko sa pangrap ng bawat Pilipino; I wish for the Filipino people only what I would wish for myselp, after all, who are we if not our dream?</p>\r\n<p>mula sa talumpati ni DILG Sec Mar Roxas</p>\r\n<p>Paraan ng panghihikayat: __________________________________</p>\r\n<p>Paliwanag : ______________________________________________</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"height: 250px; width: 732px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 250px;\">\r\n<td style=\"height: 250px; width: 722px;\">\r\n<p><strong>GAWAIN II (5 PTS)</strong></p>\r\n<p>Magbigay reaksyon sa maraming mga produkto, balita, propaganda at maging politiko na nakilala natin dahil sa matatamis ang kanilang dila at mahusay maghabi ng salita. Sa madaling salita mahusay silang manghikayat at mangumbinsi, hindi tuloy natin alam kung ano talaga ang totoo at dapat paniwalaan. Mayroon ka bang tatandaang ganitong tekstong persweysib.</p>\r\n<p>Isulat sa isang buong papel ang iyong sagot. Pagkatapos ay sagutin ang sumusunod na tanong.</p>\r\n<ol>\r\n<li>Sa unang pagkakaataong nabasa mo ito, nagdududa k aba agad? Ipaliwanag ang iyong sagot?</li>\r\n<li>Ano-anong dahilan ang iyong naisip at hindi ka nakumbinsi ng tekstong ito?</li>\r\n<li>Sa ngayon ay laganap pa rin ang mga tekstong persweysib na nagtataglay ng mga huwad na pangako na nagliligaw sa madla. Sa iyong palagay, ano ang nararapat mong gawin bilag isang mapanuring mambabasa o matalinong botante at mamimili.</li>\r\n<li>Anong aral ang iyong natutunan at nais ibahagi sa iba pagdating sa mga ganitong uri ng teksto</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>PANGKATANG GAWAIN</strong></p>\r\n<table style=\"width: 841px; height: 940px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 940px;\">\r\n<td style=\"width: 831px; height: 940px;\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table style=\"width: 268px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"198\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Hindi malinaw ang isinulat na tagline. Maligoy at hindi gumamit ng paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>'),(26,49,'ARALIN 4','NARATIBO','NARATIBO','<table style=\"width: 628px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 618px;\">\r\n<p><strong>Likha mo Kwento mo!</strong></p>\r\n<p>Tatawag ang guro isang mag-aaral para magkwento ng kanyang pang-araw araw na karanasan sa buhay?</p>\r\n<p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tungkol saan ang isinadula ng kanilang pangkat?</p>\r\n<p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anong pamagat ng mga ito?</p>\r\n<p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ito ba ay isang maikling kuwento? nobela? alamat? pabula?</p>\r\n<p>d.&nbsp;&nbsp;&nbsp;&nbsp; Ano ang pinakapaborito mong kwento?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kahulugan at Katangian ng Tekstong Naratibo</strong></p>\r\n<p><strong>&hearts; </strong>Layunin ng tekstong naratibo ang magsalaysay o magkwento batay sa isang tiyak na pangyayari, totoo man o hindi. Layunin rin nitong mang-aliw o manlibang sa mga mambabasa kaya naman kahit ito\'y nakabase sa katotohanan ay higit itong nakatuon sa katotohanang may kaugnayan sa emosyonal at moral na anggulo sa halip na sa paghahanap ng katotohanan sa lahat ng detalye na kailangan pang gamitin ng pananaliksik na siya namang taglay ng isang tekstong impormatibo.</p>\r\n<p>&hearts; Ang <strong>tekstong naratibo</strong> ay nagkukuwento ng mga serye ng pangyayari na maaaring piksyon ( nobela, maikling kuwento, tula) o di fiksyon (memoir, biyograpiya, balita, maikling kuwento , sanaysay) Kapwa gumagamit ng imahinasyon, nakapagpahayag ng emosyon, kumakasangkapan ng iba\'t ibang imahen, metapora at simbolo upang maging malikhain.</p>\r\n<p><strong>Tekstong Naratibo</strong> ay pagsasalaysay o pagkukuwento ng mga pangyayari sa isang tao o mga tauhan, nangyri sa isang lugar at panahon o isang tagpuan nang maayos na pagkakasunod-sunod mula sa simula hanggang katapusan.</p>\r\n<p><strong>May iba\'t ibang Pananaw o Punto de Vista (Point of View) sa Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong> Unang Panauhan- </strong>sa pananaw na ito, isa sa mga tauhan ang nagsasalaysay ng mga bagay na kanyang nararanasan, naaalala o naririnig kaya gumagamit ng panghalip na ako. Karaniwang ginagamit ng manunulat sa pagsulat ng iba\'t ibang kuwento.</li>\r\n<li><strong> Ikalawang Panauhan- </strong>Dito mistulang kinakausap ng manunulat ang tauhang pinagagalaw niya sa kuwento kaya\'t gumagamit siya ng mga panghalip na ka o ikaw &nbsp;subalit tulad ng unang nasabi, hindi ito gaanong ginagamit &nbsp;ng mga manunulat sa kanilang pagsasalaysay.</li>\r\n<li><strong> Ikatlong Panauhan- </strong>ang mga pangyayari sa pananaw na ito ay isinasalaysay ng isang taong walang relasyon sa tauhan kaya ang panghalip na ginagamit niya sa pagsasalaysay ay<strong> siya.</strong></li>\r\n</ol>\r\n<p><strong>3 Pananaw ng ikatlong panauhan</strong></p>\r\n<ol>\r\n<li><strong> Maladiyos na panauhan- </strong>nababatid niya ang galaw at iniisip ng lahat ng mga tauhan.Napapasok niya ang isipanng bawat tauhan at naipapahayag niya ang iniisip,damdamin at paniniwala ng mga ito sa mga mambabasa.</li>\r\n<li><strong> Limitadong panauha</strong>n- nababatid niya ang iniisip at ikinikilos &nbsp;ng isa sa mga tauhan subalit hindi ang ibang tauhan.</li>\r\n<li><strong> tagaobserbang panauhan</strong>- hindi niya napapasok o nababatid ang nilalaman ng isip at damdamin ng mga tauhan. Tanging nakikita o naririnig niyang mga pangyayari , kilos o sinasabi lang ang kanyang isinasalaysay</li>\r\n<li><strong>Kombinasyong Pananaw o Paningin- </strong>Dito ay hindi lang iisa ang tagapagsalaysay kaya&rsquo;t iba&rsquo;t ibang pananaw o paningin ang nagagamit sa pagsasalaysay. Karaniwan itong nangyayari sa isang nobela kung saan ang mga pangyayari ay sumasakop sa mas mahabang panahon at mas maraming tauhan ang nagipakilala sa bawat kabanata.</li>\r\n<li>\r\n<p><strong>Mga Paraan ng Pagpapahayag ng Diyalogo, Saloobin o Damdamin sa Tekstong Naratibo.</strong></p>\r\n<ol>\r\n<li><strong>Direkta o Tuwirang Pagpapahayag</strong>.-ang tauhan ay direkta o tuwirangg nagsasaad o nagsasabi ng kanyang diyalogo, saloobin o damdamin. Ito ay ginagamitan ng panipi. Sa ganitong paraan ng pagpapahayag ay nagiging natural at lalong lumulutang ang katangiang taglay ng tauhan.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo; Donato, kakain na, Anak&rdquo; tawag ni Aling Guada sa anak na noo&rsquo;y&nbsp; abalang abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. &ldquo; Aba&rsquo;t kayganda naman nireng ginagawa mo, Anak! Ay ano ba talaga ang balak mo, ha?</p>\r\n<ol start=\"2\">\r\n<li><strong>Di direkta o Di tuwirang Pagpapahayag</strong>- ang tagapagsalaysay ang naglalahad sa sinasabi, iniisip o nararamdaman ng tauhan sa ganitong uri ng pagpapahayag. Hindi na ito ginagamitan ng panipi.</li>\r\n</ol>\r\n<p>Halimbwa: Tinawag ni Aling Guada ang anak dahil kakain na habang ito&rsquo;y abalang-abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. Sinabo niyang kayganda ng ginagawa ng anak at tinanong din niya kung ano baa ng balak niya.</p>\r\n<p><strong>&nbsp;May mga Elemento ang mga Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong>Tauhan &ndash;</strong>may dalawang paraan ng pagpapakilala ng tauhan- ang expository at ang dramatiko.</li>\r\n</ol>\r\n<p><strong>Expository</strong>- ang tagapagsalaysay ang magpapakilala o maglalarawan sa pagkatao ng tauhan</p>\r\n<p><strong>Dramatiko</strong>- kung kusang mabubunyag ang karakter dahil sa kanyang pagkilos o pagpapahayag.</p>\r\n<p><strong>Karaniwang Tauhan</strong>:</p>\r\n<ol>\r\n<li><strong>Pangunahing tauhan-</strong> tinatawag na bida, umiikot ang mga pangyayari sa kuwento mula sa simula hanggang katapusan. Karaniwang iisa lamang ang pangunahing tauhan.</li>\r\n<li><strong>Katungaling tauhan</strong>- tinatawag na kontrabida na siyang sumasalungat o kalaban ng pangunahing tauhan. Mahalaga ang papel ng tauhang ito sapagkat sa mga tunggaliang nangyayari sa pagitan nila, nabubuhay ang mga pangyayari sa kuwento at higit na napatitingkad ang mga katangian ng pangunahing tauhan.</li>\r\n<li><strong>Kasamang tauhan</strong>- gaya ng ipinahihiwatig ng katawagan , ang kasamang tauhan ay karaniwang kasama o kasangga ng pangunahing tauhan. Ang pangunahing papel o tungkulin niya ay sumuporta, magsilbing hingahan, o kapalagayang-loob ng pangunahing tauhan.</li>\r\n<li><strong>May Akda</strong>- sinasabing ang pangunahing tauhan at ang may akda ay lagi nang magkasama sa kabuoan ng akda.</li>\r\n</ol>\r\n<p><strong>Dalawang uri ng tauhan</strong></p>\r\n<ol>\r\n<li><strong>Tauhang Bilog- (</strong>round character) isang tauhang may multidimensional o maraming saklaw ang personalidad. Tulad ng isang tunay na katauhan, nagbabago ang kanyang pananaw, katangian at damdamin ayon sa pangangailangan. Ang isang tahimik at mapagtimping tauhan, halimbawa ay maaaring sumambulat kapag hinihingi ng sitwasyon o pangyayari sa kuwento.</li>\r\n<li><strong>Tauhang Lapad </strong>(flat character) ito ang tauhang nagtataglay ng iisa o dadalawang katangiang madaling matukoy o predictable.</li>\r\n</ol>\r\n<p><strong>Halimbawa</strong>; mapang-aping madrasta, mapagmahal na ina, tin-edyer na hindi sumusunod sa magulang</p>\r\n<ol start=\"2\">\r\n<li><strong>Tagpuan at Panahon-</strong> tumutukoy hindi lang sa lugar kung saan nagana pang mga pangyayari sa akda kundi gayundin sa panahon (oras, petsa, taon) at maging sa damdaming umiiral sa kapaligiran nang maganap ang mga pangyayari tulad ng kasaysayang dala ng pagdiriwang sa isang kaarawan, takot sa umiiral dahil sa malakas na hampas ng hangin at ulang dala ng bagyo, romantikong paligid sanhi ng maliwanag na buwang nakatunghay sa magkasingtahang naghahapunan sa isang hardin, matinding pagod ng magsasakang nag-aararo sa lilim na tirik na araw, kalungkutan ng pamilyang nakatunghay habang ibinababa sa kanyang huling hantungan ang isang minamahal.</li>\r\n<li><strong>Banghay-</strong> ito ang tawag sa maayos o daloy o pagkakasunod-sunod ng mga pangyayari sa mga tekstong naratibo upang mabigyang linaw ang temang taglay</li>\r\n</ol>\r\n<p>Karaniwang banghay o balangkas ng isang naratibo.</p>\r\n<ul>\r\n<li>Pagkakaroon ng isang epektibong simula kung saan maipakikilala ang mga tauhan, tagpuan at tema (orientation o introduction)</li>\r\n<li>Pagpapakilala sa suliraning ihahanap ng kalutasan ng mga tauhan particular ang pangunahing tauhan (problem)</li>\r\n<li>Pagkakaroon ng saglit na kasiglang hahantong sa pagpapakita ng aksyong gagawin ng tauhan tungo sa paglutas sa suliranin (rising action)</li>\r\n<li>Patuloy sa pagtaas ang pangyayaring humahantong sa isang resolusyon o kakalasan (falling action)</li>\r\n<li>Pagkakaroon ng isang makabuluhang wakas (ending)</li>\r\n</ul>\r\n<p>3 pagkakaayos ng banghay ayon sa anachrony</p>\r\n<ol>\r\n<ol>\r\n<li>Analepsis (Flashback) dito ipinapasok ang mga pangyayaring naganap sa nakalipas</li>\r\n<li>Prolepsis (Flash-forward) ditto nama&rsquo;y ipinapasok ang mga pangyayaring magaganap pa lang sa hinaharap</li>\r\n<li>Ellipsis &ndash; may mga puwang o patlang sa pagkakasunod-sunod ng mga pangyayari na nagpapakitang may bahagi sa pagsasalaysay sa tinanggal o hindi isinama.</li>\r\n<li>Paksa o Tema- ito ang sentral na ideya kung saan umiikot ang mga pangyayari sa tekstong naratibo. Mahalagang malinang ito nang husto sa kabuoan ng akda upang mapalutang ng may akda ang pinakamahalagang mensaheng nais na niyang iparating sa kanyang mambabasa.</li>\r\n</ol>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><strong>GAWAIN I- Isigaw ang salitang Pawer kung ang pahayag ay tekstong naratibo.</strong></p>\r\n<p><strong>Sagutin ang mga katanungan.</strong></p>\r\n<ol>\r\n<li>Bigla akong napatigil sa aking paglalakad nakita ko ang isang anino na papalapit sa akin. Pilit kong huwag matakot pero nakita ko may hawak siyang patalim. Nanginig ako sa takot kaya naman tumatakbo ako ng matulin. Hanggang marating ko ang aming bahay. Napaiyak ako ng sobra dahil sa pangambang napahamak ako ng oras na iyon. Napaisip ako sa nangyari kung hindi sana ako umalis ng bahay namin hindi sana nangyari sa akin ito. Panglawang buhay ko na maituturing ang aking naranasan . Niyakap ko ang aking ina habang umiiyak na hindi ko masagot ang kanyang mga tanong dahil hindi niya alam na tumakas ako at naglakwatsa.</li>\r\n</ol>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento?</li>\r\n</ol>\r\n<p>&nbsp;2. Walang imposible sa Diyos (Panoorin ang video)</p>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento</li>\r\n</ol>\r\n<p><strong>Ipaliwanag:</strong></p>\r\n<p>&ldquo;Tiyak na maraming aliw at saya para sa mga mahilig magbasa,</p>\r\n<p>Mga tekstong naratibo&rsquo;y di lang nakalilibang kundi may aral pang dala.&rdquo;</p>\r\n<p><strong>Gawain 2 Basahin ang tekstong \"Mabangis na Lungsod\"</strong></p>\r\n<table style=\"width: 928px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 918px;\">\r\n<p>Ano ang paksa o temang tinalakay ng akda? Tukuyin at lagyan ng tsek (&radic;) ang sagot mo at saka ipaliwanag ang napiling sagot.</p>\r\n<p>__ Dapat lang maparusahan ang mga taong nang-api sa kapwa.</p>\r\n<p>__ Dapat gumawa ang pamahalaan ng makakaya upang maibsan ang kahirapan sa iba&rsquo;t ibang bahagi ng bansa.</p>\r\n<p>__ Mananatiling biktima ang mahihina hanggat nagbubulag-bulagan ang lipunan sa ganitong kalakaran.</p>\r\n<p>__ Nangangailangan ng kandili at pagmamahal ang mga batang walang magulang.</p>\r\n<p>__ Walang mang-aalipin kung walang magpapaalipin.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 926px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 916px;\">\r\n<p>Paano mo iuugnay ang mga aral sa tekstong naratibo sa iyong sarili, pamilya, komunidad o at bansa?</p>\r\n<p>&nbsp;</p>\r\n<p>Mga Katanungan:</p>\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nakita moa ng paghihirap ni Adong para lamang makaipon ng mga baryang inililimos upang may maipanlaman sa kumakalam na sikmura. Tiyak na hindi mo kailanman naranasang mamalimos para lang may makain. Paano mo magagamit ang aral na ito sa iyong sarili?</p>\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sadyang mahirap ang walang pamilya at ito&rsquo;y napatunayan ni Adong. walang magulang at mga kapatid na nagmalasakit sa kanya sa panahon ng kanyang pangangailangan. Mapalad ka sa pagkakaroon nng pamilya kahit pa sabihing hindi perpekto ang pamilya mo. Paano mo maipapakita ang pagpapahalaga sa iyong pamilya?</p>\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mabangis na lungsod ang komunidad ni Adong, Maihahalintulad ito sa kagubatang ang mahihina ay nagiging lamang-tiyan ng mga mas malalakas at makapangyarihan. Ano ang magagawa mo upang kapag nakakita ka ng ganitong pang-aapi sa maas mahihina sa iyong paligid ay mahadlangan mo ito?</p>\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang kahirapan ay talamak hindi lang sa Quiapo kundi sa iba&rsquo;t ibang panig ng ating bansa. Kung hihintayin lang lagi ang pagkilos ng pamahalaan upang matugunan ang kahirapang ito ay matagal at malayo pa ang lalakbayin ng bayan upag ito ay maibsan. Ano ang magagawa mo sa iyong munting paraan upang makatulong sa pagsugpo ng kahirapan sa bansa?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ang mga mag-aaral ay susulat ng sariling halimbawa ng tekstong naratibo sa pamamagitan ng komiks. Ang paksa ay may kaugnayan sa pamilya, o di kaya naman sa komunidad o bansa o sarili</p>\r\n<p><strong><em>Pamantayan sa Paggawa (25 puntos)</em></strong></p>\r\n<ol>\r\n<li>Kapupulutan ng magandang asal ang tekstong naratibong nabuo.</li>\r\n<li>Malinis ang kabuuang gawa ng tekstong naratibo.</li>\r\n<li>Maliwanag at organisado ang mga pangungusap o ideya sa binuong tekstong naratibo.</li>\r\n<li>Sumasalamin sa sarili o pamilya o bansa ang nabuong teksto.</li>\r\n<li>Wasto ang pagkakagamit ng wika tulad ng bantas at wastong gamit ng mga salita</li>\r\n</ol>'),(27,48,'ARALIN 4','NARATIBO','NARATIBO','<table style=\"width: 628px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 618px;\">\r\n<p><strong>Likha mo Kwento mo!</strong></p>\r\n<p>Tatawag ang guro isang mag-aaral para magkwento ng kanyang pang-araw araw na karanasan sa buhay?</p>\r\n<p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tungkol saan ang isinadula ng kanilang pangkat?</p>\r\n<p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anong pamagat ng mga ito?</p>\r\n<p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ito ba ay isang maikling kuwento? nobela? alamat? pabula?</p>\r\n<p>d.&nbsp;&nbsp;&nbsp;&nbsp; Ano ang pinakapaborito mong kwento?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kahulugan at Katangian ng Tekstong Naratibo</strong></p>\r\n<p><strong>&hearts; </strong>Layunin ng tekstong naratibo ang magsalaysay o magkwento batay sa isang tiyak na pangyayari, totoo man o hindi. Layunin rin nitong mang-aliw o manlibang sa mga mambabasa kaya naman kahit ito\'y nakabase sa katotohanan ay higit itong nakatuon sa katotohanang may kaugnayan sa emosyonal at moral na anggulo sa halip na sa paghahanap ng katotohanan sa lahat ng detalye na kailangan pang gamitin ng pananaliksik na siya namang taglay ng isang tekstong impormatibo.</p>\r\n<p>&hearts; Ang <strong>tekstong naratibo</strong> ay nagkukuwento ng mga serye ng pangyayari na maaaring piksyon ( nobela, maikling kuwento, tula) o di fiksyon (memoir, biyograpiya, balita, maikling kuwento , sanaysay) Kapwa gumagamit ng imahinasyon, nakapagpahayag ng emosyon, kumakasangkapan ng iba\'t ibang imahen, metapora at simbolo upang maging malikhain.</p>\r\n<p><strong>Tekstong Naratibo</strong> ay pagsasalaysay o pagkukuwento ng mga pangyayari sa isang tao o mga tauhan, nangyri sa isang lugar at panahon o isang tagpuan nang maayos na pagkakasunod-sunod mula sa simula hanggang katapusan.</p>\r\n<p><strong>May iba\'t ibang Pananaw o Punto de Vista (Point of View) sa Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong> Unang Panauhan- </strong>sa pananaw na ito, isa sa mga tauhan ang nagsasalaysay ng mga bagay na kanyang nararanasan, naaalala o naririnig kaya gumagamit ng panghalip na ako. Karaniwang ginagamit ng manunulat sa pagsulat ng iba\'t ibang kuwento.</li>\r\n<li><strong> Ikalawang Panauhan- </strong>Dito mistulang kinakausap ng manunulat ang tauhang pinagagalaw niya sa kuwento kaya\'t gumagamit siya ng mga panghalip na ka o ikaw &nbsp;subalit tulad ng unang nasabi, hindi ito gaanong ginagamit &nbsp;ng mga manunulat sa kanilang pagsasalaysay.</li>\r\n<li><strong> Ikatlong Panauhan- </strong>ang mga pangyayari sa pananaw na ito ay isinasalaysay ng isang taong walang relasyon sa tauhan kaya ang panghalip na ginagamit niya sa pagsasalaysay ay<strong> siya.</strong></li>\r\n</ol>\r\n<p><strong>3 Pananaw ng ikatlong panauhan</strong></p>\r\n<ol>\r\n<li><strong> Maladiyos na panauhan- </strong>nababatid niya ang galaw at iniisip ng lahat ng mga tauhan.Napapasok niya ang isipanng bawat tauhan at naipapahayag niya ang iniisip,damdamin at paniniwala ng mga ito sa mga mambabasa.</li>\r\n<li><strong> Limitadong panauha</strong>n- nababatid niya ang iniisip at ikinikilos &nbsp;ng isa sa mga tauhan subalit hindi ang ibang tauhan.</li>\r\n<li><strong> tagaobserbang panauhan</strong>- hindi niya napapasok o nababatid ang nilalaman ng isip at damdamin ng mga tauhan. Tanging nakikita o naririnig niyang mga pangyayari , kilos o sinasabi lang ang kanyang isinasalaysay</li>\r\n<li><strong>Kombinasyong Pananaw o Paningin- </strong>Dito ay hindi lang iisa ang tagapagsalaysay kaya&rsquo;t iba&rsquo;t ibang pananaw o paningin ang nagagamit sa pagsasalaysay. Karaniwan itong nangyayari sa isang nobela kung saan ang mga pangyayari ay sumasakop sa mas mahabang panahon at mas maraming tauhan ang nagipakilala sa bawat kabanata.</li>\r\n<li>\r\n<p><strong>Mga Paraan ng Pagpapahayag ng Diyalogo, Saloobin o Damdamin sa Tekstong Naratibo.</strong></p>\r\n<ol>\r\n<li><strong>Direkta o Tuwirang Pagpapahayag</strong>.-ang tauhan ay direkta o tuwirangg nagsasaad o nagsasabi ng kanyang diyalogo, saloobin o damdamin. Ito ay ginagamitan ng panipi. Sa ganitong paraan ng pagpapahayag ay nagiging natural at lalong lumulutang ang katangiang taglay ng tauhan.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo; Donato, kakain na, Anak&rdquo; tawag ni Aling Guada sa anak na noo&rsquo;y&nbsp; abalang abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. &ldquo; Aba&rsquo;t kayganda naman nireng ginagawa mo, Anak! Ay ano ba talaga ang balak mo, ha?</p>\r\n<ol start=\"2\">\r\n<li><strong>Di direkta o Di tuwirang Pagpapahayag</strong>- ang tagapagsalaysay ang naglalahad sa sinasabi, iniisip o nararamdaman ng tauhan sa ganitong uri ng pagpapahayag. Hindi na ito ginagamitan ng panipi.</li>\r\n</ol>\r\n<p>Halimbwa: Tinawag ni Aling Guada ang anak dahil kakain na habang ito&rsquo;y abalang-abala sa ginagawa at hindi halos napansing nakalapit na pala ang ina sa kanyang kinalalagyan. Sinabo niyang kayganda ng ginagawa ng anak at tinanong din niya kung ano baa ng balak niya.</p>\r\n<p><strong>&nbsp;May mga Elemento ang mga Tekstong Naratibo</strong></p>\r\n<ol>\r\n<li><strong>Tauhan &ndash;</strong>may dalawang paraan ng pagpapakilala ng tauhan- ang expository at ang dramatiko.</li>\r\n</ol>\r\n<p><strong>Expository</strong>- ang tagapagsalaysay ang magpapakilala o maglalarawan sa pagkatao ng tauhan</p>\r\n<p><strong>Dramatiko</strong>- kung kusang mabubunyag ang karakter dahil sa kanyang pagkilos o pagpapahayag.</p>\r\n<p><strong>Karaniwang Tauhan</strong>:</p>\r\n<ol>\r\n<li><strong>Pangunahing tauhan-</strong> tinatawag na bida, umiikot ang mga pangyayari sa kuwento mula sa simula hanggang katapusan. Karaniwang iisa lamang ang pangunahing tauhan.</li>\r\n<li><strong>Katungaling tauhan</strong>- tinatawag na kontrabida na siyang sumasalungat o kalaban ng pangunahing tauhan. Mahalaga ang papel ng tauhang ito sapagkat sa mga tunggaliang nangyayari sa pagitan nila, nabubuhay ang mga pangyayari sa kuwento at higit na napatitingkad ang mga katangian ng pangunahing tauhan.</li>\r\n<li><strong>Kasamang tauhan</strong>- gaya ng ipinahihiwatig ng katawagan , ang kasamang tauhan ay karaniwang kasama o kasangga ng pangunahing tauhan. Ang pangunahing papel o tungkulin niya ay sumuporta, magsilbing hingahan, o kapalagayang-loob ng pangunahing tauhan.</li>\r\n<li><strong>May Akda</strong>- sinasabing ang pangunahing tauhan at ang may akda ay lagi nang magkasama sa kabuoan ng akda.</li>\r\n</ol>\r\n<p><strong>Dalawang uri ng tauhan</strong></p>\r\n<ol>\r\n<li><strong>Tauhang Bilog- (</strong>round character) isang tauhang may multidimensional o maraming saklaw ang personalidad. Tulad ng isang tunay na katauhan, nagbabago ang kanyang pananaw, katangian at damdamin ayon sa pangangailangan. Ang isang tahimik at mapagtimping tauhan, halimbawa ay maaaring sumambulat kapag hinihingi ng sitwasyon o pangyayari sa kuwento.</li>\r\n<li><strong>Tauhang Lapad </strong>(flat character) ito ang tauhang nagtataglay ng iisa o dadalawang katangiang madaling matukoy o predictable.</li>\r\n</ol>\r\n<p><strong>Halimbawa</strong>; mapang-aping madrasta, mapagmahal na ina, tin-edyer na hindi sumusunod sa magulang</p>\r\n<ol start=\"2\">\r\n<li><strong>Tagpuan at Panahon-</strong> tumutukoy hindi lang sa lugar kung saan nagana pang mga pangyayari sa akda kundi gayundin sa panahon (oras, petsa, taon) at maging sa damdaming umiiral sa kapaligiran nang maganap ang mga pangyayari tulad ng kasaysayang dala ng pagdiriwang sa isang kaarawan, takot sa umiiral dahil sa malakas na hampas ng hangin at ulang dala ng bagyo, romantikong paligid sanhi ng maliwanag na buwang nakatunghay sa magkasingtahang naghahapunan sa isang hardin, matinding pagod ng magsasakang nag-aararo sa lilim na tirik na araw, kalungkutan ng pamilyang nakatunghay habang ibinababa sa kanyang huling hantungan ang isang minamahal.</li>\r\n<li><strong>Banghay-</strong> ito ang tawag sa maayos o daloy o pagkakasunod-sunod ng mga pangyayari sa mga tekstong naratibo upang mabigyang linaw ang temang taglay</li>\r\n</ol>\r\n<p>Karaniwang banghay o balangkas ng isang naratibo.</p>\r\n<ul>\r\n<li>Pagkakaroon ng isang epektibong simula kung saan maipakikilala ang mga tauhan, tagpuan at tema (orientation o introduction)</li>\r\n<li>Pagpapakilala sa suliraning ihahanap ng kalutasan ng mga tauhan particular ang pangunahing tauhan (problem)</li>\r\n<li>Pagkakaroon ng saglit na kasiglang hahantong sa pagpapakita ng aksyong gagawin ng tauhan tungo sa paglutas sa suliranin (rising action)</li>\r\n<li>Patuloy sa pagtaas ang pangyayaring humahantong sa isang resolusyon o kakalasan (falling action)</li>\r\n<li>Pagkakaroon ng isang makabuluhang wakas (ending)</li>\r\n</ul>\r\n<p>3 pagkakaayos ng banghay ayon sa anachrony</p>\r\n<ol>\r\n<ol>\r\n<li>Analepsis (Flashback) dito ipinapasok ang mga pangyayaring naganap sa nakalipas</li>\r\n<li>Prolepsis (Flash-forward) ditto nama&rsquo;y ipinapasok ang mga pangyayaring magaganap pa lang sa hinaharap</li>\r\n<li>Ellipsis &ndash; may mga puwang o patlang sa pagkakasunod-sunod ng mga pangyayari na nagpapakitang may bahagi sa pagsasalaysay sa tinanggal o hindi isinama.</li>\r\n<li>Paksa o Tema- ito ang sentral na ideya kung saan umiikot ang mga pangyayari sa tekstong naratibo. Mahalagang malinang ito nang husto sa kabuoan ng akda upang mapalutang ng may akda ang pinakamahalagang mensaheng nais na niyang iparating sa kanyang mambabasa.</li>\r\n</ol>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><strong>GAWAIN I- Isigaw ang salitang Pawer kung ang pahayag ay tekstong naratibo.</strong></p>\r\n<p><strong>Sagutin ang mga katanungan.</strong></p>\r\n<ol>\r\n<li>Bigla akong napatigil sa aking paglalakad nakita ko ang isang anino na papalapit sa akin. Pilit kong huwag matakot pero nakita ko may hawak siyang patalim. Nanginig ako sa takot kaya naman tumatakbo ako ng matulin. Hanggang marating ko ang aming bahay. Napaiyak ako ng sobra dahil sa pangambang napahamak ako ng oras na iyon. Napaisip ako sa nangyari kung hindi sana ako umalis ng bahay namin hindi sana nangyari sa akin ito. Panglawang buhay ko na maituturing ang aking naranasan . Niyakap ko ang aking ina habang umiiyak na hindi ko masagot ang kanyang mga tanong dahil hindi niya alam na tumakas ako at naglakwatsa.</li>\r\n</ol>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento?</li>\r\n</ol>\r\n<p>&nbsp;2. Walang imposible sa Diyos (Panoorin ang video)</p>\r\n<ol>\r\n<li>Sino ang tagapagsalaysay sa kwento?</li>\r\n<li>Sino ang pangunahing tauhan?</li>\r\n<li>Sino ang katunggalian sa kwento?</li>\r\n<li>Siya ba&rsquo;t tauhang bilog o lapad</li>\r\n<li>Ano ang aral sa kwento</li>\r\n</ol>\r\n<p><strong>Ipaliwanag:</strong></p>\r\n<p>&ldquo;Tiyak na maraming aliw at saya para sa mga mahilig magbasa,</p>\r\n<p>Mga tekstong naratibo&rsquo;y di lang nakalilibang kundi may aral pang dala.&rdquo;</p>\r\n<p><strong>Gawain 2 Basahin ang tekstong \"Mabangis na Lungsod\"</strong></p>\r\n<table style=\"width: 928px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 918px;\">\r\n<p>Ano ang paksa o temang tinalakay ng akda? Tukuyin at lagyan ng tsek (&radic;) ang sagot mo at saka ipaliwanag ang napiling sagot.</p>\r\n<p>__ Dapat lang maparusahan ang mga taong nang-api sa kapwa.</p>\r\n<p>__ Dapat gumawa ang pamahalaan ng makakaya upang maibsan ang kahirapan sa iba&rsquo;t ibang bahagi ng bansa.</p>\r\n<p>__ Mananatiling biktima ang mahihina hanggat nagbubulag-bulagan ang lipunan sa ganitong kalakaran.</p>\r\n<p>__ Nangangailangan ng kandili at pagmamahal ang mga batang walang magulang.</p>\r\n<p>__ Walang mang-aalipin kung walang magpapaalipin.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 926px;\" width=\"1114\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 916px;\">\r\n<p>Paano mo iuugnay ang mga aral sa tekstong naratibo sa iyong sarili, pamilya, komunidad o at bansa?</p>\r\n<p>&nbsp;</p>\r\n<p>Mga Katanungan:</p>\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nakita moa ng paghihirap ni Adong para lamang makaipon ng mga baryang inililimos upang may maipanlaman sa kumakalam na sikmura. Tiyak na hindi mo kailanman naranasang mamalimos para lang may makain. Paano mo magagamit ang aral na ito sa iyong sarili?</p>\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sadyang mahirap ang walang pamilya at ito&rsquo;y napatunayan ni Adong. walang magulang at mga kapatid na nagmalasakit sa kanya sa panahon ng kanyang pangangailangan. Mapalad ka sa pagkakaroon nng pamilya kahit pa sabihing hindi perpekto ang pamilya mo. Paano mo maipapakita ang pagpapahalaga sa iyong pamilya?</p>\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mabangis na lungsod ang komunidad ni Adong, Maihahalintulad ito sa kagubatang ang mahihina ay nagiging lamang-tiyan ng mga mas malalakas at makapangyarihan. Ano ang magagawa mo upang kapag nakakita ka ng ganitong pang-aapi sa maas mahihina sa iyong paligid ay mahadlangan mo ito?</p>\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang kahirapan ay talamak hindi lang sa Quiapo kundi sa iba&rsquo;t ibang panig ng ating bansa. Kung hihintayin lang lagi ang pagkilos ng pamahalaan upang matugunan ang kahirapang ito ay matagal at malayo pa ang lalakbayin ng bayan upag ito ay maibsan. Ano ang magagawa mo sa iyong munting paraan upang makatulong sa pagsugpo ng kahirapan sa bansa?</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ang mga mag-aaral ay susulat ng sariling halimbawa ng tekstong naratibo sa pamamagitan ng komiks. Ang paksa ay may kaugnayan sa pamilya, o di kaya naman sa komunidad o bansa o sarili</p>\r\n<p><strong><em>Pamantayan sa Paggawa (25 puntos)</em></strong></p>\r\n<ol>\r\n<li>Kapupulutan ng magandang asal ang tekstong naratibong nabuo.</li>\r\n<li>Malinis ang kabuuang gawa ng tekstong naratibo.</li>\r\n<li>Maliwanag at organisado ang mga pangungusap o ideya sa binuong tekstong naratibo.</li>\r\n<li>Sumasalamin sa sarili o pamilya o bansa ang nabuong teksto.</li>\r\n<li>Wasto ang pagkakagamit ng wika tulad ng bantas at wastong gamit ng mga salita</li>\r\n</ol>'),(28,48,'ARALIN 3','PERSWEYSIB','PERSWEYSIB','<p>Mayroon ka ba bang natatandaan mga linya sa patalastas na tumatak sa iyong isipan&nbsp; at humikayat sa iyong bumili ng produkto? Ibahagi sa klase ang iyong nalalaman?_______________</p>\r\n<p>Masasabi mo bang naging epektbo ang paaan ng panghihikayat kaya tumatatak sa iyong isipan at humikaya sa iyong bumili?</p>\r\n<p>____________________________________________________________________________________________</p>\r\n<p><strong>ALAM MO BA?</strong></p>\r\n<p>Mga Propaganda Device</p>\r\n<ol>\r\n<li><strong>NAME CALLING </strong>&ndash; Ito ay may pagbibigay ng hindi magandang taguri sa isang produkto o katunggaling politiko upang hindi tangkilikin. Karaniwang ginagamit ito sa mundo ng politiko.</li>\r\n</ol>\r\n<p><strong>HALIMBAWA: </strong>ang pekeng sabon, bagitong kandidato,tropa( traditional politician)</p>\r\n<ol start=\"2\">\r\n<li><strong>GLITTERING GENERALITIES </strong>&ndash; Ito ay ang magaganda at nakakasilaw na pahayag ukol sa isang produktong tumutugon sa mga paniniwala at pagpapahalaga ng mambabasa.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Mas makatitipid sa bagong ________. Ang iyong damit ay mas magiging maputi sa _________ puting puti. Bossing sa kaputian.</p>\r\n<ol start=\"3\">\r\n<li><strong>TRANSFER </strong>&ndash; Ang paggamit ng isang sikat na personalidad upang mailipat sa isang produkto o tao ang kasikatan.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Ipagpapatuloy ko ang sinimulan ni<strong> FPJ. &ndash; Grace Poe ; </strong>Manny Pacquaio gumagamit ng ________ kapag nasasaktan<strong>.</strong></p>\r\n<ol start=\"4\">\r\n<li><strong>TESTIMONIAL &ndash; </strong>Kapag ang isang sikat na personalidad ay tuwirang nag-endorso ng isang tao o produkto.</li>\r\n</ol>\r\n<ol start=\"5\">\r\n<li><strong>PLAIN FOLKS &ndash; </strong>Karaniwan itong ginagamit sa kampanya o komersiyal kung saan ang mga kilala o tanyag na tao ay pinalalabas na ordinaryong taong nanghihikayat sa boto, produkto, o serbisyo.</li>\r\n</ol>\r\n<ol start=\"6\">\r\n<li><strong>CARD STACKING</strong> &ndash; Ipinakikita nito ang lahat ng magagandang katangian ng produkto ngunit hindi binabanggit ang hindi magandang katangian. <strong>HALIMBAWA:</strong> Ang instant noodles na ito ay nakapagbubuklod ng pamilya, nakatitipid ng oras , mura na , masarap pa.( Ngunit hindi nito sinasabing kakaunti lang ang sustansiyang taglay, maraming tagong asin at kung araw-araw itong kakainin ay maaring magdulot ng sakit.)</li>\r\n</ol>\r\n<ol start=\"7\">\r\n<li>BANDWAGON &ndash; Panghihikayat kung saan hinihimok ang lahat na gamitin ang isang produkto o sumali sa isang pangkat dahil ang lahat ay sumali na. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;HALIMBAWA: Buong bayan ay nag-peso padala na.</li>\r\n</ol>\r\n<p><strong>ANG TEKSTONG PERSUWEYSIB</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Layunin ng isang tekstong&nbsp; persuweysib ang manghikayat sa babasa ng teksto. Isinusulat ang tekstong persuweysib uapng mabago ang takbo ng isip ng mambabasa at makumbinsi na ang punto ng manunulat, at hindi sa iba, ang siyang tama.Hinihikayat din nito ang mambabasang tanggapin ang posisyong pinaniniwalaan o ineendorso ng teksto.</p>\r\n<p><strong>TEKSTONG PERSUWEYSIB </strong></p>\r\n<p>-ay may subhetibong tono sapagkat malayang ipinahahayag ng manunulat ang kanyang paniniwala at pagkiling tungkol sa isang isyung may ilang panig.Taglay nito ang personal na opinyon at paniniwala ng may akda.</p>\r\n<p>Inilarawan ng Griyegong pilosopona si Aristotle ang tatlong paraan ng panghihikayat o pangungumbinsi .Ito ang mga sumusunod:</p>\r\n<p><strong>ETHOS</strong></p>\r\n<p><strong>-</strong>Ito ay tumutukoy sa kredibilidad ng isang manunulat.Dapat makumbinsi ng isang manunulat ang mambabasa na siya ay may malawak na kaalaman at karanasan tungkol sa kanyang sinusulat, kung hindi ay baka hindi sila mahikayat na maniwala rito.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang isang taong nanghihikayat ng mga turista upang bisitahin ang isang isla sa pilipinas gayong hindi pa sya nakakapunta rito ay maaaring maging kaduda-duda.Gayunpaman, may iba pang paraan upang magkaroon ng kredibilida.</p>\r\n<ul>\r\n<li>Ang estilo ng pagsulat ay mahalaga upang magkaroon ng kredibilidad.</li>\r\n<li>Dapat na masulat nang malinaw at wasto ang teksto upang lumabas na hitik sa kaalaman at mahusay ang sumusulat.Ang paraan ng pagsisipi ng sanggunian ay maaaring makatulong sa pagpapatibay ng kredibilidad.Kailangang mapatunayan sa mga mambabasa na ang mga datos at impormasyon ay wasto at napapanahon upang makumbinsi na ang isinulat ay tama at mapagkakatiwalaan.</li>\r\n</ul>\r\n<p><strong>PATHOS</strong></p>\r\n<p><strong>-</strong>Tumutukoy ito sa gamit ng emosyon o damdamin upang mahikayat ang mambabasa.Ayon kay Aristotle,karamihan sa mga mambabasa ay madaling madala ng kanilang emosyon.Ang paggamit ng pagpapahalaga at paniniwala ng mambabasa ay isang ay isang epektibong paraan upang makumbinsi sila.</p>\r\n<p><strong>HALIMBAWA:</strong>Ang pagsasalaysay ng isang kuwentong makakaantig ng galit o awa ay isang mabisang paraan upang mahikayat silang pumanig sa manunulat.</p>\r\n<p><strong>LOGOS</strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp; -</strong>Ito ay tumutukoy sa gamit ng lohika upang makumbinsi ang mambabasa.Kailangang mapatunayan ng manunulat sa mga mambabasa na batay sa mga impormasyon at datos na kanyang inilatag ang kanyang pananaw o punto ang siyang dapat paniwalaan.Gayunpaman,isa sa mga madalas na pagkakamali ng mga manunulat ang paggamit ng<strong> <em>ad hominem fallacy</em></strong>, kung saan ang manunulat ay sumasalungat sa personalidad ng katunggali at hindi sa pinaniniwalaan nito.</p>\r\n<table style=\"width: 729px; height: 208px;\" width=\"1153\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 719px;\">\r\n<p><strong>GAWAIN I</strong></p>\r\n<p>Tukuyin ang katangian ng tekstong persuweysib</p>\r\n<p>Lagyan ng (/) tsek ang mga pahayag na naglalarawan ng tekstong persweysib. Ekis (x) naman ang ilagay kung hindi.</p>\r\n<ol>\r\n<li>Layunin ng teksto ang mahikayat o makumbinsi ang babasa.</li>\r\n<li>Nais nitong mabago ang takbo ng isip ng mambabasa at tanggapin ang posisyon ng may-akda</li>\r\n<li>Karaniwang obhetibo ang tono ng tekstong persuweysib</li>\r\n<li>Naglalarawan ito ng katangian at kalikasan ng paksa</li>\r\n<li>Isinaalang-alang nito ang uri ng mambabasa upang mahikayat silang pumanig sa manunulat.</li>\r\n</ol>\r\n<p><strong>&nbsp;Basahin ang pahayag na bahagi ng isang tekstong persweysib. Tukuyin kung anong paraan ng panghihikayat ang ginamit. Isulat kung ito ethos, pathos o logos. Pagkatapos, isulat ang paliwanag kung bakit ito ang paraang napili. (10 pts)</strong></p>\r\n<p>Doon&nbsp; nagsimula ang buhay ko bilang lingkod-bayan. Sa maraming taon sa serbisyo, namulat ako sa mga hamon , sa requirements, sa tama at makaturangang diskarte at pagpaplano para masigurong aabot sa taumbayan ang nararapat na serbisyo. Kasama dito ang pagpapasa ng makabuluhang batas, ang pagpapatibay ng ugnayan sa pribadong sektor, ang pagbuo ng concensus na patas, kung saan tanging taumbayan lang ang panalo.</p>\r\n<p>Sa pagiging lingkod-bayan, ang pinakamahalagang natutunan ko -sa pagpunta ko sa iba\'t ibang&nbsp; mga lalawigan, at sa pakikipag-usap ko sa mga kapwa nating Pilipino, magsasaka man o informal settler , nagtatrabho sa call center o ordinaryong mamamayan: Binigkas tayo ng ating mga pangarap. Hindi iba ang pangarap ko sa pangrap ng bawat Pilipino; I wish for the Filipino people only what I would wish for myselp, after all, who are we if not our dream?</p>\r\n<p>mula sa talumpati ni DILG Sec Mar Roxas</p>\r\n<p>Paraan ng panghihikayat: __________________________________</p>\r\n<p>Paliwanag : ______________________________________________</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"height: 250px; width: 732px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 250px;\">\r\n<td style=\"height: 250px; width: 722px;\">\r\n<p><strong>GAWAIN II (5 PTS)</strong></p>\r\n<p>Magbigay reaksyon sa maraming mga produkto, balita, propaganda at maging politiko na nakilala natin dahil sa matatamis ang kanilang dila at mahusay maghabi ng salita. Sa madaling salita mahusay silang manghikayat at mangumbinsi, hindi tuloy natin alam kung ano talaga ang totoo at dapat paniwalaan. Mayroon ka bang tatandaang ganitong tekstong persweysib.</p>\r\n<p>Isulat sa isang buong papel ang iyong sagot. Pagkatapos ay sagutin ang sumusunod na tanong.</p>\r\n<ol>\r\n<li>Sa unang pagkakaataong nabasa mo ito, nagdududa k aba agad? Ipaliwanag ang iyong sagot?</li>\r\n<li>Ano-anong dahilan ang iyong naisip at hindi ka nakumbinsi ng tekstong ito?</li>\r\n<li>Sa ngayon ay laganap pa rin ang mga tekstong persweysib na nagtataglay ng mga huwad na pangako na nagliligaw sa madla. Sa iyong palagay, ano ang nararapat mong gawin bilag isang mapanuring mambabasa o matalinong botante at mamimili.</li>\r\n<li>Anong aral ang iyong natutunan at nais ibahagi sa iba pagdating sa mga ganitong uri ng teksto</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>PANGKATANG GAWAIN</strong></p>\r\n<table style=\"width: 841px; height: 940px;\" width=\"1153\">\r\n<tbody>\r\n<tr style=\"height: 940px;\">\r\n<td style=\"width: 831px; height: 940px;\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table style=\"width: 268px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 66px;\" width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td style=\"width: 202px;\" width=\"198\">\r\n<p>Gumawa ng isang tag line na makakahiyat sa isang produkto na iyong napili. Gawin gabay ang rubric sa ibaba para sa iyong isusulat na tekstong persweysib</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"62\">\r\n<p>Puntos</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Pamantayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>4</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilikin ang mga produkto. Malinaw at hindi maligoy.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline ay naglalayong tangkilin ang&nbsp; mga produkto. Makakahikayat ito dahil ginamitan ng ilang paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Ang tagline , bagamat naglalayong nakapagtangkilik subalit hindi ito gaanong malinaw at maligoy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"62\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"121\">\r\n<p>Hindi malinaw ang isinulat na tagline. Maligoy at hindi gumamit ng paraan ng panghihikayat</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),(29,50,'ARALIN 3','PERSWEYSIB','PERSWEYSIB','<p>ayroon ka ba bang natatandaan mga linya sa patalastas na tumatak sa iyong isipan&nbsp; at humikayat sa iyong bumili ng produkto? Ibahagi sa klase ang iyong nalalaman?_______________</p>\r\n<p>Masasabi mo bang naging epektbo ang paaan ng panghihikayat kaya tumatatak sa iyong isipan at humikaya sa iyong bumili?</p>\r\n<p>____________________________________________________________________________________________</p>\r\n<p><strong>ALAM MO BA?</strong></p>\r\n<p>Mga Propaganda Device</p>\r\n<ol>\r\n<li><strong>NAME CALLING </strong>&ndash; Ito ay may pagbibigay ng hindi magandang taguri sa isang produkto o katunggaling politiko upang hindi tangkilikin. Karaniwang ginagamit ito sa mundo ng politiko.</li>\r\n</ol>\r\n<p><strong>HALIMBAWA: </strong>ang pekeng sabon, bagitong kandidato,tropa( traditional politician)</p>\r\n<ol start=\"2\">\r\n<li><strong>GLITTERING GENERALITIES </strong>&ndash; Ito ay ang magaganda at nakakasilaw na pahayag ukol sa isang produktong tumutugon sa mga paniniwala at pagpapahalaga ng mambabasa.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Mas makatitipid sa bagong ________. Ang iyong damit ay mas magiging maputi sa _________ puting puti. Bossing sa kaputian.</p>\r\n<ol start=\"3\">\r\n<li><strong>TRANSFER </strong>&ndash; Ang paggamit ng isang sikat na personalidad upang mailipat sa isang produkto o tao ang kasikatan.</li>\r\n</ol>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HALIMBAWA</strong>: Ipagpapatuloy ko ang sinimulan ni<strong> FPJ. &ndash; Grace Poe ; </strong>Manny Pacquaio gumagamit ng ________ kapag nasasaktan<strong>.</strong></p>\r\n<ol start=\"4\">\r\n<li><strong>TESTIMONIAL &ndash; </strong>Kapag ang isang sikat na personalidad ay tuwirang nag-endorso ng isan