ang talata:</strong> Unang konklusyon na lalagom sa iyong isinulat. <strong>Ikaanim na talata:</strong> Ikalawang konklusyon na sasagot sa tanong na &ldquo;E ano ngayon kungb iyan ang iyong posisyon?</li>\r\n<li>Isulat na ang draft ng iyong tekstong argumentatibo.</li>\r\n<li>Basahing muli ang isinulat upang maiwasto ang mga pagkakamali sa wika at mekaniks.</li>\r\n<li>Muling isulat ang iyong teksto taglay ang anumang pagwaasto. Ito ang magiging pinal na kopya.</li>\r\n</ol>\r\n<p><strong>&nbsp;</strong></p>'),(37,50,'argumentatibo','argumentatibo','argumentatibo','<p><strong><em>Ang tekstong Argumentatibo</em></strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Sa nakalipas na aralin, nalaman natin na ang isang tekstong nanungumbinsi ng mambabaasa na tanggapin ang unto ng may-akda ay tinatawag na tekstong persuweysib. Subhetibo ang tono ng isang tekstong persuweysib sapagkat nakabatay ito sa damdamin at opinyon ng manunulat. Sa araling ito ay tatalakayin natin ang tekstong argumentatibo na naglalayon ding kumbinsihin ang mambabasa ngunit hindi lamang ito nakabatay sa opinyon o damdamin ng manunulat, batay ito sa datos o impormasyong inilatag ng manunulat. Sa tatlong paraan ng pangungumbinsi - ethos, pathos at logos, ginagamit ng tekstong argumentatibo ang logos. Upang makumbinsi ang mambabasa, inilalahad ng may-akda ang mga argumento, katwiran at ebidensya na nagpapatibay ng kanyang posisyon o punto.</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Hindi nagkakalayo ang tekstong argumentatibo at persuweysib, kapwa ito nangungumbinsi o nanghihikayat. gayunpaman, may pagkakaiba rin ang mga ito. Suriin ang talahanayan sa ibaba:</p>\r\n<p>&nbsp;</p>\r\n<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td width=\"50%\">\r\n<p><strong><em>Tekstong Argumentatibo</em></strong></p>\r\n</td>\r\n<td width=\"50%\">\r\n<p><strong><em>Tekstong Persuweysib</em></strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"50%\">\r\n<p>- Nangungumbinsi batay sa dato o