ng mambabaasa na tanggapin ang unto ng may-akda ay tinatawag na tekstong persuweysib. Subhetibo ang tono ng isang tekstong persuweysib sapagkat nakabatay ito sa damdamin at opinyon ng manunulat. Sa araling ito ay tatalakayin natin ang tekstong argumentatibo na naglalayon ding kumbinsihin ang mambabasa ngunit hindi lamang ito nakabatay sa opinyon o damdamin ng manunulat, batay ito sa datos o impormasyong inilatag ng manunulat. Sa tatlong paraan ng pangungumbinsi - ethos, pathos at logos, ginagamit ng tekstong argumentatibo ang logos. Upang makumbinsi ang mambabasa, inilalahad ng may-akda ang mga argumento, katwiran at ebidensya na nagpapatibay ng kanyang posisyon o punto.</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Hindi nagkakalayo ang tekstong argumentatibo at persuweysib, kapwa ito nangungumbinsi o nanghihikayat. gayunpaman, may pagkakaiba rin ang mga ito. Suriin ang talahanayan sa ibaba:</p>\r\n<p>&nbsp;</p>\r\n<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td width=\"50%\">\r\n<p><strong><em>Tekstong Argumentatibo</em></strong></p>\r\n</td>\r\n<td width=\"50%\">\r\n<p><strong><em>Tekstong Persuweysib</em></strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"50%\">\r\n<p>- Nangungumbinsi batay sa dato o impormasyon</p>\r\n<p>- Nakahihikayat dahil sa merito ng mga ebidensya</p>\r\n<p>- Obhetibo</p>\r\n</td>\r\n<td width=\"50%\">\r\n<p>- Nangungumbinsi batay sa opinyon</p>\r\n<p>- Nakahihikayat sa pamamagitan ng pagpukaw ng emosyon ng mambabasa at pagpokus sa kredibilidad ng may-akda</p>\r\n<p>- Subhetibo&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong><em>Hakbang Sa Pagsulat ng Tekstong Argumentatibo</em></strong></p>\r\n<ol>\r\n<li>Pumili ng paksang isusulat na angkop para sa tekstong argumentatibo</li>\r\n<li>Itanong sa sarili kung ani ang panig na nais mong panindigan at ano ang mga dahilan mo sa pagpanig dito.</li>\r\n<li>Mangalap ng ebidensya. ito ay ang mga impormasyon o datos na susuporta sa iyong posisyon.</li>\r\n<li>Gumawa ng burador (draft)</li>\r\n<li>Unang talata: Panimula</li>\r\n<li>Ikawalang talata: Kaligiran</li>\r\n<li>Ikatlong talata: Ebidensyang susuporta sa posisyon. Maaaring magdagdag pa ng talata kung maraming ebidensya.</li>\r\n<li>Ikaapat na talata: Counter argument. Asahan mong mayroong ibang mambabasa na hindi sasang-ayon sa iyong argumento kaya ilahad dito ang iyong mga lohikal na dahilan kung bakit iyon ang iyong posisyon.</li>\r\n<li>Ikalimang talata: Unang konklusyon na lalagom sa iyong isinulat.</li>\r\n<li>Ikaanim na talata: Ikalawang konklusyon na sasagot sa tanong na &ldquo;E ano ngayon kungb iyan ang iyong posisyon?</li>\r\n<li>Isulat na ang draft ng iyong tekstong argumentatibo.</li>\r\n<li>Basahing muli ang isinulat upang maiwasto ang mga pagkakamali sa wika at mekaniks.</li>\r\n<li>Muling isulat ang iyong teksto taglay ang anumang pagwaasto. Ito ang magiging pinal na kopya.</li>\r\n</ol>'),(39,49,'prosudyural','prosidyural','prosidyural','<p style=\"text-align: center;\"><strong><em>Ang Tekstong Prosidyural</em></strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; Isang espesyal na uri ng <strong><em>tekstong ekspositori</em></strong> ang tekstong prosidyural. inilalahad nito ang serye o mga hakbang sa pagbuo ng isang gawain upang matamo ang inaasahan. nagpapaliwanag ito kung paano ginagawa ang isang bagay. Layunin nitong maipabatid ang mga wastong hakbang na dapat isagawa. Sa panahon ngayong maraming mga bagay ang sinasabi nilang do-it-yourself o &lsquo;yung mga bagay na sa halip na kumuha ng iba pang gagawa ay ikaw na mismo ang gagawa, nararapat lamang na marunong tayong umunawa sa mga prosidyur na nakalakip dito. Ang wastong pag-unawa sa mga prosidyur ang gagabay sa atin upang matagumpay na maisagawa ang isang bagay.</p>\r\n<p>&nbsp; &nbsp; &nbsp; Hindi sapat na marunong tayong umunawa sa mga tekstong prosidyural, dapat ding magkaroon tayo ng kakayahang sumulat ng isang prosidyur na mauunawaan ng lahat. Sa pagsulat ng tekstong prosidyural, kailangang malawak an kaalaman sa paksang tatalakayin. Nararapat ding malinaw at tama ang pagkakasunud-sunod ng dapat gawin upang hindi mailto o magkamali ang gagawa nito. Ang isa pang dapat tandaan ay ang paggamit ng mga <strong><em>payak ngunit angkop na salitang madaling</em></strong> <strong><em>maunawaan</em></strong> ng sinumang gagawa. Nakatutulong din ang <strong><em>paglalakip ng larawan o ilustrasyon</em></strong> kasama ng mga paliwanag upang higit na maging malinaw ang pagsasagawa sa mga hakbang. Dapat pakaisiping layunin ng tekstong prosidyural na maipaliwanag nang mabuti ang isang gawain upang maisagawa ito nang maayos at tumpak, kaya nararapat lamang na maisulat ito sa paraang mauunawaan ng lahat.</p>\r\n<p>&nbsp;</p>'),(40,46,'prosidyural','prosidyural','prosidyural','<p><strong><em>Ang tekstong Prosidyural</em></strong></p>\r\n<p>Isang espesyal na uri ng <strong><em>tekstong ekspositori</em></strong> ang tekstong prosidyural. inilalahad nito ang serye o mga hakbang sa pagbuo ng isang gawain upang matamo ang inaasahan. nagpapaliwanag ito kung paano ginagawa ang isang bagay. Layunin nitong maipabatid ang mga wastong hakbang na dapat isagawa. Sa panahon ngayong maraming mga bagay ang sinasabi nilang do-it-yourself o &lsquo;yung mga bagay na sa halip na kumuha ng iba pang gagawa ay ikaw na mismo ang gagawa, nararapat lamang na marunong tayong umunawa sa mga prosidyur na nakalakip dito. Ang wastong pag-unawa sa mga prosidyur ang gagabay sa atin upang matagumpay na maisagawa ang isang bagay.</p>\r\n<p>Hindi sapat na marunong tayong umunawa sa mga tekstong prosidyural, dapat ding magkaroon tayo ng kakayahang sumulat ng isang prosidyur na mauunawaan ng lahat. Sa pagsulat ng tekstong prosidyural, kailangang malawak an kaalaman sa paksang tatalakayin. Nararapat ding malinaw at tama ang pagkakasunud-sunod ng dapat gawin upang hindi mailto o magkamali ang gagawa nito. Ang isa pang dapat tandaan ay ang paggamit ng mga <strong><em>payak ngunit angkop na salitang madaling</em></strong> <strong><em>maunawaan</em></strong> ng sinumang gagawa. Nakatutulong din ang <strong><em>paglalakip ng larawan o ilustrasyon</em></strong> kasama ng mga paliwanag upang higit na maging malinaw ang pagsasagawa sa mga hakbang. Dapat pakaisiping layunin ng tekstong prosidyural na maipaliwanag nang mabuti ang isang gawain upang maisagawa ito nang maayos at tumpak, kaya nararapat lamang na maisulat ito sa paraang mauunawaan ng lahat.</p>\r\n<p>&nbsp;</p>'),(41,48,'prosidyural','prosidyural','prosidyural','<p><strong><em>Ang tekstong Prosidyural</em></strong></p>\r\n<p>Isang espesyal na uri ng <strong><em>tekstong ekspositori</em></strong> ang tekstong prosidyural. inilalahad nito ang serye o mga hakbang sa pagbuo ng isang gawain upang matamo ang inaasahan. nagpapaliwanag ito kung paano ginagawa ang isang bagay. Layunin nitong maipabatid ang mga wastong hakbang na dapat isagawa. Sa panahon ngayong maraming mga bagay ang sinasabi nilang do-it-yourself o &lsquo;yung mga bagay na sa halip na kumuha ng iba pang gagawa ay ikaw na mismo ang gagawa, nararapat lamang na marunong tayong umunawa sa mga prosidyur na nakalakip dito. Ang wastong pag-unawa sa mga prosidyur ang gagabay sa atin upang matagumpay na maisagawa ang isang bagay.</p>\r\n<p>Hindi sapat na marunong tayong umunawa sa mga tekstong prosidyural, dapat ding magkaroon tayo ng kakayahang sumulat ng isang prosidyur na mauunawaan ng lahat. Sa pagsulat ng tekstong prosidyural, kailangang malawak an kaalaman sa paksang tatalakayin. Nararapat ding malinaw at tama ang pagkakasunud-sunod ng dapat gawin upang hindi mailto o magkamali ang gagawa nito. Ang isa pang dapat tandaan ay ang paggamit ng mga <strong><em>payak ngunit angkop na salitang madaling</em></strong> <strong><em>maunawaan</em></strong> ng sinumang gagawa. Nakatutulong din ang <strong><em>paglalakip ng larawan o ilustrasyon</em></strong> kasama ng mga paliwanag upang higit na maging malinaw ang pagsasagawa sa mga hakbang. Dapat pakaisiping layunin ng tekstong prosidyural na maipaliwanag nang mabuti ang isang gawain upang maisagawa ito nang maayos at tumpak, kaya nararapat lamang na maisulat ito sa paraang mauunawaan ng lahat.</p>\r\n<p>&nbsp;</p>'),(42,50,'prosidyural','prosidyural','prosidyural','<p><strong><em>Ang tekstong Prosidyural</em></strong></p>\r\n<p>Isang espesyal na uri ng <strong><em>tekstong ekspositori</em></strong> ang tekstong prosidyural. inilalahad nito ang serye o mga hakbang sa pagbuo ng isang gawain upang matamo ang inaasahan. nagpapaliwanag ito kung paano ginagawa ang isang bagay. Layunin nitong maipabatid ang mga wastong hakbang na dapat isagawa. Sa panahon ngayong maraming mga bagay ang sinasabi nilang do-it-yourself o &lsquo;yung mga bagay na sa halip na kumuha ng iba pang gagawa ay ikaw na mismo ang gagawa, nararapat lamang na marunong tayong umunawa sa mga prosidyur na nakalakip dito. Ang wastong pag-unawa sa mga prosidyur ang gagabay sa atin upang matagumpay na maisagawa ang isang bagay.</p>\r\n<p>Hindi sapat na marunong tayong umunawa sa mga tekstong prosidyural, dapat ding magkaroon tayo ng kakayahang sumulat ng isang prosidyur na mauunawaan ng lahat. Sa pagsulat ng tekstong prosidyural, kailangang malawak an kaalaman sa paksang tatalakayin. Nararapat ding malinaw at tama ang pagkakasunud-sunod ng dapat gawin upang hindi mailto o magkamali ang gagawa nito. Ang isa pang dapat tandaan ay ang paggamit ng mga <strong><em>payak ngunit angkop na salitang madaling</em></strong> <strong><em>maunawaan</em></strong> ng sinumang gagawa. Nakatutulong din ang <strong><em>paglalakip ng larawan o ilustrasyon</em></strong> kasama ng mga paliwanag upang higit na maging malinaw ang pagsasagawa sa mga hakbang. Dapat pakaisiping layunin ng tekstong prosidyural na maipaliwanag nang mabuti ang isang gawain upang maisagawa ito nang maayos at tumpak, kaya nararapat lamang na maisulat ito sa paraang mauunawaan ng lahat.</p>'),(43,46,'ARALIN 2- GAMIT NG KATAGA','GAMIT NG KATAGA','GAMIT NG KATAGA','<ul>\r\n<li>Ang kaalaman sa wastong gamit ay kaugnay ng <strong>kaalamang</strong> <strong>pambalarila</strong><strong>.</strong></li>\r\n<li>Maging ang katha ay pasalita o pasulat, ang wastong gamit ay kailangan upang ang pagpapahayag ay <strong>maging</strong> <strong>tumpak</strong><strong>, </strong><strong>maayos</strong>, at <strong>mabisa</strong></li>\r\n<li><strong>Gamit ng May</strong></li>\r\n<li>A. kung ang salitang sinusundan ay isang;</li>\r\n<li>Pangngalan</li>\r\n<li>Pang-uri</li>\r\n<li>Pang-abay</li>\r\n<li>Pandiwa</li>\r\n<li>Panghalip na panao sa kaukulang paari</li>\r\n<li>Gamit ng MAYROON</li>\r\n<li>\r\n<ul>\r\n<li>A. kung ang sinusundan ay isang <strong>kataga</strong><strong> o </strong><strong>panghalip</strong> <strong>na</strong> <strong>panao</strong> <strong>sa</strong> <strong>kaukulang</strong> <strong>palagyo</strong><strong>.</strong></li>\r\n</ul>\r\n<p>Mga Halimbawa:</p>\r\n<p>1.Mayroon <u>pang</u> pagkain dito.</p>\r\n<p>2.Mayroon <u>silang</u> ibabalita sa inyo.</p>\r\n<p>3.Mayroon <u>kaming</u> sorpresa sa iyo.</p>\r\n</li>\r\n<li>\r\n<ul>\r\n<li>B. bilang <strong>panagot</strong> <strong>sa</strong> <strong>tanong</strong>.</li>\r\n</ul>\r\n<p>Halimbawa:</p>\r\n<p>1.Tanong: May pera pa ba kayo?</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sagot: <u>Mayroon</u></p>\r\n</li>\r\n<li>\r\n<ul>\r\n<li>C. kung nangangahulugan ng &ldquo;<strong>mayaman</strong>&rdquo;</li>\r\n</ul>\r\n<p>Halimbawa:</p>\r\n<p>1.Ang mga Zobel de Ayala ay tunay na <u>mayroon</u><u>.</u></p>\r\n</li>\r\n<li>\r\n<p>&nbsp;</p>\r\n<p>Sila ay isa sa mga <u>mayroon</u> sa kanilang lalawigan2.Tanong: May magulang pa ba si Salome?</p>\r\n<p>3.Sagot: <u>Mayroon</u> pa.</p>\r\n</li>\r\n<li>Sagutan ang mga sumusunod.</li>\r\n<li>1._______ inihahabilin ang matanda sa iyo bago ka umalis.</li>\r\n<li>2. Kailangang _______ akong mautusan bago kumagat ang dilim.</li>\r\n<li>3._______ tumatakbong bata sa labas ng bakuran.</li>\r\n<li>4. Siya ay _______ pagtingin sa iyo.</li>\r\n<li>Gamit ng Nang</li>\r\n<li>A. ginagamit na <u><strong>pangatnig</strong></u> sa hugnayang pangungusap (panimula ng sugnay na di makapag-iisa)</li>\r\n<li>Halimbawa:</li>\r\n<li>1. <u>Nang</u> ako ay dumating sa bahay, tulog na ang mga bata.</li>\r\n<li>&nbsp;</li>\r\n<li>&nbsp;</li>\r\n</ul>'),(44,46,'SINTAKS','SINTAKS','SINTAKS','<p style=\"text-align: center;\"><span style=\"font-size: 14pt;\"><em><strong>KAKAYAHANG PANGKOMUNIKATIBO NG MGA PILIPINO - KAKAYAHANG DISKORSAL: Pagtiyak sa Kahulugang Ipinahahayag ng mga Teksto/Sitwasyon Ayon sa Konteksto</strong></em></span></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Sa mga nakalipas na aralin, nabatid mo ang unang apat na kakayahang pangkomunikatibong dapat taglayin ng isang mahusay na komyunikeytor. Sinasabing mas nalilinang at lumalago ang kakayahang pangkomunikatibo kapag iba\'t ibang konteksto kapag ito ay madalas na ginagamit at nararanasan sa iba\'t ibang konteksto.</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Bagamat ang kahalagan ng bawat salik ng kakayahang pangkomunikatibo ay nakasalalay sa bawat isa, hindi matatawarang ang bawat salik ay mahalaga at nararapat lamang pag-aralan. Ngayong alam mo na ang iba pang salik ng kakayahang komunikatibo-ang lingguwistiko, gramatikal, sosyolingguwistiko, pragmatik, at istratedyik,\'tatalakayin natin ang isa pang salik, ang <strong>kakayahang diskorsal</strong>. Saklaw ng diskorsal ang pagkakaugnay ng serye ng mga salita o pangungusap na bumubuo ng isang makabuluhang teksto. Ang isang taong may kakayahang pangkomunikatibo ay nakapagbibigay rin ng wastong interpretasyon ng napakinggan o nabasang pangungusap o pahayag upang makabuo ng isang makabuluhang kahulugan. Masasabi mo bang may kakayahang diskorsal ang isang taong nagpahayag ng sumusunod?</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;\"Pumunta ako ng palengke kanina. Maglaro tayo. Makikita mo ang hinahanap mo. Isasama kita. Marami-rami rin ang kanyang kinain. Napaiyak ako sa palabas sa telebisyon.\"</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; Malinaw ba ang pahayag? Ano ang dapat gawin upang maging makabuluhan ang pahayag?</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; Tandaan, may dalawang bagay na isinasaalang-alang upang malinang ang kakayahang diskorsal - ang cohesion o pagkakaisa at coherence o pagkakaugnay-ugnay. Ugaliiang gumamit ng mga panandang kohesyong gramatikal at panandang pandiskurso upang matiyak ang kaisahan at pagkakaugnay-ugnay ng kaisipan. Masasabi nating may kakayahang diskorsal ang isang taong nagpapahayag nang may kaisahan at magkakaugnay.</p>\r\n<p><span style=\"font-size: 12pt; font-family: \'book antiqua\', palatino, serif;\"><em><strong>ANIM NA PAMANTAYAN SA PAGTATAYA NG KAKAYAHANG PANGKOMUNIKATIBO</strong></em></span></p>\r\n<p>&nbsp; &nbsp; &nbsp; Sina Canary at Cody (2000) ay nagbigay ng 6 na pamantayan sa pagtatay ng kakayahang pangkomunikatibo. Narito ang 6 na pamantayan.</p>\r\n<p><strong>1. Pakikibagay (Adaptability)</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Ang isang taong may kakayahang pangkomunikatibo ay may kakayahang mabago ang pag-uugali at layunin upang maisakatuparan ang pakikipag-ugnayan.</p>\r\n<p>&nbsp; &nbsp; &nbsp;Makikita ang kakayahang ito sa sumusunod:</p>\r\n<p>&nbsp; &nbsp; &nbsp;a. pagsali sa iba\'t ibang inter-aksiyong sosyal</p>\r\n<p>&nbsp; &nbsp; &nbsp;b. pagpapakita ng pagiging kalmado sa pakikisalamuha sa iba</p>\r\n<p>&nbsp; &nbsp; &nbsp;c. kakayahang ipahayag ang kaalaman sa pamamagitan ng wika</p>\r\n<p>&nbsp; &nbsp; &nbsp;d. kakayahang magpatawa habang nakikisalamuha sa iba</p>\r\n<p><strong>2. Paglahok sa Pag-uusap (Conversational Involvement)</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; May kakayahan ang isang taong gamitin ang kaalaman tungkol sa anumang paksa sa pakikisalamuha sa iba. Makikita ito kung taglay ng isang komyunikeytor ang sumusunod:</p>\r\n<p>&nbsp; &nbsp; &nbsp;a. kakayahang tumugon</p>\r\n<p>&nbsp; &nbsp; &nbsp;b. kakayahang makaramdam kung ano ang tingin sa kanya ng ibang tao</p>\r\n<p>&nbsp; &nbsp; &nbsp;c. kakayahang makinig at magpokus sa kausap</p>\r\n<p><strong>3. Pamamahala sa Pag-uusap (Conversational Management)</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Tumutukoy ito sa kakayahan ng isang taong pamahalaan ang pag-uusap. Nakokontrol nito ang daloy ng usapan at kung paanong ang mga paksa ay nagpapatuloy at naiiba.</p>\r\n<p><strong>4. Pagkapukaw-damdamin (Empathy)</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Ito ay pagpapakita ng kakayahang mailagay ang damdamin sa katauhan ng ibang tao at pag-iisip ng posibleng mangyari o maranasan kung ikaw ay nasa kalagayan ng isang tao o samahan.</p>\r\n<p><strong>5. Bisa (Effectiveness)</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Tumutukoy ito sa isa sa dalawang mahahalagang pamantayan upang mataya ang kakayahang pangkomunikatibo - ang pagtiyak kung epektibo ang pakikipag-usap. Ang taong may kakayahang pangkomunikatibo ay may kakayahang mag-isip kung ang kanyang pakikipag-usap ay epektibo at nauunawaan.</p>\r\n<p><strong>6. Kaangkupan (Appropriateness)</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Maliban sa bisa, isa pang mahalagang pamantayan upang mataya ang kakayahang pangkomunikatibo ay ang kaangkupan ng paggamit ng wika. Kung ang isang tao ay may kakayhang pangkomunikatibo, naiiangko niya ang kanyang wika sa sitwasyon, sa lugar na pinangyayarihan ng pag-uusap o sa taong kausap.</p>'),(45,46,'','ISTRATEDYIK','ISTRATEDYIK','<p style=\"text-align: center;\"><span style=\"font-size: 14pt;\"><strong><em>KAKAYAHANG PRAGMATIK</em></strong></span></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Sa mga nakalipas na dalawang aralin ay nabatid natin ang ilang kakayahang pangkomunikatibo tulad ng lingguwistiko o gramatikal at sosyolingguwistikong tutulong sa atin upang maging epektibo sa pakikipagtalastasan. Ang mga kakayahang pangkomunikatibo ay batay sa mga modelong binuo ng mga lingguwista. Sadyang may pagkakaiba ang mga modelo ngunit makikita natin ang pagkakatulad ng mga ito at ang layunin nitong magdebelop ng mga epektibong <em>komyunikeytor</em>. Sa araling ito, tatalakayin natin ang isa pang kakayahang pangkomunikatibo, ang kakayahang pragmatik. Bagama\'t ang mga kakayahang komunikatibo ay magkakaugnay, inisa-isa natin ang pagtalakay rito upang lubos na maipaliwanag at maunawaan. Kung ang isang tao ay may kakayahang pragmatik natutukoy nito ang kahulugan ng mensaheng sinasabi at di sinasabi, batay sa ikinikilos ng taong kausap. Natutukoy rin nito ang kaugnayan ng mga salita sa kanilang kahulugan batay sa paggamit at sa konteksto.</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; Sa pakikipagtalastasan,mahalagang maunawaan ang intensiyon ng nagsasalita dahil mahuhulaan ang mensahe nito ng tagapakinig. Mahalaga ang kakayahang pragmatiko bilang daan sa pagging epektibo ng pakikipagtalastasan, sapagkat nililinaw nito ang relasyon sa pagitan ng intensiyon ng nagsasalita o nagpapahatid ng mensahe at ang kahulugan nito.</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; Nararapat ding malamang may iba\'t ibang salik pang dapat isaalang-alang sa pag-unawa, kasama na rito ang intelektuwal na kalagayan ng decoder, kalinawan ng encoder at ang pagtatagpo ng kani-kanilang interpretasyon.</p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 14pt;\"><strong><em>KAKAYAHANG ISTRATEDYIK</em></strong></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 14pt;\"><span style=\"font-size: 12pt;\">&nbsp; &nbsp; &nbsp; Isa pang kakayahang pangkomunikatibo na dapat taglay ng isang mahusay rut komyunikeytor ay ang kakayahang <strong>istratedyik</strong>. Ito ay ang kakayahang magamit ang verbal at di verbal na mga hudy&auml;t upang maipabatid nang mas malinaw ang mensahe at maiwasan o maisaayos ang mga hindi pagkakaunawaan o mga puwang <em>(gaps)</em> sa komunikasyon. Sa isang bagong nag-aaral ng salitang hindi pa bihasa sa paggamit ng wikang binibigkas ay makatutulong ang paggamit ng mga a verbal na hudyat tulad ng kumpas ng kamay, tindig, ekspresyon ng mukha, at marami pang iba upang maipaabot ang tamang mensahe. Maging ang mga katutubong nagsasalita ng isang wika ay gumagamit din ng kakayhang istratedyik kapag minsang nakalimutan ang tawag sa isang bagay o nasa \"dulo na ito ng kanilang dila\" at hindi agad maalala ang tamang salita. Kilala rito ang mga Pilipinong madalas gumagamit ng senyas sa pamamagitan ng nguso o pagkumpas ng kamay kapag may nagtatanong ng lokasyon ng isang lugar.</span></span></p>'),(46,46,'','kakayahang sosyolingguwistiko','kakayahang sosyolingguwistiko','<p style=\"text-align: center;\"><em><span style=\"font-size: 14pt;\"><strong><span style=\"font-family: georgia, palatino, serif;\">MGA DAPAT ISAALANG-ALANG SA EPEKTIBONG KOMUNIKASYON</span></strong></span></em></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Sa ikalawang aralin nabatid mong hindi sapat na ang tao\'y matuto ng lengguwahe at makapagsalita, dapat ding maunawaan at magamit niya ito nang tama. Ayon sa lingguwistang si Dell Hymes, magiging mabisa lamang ang komunikasyon kung ito ay isasaayos, at sa pagsasaayos ng komunikasyon, may mga bagay na dapat isaalang-alang. Ginamit ni Dell Hymes ang SPEAKING bilang acronym upang isa-isahin ang mga dapat isaalang-alang upang magkaroon ng mabisang pakikipagtalastasan. Binuo niya ang modelo upang makatulong sa pagsusuri ng diskurso.</span></p>\r\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 50%;\">S (SETTING)</td>\r\n<td style=\"width: 50%;\">Ang lugar kung saan nag-uusap o nakikipagtalstasan ang mga tao. Mahalagang salik ang lugar kung saan nag-uusap ang mga tao. Katulad ng pananamit, ikino-konsidera din natin ang lugar na pinagyarihan ng pakikipagtalastasan upang maiangkop ang paraan ng ating pananalita. Halimbawa, kapag tayo ay nanonood ng isang pormal na palatuntunan, hindi tayo nakikipag-usap sa iba na parang tayo ay nasa kalsada lamang o nasa isang kasayahan.&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\">P (Participant)</td>\r\n<td style=\"width: 50%;\">Ang mga taong nakikipagtalstasan. Isinasaalang-alang din natin ang ating kausap upang pumili ng paraan kung paano siya kakausapin. Hindi natin kinakausap ang ating guro sa paraang ginagamit natin tuwing kausap natin ang ating mga kaklase o kaibigan. Sinisikap nating magbiga-galang sa ating guro habang sa ating mga kaklase o kaibigan ay kaswal o kampante ang ating pamamaraan.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\">E (Ends)</td>\r\n<td style=\"width: 50%;\">Mga layunin o pakay ng pakikipagtalastasan. Dapat bigyan ng konsiderasyon ang pakay o layunin sa pakikipag-usap. Hindi ba\'t kung tayo ay hihingi ng pabor ay gumagamit tayo ng paraang nagpapakita ng pagpapakumbaba? At kung nais din nating kumbinsihin ang kausap ay iba ang ating pamamaraan? Samakatuwid, nararapat na isaalang-alang ang layunin natin upang maiangkop natin ang paraan ng ating pakikipagtalastasan.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\">A (Act Sequence)</td>\r\n<td style=\"width: 50%;\">Ang takbo ng usapan. Bigyang-pansin din ang takbo ng usapan. Minsan ay nag-uumpisa tayo sa mainit na usapan at kapag mahusay ang nakikipag-usap ay madlas itong humahantong sa mapayapang pagtatapos. Kung minsan naman ay biruang nagbubunga ng pagkapiko o alitan. Ang isang mahusay na komyunikeytor ay nararapat lamang na maging sensitibo sa takbo ng usapan.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\">K (Keys)</td>\r\n<td style=\"width: 50%;\">Tono ng pakikipag-usap. Katulad ng setting o pook, nararapat ding isaalang-alang ang sitwasyon ng usapan, kung ito ba ay pormal o di pormal. Wala sigurong makagugusto kung mga salitang balbal ang gagamitin natin sa isang pormal na okasyon.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\">I (Instrumentalities)</td>\r\n<td style=\"width: 50%;\">Tsanel o midyum na ginamit, pasalita o pasulat. Dapat isaisip ang midyum ng pakikipagtalstasan. Iniaangkop natin ang tsanel na gagamitin sa kung ano ang sasabihin natin at kung saan natin ito sasabihin.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\">N (Norms)</td>\r\n<td style=\"width: 50%;\">Paksa ng usapan. Mahalagang alamin kung tungkol saan ang usapan. May mga sensitibong bagay na kung minsan ay limitado lamang ang ating kaalaman. Sa mga ganitong sitwasyon, suriin muna natin kung ang ilalahad natin ay tama o hindi. O di kaya minsan ay may mga paksang eksklusibo, kagaya ng sinasabi ng mga nakatatanda, may mga usapang pangmatanda, usapang pambabae lamang at usapang panlalaki lamang.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\">G (Genre)</td>\r\n<td style=\"width: 50%;\">Diskursong ginagamit, kung nagsasalaysay, nakikipagtalo, o nangangatwiran. Dapat iangkop ang uri ng diskursong gagamitin sa pakikipagtalastasan. Minsan dahil sa miskomunikasyon sa genre ay hindi nagkakaunawan ang magkausap.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; Binuo ni Dell Hymes ang modelong ito upang itaguyod ang pagsusuri ng diskurso bilang serye ng usapan sa isang kontekstong kultural.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong><span style=\"font-family: \'courier new\', courier, monospace; font-size: 12pt;\"><em>Pag-unawa batay sa Pagtukoy sa Sino, Paano, Kailan, Saan at Bakit</em></span></strong></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"font-family: \'courier new\', courier, monospace; font-size: 12pt;\"><em>Nangyari ang Sitwasyong Komunikatibo</em></span></strong></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Sa ikalawang aralin ng yunit na ito ay nabatid mo ang kahalagahan ng kakayahang pangkomunikatibo. Sa modeIong ginamit nina Canale at Swain, inisa-isa nila ang tatlong kakayahang pangkomunikatibo: una, ang lingguwistiko o gramatikal na kakayahang tinalakay sa ikalawang aralin; ikalawa, ang sosyolingguwistikong ating tatalakayin sa araling ito.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp; &nbsp; &nbsp; &nbsp; Sa pagtalakay ng kakayahang sosyolingguwistiko ay maaari nating balikan ang Inga usapin tungkol sa pagkakaiba ng competence o kagalingan o kakayahan sa performance o pagganap. Sa gitna ng maraming diskusyon, maganda ang naging pananaw ni Savignon (1972), isang propesor sa University of Illinois, sa pagkakaiba ng <em><strong>competence</strong></em> at <em><strong>performance</strong></em>. Ayon sa kanya, ang competence ay ang batayang kakayahan o kaalaman ng isang tao sa wika habang ang performance ay ang paggamit ng tao sa wika. Idinagdag niya na ang kakayahan o kaalaman ng tao sa wika ay makikita, madedebelop, at matataya l&acirc;mang gamit ang pagganap. Itinutumbas niya ang kakayahang pangkomunikatibo sa kakayahang gamitin ng tao ang isang wika.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp; &nbsp; &nbsp;&nbsp;Ang kakayahang sosyolingguwistiko ay ang pagsasaalang-alang ng isang tao sa ugnayan niya sa mga kausap, ang impormasyong pinag-uusapan, at ang lugar ng Ianilang pmag-uusapan. Isinasa-alang-alang dito ang kontekstong sosyal ng isang wika. Sa mga bagay na dapat isaalang-alang para sa epektibong komunjkasyon na inisa-isa ni Hymes sa kanyang acronym na SPEAKING, mapapansing tatlo sa mga ito ay ang participant, setting, at norm na binibigyan din ng konsiderasyon ng isang taong may kakayahang sosyolingguwistiko. Ayon kay Fantini (sa Pagkalinawan 2004), isang propesor sa wika, may mga salik-panlipunang dapat isaalang-alang sa paggamit ng wika, ito ay ang ugnayan ng nag-uusap, ang paksa, lugar, at iba pa. Ang isang taong may ganitong uri ng kakayahan ay iniaangkop ang Wika sa kanyang kausap,\'kung ang kanyang kausap ba ay bat&agrave; o matanda, pmpesyonal o hindi pa nakapagtatapos, lokal ba o dayuhan. Iniaangkop din Hiya sa lugar na pinapusapan, tulad ng kung nasa ibang bansa o lugar ha siya na hindi masyadon.g nakauunawa ng kanyang wika. Isinasa-alang-alang din niya ang impormasyong pinag-uusapan, ito ba ay tungkol sa iba-ibang paniniwala tungkol sa politika o tungkol sa iba-iba&rsquo;t pananampalataya. Kailangang alam at magamit ng nagsasalita ang angkop na wika para sa hinihinging pagkakataon. Dito makikilala ang pagkakaiba ng isang taong mahusay lang magsalita kumpara sa isang katutubong nagsasalita ng wika. Madalas ang isang mahusay lang magsalita ay maaaring magkamali sa pagpili ng salitang gagamitin na maaaring magbigay ng impresyon sa tagapakinig na siya&rsquo;y walang galang, mayabang o naiiba.</span></p>'),(47,46,'ARALIN 1-PAGBASA','Batayang Kaalaman sa Mapanurin','Batayang Kaalaman sa Mapanuring Pagbasa','<p>&ldquo;Huwag kang magbasa, gaya ng mga bata, upang libangin ang sarili, o gaya ng mga matatayog ang pangarap, upang matuto. Magbasa ka upang mabuhay.&rdquo;</p>\r\n<p><strong>Kahulugan ng Pagbasa</strong></p>\r\n<p>Ayon kina Anderson et al. (1985), sa aklat na <em>Becoming a Nation of Readers</em>, ang pagbasa ay isang proseso ng pagbuo ng kahulugan mula sa mga nakasulat na teksto. Ito ay isang kompleks na kasanayan na nangangailangan ng koordinasyon ng iba&rsquo;t iba at magkakaugnay na pinagmumulan ng impormasyon</p>\r\n<p><strong>Kahulugan at </strong><strong>Kahalagahan</strong><strong> ng </strong><strong>Pagbasa</strong></p>\r\n<p>Ayon kina Wixson et al. (1987) sa artikulong <em>&ldquo;New Directions in Statewide Reading Assessment&rdquo;</em> ang pagbasa ay isang proseso ng pagbuo ng kahulugan sa pamamagitan ng interaksiyon ng:</p>\r\n<p>1)imbak o umiiral nang kaalaman ng mambabasa;</p>\r\n<p>2)impormasyong ibinibigay ng tekstong binabasa; at</p>\r\n<p>&nbsp;konteksto ng kalagayan o sitwasyon sa pagbabasa</p>\r\n<ul>\r\n<li>Ang pagbasa ay isang kompleks na kognitibong proseso ng pagtuklas sa kahulugan ng bawat simbolo upang makakuha at makabuo ng kahulugan.</li>\r\n</ul>\r\n<ul>\r\n<li><strong>Kaalamang Ponemiko&gt; Pag-aaral ng Ponolohiya&gt; Katatasan&gt; Bokabularyo&gt; Komprehensyon</strong></li>\r\n</ul>\r\n<p><strong>Intensibo</strong></p>\r\n<ul>\r\n<li>Kinapapalooban ng malalimang pagsusuri sa pagkakaugnay-ugnay, estruktura, at uri ng diskurso sa loob ng teksto, pagtukoy sa mahahalagang bokabularyong ginamit ng manunulat, at paulit-ulit at maingat na paghahanap ng kahulugan.</li>\r\n<li>Sa ganitong uri ng pagbasa, nakatutulong ang pagbabalangkas o paggawa ng larawang konseptuwal upang lubos na maunawaan ng mag-aaral ang isang teksto.</li>\r\n</ul>\r\n<p><strong>Ekstensibo</strong></p>\r\n<ul>\r\n<li>Ayon kina Long at Richards (1987), nagaganap ang ekstensibong pagbabasa kapag ang isang mambabasa ay nagbabasa ng maramihang babasahin na ayon sa kaniyang interes, mga babasahing kadalasang hindi kahingian sa loob ng klase o itinatakda sa anomang asignatura.</li>\r\n</ul>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; Kadalasan, ang layunin ng mambabasa sa ganitong uri ng pagbasa ay upang makuha lamang ang &ldquo;gist&rdquo; o pinaka-esensya at kahulugan ng binasa na hindi&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; pinagtutuunan ng pansin ang mga salitang malabo o hindi alam ang kahulugan</p>\r\n<p><strong>Scanning</strong></p>\r\n<ul>\r\n<li>Mabilisang pagbasa ng isang teksto na ang pokus ay hanapin ang ispesipikong impormasyon na itinatakda bago bumasa. Kinapapalooban ito ng bilis at talas ng mata sa paghahanap hanggang sa makita ng mambabasa ang tiyak na kinakailangang impormasyon.</li>\r\n<li>Kung ang kahingian ay alalahanin ang pangalan, petsa, simbolo, larawan, o tiyak na sipi na makatutulong sa iyo, scanning ang angkop na paraan ng pagbasa na dapat gamitin. Ibig sabihin, may paunang pag-alam o pagkaunawa na sa hinahanap na impormasyon at ang layunin ay matiyak ang katumpakan nito na makikita sa mga libro o iba pang sanggunian.</li>\r\n</ul>\r\n<p><strong>Skimming</strong></p>\r\n<ul>\r\n<li>Mabilisang pagbasa na ang layunin ay alamin ang kahulugan ng kabuuang teksto, kung paano inorganisa ang mga ideya o kabuuang diskurso ng teksto at kung ano ang pananaw at layunin ng manunulat.</li>\r\n<li>Mas kompleks ang skimming kaysa scanning dahil nangangailangan ito ng mabilisang paraan ng organisasyon at pag-alaala sa panig ng mambabasa upang maunawaan ang kabuuang teksto at hindi lamang upang matagpuan ang isang tiyak na impormasyon sa loob nito</li>\r\n</ul>\r\n<p><strong>Antas ng Pagbasa</strong></p>\r\n<p><strong>Primarya</strong></p>\r\n<ul>\r\n<li>Ito ang pinakamababang antas ng pagbasa at pantulong upang makamit ang literasi sa pagbasa. Kinapapalooban lamang ng pagtukoy sa tiyak na datos at ispesipikong impormasyon gaya ng petsa, setting, lugar, o mga tauhan sa isang teksto.</li>\r\n<li>Itinuturing na magkakahiwalay ang mga impormasyong ito, na mahirap para sa bagong mambabasa upang makabuo ng kabuuang hinuha at pag-unawa sa teksto.</li>\r\n<li>Nauunawaan lamang ang hiwa-hiwalay na impormasyon sa literal na antas at hindi nakabubuo ng interpretasyon mula sa pagkakaugnay-ugnay ng mga nito.</li>\r\n</ul>\r\n<p><strong>Mapagsiyasat</strong></p>\r\n<ul>\r\n<li>Sa antas na ito, nauunawaan na ng mambabasa ang kabuuang teksto at nakapagbibigay ng mga hinuha o impresyon tungkol dito.</li>\r\n<li>Sa pamamagitan nito, nakapagbibigay ng mabilisan ngunit makabuluhang paunang rebyu sa isang teksto ang mambabasa upang matukoy kung kakailanganin niya ito at kung maaari itong basahin nang mas malaliman.</li>\r\n<li>Paimbabaw ang katangian ng pagbasang ito sapagkat halos panlabas na bahagi lamang ng teksto ang tinitingnan. Hindi ito pinagiisipan nang malalim para magbigay ng interpretasyon o pinag-uukulan ng pansin ang ilang bahaging hindi maunawaan sa teksto.</li>\r\n</ul>\r\n<p><strong>Analitikal</strong></p>\r\n<ul>\r\n<li>Sa antas na ito ng pagbasa, ginagamit ang mapanuri o kritikal na pag-iisip upang malalimang maunawan ang kahulugan ng teksto at ang layunin o pananaw ng manunulat.</li>\r\n<li>Bahagi ng antas na ito ang pagtatasa sa katumpakan, kaangkupan, at kung katotohanan o opinyon ang nilalaman ng teksto.</li>\r\n<li>Malalim at mapanuri na ang antas na ito, ngunit hindi rito nagtatapos ang layunin ng pagbasa.</li>\r\n</ul>\r\n<p><strong>Sintopikal</strong></p>\r\n<ul>\r\n<li>Sa sintopikal na pagbasa, nakabubuo ng sariling perspektiba o pananaw sa isang tiyak na larangan mula sa paghahambing ng mga akdang inunawa.</li>\r\n<li>Ito ay hindi lamang pag-unawa sa mga nariyan nang mga eksperto sa isang larangan o disiplina, kundi ang pagbuo ng sariling sistema ng kaalaman at pag-unawa mula sa pagbasa sa mga ekspertong ito. Ang mga aklat na binasa mo ay mga kasangkapan lamang upang maunawaan mo ang mga kaalaman na naipundar na ng mga naunang iskolar.</li>\r\n<li>Sa pamamagitan ng sistematikong paraan, pinaghahalo ang mga impormasyon mula sa aklat at ang mga sariling karanasan at kaalaman upang makabuo ng ugnayan at bagong mga pananaw at kaalaman. Ibig sabihin, sa antas na ito ng pagbasa, itinuturing mo na rin ang sarili bilang isa sa mga eksperto ng iyong binasa.</li>\r\n</ul>'),(48,46,'ARALIN 2-  MGA KASANAYAN','MGA KASANYAN SA MAPANURING PAG','MGA KASANAYAN SA MAPANURING PAGBASA','<p>BAGO MAGBASA-</p>\r\n<ul>\r\n<li>Pagsusuri ng panlabas na katangian ng teksto upang malaman ang tamang estratehiya sa pagbasa batay sa uri at genre ng teksto o kung kinakailangan ba ito ayon sa itinakdang layunin ng pagbasa.</li>\r\n<li>Kinapapalooban ito ng previewing o surveying ng isang teksto sa pamamagitan ng mabilisang pagtingin sa mga larawan, pamagat, at pangalawang pamagat sa loob ng aklat.</li>\r\n<li>Sa bahaging ito, iniuugnay sa inisyal na pagsisiyasat ang mga imbak at kaligirang kaalaman upang lubusang masuri kung anong uri ng teksto ang babasahin. Nakabubuo ng mga tanong at matalinong prediksyon kung tungkol saan ang isang teksto batay sa isinagawang pagsisiyasat</li>\r\n</ul>\r\n<p>HABANG NAGBABASA</p>\r\n<ul>\r\n<li>Nakapaloob sa bahaging ito ang: 1) Pagtantiya sa bilis ng pagbasa; 2) Biswalisasyon ng binabasa; 3) Pagbuo ng koneksiyon; 4) Paghihinuha; 5) Pagsubaybay sa komprehensiyon; 6) Muling pagbasa; 7) Pagkuha ng kahulugan mula sa konteksto.</li>\r\n<li>Sinisimulan ng isang aktibong mambabasa ang paglilipat ng impormasyon sa matagalang memorya sa pamamagitan ng elaborasyon, organisasyon, at pagbuo ng mga biswal na imahen. Ang <strong>elaborasyon</strong> ay ang pagpapalawak at pagdaragdag ng bagong ideya sa impormasyong natutuhan mula sa teksto. Ang <strong>organisasyon</strong> ay pagbuo ng koneksiyon sa pagitan ng iba&rsquo;t ibang bahagi ng impormasyon na nakuha sa teksto habang ang <strong>pagbuo</strong><strong> ng </strong><strong>biswal</strong> <strong>na</strong> <strong>imahen</strong> ay paglikha ng mga imahen at larawan sa isipan ng mambabasa habang nagbabasa.</li>\r\n</ul>\r\n<p>PAGKATAPOS MAGBASA</p>\r\n<ul>\r\n<li><strong>Pagtatasa ng </strong><strong>komprehensiyon</strong><strong>.</strong> Sagutin ang iba&rsquo;t ibang tanong tungkol sa binasa upang matasa ang kabuuang komprehensiyon o pag-unawa sa binasa.</li>\r\n<li><strong>Pagbubuod.</strong> Sa pamamagitan ng pagbubuod, natutukoy ng manunulat ang pangunahing ideya at detalye sa binasa.</li>\r\n<li><strong>Pagbuo ng </strong><strong>sintesis</strong><strong>.</strong> Halos kagaya rin ito ng pagbubuod, ngunit bukod sa pagpapaikli ng teksto, ang pagbuo ng sintesis ay kinapapalooban ng pagbibigay ng perspektiba at pagtingin ng manunulat batay sa kaniyang pag-unawa.</li>\r\n<li><strong>Ebalwasyon.</strong> Pagtataya ng mambabasa sa katumpakan at kaangkupan ng mga impormasyong nabasa sa teksto.</li>\r\n</ul>\r\n<p>KATOTOHANAN</p>\r\n<p>Ang katotohanan ay mga pahayag na maaaring mapatunayan o mapasubalian sa pamamagitan ng empirikal na karanasan, pananaliksik, o pangkalahatang kaalaman o impormasyon.</p>\r\n<p>OPINYON</p>\r\n<p>Ang opinyon naman ay mga pahayag na nagpapakita ng preperensiya o ideya batay sa personal na paniniwala at iniisip ng isang tao. Maaaring kakitaan ito ng mga panandang diskurso tulad ng &ldquo;sa opinyon ko,&rdquo; &ldquo;para sa akin,&rdquo; &ldquo;gusto ko,&rdquo; o sa &ldquo;tingin ko.&rdquo;</p>\r\n<p>LAYUNIN</p>\r\n<ul>\r\n<li>Ang layunin ay tumutukoy sa nais iparating at motibo ng manunulat sa teksto. Mahihinuha ito sa pamamagitan ng uri ng diskursong ginamit sa pagpapahayag.</li>\r\n<li>Halimbawa, naglalarawan ba ito o kaya ay nagkukuwento lang ng isang tiyak na karanasan o sitwasyon? Maaari ding nangangatuwiran ito o kaya naman ay hinihikayat ang mambabasa na pumanig sa opinyon o paninindigan niya.</li>\r\n<li>Sa layunin, tinutukoy rin ang suliranin o pangunahing tanong ng akda na nais solusyonan ng may-akda</li>\r\n</ul>\r\n<p>PANANAW</p>\r\n<ul>\r\n<li>Ang pananaw naman ay ang pagtukoy kung ano ang preperensiya ng manunulat sa teksto. Ibig sabihin, natutukoy rito kung ano ang distansiya niya sa tiyak na paksang tinatalakay. Nasa unang panauhan ba ito na maaaring magpakita na personal ang perspektiba niya sa paglalahad, o kaya naman ay nasa ikatlong panauhan na nagbibigay ng obhetibong pananaw at paglalahad sa paksa?</li>\r\n<li>Mula sa mahusay na pagtukoy ng pananaw, nahihinuha rin ng mambabasa kung ano ang kahihinatnan ng isang teksto.</li>\r\n</ul>\r\n<p>DAMDAMIN</p>\r\n<ul>\r\n<li>Ang damdamin naman ay ang ipinahihiwatig na pakiramdam ng manunulat sa teksto. Maaaring nagpapahayag ito ng kaligayahan, tuwa, galit, tampo, o kaya naman ay matibay na paniniwala o paninindigan tungkol sa isang pangyayari o paksa.</li>\r\n<li>Dahil sa damdamin na ipinahahayag ng teksto, hindi naiiwasan na ito rin ang nagiging pakiramdam ng mambabasa sa pagbasa nito. Sa katapusan ng pagbasa, maaari ding tasahin ng isang mambabasa kung nagtagumpay ba ang manunulat na iparamdam ang layunin ng teksto.</li>\r\n</ul>\r\n<p>PARAPHRASE</p>\r\n<ul>\r\n<li>Ang paraphrase ay tumutukoy sa muling pagpapahayag ng ideya ng may-akda sa ibang pamamaraan at pananalita upang padaliin at palinawin ito para sa mambabasa.</li>\r\n<li>Mahalaga ang paraphrase sa pananaliksik upang tukuyin ang pinagmulan ng isang ideya o kaisipan at ipahayag ito sa pamamaraan na makatutulong sa pananaliksik.</li>\r\n</ul>\r\n<p>ABSTRAK</p>\r\n<ul>\r\n<li>Ang abstrak naman ay isang buod ng pananaliksik, tesis, o kaya ay tala ng isang komperensiya o anomang pag-aaral sa isang tiyak na disiplina o larangan.</li>\r\n<li>Ang abstrak ay nakatutulong upang mabilis na makita ng isang mambabasa ang kabuuang latag ng pananaliksik kabilang ang mga layunin at kinalabasan nito. Sa ilang publikasyon, tinatawag din itong precis o synopsis.</li>\r\n</ul>\r\n<p>REBYU</p>\r\n<ul>\r\n<li>Ang rebyu naman ay isang uri ng pampanitikang kritisismo na ang layunin ay suriin ang isang aklat batay sa nilalaman, estilo, at anyo ng pagkakasulat nito.</li>\r\n<li>Naglalaman din ang rebyu ng pagtataya o ebalwasyon ng akda batay sa personal na pananaw ng mambabasa na nagbibigay ng rebyu. Ang mga nagsusulat ng rebyu sa mga pahayagan o online portal ay gumagamit ng panunuri upang magpalaganap ng sariling kaalaman na sumusuporta o kaya ay nagpapasubali sa nilalaman ng aklat.</li>\r\n<li>Maaaring ang rebyu ay naglalaman ng maikling buod ng aklat upang magkaroon ng ideya ang mga mambabasa.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),(49,46,'PANANALIKSIK','URI PANANALIKSIK','PANANALIKSIK','<p>PANANALIKSIK</p>\r\n<p style=\"text-align: justify;\">-Mula sa <u>panlaping</u><u>&nbsp; pang (pan + d, l, r, s, t) at </u><u>salitang</u> <u>ugat</u> <u>na</u> <u>saliksik</u>, nangangahulugan ito ng malalim na pagsusuri at&nbsp; pagsisiyasat sa paksang nais pagtuunan ng pag-aaral.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br />Sa&nbsp; <u>Ingles&nbsp; ay Research</u>&nbsp; na may kahulugan sa diksyunaryo na: maingat, sistematikong pag-aaral at pag-iimbestiga sa iba&rsquo;t ibang saklaw ng karunungan.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br />-Ayon <u>kay</u><u> Galileo </u><u>Zafra</u>, isang propesor at batikang mananaliksik mula sa Unibersidad ng Pilipinas &ldquo; ang salitang research ay lumang salitang Pranses na recherche na ang kahulugan ay to seek out o hanapin.</p>\r\n<p>&nbsp;-Ayon sa <u>Oxford Concise Dictionary,</u> ang pananaliksik ay sistematikong pag-iimbestiga at pag-aaral ng mga materyal upang mailatag ang katotohanan at makabuo ng kongklusyon.</p>\r\n<p>&nbsp;- Ayon sa <u>Edison State College</u>, ang pananaliksik ay isang imbestigasyon ng isang paksa na gumagamit ng mga mapagkakatiwalaan at mahusay na batis ng kaalaman</p>\r\n<p><u>Bilang </u><u>gawaing</u> <u>akademiko</u>, ang pananaliksik ay isang maingat , kritikal at disiplinadong inquiry na gumagamit ng iba&rsquo;t ibang teknik at pamamaraan batay sa kalagayan ng natukoy na suliranin tungo sa paglilinaw at solusyon nito</p>\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; URI NG PANANALIKSIK</strong></p>\r\n<table width=\"848\">\r\n<tbody>\r\n<tr>\r\n<td width=\"424\">\r\n<p><strong>BASIC</strong></p>\r\n</td>\r\n<td width=\"424\">\r\n<p><strong>&nbsp;APPLIED</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"424\">\r\n<p>Dagdag kaalaman at impormasyon</p>\r\n</td>\r\n<td width=\"424\">\r\n<p>Solusyon sa isang umiiral na suliranin</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"424\">\r\n<p>Pagtuklas at Imbensyon</p>\r\n</td>\r\n<td width=\"424\">\r\n<p>Inobasyon at Aplikasyon</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"424\">\r\n<p>Ang tuon ng pananaliksik ay akademiko</p>\r\n</td>\r\n<td width=\"424\">\r\n<p>Ang tuon ng paanaliksik ay solusyonan ang problemang umiiral</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"424\">\r\n<p>Malawak ang nasasaklaw</p>\r\n</td>\r\n<td width=\"424\">\r\n<p>Ang pokus o tiyak ang saklaw</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"424\">&nbsp;</td>\r\n<td width=\"424\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>'),(50,46,'ARALIN 11','ETIKA NG PANANALIKSIK','ETIKA NG PANANALIKSIK','<ul>\r\n<li>Ang pagiging <strong>etikal</strong> ay tumutukoy sa pagiging matuwid, makatarungan, matapat, at mapagpahalaga sa kapuwa ng isang tao. Kung ilalapat ito sa pagsasagawa ng pananaliksik, mahihinuha na ang pagiging etikal sa larangang ito ay pagsunod sa mga pamantayang may pagpapahalaga sa katapatan, kabutihan, at pagpapanguna sa kapakanan ng kapuwa.</li>\r\n</ul>\r\n<p><strong>Mga Gabay sa Etikal na Pananaliksik</strong></p>\r\n<p><strong>Pagkilala </strong><strong>sa</strong> <strong>Pinagmulan</strong><strong> ng </strong><strong>mga</strong> <strong>Ideya</strong> <strong>sa</strong> <strong>Pananaliksik</strong></p>\r\n<p>&nbsp; &nbsp; Gaya ng nabanggit sa unang bahagi ng aralin, ang pananaliksik ay maihahalintulad sa paglahok sa isang pampublikong diyalogo. Ibig sabihin, bukod sa mananaliksik ay maaaring marami nang naunang nag-isip tungkol sa partikular na paksang nais mong unawain at pagyamanin. Mahalaga ang pagbanggit at pagkilala sa iba pang mananaliksik at iskolar na naging tuntungan at pundasyon ng iyong pananaliksik. Sa pamamagitan ng diyalogong ito, nakalilikha ng isang komunidad ng mga mananaliksik na may malasakit at iisang layunin.</p>\r\n<p><strong>Boluntaryong </strong><strong>Partisipasyon</strong><strong> ng </strong><strong>mga</strong> <strong>Kalahok</strong></p>\r\n<p>&nbsp; Kinakailangang hindi pinilit ang sinomang kalahok o respondente sa pagbibigay ng impormasyon o anomang partisipasyon sa pananaliksik. Bago simulan ang pagsagot sa sarbey, pakikipanayam, o eksperimento, kailangang maging malinaw muna sa mga tagasagot ang kabuuang layunin ng pananaliksik at halaga ng kanilang partisipasyon. Kung eksperimental, mahalagang maunawaan din ng kalahok ang bigat o inaasahang peligro ng eksperimento at kailangang buong-loob ang kaniyang paglahok sa kabila nito.</p>\r\n<p><strong>Pagiging </strong><strong>Kumpidensiyal</strong><strong> at </strong><strong>Pagkukubli</strong> <strong>sa</strong></p>\r\n<p><strong>Pagkakakilanlan</strong> <strong>ng </strong><strong>Kalahok</strong></p>\r\n<p>&nbsp; Kailangang ipaunawa sa mga kalahok na ang anomang impormasyon na magmumula sa kanila ay gagamitin lamang sa kapakinabangan ng pananaliksik. Dapat ding pag-isipan ng mananaliksik kung paano ikukubli ang pagkakakilanlan ng tagasagot lalong-lalo na sa mga pananaliksik na may sensitibong paksa. Sa mga pagkakataong kailangang isapubliko ang resulta ng pananaliksik o kaya&rsquo;y ibahagi sa colloquium o publikasyon, kailangan pa ring ipagpaalam at hingin ang permiso ng mga tagasagot na pangunahing pinagmulan ng datos ng pananaliksik.</p>\r\n<p><strong>Pagbabalik at </strong><strong>Paggamit</strong> <strong>sa</strong> <strong>Resulta</strong><strong> ng </strong><strong>Pananaliksik</strong></p>\r\n<p>&nbsp;&nbsp; Mahalagang ipaalam sa mga tagasagot ang sistematikong pagsusuri ng mananaliksik sa kinalabasan ng pag-aaral. Madalas na nararamdaman ng mga kalahok, lalo na yaong mga nasa komunidad, na ginagamit lamang sila ng mananaliksik upang kumuha ng datos at pagkatapos ay parang bulang nawawala ang mga ito. Ito ay dahil sa mangilanngilan lamang na mananaliksik ang bumabalik upang ibahagi sa mga kalahok ang kinalabasan ng pag-aaral. Kung may awtput tulad ng modelo, pagbuo ng polisiya, o iba pang mahahalagang rekomendasyon ang pananaliksik, makabubuti kung ipaalam ito sa kinauukulan upang makatulong sa kapakinabangan ng komunidad o kaugnay na institusyong pinag-aaralan.</p>\r\n<p><strong><em>Plagiarism</em></strong><strong> at </strong><strong>ang</strong> <strong>mga</strong> <strong><br /></strong><strong>Responsibilidad</strong> <strong>ng </strong><strong>Mananaliksik</strong></p>\r\n<ul>\r\n<li>Ayon sa Purdue University Online Writing Lab (2014), <strong>ang</strong><strong> plagiarism ay </strong><strong>ang</strong> <strong>tahasang</strong> <strong>paggamit</strong><strong> at </strong><strong>pangongopya</strong><strong> ng </strong><strong>mga</strong> <strong>salita</strong><strong> at/o </strong><strong>ideya</strong><strong> ng </strong><strong>walang</strong> <strong>kaukulang</strong> <strong>pagbanggit</strong><strong> o </strong><strong>pagkilala</strong> <strong>sa</strong> <strong>pinagmulan</strong> <strong>nito</strong><strong>.</strong></li>\r\n<li>pag-angkin sa gawa, produkto o ideya ng iba;</li>\r\n<li>hindi paglalagay ng maayos na panipi sa mga siniping pahayag;</li>\r\n<li>pagbibigay ng maling impormasyon sa pinagmulan ng siniping pahayag;</li>\r\n<li>pagpapalit ng mga salita sa katulad na wika o kaya ay pagsasalin ng teksto ngunit pangongopya sa ideya nang walang sapat na pagkilala;</li>\r\n<li>ang pangongopya ng napakaraming ideya at pananalita sa isang pinagkunan na halos bumuo na sa iyong produkto, tukuyin mo man o hindi ang pinagmulan nito</li>\r\n</ul>'),(51,46,'ARALIN 10','PANANALIKSIK','URI NG PANANALIKSIK','<p>PANANALIKSIK&nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Mula sa <u>panlaping</u><u>&nbsp; pang (pan + d, l, r, s, t) at </u><u>salitang</u> <u>ugat</u> <u>na</u> <u>saliksik</u>, nangangahulugan ito ng malalim na pagsusuri at&nbsp; pagsisiyasat sa paksang nais pagtuunan ng pag-aaral.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br />Sa&nbsp; <u>Ingles&nbsp; ay Research</u>&nbsp; na may kahulugan sa diksyunaryo na: maingat, sistematikong pag-aaral at pag-iimbestiga sa iba&rsquo;t ibang saklaw ng karunungan.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ayon <u>kay</u><u> Galileo </u><u>Zafra</u>, isang propesor at batikang mananaliksik mula sa Unibersidad ng Pilipinas &ldquo; ang salitang research ay lumang salitang Pranses na recherche na ang kahulugan ay to seek out o hanapin.</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ayon sa <u>Oxford Concise Dictionary,</u> ang pananaliksik ay sistematikong pag-iimbestiga at pag-aaral ng mga materyal upang mailatag ang katotohanan at makabuo ng kongklusyon.</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ayon sa <u>Edison State College</u>, ang pananaliksik ay isang imbestigasyon ng isang paksa na gumagamit ng mga mapagkakatiwalaan at mahusay na batis ng kaalaman</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; URI NG PANANALIKSIK</p>\r\n<table width=\"848\">\r\n<tbody>\r\n<tr>\r\n<td width=\"424\">\r\n<p><strong>BASIC</strong></p>\r\n</td>\r\n<td width=\"424\">\r\n<p><strong>&nbsp;APPLIED</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"424\">\r\n<p>Dagdag kaalaman at impormasyon</p>\r\n</td>\r\n<td width=\"424\">\r\n<p>Solusyon sa isang umiiral na suliranin</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"424\">\r\n<p>Pagtuklas at Imbensyon</p>\r\n</td>\r\n<td width=\"424\">\r\n<p>Inobasyon at Aplikasyon</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"424\">\r\n<p>Ang tuon ng pananaliksik ay akademiko</p>\r\n</td>\r\n<td width=\"424\">\r\n<p>Ang tuon ng paanaliksik ay solusyonan ang problemang umiiral</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"424\">\r\n<p>Malawak ang nasasaklaw</p>\r\n</td>\r\n<td width=\"424\">\r\n<p>Ang pokus o tiyak ang saklaw</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"424\">&nbsp;</td>\r\n<td width=\"424\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>'),(52,1013,'MODYUL 3','Sitwasyong Pangwika sa Pelikul','Pelikula at Dula','<p style=\"text-align: left;\"><strong>Tuklasin</strong></p>\r\n<p style=\"text-align: justify;\">Sa bahaging ito naman ay ating tatalakayin ang kalagayan ng wika sa mga pelikula <br />at dulang Filipino upang ganap mong maunawaan ang araling ito.</p>\r\n<p style=\"text-align: justify;\"><br /><strong>Pelikula at Dul&acirc;</strong><br />Ang pelikula na kilala rin b&iacute;lang sine at pinilakang-tabing ay isang larangan na <br />nagpapakita ng mga gumagalaw na larawan b&iacute;lang isang anyo ng sining o b&iacute;lang <br />bahagi ng industriya ng libangan.<br />Ang panonood ng pelikula ang pinakamura at abot-kayang uri ng libangan ng lahat <br />ng uri ng tao sa lipunan. Iba-iba ang uri ng pelikulang tinatangkilik ng mga <br />manonoood. Naaayon ito sa kaniyang ibig panoorin at nagugustuhan. Nariyan ang <br />aksiyon, animation, dokumentaryo, drama, pantasya, historical, katatakutan, <br />komedya, musical, sci-fi (science fiction), at iba pa. Anuman ang pelikulang <br />tinatangkilik, tiyakin l&aacute;mang na kapupulutan ng aral na magiging gabay naman ng <br />mga manonoood sa nangyayari sa araw-araw na b&uacute;hay niya.<br />Samantala, ang dul&acirc; ay isang akdang sa pamamagitan ng kilos at galaw sa <br />tanghalan ay naglalarawan ng kawil ng mga pangyayaring naghahayag ng kapana-panabik na bahagi ng b&uacute;hay ng tao.<br />Sinasabi ring isang genre na panitikan na n&aacute;sa anyong tuluyan ang dula na dapat <br />na itanghal sa entablado, may mga tauhang gumaganap na nag-uusap sa <br />pamamagitan ng mga diyalogo. Masasabing may anyong pampanitikang inihanda <br />para sa dula na ang mga artista ay kumakatawan sa mga tauhan, ginagawa ang<br />nararapat na pagkilos ayon sa hinihingi ng mga pangyayari, at sinasabi ang <br />nakasulat na usapan.</p>\r\n<p style=\"text-align: justify;\"><br /><strong>Sitwasyong Pangwika sa Pelikula</strong></p>\r\n<p style=\"text-align: justify;\"><br />Bagamanmas maraming banyaga kaysa lokal na pelikula ang naipalalabas sa ating <br />bansa taon-taon, ang mga lokal na pelikulang gumagamit ng midyum na Filipino at <br />mga barayti nit&oacute; ay mainit ding tinatangkilik ng mga manonood. Katunayan, sa <br />dalawampung nangungunang pelikulang ipinalabas noong 2014, batay sa kinita, <br />lima sa mga ito ang lokal na tinatampukan din ng mga lokal na artista. Iyon nga <br />lang, Ingles ang karaniwang pamagat ng mga pelikulang Pilipino tulad ng One More <br />Chance, Starting Over Again, It Takes A Man and A Woman, Bride for Rent, You&rsquo;re <br />My Boss, You&rsquo;re Still the One, at iba pa. Ang wikang ginagamit ay Filipino, Taglish, <br />at iba pang barayti ng wika.</p>\r\n<p style=\"text-align: justify;\">Hindi na nga maitatatwang Filipino ang wika o lingua franca ng telebisyon, radio, <br />diyaryo, at pelikula. Maaaring sabihing ang pangunahing layunin ng mga ito sa <br />paggamit ng Filipino bilang midyum ay upang makaakit nang mas maraming <br />manonood, tagapakinig, o mambabas&aacute;ng makauunawa at malilibang sa kanilang <br />palabas, programa, at babasahin upang kumita sila nang mas malaki. Subalit, <br />hindi rin mapasusubalian ang katotohanang mas dahil sa malawak na <br />impluwensiya ng wikang ginagamit sa mass media ay mas maraming mamamayan <br />sa bansa ngayon ang nakapagsasalita, nakauunawa, at gumagamit ng wikang <br />Filipino. Isang mabuting senyales para sa lalong pag-unlad at paglago ng ating <br />wikang pambansa.</p>\r\n<p style=\"text-align: justify;\">Bagaman laganap na sa mass media, mapapansin pa rin na ang wikang Filipino ay <br />madalas na ginagamit sa mga programa sa radyo at telebisyon, sa tabloid, at sa <br />pelikula kung saan ang nananaig na tono ay impormal, at waring hindi gaanong <br />estrikto sa pamantayan ng propesyonalismo. Sa maraming babasahin at palabas <br />na Filipino, ang tila nangingibabaw na layunin ay mang-aliw, manlibang, at <br />lumikha ng ugong o ingay ng kasayahan (Tiongson, 2012). Isang pag-asam at <br />h&aacute;mon para sa mga t&aacute;ong nas&aacute; likod ng mass media at mga t&aacute;ong tumatangkilik <br />sa mga ito na hindi lang basta lumaganap ang Filipino kundi magamit din ito ng <br />mga nasabing midyum upang higit na maitaas ang antas ng ating wika</p>'),(55,1013,'Modyul 7','Gamit ng Wika sa Lipunan','Tungkulin ng wika','<p>Ang Cohesive Device o Kohesyong Gramatikal Sa ating pakikipagtalastasan pasulat man o pasalita, maaari itong binubuo ito ng pangungusap, parirala o sugnay na may magkakaugnay na kaisipan. Kaya&rsquo;t gumagamit tayo ng mga salitang kohesyon upang higit nating malinawan at maunawaan ang mensaheng nais iparating ng bawat bahagi nito.</p>\r\n<p>Ang limang pangunahing cohesive device o kohesiyong gramatikal ay ang sumusnod: patungkol o reperensiya (reference), substitusyon, ellipsis, pang-ugnay at leksikal. Subalit sa pagkakataong ito, ang tatalakayin lamang na kohesyong gramatikal ay patungkol o reperensiya (reference), ellipsis at pang-ugnay.</p>\r\n<p>Reperensiya Ang cohesive device o kohesiyong gramatikal na reperensiya tumutukoy sa mga panandang salita na gumamit panghalip upang ng paulit-ulit ang pangngalan. Ang paggamit ng panghalip ay tinatawag na pagpapatungkol.</p>\r\n<p>&nbsp;</p>\r\n<p>Uri ng Kohesyong Gramatikal na Patungkol/Reperensiya: ? anapora ? katapora Ang anapora ay tumutukoy sa mga panghalip na ginagamit sa hulihan bilang pananda sa pinalitang pangngalan sa unahan.</p>\r\n<p>Halimbawa: 1. Kapag nagkita kayo ni Elena, pakisabi na kinukumusta ko siya. Tawagan niya ako kapag may pagkakataon. 2. Binigyan ng mataas na grado si John sa Matematika, Sang &ndash; ayon sa kanyang guro mahusay ang kanyang performance sa Matematika. Ang katapora ay tumutukoy sa mga panghalip na ginagamit sa unahan bilang pananda sa pinalitang pangngalan sa hulihan. Halimbawa: 1. Siya&rsquo;y naging isang mabuting halimbawa sa ating lahat. Tunay na si Dr. Jose Rizal ay katangi &ndash; tangi. 2. Ano ang mahirap sa subject na it</p>'),(56,1067,'MODULE 1','Kahulugan at kahalagahan ng Fi','Kahulugan at kahalagahan ng Filipino, Kurikulum, at Edukasyon','<p>&nbsp;</p>\r\n<p><strong>KOLEHIYO NG EDUKASYON</strong></p>\r\n<p>KAGAWARAN NG FILIPINO</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>KAGAMITANG PAMPAGTUTURO SA</strong></p>\r\n<p><strong>Ang Filipino sa Kurikulum ng Batayang Edukasyon</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>INIHANDA NI:</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Prof. RHEA V. IRANZO</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Feb 2020</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>YUNIT I Kahulugan at kahalagahan ng Filipino, Kurikulum, at Edukasyon</strong></p>\r\n<p>Paksa 1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kahulugan at kahalagahan ng kurso</p>\r\n<p>Paksa 2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Epektibong guro at malikhaing pagtuturo</p>\r\n<ol>\r\n<li>Mga katangian ng guro</li>\r\n<li>Code of ethics</li>\r\n<li>Disenyo ng malikhaing pagtuturo</li>\r\n<li>Layunin ng pagtuturo</li>\r\n<li>Kasangkapan sa proseso ng pagtuturo</li>\r\n<li>Mga elemento ng mabuting pagtuturo</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>YUNIT 1 KAHULUGAN AT KAHALAGAHAN NG KURSO </strong></p>\r\n<p>---------------------------------------------------------------------------------------------------------------------------</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>PANGKALAHATANG IDEYA:</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Sumasabay ang Filipino sa mga pagbabagong nagaganap sa daigdig kasabay nito ang pagbabago sa larangan ng edukasyon ang patuloy na paglago nito upang makasabay sa usaping global ng pag-aaral ang pagbabago ng ating kurikulum at patuloy na pagsasaayos nito at ang bahaging ito ay tumatalakay sa mga batayang teoretikal, nilalaman, katangian at panuntunan sa pagpapatupad ng nireistrukturang kurikulum sa Filipino. Inaangkop ang iba pang kurikulum sa mga kondisyon at sitwasyong local.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>INAASAHANG MATUTUHAN: Sa pagtatapos ng paksang ito, inaasahan na</strong>:</p>\r\n<ol>\r\n<li>Natatalakay nang mahusay ang mga pamantayan, patakaran, kalakaran at mga prosesong pinag-ugatan ng kurikulum</li>\r\n</ol>\r\n<p><strong>Kagamitan ng Kurso:</strong></p>\r\n<p><strong><u>Kahulugan at kahalagahan ng kurso</u></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Layunin:</strong></p>\r\n<ol>\r\n<li>Nakapaglilikha ng mga graphic organizers bilang pagpapaliwanag tungkol sa guro.</li>\r\n<li>Nakapagbubuo ng mga gabay sa pag-uugnay ng mga kaalaman tungkol sa proseso ng pagtuturo</li>\r\n<li>Nakapagtutukoy sa mga kasanayang pangwika sa pagtatamo ng kasanayang akademik.</li>\r\n<li>Nakabubuo ng isang Posisyong Papel kaugnay sa kasalukuyang kalagayan ng Pagtuturo ng Filipino sa Batayang Edukasyon.</li>\r\n</ol>\r\n<p><strong>KURIKULUM</strong></p>\r\n<p>Ano ang Kurikulum?</p>\r\n<ul>\r\n<li>Nagmula sa salitang latin na &ldquo;curere&rdquo; na ang ibig sabihin ay &ldquo;to run; the course of the race.&rdquo; or a runway on which one runs to reach a goal.</li>\r\n<li>. If the teacher is the guide, the curriculum is the path. Curriculum is the total structure of ideas and activities.</li>\r\n<li>The word curriculum has been in existence since about 1820.</li>\r\n<li>Kilalang curicuralist: Hilda Taba and Ralph Tyler</li>\r\n<li>Ang kabuuan ng nilalaman ng isang pinag-aaralan, mga Gawain at mga pinagbatayan na puspusang pinili, isinaayos at ipinatupad sa mga paaralan sa natatanging gawaing pantao bilang isang institusyon ng katarungan at makataong pagpapaunlad. Sakop ng Kurikulum ang kabuuang tuon o layunin, na dapat isakatuparan ng mga paaralan at maabot ang mga tiyak na tunguhin ng pagtuturo.</li>\r\n<li>Ang kurikulum ay disiplina sa paaralan,mga aklat at mga Kagamitang ginagamit,paggawa ng banghay-aralin,mga pagpapahalaga,mg apagsusulit at kung anu-anoang itinuturo ng guro.</li>\r\n<li>Ayon kina <strong>Ragan</strong> at <strong>Shepherd</strong> ang kurikulum ay isang daluyang magpapadali kung saan ang paaralan ay may resposibilidad sa paghahatid, pagsasalin at pagsasaayos ng mga karanasang pampagkatuto.</li>\r\n<li>Sa pamamagitan ng kurikulum, ang mga mag-aaral naisasama sa karanasang pang-edukasyonal at tunay na makatutulong sa pagpapaunlad ng sitwasyon ng lipunan</li>\r\n<li>Ang kurikulum ay isang plano ng mga gawaing pampaaralan at kasama rito ang sumusunod:\r\n<ul>\r\n<li>ang mga dapat matutunan ng mga mag-aaral,</li>\r\n<li>ang paraan kung paano tayahin ang pagkatuto,</li>\r\n<li>ang katangian ng mga mag-aaral kung paano sila matatanggap sa programa, at</li>\r\n<li>ang mga kagamitang pampagtuturo</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><strong>FIVE BASIC DEFINITIONS OF CURRICULUM</strong></p>\r\n<ol>\r\n<li>Curriculum can be defined as a <strong>plan for achieving goals. </strong>The plan involves a sequence of steps.</li>\r\n</ol>\r\n<ol>\r\n<li><strong> Galen Saylor </strong>- defines curriculum as &ldquo;a plan for providing sets of learning opportunities for person to be educated.&rdquo;</li>\r\n</ol>\r\n<p><strong>David Pratt</strong>- &ldquo;Curriculum is an organized set of formal education and/or training intentions.&rdquo;</p>\r\n<p><strong>John Wiles and Joseph Bondi</strong>- view curriculum as &ldquo;a four-step plan involving purpose, design, implementation and assessment.&rdquo;</p>\r\n<ol>\r\n<li>Curriculum can be defined broadly, <strong>as dealing with the learner&rsquo;s experience</strong>. By this definition, almost anything planned in and outside of school is part of the curriculum.</li>\r\n</ol>\r\n<p><strong>Hollis Caswell and Doak Campbell- </strong>view curriculum as &ldquo;all the experiences children have under the guidance of teachers.&rdquo;</p>\r\n<p><strong>Gene Shepherd and William Ragan</strong>- &ldquo;The curriculum consists of the ongoing experiences of children under the guidance of the school.&rdquo;</p>\r\n<p><strong>Collin Marsh and George Willis</strong>- views curriculum as all the &ldquo;experiences in the classroom that are planned and enacted.&rdquo;</p>\r\n<ol>\r\n<li>Curriculum <strong>is a system for dealing with people. </strong></li>\r\n<li>Curriculum can be defined <strong>as a field of study with its own foundations, knowledge domains, research, theory, principles, and specialist.</strong></li>\r\n</ol>\r\n<p>-Discuss curriculum in theoretical rather than practical terms.</p>\r\n<p>-They are concerned with broad historical, philosophical, or social issues.</p>\r\n<ol>\r\n<li>Curriculum can be defined <strong>in terms of subject matter</strong> (math, science, English, history and so on) or content (the way we organize and assimilate information).</li>\r\n</ol>\r\n<p><strong>BAHAGI NG KURIKULUM</strong></p>\r\n<ol>\r\n<li>AIM - Balak o Pakay, Paglalahad o pagpapaliwanag ng pangkalahatang pakay ng kurikulum. Napakaloob dito ang mga tagapakinig (audience) pati na rin ang paksa.</li>\r\n<li>RATIONALE - Makatwirang Paliwanag, Mapaghimok na pagtatalo, dahil dito ipinaliliwanag kung bakit gustong magmungkahi at ang mga paggamit ng oras at mga pinagkukunan para sa kurikulum.</li>\r\n<li>GOALS AND OBJECTIVES - Hangarin at Layunin - Talaan ng mga maaring bunga ng mga matutuhan ng mga mag-aaral base sa magiging partisipasyon sa kurikulum. Napakaloob rin dito ang pagpapaliwanag kung paano makatutulong ang kurikulum sa bansa at sa lipunan.</li>\r\n<li>AUDIENCE &amp; PREREQUSITES - Mag-aaral at mga</li>\r\n</ol>\r\n<p>Pangunang Kailangan - Nagpapaliwanag kung sino ang makikinabang sa kurikulum at mga pangunang kaalaman at kakayahan para sa mabisang kurikulum.</p>\r\n<ol start=\"5\">\r\n<li>MATERIALS - Mga Kagamitan - Tala ng mga kakailanganing kagamitan para sa matagumpay na pagtuturo ng kurikulum. Napakaloob dito ang mga &ldquo;web pages&rdquo;, mga aklat, mga mesa, papel, chalkboard, calculator, at iba pang karaniwang kagamitan.</li>\r\n<li>INSTRUCTIONAL PLAN - Matalinong pagpaplano - Nagsasaad sa mga gawaing kukunin ng mga mag-aaral at ang pagkasunod-sunod nito. Napakaloob rin dito kung ano ang maaring gawin ng guro sa klase. Estratehiya, metodo, istilo ng pagtuturo.</li>\r\n<li>PLANS FOR ASSESSMENT AND EVALUATION - Ebalwasyon o Pagkilatis - Binubuo ng mga model project, mga halimbawa ng tanong sa pagsusulit at iba pang kakailanganin sa assessment.</li>\r\n</ol>\r\n<p><strong>TYPES OF CURRICULUM OPERATING IN SCHOOLS</strong></p>\r\n<p><strong>Allan Glatthorn </strong>(2000) describes seven types of curriculum operating in the schools.</p>\r\n<p>(1) Recommended curriculum</p>\r\n<ul>\r\n<li>The recommended curriculum is that which is recommended by scholars and professional organizations such as DepEd, CHED, and DOST.</li>\r\n</ul>\r\n<p>(2) Written curriculum</p>\r\n<ul>\r\n<li>The written curriculum is intended primarily to ensure that the educational goals of the system are being accomplished; it is a curriculum of control.</li>\r\n</ul>\r\n<p>(3) Taught curriculum</p>\r\n<ul>\r\n<li>The taught curriculum is the delivered curriculum, a curriculum that an observer sees in action as the teacher teaches.</li>\r\n</ul>\r\n<p>(4) Supported curriculum</p>\r\n<ul>\r\n<li>The supported curriculum includes those resources that support the curriculum-textbooks, software, and other media.</li>\r\n</ul>\r\n<p>(5) Assessed curriculum</p>\r\n<ul>\r\n<li>The assessed curriculum is that which appears in the test and performance measure: state tests, standardized tests, district tests, and teacher-made tests.</li>\r\n</ul>\r\n<p>(6) Learned curriculum</p>\r\n<ul>\r\n<li>The learned curriculum is the bottom line curriculum, the curriculum that students actually learn. It denoted all the changes in values, perceptions, and behavior that occur as a result of school experiences.</li>\r\n</ul>\r\n<p>(7) Hidden curriculum</p>\r\n<ul>\r\n<li>This is the unintended curriculum. It defined what students learned from the physical environment, the policies, and the procedures of the school.</li>\r\n</ul>\r\n<p><strong>CHARACTERISTICS OF CURRICULUM</strong></p>\r\n<ul>\r\n<li>It includes all the experiences of children for which the school is responsible,</li>\r\n<li>It has content,</li>\r\n<li>It is a system for dealing with people,</li>\r\n<li>It is planned,</li>\r\n<li>It is a series of courses to be taken by the students.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Prescriptive vs. Descriptive</strong></p>\r\n<ul>\r\n<li><strong>Prescriptive Curriculum </strong>definitions provide us with what &ldquo;ought&rdquo; to happen, and they more often than not take the form of a plan, an intended program, or some kind of expert opinion about what needs to take place in the course of study. (Ellis, 2004, p.4)</li>\r\n<li><strong>John Dewey (1902)</strong>- Curriculum is a continuous reconstruction, moving from the child&rsquo;s present experience out into the represented by the organized bodies of truth that we call studies&hellip; the various studies&hellip; are themselves experience &ndash; they are that of the race.</li>\r\n<li><strong> L. McBrien &amp; R. Brant (1997)</strong>- Curriculum refers to a written plan outlining what students will be taught (a course of study). Curriculum may refer to all the courses offered at a given school, or all the courses offered at a school in a particular area study.</li>\r\n<li><strong>Descriptive Curriculum</strong> goes beyond the prescriptive terms as they force thought about the curriculum &ldquo;not merely in terms of how things ought to be&hellip; but how things are in real classroom&rdquo; (Ellis, 2004, p.5). Descriptive curriculum is experience.</li>\r\n<li><strong>Thomas Hopkins (1941)</strong>- Those learning each child selects, accepts, and incorporates into himself to act with, in, and upon, in subsequent experiences.</li>\r\n<li><strong>Daniel Tanner &amp; Laurel Tanner (1995)</strong>- The reconstruction of knowledge and experience that enables the learner to grow in exercising intelligent control in subsequent knowledge and experience.</li>\r\n</ul>\r\n<p><strong>DISTINCTION BETWEEN CURRICULUM AND OTHER TERMINOLOGIES</strong></p>\r\n<p><strong>Curriculum and Syllabus</strong></p>\r\n<ul>\r\n<li>A syllabus is part of a curriculum but it is not the curriculum.</li>\r\n<li>Syllabus is the content of the school subjects offered in the school, and it is a sub-set of the curriculum.</li>\r\n</ul>\r\n<p><strong>Curriculum and Scheme of Work</strong></p>\r\n<ul>\r\n<li>The curriculum of a school is not the scheme of work.</li>\r\n<li>A scheme of work is the systematic arrangement of subject matter and activities within a given time period, such as a term or a semester.</li>\r\n</ul>\r\n<p><strong>Curriculum and Course of Study</strong></p>\r\n<ul>\r\n<li>A course of study refers mainly to a programme of learning that are offered to students &ndash;with various course contents &ndash; at the end of which they are awarded a certificate indicating the type of course.</li>\r\n</ul>\r\n<p><strong>Curriculum and Lesson Note</strong></p>\r\n<ul>\r\n<li>A lesson note is a guide for teachers to assist them in the orderly presentation of a lesson to the learners in order to facilitate learning.</li>\r\n<li>The lesson note is not a curriculum but it is an important aspect of curriculum implementation.</li>\r\n</ul>\r\n<p><strong>IBA PANG KAHULUGAN NG KURIKULUM</strong></p>\r\n<ul>\r\n<li>Curriculum is the crux of the whole educational process. Without curriculum, we cannot conceive any educational Endeavour. The curriculum in a literal sense, a pathway towards a goal.&nbsp; Curriculum is actually what happens during a course i.e., lecture, demonstrations, field visits, the work with the client and so on. &mdash; Curriculum also means a written description of what happens.</li>\r\n<li>Curriculum is an important element of education. Aims of education are reflected in the curriculum. In other words, the curriculum is determined by the aims of life and society. Aims of life and society are subject to constant change.</li>\r\n<li>Stenhouse (1980) &mdash;\"A curriculum is an attempt to communicate the essential principles and features of an educational proposal in such a form that it is open to critical scrutiny and capable of effective translation into practice.\"</li>\r\n<li>Cunningham - Curriculum is tool in the hand of the artist (teacher) to mould his material in accordance with his ideals in the school</li>\r\n<li>(Genn J, 1995) &ldquo;Everything that happens in relation to the educational programme.&rdquo;</li>\r\n<li>The secondary education commission says: A curriculum does not mean only the academic subjects traditionally taught in the school but it includes the totality of experiences that a public receives through the manifold activities that go on in the school, workshop, playground, library, laboratory and in the informal contacts between teachers and pupils.</li>\r\n<li>The whole life of the school becomes the curriculum which can touch the life of students at all points and help to form a balanced personality. A curriculum is the instructional program through the pupils achieve their goals</li>\r\n<li>&ldquo;A curriculum is an attempt to communicate the essential principles and features of an educational proposal in such a form that it is open to critical scrutiny and capable of effective translation into practice.&rdquo; Stenhouse (1975)</li>\r\n<li>Curriculum - Any document or plan that exists in a school or school system that defines the work of teachers, at least to the extent of identifying the content to be taught student and the methods to be used in the process (English, 2000).</li>\r\n</ul>\r\n<p><strong>Who owns the curriculum?</strong></p>\r\n<ul>\r\n<li>A teacher in a public school is an employee of the district, which is an educational entity of the state.</li>\r\n<li>It is the state, the governor, the legislature (the state dept. of education or state board of education) which has ultimate responsibility over the curriculum.</li>\r\n</ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Ang curriculum ay nagmula sa salitang Latin na currere ay nangangahulugang ito run the course of the race o magtabakbo ng isang kurso sapagkat ang kurikulum ang nagsisilbing fundasyon ng mga paaralan sa pagtuturo at pagkatuto. If the teacher is the guide the curriculum is the path ang gurio ang nagagabay sa atin tungo sa path o paroroonan na sinasabi ng kurikulum. Ang kurikulum ay umiiral na simula noong 1820. At ang mga kilalang curicuralist ay sina Hilda Taba at Ralph Tyler. Ang kurikulum raw ang pinaka kabuuan ng pinag-aaralan kumbaga nandito nakabatay ang lahat ng ituturo sa mga paaralan. Gayundin nandito nakalagay ang gabay sa mga kagamitan maging sa pamamaraan ng pagtuturo. Mula naman sa pahayag nina Ragan at Sheperd ang kurikulum ay isang daan at ang paaralan ang may responsibilidad sa pagsasabuhay o sa pag-aapply ng nilalaman ng kurikulum. Dahil sa pamamagitan nito ito ay tutulong sa mga mag-aaral upang matuto ng maayos at makatulong sa pagpapaunlad ng lipunan. Ito rin ay isang plano kung saan nakalagay ang dapat matutunan sa isang paaralan o kurso, narito rin ang dapat dsukatin ang kanilang mga natutunan maging ang mga pamamraan at estratehiya narito rin ang mga kwalipikasyon kung isa itong kurrikulum ng isang kurso nakalagay ang pamantayan at tinutukoy rin sa kurrikulum ang mga Kagamitang pampagtuturo na gagamitin.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Narito naman ang iba pang kahulugan ng Curriculum mula sa iba&rsquo;t ibang tao. Una binanggit na it is a plan for achieving goals kung saan ito ay mayroon layunin na binibigyang tuon na dapat maabot kung saan ito ay proseso at mga hakbang para makamit yung layunin o pakay. Ikalawa mula sa pahayag nui J. Galen Saylor sabi niya ito ay a plan for providing sets of learning opportunities for person to be educated. Kung saan ito ay nagbibigay ng oppurtunidad na matuto ang bawat tao. Mula naman sa pahayag ni David Prattsabi niya &ldquo;Curriculum is an organized set of formal education and/or training intentions.&rdquo; Ito ay may layunin at intensiyunal hindi lang basta napag-isipan ngunit ito ay ninanais na maabot at magkaroon ng bunga o resulta. Sinabi naman ni John Wiles and Joseph Bondipinaliwanag niya ang curriculum as &ldquo;a four-step plan involving purpose, design, implementation and assessment.&rdquo; kung saan ito ay may proseso una ay ang dahilan o kung para saan ang kurikulum ikatlo ay ang disenyo kung ano ang nilalaman o ano ang tinataglay nito ikatlo ay kung paano ito isasakatuparan at huli dahil naisakatuparan na ay paano ito tatasahi9n yung mga natutunan ng mga mag-aaral. Binigyang pakahulugan rin ang kurikulum na &ldquo;as dealing with the learner&rsquo;s experience&rdquo; sa pagkat nakatuon rin ang kurikulum sa mga bagay n na kanilang natututunan at nararanasan na nagmula sa paaralan. Gayundi nagbigay pakahulugan naman si Hollis Caswell and Doak Campbellat ipinaliwanag niya ang kurikulumna &ldquo;all the experiences children have under the guidance of teachers.&rdquo; Ito yung mga natutunan ng mga bata habang sila pa ay nasa paaralan yung mga nakukuha nalang kaalaman at naiinquire nila sa kanilang mga guro. Mula naman kay Gene Shepherd and William Ragan sinabi niya na &ldquo;The curriculum consists of the ongoing experiences of children under the guidance of the school.&rdquo; Katulad din ng nakailalim sa kanilang guro maging ano man ang kanilang gawain o nararanasan sa loob ng paaralan ay bahagi ng kurikulum hindi lamang sa loob ng klase subalit ano man ang mga ginagawa sa loob ng paaralan ay maituturing na bahagi ng kurikulum. Ipinaliwanag naman ni Collin Marsh and George Willis na &ldquo;experiences in the classroom that are planned and enacted.&rdquo; kung ano ang mga gawain sa paaralan na kanilang nakukuhanan ng kaalaman ay parte parin ng kurikulum. Ito rin ay a system for dealing with people. Sapagkat walang saysay ang kurikulum kung walang tao na magsasakatuparan nito. Sa pamamagitan ng kurrikulum nagkakaroon ng pakikipag-ugnayan sa bawat tao. Gayundin pinaliwanag rin ito bilangfield of study with its own foundations, knowledge domains, research, theory, principles, and specialist. Maari ding ipakahulugan ito sa pamamagitan ng mga asignatura dahil bawat asignatura ay isa ring kurikulum kung saan nagtataglay ng mga layunin pamamaraan at nilalaman para sa pagkatuto.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Narito naman ang bahagi ng kurikulum. Una ay ang aim o Balak o Pakay. Dito inilalahad kung para saan ang kabuuan ng isang kurikulum. Ikalawa naman ay rationale o makatwirang paliwanag, o ipinaliliwanag kung ano ba ang tatalakayin o ninanais ng kurikulum. Ikatlo naman ay ang objectives o yung layunin. Narito kung ano ba yung hangarin ng kurikulum at dito nakasalalay kung ano ba ang pinakahinahanap na bunga ng kurikulum.Ikaapat ay ang audience o yung mag-aarl kung kanino gagamitin ang nasabing kurikulum dahil kung walang nakalaang pag-aalayan nito ay wala ring saysay ang kurikulum. Ikalima ay ang materyales hindi maisasagawa ng maayos ang isang kurikulum kung walang materyales na gagamitin at sa pamamagitan ng materyales mas mapapadali ang pagsasakatuparan ng kurikulum. Ikaanim ay Instructional Plan kung saan naroon yung mga palano para sa pagkatuto narito yung mga pamamaraan o estratehiya na gagamitin para sa pagsasakatuparan ng kurikulum dito rin nakasalalay ang magandang bunga ng isang kurikulum. At huli ay ang Plan for assessment evaluation kung saan mga plano at pamamaraan kung paano tatayahin at tatasahin kung ano nga ba yung mga natuunan sa kabuuan ng mag-aaral.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Narito naman ang mga uri ng kurikulum mula kay Allan Glathorn. Una ay ang Recommended curriculum kung saan ito ang mga ibinibigay o mga suhestiyong mga scholars tulad ng DepEd CHED o DOST. Ikalawa naman ay ang written curriculumkung saan ito ang gabay maaring ito ay ang lesson plan daily lesson log course outline o maging syllabus. Ikatlo ay ang taught curriculum kung saan&nbsp; ang pagsasagawa o kung paano itinuturo na ang paksa o nilalaman ng isang kurikulum. Ikaapat ay angSupported curriculum kung saan ito ang mga tumutulong sa pampagkatuto ng bata maaring ito ay ang mga libro teaching guide o yung kagamitan tulad ng mga visual aids projecter na tumutulong sa mabilis na pagkatuto ng bata. Susunod ay ang ang Assessed curriculum kung saan ito ang pamamaraan kung paano tatayahin ang bata o tatasahin sa kanilang mga natutunan sa paksa maaring ito ay pasulat o maging pasalita. Susunod ay ang Learned curriculum kung saan yung mga natutunan sa kurikulum. At kung ano yung mga dulot t epekto sa kanila. At ang huli ay ang hidden curriculum kung saan ito yung mga bagay na natutunan nila ngunit hindi naman ito bahagi ng kurikulum. Maaring pansariling pagkatuto hinggil sa kakayahan pag-uugali at sa kanilang mga pananaw.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Sino nga ba ang responsable sa paggawa ng kurikulum? Ang kurikulum ay responsibilidad ng guro sapagkat malaki ang kanilang papel na gampanin ditto. Dito ang magtuturo sa mga mag-aaral ng mga subject na napagplanuhan sa paggawa. Sila rin ang magsisilbing gabay ng mga mag-aaral habang nasa loob ng paaralan. Bukod sa mga guro, mahalaga rin ang gampanin ng mga magulang. Sila ang dapat na naggagabay sa kanilang mga anak habang sila ay nasa kanilang mga tahanan. Malaki rin ang kanilang papel sa pagkabuo ng kurikulum sapagkat kung anong klase silang tao ay repleksyon o sumasalamin ito kung paano nila pinalaki ang kanilang mga anak. Bukod pa rito, ang mga magulang ang higit na nakaaalam kung ano ang nakabubuti para sa kanilang mga anak kung kaya&rsquo;t mahalaga na magkaroon sila ng kinalaman dito. Bukod pa sa kanila, ang ating gobyerno, pamahalan, mga mamababatas at maging ang lahat ng taong nakabilang sa isang lipunan. Silang lahat ay sangkot dito, sapagkat ano man ang mangyayari o nangyayari sa ating lipunan ang lahat ay kasangkot, na maaaring maging sanhi ng hindi pagkatuto o pagkatuto ng isang mag-aaral.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>Aktibiti 1</em></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Pangalan __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Petsa: _________</p>\r\n<p>Propesor __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Taon at Pangkat _______</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Marka _________</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Ilahad ang nilalaman ng mga sumununod na memorandum order/artikulo na may kinalaman sa kurikulum</strong></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Artikulo XIV, Sek. 7 ng 1987 konstitusyon -</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>DECS Order 25, s. 1974 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>DECS Order No. 50, s. 1975 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>MEC Order No. 22, s. 1978 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>DECS Order 52, s. 1987 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>CHED Memo Order 59, s. 1996 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>CHED Memo 04, s. 1997 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>CHED Memo Order 11, s. 1998 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Sagutin ang mga sumusunod na mga katanungan batay pa rin sa kurikulum.</strong></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Ano ang mga kailangan sa pagbuo ng kurikulum? Ilahad.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li>Ano ang mga proseso sa pagsasagawa ng kurikulum?</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><u>Epektibong guro at malikhaing pagtuturo</u></strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Paano nga ba maging isang epektibong guro na siyang maging daan upang mabago ang buhay ng isang estudyante? Anu-ano ang mga katangian, personalidad at karakter ng isang epektibong guro?</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Ang tanong na ito ay umiikot sa isipan ng mga indbidwal noong sila ay estudyante pa lamang at sa mga guro na nais maging epektibo sa kanilang napiling propesyon. Ang babasahing ito ay naglalaman ng mga kasagutan kung paanu maging isang epektibong guro bilang propesyon.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Ang mga Katangian ng Epektibong Guro</strong></li>\r\n</ul>\r\n<p><strong>&nbsp;</strong></p>\r\n<ol>\r\n<li>Walang itinatangi. Hindi malilimutan ng mga mag-aaral kung ang guro\'y may paborito sa klase o angkanyang di pagkakapantay-pantay na pagtrato sa kanyang mga mag-aaral. Sa loob ng klase, dapat na siya\'y walang kinikilingan at mahalagang maging pantay ang kanyang pagtingin sa lahat ng mga mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li>May positibong ugali. NAsisiyahan ang mga mag-aaral kung sila\'y nabibigyan ng papuri at pagkakilala o rekognisyon. Malaki ang impak nito sa kanilang tiwala sa sarili at direksyon. Naniniwala at nasisiyahan siya sa tagumpay ang kanilang mga mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"3\">\r\n<li>May kahandaan. Ang kahusayan (competence) at kaalaman sa saklaw ng nilalaman ng mga paksang itinuturo ay kinikilala ng mga mag-aaral. Madaling makilala ng mga mag-aaral ang gurong organisado at handa nang magturo.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"4\">\r\n<li>May haplos-personal. Pinahahalagahan ng mga mag-aaral ang gurong may ugnayan sa kanila, yaong tumatawag sa kanilang pangalan, palangiti, nagtatanong tungkol sa kanilang nadarama at opinyon, tinutuklas ang kanilang interes at tinatanggap ang tunay nilang pagkatao. Ang pagkukwento ng guro ng mga kwentong may kinalaman sa aralin ay higit na nagugustuhan ng mga mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"5\">\r\n<li>Masayahin. Naaalala ng mga mag-aaral ang gurong masayahin sa klase. Ang dagling pagbibiro at pagpapatawa sa mga sitwasyong nahihirapan at napapahiya ang mga mag-aaral ay nakababawas sa paghihirap o kahihiyang dinaranas ng mga mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"6\">\r\n<li>Malikhain. Nagugunita ng mga mag-aaral ang kanilang gurong malikhain sa mga gawaing pangklasrum, lalo na sa oras na ginaganyak sila para sa isasagawang aralin, pati na ang pag-aayos sa klasrum ng kanilang guro.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"7\">\r\n<li>Marunong tumanggap ng kamalian. Nababatid ng mga mag-aaral kung nagkakamali ang kanilang guro lalo\'t sila ang labis na naaapektuhan bunga ng pagkakamaling ito. Nagiging modelo ang isang guro kung tinatanggap niya ang kanyang pagkakamali at buong pagpapakumbabang humingi siya ng kapatawaran sa pagkakamaling kanyang nagawa.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"8\">\r\n<li>Mapagpatawad. Kinalulugdan ng mga mag-aaral ang gurong marunong magpatawad sa kasalanang kanilang nagawa, lalo\'t yaong nauukol sa kanilang maling gawi at ikinilos. Ang guro ang tagabuo ng anumang tunggaliang nagaganap sa klase kaya\'t mahalagang maiwasan din niyang magbigay ng di-magandang puno ukol dito.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"9\">\r\n<li>May respeto. Ang kinalulugdang guro ay yaong marunong maglihim ng markang kanyang ibinigay sa kanyang mga mag-aaral o yaong kinakausap ang mag-aaral na may nagawang pagkakamali o kasalanan nang walang nakaririnig o nakakaalam, o yaong nagpapakita ng sensitibiti sa nadarama ng kanyang mga mag-aaral, nagiging marubdob ang mga mag-aaral na matupad ang kanyang mga tunguhin.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"10\">\r\n<li>May mataas na ekspektasyon. Ang di-malilimutang guro ay yaong nagpapakita ng napakataas na pamantayan lalo\'t hinahamon ang kanyang mga mag-aaral na gawin nang napakahusay ang kanyang ipinag-uutos. Madalas na nawawalan ng tiwala sa sarili ang mga mag-aaral. Kung maniniwala ang guro na may mga kakayahan ang kanyang mga mag-aaral, nagiging marubdob ang mga mag-aaral na matupad ang kanyang mga tunguhin.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"11\">\r\n<li>Mapagmahal. Kung aalamin ng guro kung bakit naalis sa isang laro, ang kanyang mag-aaral at kikilos siya upang makagawa ng paraan halimbawa para malutas ang suliranin nito ay naglalarawan ng pag-aalala at pagmamahal.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"12\">\r\n<li>Ipinadaramang kabilang ang bawat mag-aaral. Laging nasa isip ng mga mag-aaral na sila\'y kabilang sa klase. Nadarama nilang kapamilya ang kanilang guro. Ang pagtatanong at pagpapakita ng kasiyahan sa ipinakikitang mga gawad, pampamilyang album at iba pa ng mag-aaral ay nakabubuo ng pagkakaisa at mabuting pagsasamahan. Ang mahusay at epektibong guro ay yaong nakaiisip agad ng paraan upang hindi magkaroon ng hinanakitan ang kanyang mga mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Katangian, Karakter At Personalidad Ng Isang Magaling At Epektibong Guro</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong> Umaasa ng mataas o positibong personalidad</strong>. Ang mga magagaling na guro ay umaasang lahat ng kanilang estudyante ay magsisikap at gustong matuto.Kinikilala nila ang mga estudyante sa iba&rsquo;t-ibang yugto ng abilidad at katangian. Gayunpaman,sila ay naniniwala na lahat ng kanilang estudyante ay matuto,makakamtam ang tunay na progreso sa bawat na taon na pagdaanan at matamo ang mga pangunahing kakayahan tulad ng pagbasa,pagsulat at pagbilang ng numero.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li><strong> Pangangalaga</strong>. Ang mga gurong nangangalaga sa kanilang estudyante ay may malaking epekto kung ano ang ginagawa ng estudyante sa paaralan. Inaalagaan ng tunay ang estudyanteng ito bilang isang tao tulad ng isang magulang sa kanyang anak.Mabubuting guro ay mainit na nagmamahal, magalang at nakikidamay. Halimbawa, ang pagsasabi nila ng magandang araw sa mga estudyante sa tuwing nadadaanan nila. Ang mga guro ay hindi natatakot na magbigay ng matibay na pagmamahal sa kanilang estudyante. Kailangan mo lang maniwala sa iyong mga estudyante at subukin sila para manguna habang sunod-sunod silang suportahan para gawin ito.</li>\r\n<li><strong> Abilidad</strong>. Ang lahat ng ibang bagay ay magkapantay,matatalinong tao ginagawang magaling ang isang guro &ndash; at kung mas matalino ang tao mas mabuti.Ito&rsquo;y lumilipad sa paniniwala ng nakakarami.Pero ayon sa pananaliksik lumalabas na ang mataas na yugto ng kaalaman(IQ) ay nagreresulta ng mataas na kalidad sa paggawa sa lahat ng uri ng trabaho kabilang na ang pagtuturo.&rdquo;Ang tanging dahilan upang magkaroon ng ganap na progreso ang isang estudyante ay ang mataas na kalidad ng talino nang kanyang guro (Dylan Williams)&rdquo;.Hindi ito bago,kapag kinunsidera mo ang talinong kailangan upang sukatin ang abilidad na harapin ang pagsubok binibigyan nito ang pinaka-mainam na paraan para magpatuloy.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"4\">\r\n<li><strong> Pagmamahal sa tungkulin.</strong> Mga gurong epektibo ay nanghihimok sa kanilang propesyon na tulungang matuto ang kanilang mga estudyante. Kung wala ang pagmamahal na ito,walang kang lakas.Kung wala kang lakas,wala kang magagawa.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>5.Propesyonal na Kaalaman-upang maging magaling na guro kailangan niya ang mga sumusunod</strong>;</p>\r\n<p>&ndash; kaalaman sa nilalaman na ituturo</p>\r\n<p>&ndash; kurikulum,programa at materyal</p>\r\n<p>&ndash; populasyon ng estudyante</p>\r\n<p>&ndash; partikular na kontekstong edukasyonal</p>\r\n<p>&ndash; layunin at kahalagahan ng edukasyon</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"6\">\r\n<li><strong> Magaling sa komunikasyon. </strong>Isa sa mga pangunahing katangian ng isang epektibong guro ay ang galing niya sa komunikasyon.Kailangan ito upang maipaliwanag ang mga ideya,pag-uusapan na isyu,pagpapahayag ng paniniwala at kahalagahan sa pagtuturo.Ang mga guro kasi ay maraming ginagampanan sa loob ng silid-aralan at sa lugar ng trabaho.Kailangan sila ay maabilidad sa pagresolba ng mga sigalot.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"7\">\r\n<li><strong> Mapanuri sa paligid. </strong>Sa isang guro mahalaga ang pagiging mapanuri upang magkaroon ng sapat na kaalaman sa paligid nila(mga estudyante,paaralan,komunidad at kultura ng lugar ng trabaho).Para malaman ang nararapat na gawin sa isang sitwasyon.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"8\">\r\n<li><strong> Pangako sa habangbuhay na pagkatuto. </strong>Ito&rsquo;y kinikilala ng mga taong nagbibigay edukasyon, organisasyong nagbibigay akredistasyon o paniniwala,mangagawa at publiko na ang pinakaimportanteng kagalingan na dapat magkaroon ang bawat indibidwal.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"9\">\r\n<li><strong> Handang lagpasan lahat. </strong>Ang mga guro ay naniniwala sa kanilang kakayahan na magampanan nila ang kanilang tungkulin,upang gumawa ng pagbabago o direksyon sa buhay ng kanilang estudyante.Umaasa ng mataas upang mapukaw at mag-udyok sa kanilang estudyante bilang isang halimbawa.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"10\">\r\n<li><strong> Ang buhay sa labas ng paaralan. </strong>Ayon sa pag-aaral ang mga taong mayroon hilig na gawain at kaibigan ay mababa ang pakiramdam ng pagod at tumaas ang pagiging produktibo sa trabaho.Ang mga guro ay dapat humanap ng pagkakaabalahan na maglalarawan sa kanila sa labas ng paaralang tinuturuan.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>CODE OF ETHICS FOR PROFESSIONAL TEACHERS</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Pursuant to the provisions of paragraph (e), Article 11, of R. A,. No. 7836, otherwise known as the Philippines Professionalization Act of 1994 and Paragraph (a), section 6, P.D. No. 223, as amended, the Board for Professional Teachers hereby adopt the Code of Ethics for Professional Teachers.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PREAMBLE</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Teachers are duly licensed professionals who possesses dignity and reputation with high moral values as well as technical and professional competence in the practice of their noble profession, they strictly adhere to, observe, and practice this set of ethical and moral principles, standards, and values.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ARTICLE I</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>SCOPE AND LIMITATIONS</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. The Philippine Constitution provides that all educational institution shall offer quality education for all competent teachers committed of it&rsquo;s full realization The provision of this Code shall apply, therefore, to all teachers in schools in the Philippines.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 2. This Code covers all public and private school teachers in all educational institutions at the preschool, primary, elementary, and secondary levels whether academic, vocational, special, technical, or non-formal. The term &ldquo;teacher&rdquo; shall include industrial arts or vocational teachers and all other persons performing supervisory and /or administrative functions in all school at the aforesaid levels, whether on full time or part-time basis.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ARTICLE II</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>THE TEACHER AND THE STATE</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. The schools are the nurserles of the future citizens of the state; each teacher is a trustee of the cultural and educational heritage of the nation and is under obligation to transmit to learners such heritage as well as to elevate national morality, promote national pride, cultivate love of country, instill allegiance to the constitution and for all duly constituted authorities, and promote obedience to the laws of the state.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Section 2. Every teacher or school official shall actively help carryout the declared policies of the state, and shall take an oath to this effect.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 3. In the interest of the State and of the Filipino people as much as of his own, every teacher shall be physically, mentally and morally fit.</p>\r\n<p>Section 4. Every teacher shall possess and actualize a full commitment and devotion to duty.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 5. A teacher shall not engage in the promotion of any political, religious, or other partisan interest, and shall not, directly or indirectly, solicit, require, collect, or receive any money or service or other valuable material from any person or entity for such purposes</p>\r\n<p>&nbsp;</p>\r\n<p>Section 6. Every teacher shall vote and shall exercise all other constitutional rights and responsibility.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 7. A teacher shall not use his position or facial authority or influence to coerce any other person to follow any political course of action.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 8. Every teacher shall enjoy academic freedom and shall have privilege of expounding the product of his researches and investigations; provided that, if the results are inimical to the declared policies of the State, they shall be brought to the proper authorities for appropriate remedial action.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ARTICLE III</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>THE TEACHER AND THE COMMUNITY</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. A teacher is a facilitator of learning and of the development of the youth; he shall, therefore, render the best service by providing an environment conducive to such learning and growth.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 2. Every teacher shall provide leadership and initiative to actively participate in community movements for moral, social, educational, economic and civic betterment.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 3. Every teacher shall merit reasonable social recognition for which purpose he shall behave with honor and dignity at all times and refrain for such</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>activities as gambling, smoking, drunkenness, and other excesses, much less illicit relations.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 4. Every teacher shall live for and with the community and shall, therefore, study and understand local customs and traditions in order to have sympathetic attitude, therefore, refrain from disparaging the community.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 5. Every teacher shall help the school keep the people in the community informed about the school&rsquo;s work and accomplishments as well as its needs and problems.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 6. Every teacher is intellectual leader in the community, especially in the barangay, and shall welcome the opportunity to provide such leadership when needed, to extend counseling services, as appropriate, and to actively be involved in matters affecting the welfare of the people.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 7. Every teacher shall maintain harmonious and pleasant personal and official relations with other professionals, with government officials, and with&nbsp; the people, individually or collectively.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 8. A teacher posses freedom to attend church and worships as appropriate, but shall not use his positions and influence to proselyte others.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>ARTICLE IV</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>A TEACHER AND THE PROFESSION</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. Every teacher shall actively insure that teaching is the noblest profession, and shall manifest genuine enthusiasm and pride in teaching as a noble calling.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 2. Every teacher shall uphold the highest possible standards of quality education, shall make the best preparations for the career of teaching, and shall be at his best at all times and in the practice of his profession.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 3. Every teacher shall participate in the Continuing Professional Education (CPE) program of the Professional Regulation Commission, and shall pursue</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>such other studies as will improve his efficiency, enhance the prestige of the profession, and strengthen his competence, virtues, and productivity in order to be nationally and internationally competitive.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 4. Every teacher shall help, if duly authorized, to seek support from the school, but shall not make improper misrepresentations through personal advertisements and other questionable means.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 5. Every teacher shall use the teaching profession in a manner that makes it dignified means for earning a descent living.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ARTICLE V</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>THE TEACHERS AND THE PROFESSION</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. Teacher shall, at all times, be imbued with the spirit of professional loyalty, mutual confidence, and faith in one another, self sacrifice for the common good, and full cooperation with colleagues. When the best interest of the learners, the school, or the profession is at stake in any controversy, teacher shall support one another.</p>\r\n<p>&nbsp;</p>\r\n<p>Section2. A teacher is not entitled to claim credit or work not of his own, and shall give due credit for the work of others which he may use.</p>\r\n<p>&nbsp;</p>\r\n<p>Section3. Before leaving his position, a teacher shall organize for whoever assumes the position such records and other data as are necessary to carry on the work.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 4. A teacher shall hold inviolate all confidential information concerning associates and the school, and shall not divulge to anyone documents which has not been officially released, or remove records from the files without permission.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 5. It shall be the responsibility of every teacher to seek correctives for what he may appear to be an unprofessional and unethical conduct of any associates. However, this may be done only if there is incontrovertible evidence for such conduct.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 6. A teacher may submit to the proper authorities any justifiable criticism against an associate, preferably in writing, without violating the right of the individual concerned.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Section 7. A teacher may apply for a vacant position for which he is qualified; provided that he respects the system of selection on the basis of merit and competence; provided, further, that all qualified candidates are given the opportunity to be considered.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ARTICLE VI</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>THE TEACHER AND HIGHER AUTHORITIES IN THE PROFESSIONS</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. Every teacher shall make it his duties to make an honest effort to understand and support the legitimate policies of the school and the administration regardless of personal feeling or private opinion and shall faithfully carry them out.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 2. A teacher shall not make any false accusations or charges against superiors, especially under anonymity. However, if there are valid charges, he should present such under oath to competent authority.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 3. A teacher shall transact all official business through channels except when special conditions warrant a different procedure, such as when special conditions are advocated but are opposed by immediate superiors, in which case, the teacher shall appeal directly to the appropriate higher authority..</p>\r\n<p>&nbsp;</p>\r\n<p>Section 4. Every teacher, individually or as part of a group, has a right to seek redress against injustice to the administration and to extent possible, shall raise grievances within acceptable democratic possesses. In doing so, they shall avoid jeopardizing the interest and the welfare of learners whose right to learn must be respected.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 5. Every teacher has a right to invoke the principle that appointments, promotions, and transfer of teachers are made only on the basis of merit and needed in the interest of the service.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 6. A teacher who accepts a position assumes a contractual obligation to live up to his contract, assuming full knowledge of employment terms and condition</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>&nbsp;</em></strong></p>\r\n<p><strong><em>&nbsp;</em></strong></p>\r\n<p><strong><em>Aktibiti 2</em></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Pangalan __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Petsa: _________</p>\r\n<p>Propesor __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Taon at Pangkat _______</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Marka _________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Ilarawan ang sarili 3 taon mula ngayon anong klaseng guro ka sa hinaharap. Bakit?</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>Aktibiti 3</em></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Pangalan __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Petsa: _________</p>\r\n<p>Propesor __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Taon at Pangkat _______</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Marka _________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Gabay na tanong:</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Ano-ano ang mga dapat unawain na karapatan at tungkulin ng pagiging isang guro?</li>\r\n<li>Bakit mahalagang malaman ang &ldquo;Code of Ethics&rdquo; lalo na sa ating mga guro?</li>\r\n<li>Ano ang isinasaad ng preamble? Ipaliwanag</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Disenyo ng malikhaing pagtuturo</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>METODO - Ito ang tawag sa panlahat na plano para sa isang sistematikong at epektibong pagtuturo ng isang aralin. May tiyak na hakbang na sinusunod ang bawat metodo o pamamaraan.</li>\r\n<li>ESTRATEHIYA - Sa wika, ito ang tawag sa mga kagamitan at gawaing ginagamit sa bawat hakbang ng pagtuturo. Halimbawa ay ang gamit ng mga awtentikong teksto, larawan, o larong pangwika.</li>\r\n</ol>\r\n<p>- ay isang pangmatagalang pagpla-plano o pagba-balak sa kung ano ang dapat gawin para makamit ang isang tiyak na layunin. Sa kasalukuyan, ang salitang \"estratehiya\" ay kadalasang ginagamit ng mga tao na maaaring tumutukoy o tumalakay sa lahat ng bagay na pinag-iisipan gaya ng \"estratehiya sa negosyo\", &ldquo;estratehiya sa pagtuturo&rdquo;, &ldquo;estratehiya sa paglalaro ng chess&rdquo;, &ldquo;estratehiya sa marketing&rdquo;, &ldquo;estratehiya sa pulitika&rdquo;, at iba pa.</p>\r\n<ol start=\"3\">\r\n<li>TEKNIK - Ay tawag sa paraan ng organisasyon ng interaksyong pangklase. Alinman sa mga kagamitang pagsasanay o gawain sa loob ng klsarum, upang maisakatuparan ang mga layuninng isang aralin.</li>\r\n<li>DULOG - Isang set ng pagpapahalagang hinggil sa kalikasan ng wika, pagkatuto at pagtuturo.</li>\r\n<li>PAMARAAN - Isang panlahat na pagplaplano para sa isang sistematikong paglalahad ng wika batay sa isang dulog.</li>\r\n<li>METODOLOHIYA - Ito&rsquo;y isang pag-aaral ng mga gawaing pedagohikal (kasama rito ang mga paniniwalang teoretikal at kaugnayan na pananaliksik). Ito&rsquo;y tumutugon din sa anumang konsiderasyon kaugnay ng tanong na &ldquo;paano ang pagtuturo.&rdquo;</li>\r\n</ol>\r\n<p>- Ito ay ang paraan o stratehiyang ginagamit ng mga mananaliksik upang mapatunayan at maipakita ang mga suliranin sa kanilang pag-aaral.</p>\r\n<ol start=\"7\">\r\n<li>SILABUS - Ito&rsquo;y isang disenyo sa paggawa ng isang particular na programang pangwika. Itinatampok dito ang mga layunin, paksang aralin, pagkasunod-sunod ng mga aralin at mga kagamitang panturo na makatutugon sa mga pangangailangang pangwika ng isang tiyak na pangkat ng mga mag-aaral.</li>\r\n</ol>\r\n<p><strong><u>&nbsp;</u></strong></p>\r\n<ul>\r\n<li><strong>Layunin ng Pagtuturo</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>MGA LAYUNIN NG PAGTUTURO</strong></li>\r\n</ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Ang hanguan ng mga layunin ng pagtuturo ay ang mga layunin ng edukasyon sa iba&rsquo;t ibang antas: elementarya, sekundarya at tersyarya. kaya&rsquo;t anuman ang asignatura at guro, dapat&nbsp; niyang isaisip na ang paglinang sa buong katauhan ng bata na siyang panlahat na layunin ng edukasyon.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Ano ang mga layunin sa pagtuturo? Ang mga ito ay mga tiyak na pagpapahayag ng mga inaasahang pagbabago sa panig ng mag-aaral. Ang mga pagbabagong inaasahang magaganap sa katauhan ng bata ay maaring mapangkat sa tatlong lawak: pangkaisipan o pangkabatiran (cognitive), pandamdamin (affective), at pampisikal o saykomotor (psychomotor).</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Sa pagbuo ng mga layuning pangkatauhan o pangkagaiwan (behavioral Objective), tandaan ang mga sumusunod na paalala:</p>\r\n<ol>\r\n<li>Banggitin ang gawi o Gawain ng mag-aaral ayon sa pananaw ng mga-aaral at hindi sa pananaw ng guro. Ang mga layunin sa pananaw ng guro ng nagsisimula sa matutuhan, maunawaan, maikintal, mapahalagang, atbp, ay dapat iwasan sapagka&rsquo;t ang mga ito ay walang sapat na kalinawan sa kung ano ang dapat gampanan o dapat ipamalas ng mag-aral. Ang mga salitang tulad ng mapaguri-uri, makapagmungkahi, makabuo, malinawan, atbp, ang higit na mabuti sapagkat ang mga ito ay tahasang nasasabi ng tiyak na gagawin ng mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li>Bumuo ng mga layunin sa pamamagitan ng pagbanggit sa mga tiyak na gawi o gampanin na maaaring makita, marinig, maisip, maramdaman o maaaring bunga ng pagkaganap, gaya halimbawa ng. &rdquo;magunita ang mga karanasang may kinalaman sa nagdaang lindol;&rdquo; &ldquo;mabigkas ang mga salitang pares minimal nang malinaw at tumpak;&rdquo; o kaya&rsquo;y &ldquo;maawit ang Lupang Hinirang ng wasto at may damdamin.&rdquo;</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"3\">\r\n<li>Ang pagdaradag ng mga salitang nagsasaad ng antas o kasidhiang pagganap tulad ng &ldquo;mailarawang ganap,&rdquo; &ldquo;mabigkas nang may katamtamang bilis,&rdquo; ay ang nakapagdaragdag ng kalinawan sa layunin.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"4\">\r\n<li>Banggitin ang kaluwagan o kahigpitan ibibigay sa mag-aaral sa pagganap sa Gawain.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo;makaguhit ng iba&rsquo;t ibang anyo ng tatsulok sa tulong ng ruler;&rdquo; o kaya&rsquo;y &ldquo;makaguhit ng iba&rsquo;t ibang anyo ng tatsulok nang hindi gagamit ng ruler.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"5\">\r\n<li>Banggitin ang pinakamababa o pinakamataas na antas ng pagkaganap na maaaring tanggapin o pahalagahan.</li>\r\n</ol>\r\n<p>Halimbawa: Pagkatapos ng aralin, 100% ng panananagumpay ng matalinong mag-aaral, 80% ng karaniwang mag-aaral at 60% ng mahihinang mag-aaral ang inaasahang:</p>\r\n<ol>\r\n<li>Makapagpahayag nang maliwanag ng .</li>\r\n<li>Makipagbigay ng mga katunayan ng .</li>\r\n<li>Atbp.</li>\r\n</ol>\r\n<ul>\r\n<li><strong>Kasangkapan sa proseso ng pagtuturo</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Gawing malinaw at tiyak ang layunin mg pagtuturo</strong>. Bawat proseso ng pagtuturo ay nagsisimula sa pagtukoy ng guro sa mga layunin ng pagtuturo.</li>\r\n<li><strong>Iangkop sa paksang-aralin ang kagamitan</strong>. Kritikal sa pagpaplano ng pagtuturo ang pamimili ng kagamitang gagamitin</li>\r\n<li><strong>Kilalanin ang katangian at karanasan ng mga mag-aaral</strong>. Nararapat ding isaalang-alang ang katangian ng mga mag-aaral sa pamamagitan nito.</li>\r\n<li><strong>Tiyakin ang tagal ng panahon ng paggamit ng kagamitan</strong>. Mahalagang iayon sa haba o ikli ng pagtuturo ang inihandang kagamitan.</li>\r\n<li><strong>Alamin ang tamang paraan ng paggamit</strong>. May mga kagamitang sadya nang nakahanda upang gamitin sa pagtuturo tulad ng mga bagay na nabibili (tsart, modelo, interactive educational materials), elektronikong kagamitan (kompyuter, LCD projector, telebisyon) at iba pang kagamitan na hindi mismo ang guro ang gumawa at o naghanda.</li>\r\n<li><strong>Tiyaking may mapagkukunan at abot ng badget ang mga kagamitan</strong>. Kung magpaplanong gumamit ng mga kagamitan, kinakailangang tiyakin na may magagamit upang hindi masira ang nakaplanong pagtuturo.\r\n<ul>\r\n<li>Mahusay na kaalaman sa paksang aralin</li>\r\n<li>Malalim na pagkilala sa mga mag-aaral</li>\r\n<li>Mapag-isip ng iba&rsquo;t &ndash; ibang estratehiya sa pagtuturo</li>\r\n<li>Masining sa paglikha</li>\r\n<li>Masipag sa paggawa</li>\r\n<li>Maparaan sa panganagilangan</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Mga elemento ng mabuting pagtuturo</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong><em>Mga Katangian ng Mabuting Pamamaraan sa Pagtuturo</em></strong></li>\r\n</ul>\r\n<ol>\r\n<li>Ang mabuting pamaraan ng pagtuturo ay humuhubog sa mabuting pag-uugali at kaasalan ng mag-aaral.</li>\r\n</ol>\r\n<p>-Hindi diwa ng paglalaban o kompetisyon ang dapat malinang kundi ang diwa ng pag-unawa at pakikipagtulungan.</p>\r\n<ol start=\"2\">\r\n<li>Ang mabuting pamaraan ay nagbibigay ng mabuting bunga at kahihinatnan.</li>\r\n<li>Nakikitulong sa paglinang ng maraming kakayahan gaya ng</li>\r\n</ol>\r\n<p>-pananaw -pakikinig</p>\r\n<p>-paghipo -panlasa</p>\r\n<p>-pang-amoy</p>\r\n<p>&nbsp;</p>\r\n<p><em>nanasasangkot din ang</em></p>\r\n<p>-pang-unawa -pagpapahayag</p>\r\n<p>-pagsusuri -pagpapakahulugan</p>\r\n<p>-pagbibigay ng palagay -masusing pagmamasid</p>\r\n<ol start=\"4\">\r\n<li>Ang mabuting pamaraan ng pagtuturo ay humahamon sa kakayahan ng mag-aaral.</li>\r\n</ol>\r\n<p>-Gumaganyak ito sa mga mag-aaral sa pagsasakatuparan ng mga gawain.</p>\r\n<ol start=\"5\">\r\n<li>Ang guro ay tagasubaybay at tagapayo at papasok lamang sa bahaging hindi na kaya ng mag-aaral ang gawain.</li>\r\n<li>Ang isang mabuting pamaraan ng pagtuturo ay umaalisunod sa mga simulain ng pagkatuto at sa pilosopiya ng pagtuturo at sikolohiyang edukasyunal.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><em>Maaaring sabihing ang isang mabuting pamaraan ng pagtuturo ay magtaglay ng mga sumusunod:</em></p>\r\n<ul>\r\n<li><strong>May mga dapat isaalang-alang ang guro sa pagpili ng pamamaraang kanyang gagamitin.</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Angkop sa kakayahan at kawilihan ng mag-aaral</li>\r\n<li>Angkop sa paksang aralin at sitwasyon.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Ang mabuting pamaraan ng pagtuturo ay yaong payak at madaling isagawa.</li>\r\n</ol>\r\n<p>Hindi na mangangailangan ng mahabang araw ng paghahanda ng mga kagamitan at mga pantulong ang guro.</p>\r\n<ol start=\"2\">\r\n<li>Nasasangkot sa lahat ng mag-aaral sa mahahalagang gawain gaya ng</li>\r\n</ol>\r\n<p>-pagbabalak &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -pagsusuri</p>\r\n<p>-pagtatanong &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -pagtatalakayan</p>\r\n<p>-paghahambing at pageeksperimeto</p>\r\n<p>-pakikimatyag &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -pagpapasiya</p>\r\n<p>-paglalahat</p>\r\n<p>-pagsasanay at pagkakapit ng mga simulain</p>\r\n<p>-tuntunin at paglalahat na nabuo at natutuhan</p>\r\n<p>&nbsp;</p>\r\n<p><strong><u>Ang mga Kasanayang Pangwika sa Pagtatamo ng Kasanaayang Akademik</u></strong></p>\r\n<p>&nbsp;</p>\r\n<p>- Pinangunahan ng Kagawaran ng Edukasyon ang pagrereistrukturang kurikulum sa batayang edukasyon dahil sa mga sumusunod na dahilan:</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Higit namagiging malikhain o inobatibo sa interdisiplinari ang mga guro sa kanilang mga estratehiya sa pagtuturo.</li>\r\n<li>Higit namahahamon ang mgamag-aaral na makapag-isip nang kritikal upang mahikayat silang masikap namatamo angkanilang interes o pangarap sa buhay.</li>\r\n<li>Interaktib ang pinakaideyal na proseso ng pagtuturo at pagkatuto.</li>\r\n<li>Magkakaroon ng resiprokal na interaksyon ang mga guro at mga mag-aaral sa iba&rsquo;t ibang disiplina, sa mga gagamiting kagamitang paturo at multi-media sources.</li>\r\n<li>Kasangkapan ang wikang Filipino sa pakikipagkomunikasyong sosyal at interpersonal at ito&rsquo;y behikulo sapagtuturo ng mga disiplinang itinuturo sa Filipino.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><em>Sa ginawang pagrebyu ng DepEd sa dating kurikulum sa Filpino lumitaw ang mgasumusunod na obserbasyon:</em></p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Paulit-ulit lamang ang istrukturang gramatikal na itinuro mulaelementary hanggang tersyarya. Hindi pang-linggwistikaang pagsusuri at pag-aanalisang ginagawa</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Hindi maihanda ang mga mag-aaral tungo sa pagpapalawak ng kaalamang kailangan sa pag-aaral sa kolehiyo.</li>\r\n<li>Hindi lubusang nalilinang ang apat na komponent ng kasanayang komunikatibo (kaalamang gramatikal, kaalamang diskorsal, kaalamang istratedyik at kaalamang sosyo-linggwistik.)</li>\r\n<li>Hindi wastong natatalakay ang panitikan bilang isang disiplina.</li>\r\n<li>Hindi halos napagtutuunan ng pansin ang paglinang sa mga kasanayan at kaalaman sa maunawang pagbasa at malikhaing pagsulat.</li>\r\n<li>Hindi lubusang nakatutulong upang matutuhan ng mga mag-aaral ang iba pang sabdyek na ginagamitan ng Filipino bilang wikang panturo at</li>\r\n<li>Nananatiling napakababaang iskor sa NSAT (kabuuang 64% sa loob ng 3 taon)</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><em>Napagpasyahang magkaroon ng pagrepokus sa kurikulum ng Filipino sa batayang framework.</em></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>nilinaw na ang pangunahing mithiin sapagtuturo ng Filipino ay ang makalinang ng mag-aaral na pangkomunikasyon.(gramatikal, diskirsal,istratedyik at sosyo-linggwistik)</li>\r\n<li>Tiniyak na ang diskripsyon ng Filipino bilang isang sabdyek.</li>\r\n<li>bilang pantulong na sabdyek saelementary, bibigyan ng diin ang paglinang ng apat na kasanayang makro at kaisipang Pilipino.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><em>lebel 1-3, idedebelop ito samga komunikasyong sitwasyunal sa tulong ng iba&rsquo;t ibang awtentikong materyal. lebel 4-6, lilinang naman sa paggamit ng Filipino sa malikhain at kritikal napag-iisip</em></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Sa lebel sekundarya,makikilala bilang Filipino sa iskolarling pakikipagtalastasan.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Sa unang dalawang taon,ang pokus ay gramatikaat pagbasa (1-2) sa huling dalawang taon naman ay panunuring pampanitikan.(3-4)</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Maibubuod samga sumusunod nakatangian ng pagtuturo ng Filipino ayon sa bagong kurikulum.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>a) May integrasyon ng apat na makrong kasanayang pangkomunikasyon at mga kasanayan sa pag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>b) Pinalalawak o pinayayaman sa pamamagitan ng integrasyon ng bokabularyo, mgapagpapahalaga o values at mgakompetensi mula sa Agham Panlipunan at iba pang lawak ng makabayan.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>c) Nakapokus sa paglinang ng mga kasanayan sa akademikong wika at mga kasanayan sa batayang komunikasyong interpersonal at sosyal.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>d) Nakasentro sa pagtulong samga mag-aaral na magkaroon ng akses namatutuhan ang nilalaman anuman ang anyo nito-teksto, grap, ilustrasyon at iba pa.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>e) May interaksyong mag-aaral-guro-teksto at multimedia.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>f) Humahamon sa mga mag-aaral upang mapag-isip ng kritikal at malikhain sa target na wika.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>g) Binibigyang-diin ang aktibasyon at integrasyon ng dating kaalaman, ginagamit ng mga alternatibong paraang ebalwasyon, kooperatib/kolaboratibong pagkatuto, scaffolding at paglinang ng mga estratehiyasa pag-aaral.</li>\r\n<li>h) Hinihikayat ang mga mag-aaral na magkaroon ng control sadisenyo ng pagkatuto at pag-oorganisang klase</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Sanggunian:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Flores, Marivic. &ldquo;Kurikulum sa Kurikulum K-&ldquo;. Nakuha ngayong Setyembre 8, 2020.</p>\r\n<p>&nbsp;<a href=\"https://www.academia.edu/36630160/Kurikulum_sa_Kurikulum_K_\">https://www.academia.edu/36630160/Kurikulum_sa_Kurikulum_K_</a></p>\r\n<p>Garcia, Theia. &ldquo;Kurikulum Written Report.docx&rdquo;. Nakuha ngayong Setyemyembre 8, 2020.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"https://www.academia.edu/35816310/Kurikulum_Written_Report_docx\">https://www.academia.edu/35816310/Kurikulum_Written_Report_docx</a></p>\r\n<p>Villafuerte, Patricinio V. at Rolando A. Bernales.&nbsp; 2008.&nbsp; Pagtuturo ng/sa Filipino: Mga</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Teorya at Praktika.&nbsp; Valenzuela City: Mutya Publishing House, Inc.</p>\r\n<p>GURO AKO ADMIN: &ldquo;Katangian, Karakter At Personalidad Ng Isang Magaling At Epektibong</p>\r\n<p>Guro&rdquo;. Nakuha ngayong Setyembre 8, 2020.</p>\r\n<p><a href=\"https://guroako.com/2017/09/05/katangian-ng-isang-magaling-na-guro/\">https://guroako.com/2017/09/05/katangian-ng-isang-magaling-na-guro/</a></p>\r\n<p><a href=\"https://wyethinlove.wordpress.com/2017/11/30/code-of-ethics-for-professional-teachers/\">https://wyethinlove.wordpress.com/2017/11/30/code-of-ethics-for-professional-teachers/</a></p>\r\n<p><a href=\"https://www.coursehe'),(54,1013,'MODYUL 3','Sitwasyong Pangwika sa Pelikul','Pelikula at Dula','<p><strong>Tuklasin</strong><br />Sa bahaging ito naman ay ating tatalakayin ang kalagayan ng wika sa mga pelikula <br />at dulang Filipino upang ganap mong maunawaan ang araling ito.</p>\r\n<p><br /><strong>Pelikula at Dul&acirc;</strong></p>\r\n<p><br />Ang pelikula na kilala rin b&iacute;lang sine at pinilakang-tabing ay isang larangan na <br />nagpapakita ng mga gumagalaw na larawan b&iacute;lang isang anyo ng sining o b&iacute;lang <br />bahagi ng industriya ng libangan.<br />Ang panonood ng pelikula ang pinakamura at abot-kayang uri ng libangan ng lahat <br />ng uri ng tao sa lipunan. Iba-iba ang uri ng pelikulang tinatangkilik ng mga <br />manonoood. Naaayon ito sa kaniyang ibig panoorin at nagugustuhan. Nariyan ang <br />aksiyon, animation, dokumentaryo, drama, pantasya, historical, katatakutan, <br />komedya, musical, sci-fi (science fiction), at iba pa. Anuman ang pelikulang <br />tinatangkilik, tiyakin l&aacute;mang na kapupulutan ng aral na magiging gabay naman ng <br />mga manonoood sa nangyayari sa araw-araw na b&uacute;hay niya.<br />Samantala, ang dul&acirc; ay isang akdang sa pamamagitan ng kilos at galaw sa <br />tanghalan ay naglalarawan ng kawil ng mga pangyayaring naghahayag ng kapanapanabik na bahagi ng b&uacute;hay ng tao.<br />Sinasabi ring isang genre na panitikan na n&aacute;sa anyong tuluyan ang dula na dapat <br />na itanghal sa entablado, may mga tauhang gumaganap na nag-uusap sa <br />pamamagitan ng mga diyalogo. Masasabing may anyong pampanitikang inihanda <br />para sa dula na ang mga artista ay kumakatawan sa mga tauhan, ginagawa ang<br />nararapat na pagkilos ayon sa hinihingi ng mga pangyayari, at sinasabi ang <br />nakasulat na usapan.</p>\r\n<p><br /><strong>Sitwasyong Pangwika sa Pelikula</strong></p>\r\n<p><br />Bagamanmas maraming banyaga kaysa lokal na pelikula ang naipalalabas sa ating <br />bansa taon-taon, ang mga lokal na pelikulang gumagamit ng midyum na Filipino at <br />mga barayti nit&oacute; ay mainit ding tinatangkilik ng mga manonood. Katunayan, sa <br />dalawampung nangungunang pelikulang ipinalabas noong 2014, batay sa kinita, <br />lima sa mga ito ang lokal na tinatampukan din ng mga lokal na artista. Iyon nga <br />lang, Ingles ang karaniwang pamagat ng mga pelikulang Pilipino tulad ng One More <br />Chance, Starting Over Again, It Takes A Man and A Woman, Bride for Rent, You&rsquo;re <br />My Boss, You&rsquo;re Still the One, at iba pa. Ang wikang ginagamit ay Filipino, Taglish, <br />at iba pang barayti ng wika.<br />Hindi na nga maitatatwang Filipino ang wika o lingua franca ng telebisyon, radio, <br />diyaryo, at pelikula. Maaaring sabihing ang pangunahing layunin ng mga ito sa <br />paggamit ng Filipino bilang midyum ay upang makaakit nang mas maraming <br />manonood, tagapakinig, o mambabas&aacute;ng makauunawa at malilibang sa kanilang <br />palabas, programa, at babasahin upang kumita sila nang mas malaki. Subalit, <br />hindi rin mapasusubalian ang katotohanang mas dahil sa malawak na <br />impluwensiya ng wikang ginagamit sa mass media ay mas maraming mamamayan <br />sa bansa ngayon ang nakapagsasalita, nakauunawa, at gumagamit ng wikang <br />Filipino. Isang mabuting senyales para sa lalong pag-unlad at paglago ng ating <br />wikang pambansa.<br />Bagaman laganap na sa mass media, mapapansin pa rin na ang wikang Filipino ay <br />madalas na ginagamit sa mga programa sa radyo at telebisyon, sa tabloid, at sa <br />pelikula kung saan ang nananaig na tono ay impormal, at waring hindi gaanong <br />estrikto sa pamantayan ng propesyonalismo. Sa maraming babasahin at palabas <br />na Filipino, ang tila nangingibabaw na layunin ay mang-aliw, manlibang, at <br />lumikha ng ugong o ingay ng kasayahan (Tiongson, 2012). Isang pag-asam at <br />h&aacute;mon para sa mga t&aacute;ong nas&aacute; likod ng mass media at mga t&aacute;ong tumatangkilik <br />sa mga ito na hindi lang basta lumaganap ang Filipino kundi magamit din ito ng <br />mga nasabing midyum upang higit na maitaas ang antas ng ating wika</p>'),(57,1067,'MODULE 1','Kahulugan at kahalagahan ng Fi','Kahulugan at kahalagahan ng Filipino, Kurikulum, at Edukasyon','<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PAMANTASAN NG LUNGSOD NG PASIG&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\r\n<p>Alcalde Jose Street, Kapasigan, Pasig City</p>\r\n<p>&nbsp;</p>\r\n<p><strong>KOLEHIYO NG EDUKASYON</strong></p>\r\n<p>KAGAWARAN NG FILIPINO</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>KAGAMITANG PAMPAGTUTURO SA</strong></p>\r\n<p><strong>Ang Filipino sa Kurikulum ng Batayang Edukasyon</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>INIHANDA NI:</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Prof. RHEA V. IRANZO</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Feb 2020</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>YUNIT I Kahulugan at kahalagahan ng Filipino, Kurikulum, at Edukasyon</strong></p>\r\n<p>Paksa 1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kahulugan at kahalagahan ng kurso</p>\r\n<p>Paksa 2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Epektibong guro at malikhaing pagtuturo</p>\r\n<ol>\r\n<li>Mga katangian ng guro</li>\r\n<li>Code of ethics</li>\r\n<li>Disenyo ng malikhaing pagtuturo</li>\r\n<li>Layunin ng pagtuturo</li>\r\n<li>Kasangkapan sa proseso ng pagtuturo</li>\r\n<li>Mga elemento ng mabuting pagtuturo</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>YUNIT 1 KAHULUGAN AT KAHALAGAHAN NG KURSO </strong></p>\r\n<p>---------------------------------------------------------------------------------------------------------------------------</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>PANGKALAHATANG IDEYA:</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Sumasabay ang Filipino sa mga pagbabagong nagaganap sa daigdig kasabay nito ang pagbabago sa larangan ng edukasyon ang patuloy na paglago nito upang makasabay sa usaping global ng pag-aaral ang pagbabago ng ating kurikulum at patuloy na pagsasaayos nito at ang bahaging ito ay tumatalakay sa mga batayang teoretikal, nilalaman, katangian at panuntunan sa pagpapatupad ng nireistrukturang kurikulum sa Filipino. Inaangkop ang iba pang kurikulum sa mga kondisyon at sitwasyong local.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>INAASAHANG MATUTUHAN: Sa pagtatapos ng paksang ito, inaasahan na</strong>:</p>\r\n<ol>\r\n<li>Natatalakay nang mahusay ang mga pamantayan, patakaran, kalakaran at mga prosesong pinag-ugatan ng kurikulum</li>\r\n</ol>\r\n<p><strong>Kagamitan ng Kurso:</strong></p>\r\n<p><strong><u>Kahulugan at kahalagahan ng kurso</u></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Layunin:</strong></p>\r\n<ol>\r\n<li>Nakapaglilikha ng mga graphic organizers bilang pagpapaliwanag tungkol sa guro.</li>\r\n<li>Nakapagbubuo ng mga gabay sa pag-uugnay ng mga kaalaman tungkol sa proseso ng pagtuturo</li>\r\n<li>Nakapagtutukoy sa mga kasanayang pangwika sa pagtatamo ng kasanayang akademik.</li>\r\n<li>Nakabubuo ng isang Posisyong Papel kaugnay sa kasalukuyang kalagayan ng Pagtuturo ng Filipino sa Batayang Edukasyon.</li>\r\n</ol>\r\n<p><strong>KURIKULUM</strong></p>\r\n<p>Ano ang Kurikulum?</p>\r\n<ul>\r\n<li>Nagmula sa salitang latin na &ldquo;curere&rdquo; na ang ibig sabihin ay &ldquo;to run; the course of the race.&rdquo; or a runway on which one runs to reach a goal.</li>\r\n<li>. If the teacher is the guide, the curriculum is the path. Curriculum is the total structure of ideas and activities.</li>\r\n<li>The word curriculum has been in existence since about 1820.</li>\r\n<li>Kilalang curicuralist: Hilda Taba and Ralph Tyler</li>\r\n<li>Ang kabuuan ng nilalaman ng isang pinag-aaralan, mga Gawain at mga pinagbatayan na puspusang pinili, isinaayos at ipinatupad sa mga paaralan sa natatanging gawaing pantao bilang isang institusyon ng katarungan at makataong pagpapaunlad. Sakop ng Kurikulum ang kabuuang tuon o layunin, na dapat isakatuparan ng mga paaralan at maabot ang mga tiyak na tunguhin ng pagtuturo.</li>\r\n<li>Ang kurikulum ay disiplina sa paaralan,mga aklat at mga Kagamitang ginagamit,paggawa ng banghay-aralin,mga pagpapahalaga,mg apagsusulit at kung anu-anoang itinuturo ng guro.</li>\r\n<li>Ayon kina <strong>Ragan</strong> at <strong>Shepherd</strong> ang kurikulum ay isang daluyang magpapadali kung saan ang paaralan ay may resposibilidad sa paghahatid, pagsasalin at pagsasaayos ng mga karanasang pampagkatuto.</li>\r\n<li>Sa pamamagitan ng kurikulum, ang mga mag-aaral naisasama sa karanasang pang-edukasyonal at tunay na makatutulong sa pagpapaunlad ng sitwasyon ng lipunan</li>\r\n<li>Ang kurikulum ay isang plano ng mga gawaing pampaaralan at kasama rito ang sumusunod:\r\n<ul>\r\n<li>ang mga dapat matutunan ng mga mag-aaral,</li>\r\n<li>ang paraan kung paano tayahin ang pagkatuto,</li>\r\n<li>ang katangian ng mga mag-aaral kung paano sila matatanggap sa programa, at</li>\r\n<li>ang mga kagamitang pampagtuturo</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><strong>FIVE BASIC DEFINITIONS OF CURRICULUM</strong></p>\r\n<ol>\r\n<li>Curriculum can be defined as a <strong>plan for achieving goals. </strong>The plan involves a sequence of steps.</li>\r\n</ol>\r\n<ol>\r\n<li><strong> Galen Saylor </strong>- defines curriculum as &ldquo;a plan for providing sets of learning opportunities for person to be educated.&rdquo;</li>\r\n</ol>\r\n<p><strong>David Pratt</strong>- &ldquo;Curriculum is an organized set of formal education and/or training intentions.&rdquo;</p>\r\n<p><strong>John Wiles and Joseph Bondi</strong>- view curriculum as &ldquo;a four-step plan involving purpose, design, implementation and assessment.&rdquo;</p>\r\n<ol>\r\n<li>Curriculum can be defined broadly, <strong>as dealing with the learner&rsquo;s experience</strong>. By this definition, almost anything planned in and outside of school is part of the curriculum.</li>\r\n</ol>\r\n<p><strong>Hollis Caswell and Doak Campbell- </strong>view curriculum as &ldquo;all the experiences children have under the guidance of teachers.&rdquo;</p>\r\n<p><strong>Gene Shepherd and William Ragan</strong>- &ldquo;The curriculum consists of the ongoing experiences of children under the guidance of the school.&rdquo;</p>\r\n<p><strong>Collin Marsh and George Willis</strong>- views curriculum as all the &ldquo;experiences in the classroom that are planned and enacted.&rdquo;</p>\r\n<ol>\r\n<li>Curriculum <strong>is a system for dealing with people. </strong></li>\r\n<li>Curriculum can be defined <strong>as a field of study with its own foundations, knowledge domains, research, theory, principles, and specialist.</strong></li>\r\n</ol>\r\n<p>-Discuss curriculum in theoretical rather than practical terms.</p>\r\n<p>-They are concerned with broad historical, philosophical, or social issues.</p>\r\n<ol>\r\n<li>Curriculum can be defined <strong>in terms of subject matter</strong> (math, science, English, history and so on) or content (the way we organize and assimilate information).</li>\r\n</ol>\r\n<p><strong>BAHAGI NG KURIKULUM</strong></p>\r\n<ol>\r\n<li>AIM - Balak o Pakay, Paglalahad o pagpapaliwanag ng pangkalahatang pakay ng kurikulum. Napakaloob dito ang mga tagapakinig (audience) pati na rin ang paksa.</li>\r\n<li>RATIONALE - Makatwirang Paliwanag, Mapaghimok na pagtatalo, dahil dito ipinaliliwanag kung bakit gustong magmungkahi at ang mga paggamit ng oras at mga pinagkukunan para sa kurikulum.</li>\r\n<li>GOALS AND OBJECTIVES - Hangarin at Layunin - Talaan ng mga maaring bunga ng mga matutuhan ng mga mag-aaral base sa magiging partisipasyon sa kurikulum. Napakaloob rin dito ang pagpapaliwanag kung paano makatutulong ang kurikulum sa bansa at sa lipunan.</li>\r\n<li>AUDIENCE &amp; PREREQUSITES - Mag-aaral at mga</li>\r\n</ol>\r\n<p>Pangunang Kailangan - Nagpapaliwanag kung sino ang makikinabang sa kurikulum at mga pangunang kaalaman at kakayahan para sa mabisang kurikulum.</p>\r\n<ol start=\"5\">\r\n<li>MATERIALS - Mga Kagamitan - Tala ng mga kakailanganing kagamitan para sa matagumpay na pagtuturo ng kurikulum. Napakaloob dito ang mga &ldquo;web pages&rdquo;, mga aklat, mga mesa, papel, chalkboard, calculator, at iba pang karaniwang kagamitan.</li>\r\n<li>INSTRUCTIONAL PLAN - Matalinong pagpaplano - Nagsasaad sa mga gawaing kukunin ng mga mag-aaral at ang pagkasunod-sunod nito. Napakaloob rin dito kung ano ang maaring gawin ng guro sa klase. Estratehiya, metodo, istilo ng pagtuturo.</li>\r\n<li>PLANS FOR ASSESSMENT AND EVALUATION - Ebalwasyon o Pagkilatis - Binubuo ng mga model project, mga halimbawa ng tanong sa pagsusulit at iba pang kakailanganin sa assessment.</li>\r\n</ol>\r\n<p><strong>TYPES OF CURRICULUM OPERATING IN SCHOOLS</strong></p>\r\n<p><strong>Allan Glatthorn </strong>(2000) describes seven types of curriculum operating in the schools.</p>\r\n<p>(1) Recommended curriculum</p>\r\n<ul>\r\n<li>The recommended curriculum is that which is recommended by scholars and professional organizations such as DepEd, CHED, and DOST.</li>\r\n</ul>\r\n<p>(2) Written curriculum</p>\r\n<ul>\r\n<li>The written curriculum is intended primarily to ensure that the educational goals of the system are being accomplished; it is a curriculum of control.</li>\r\n</ul>\r\n<p>(3) Taught curriculum</p>\r\n<ul>\r\n<li>The taught curriculum is the delivered curriculum, a curriculum that an observer sees in action as the teacher teaches.</li>\r\n</ul>\r\n<p>(4) Supported curriculum</p>\r\n<ul>\r\n<li>The supported curriculum includes those resources that support the curriculum-textbooks, software, and other media.</li>\r\n</ul>\r\n<p>(5) Assessed curriculum</p>\r\n<ul>\r\n<li>The assessed curriculum is that which appears in the test and performance measure: state tests, standardized tests, district tests, and teacher-made tests.</li>\r\n</ul>\r\n<p>(6) Learned curriculum</p>\r\n<ul>\r\n<li>The learned curriculum is the bottom line curriculum, the curriculum that students actually learn. It denoted all the changes in values, perceptions, and behavior that occur as a result of school experiences.</li>\r\n</ul>\r\n<p>(7) Hidden curriculum</p>\r\n<ul>\r\n<li>This is the unintended curriculum. It defined what students learned from the physical environment, the policies, and the procedures of the school.</li>\r\n</ul>\r\n<p><strong>CHARACTERISTICS OF CURRICULUM</strong></p>\r\n<ul>\r\n<li>It includes all the experiences of children for which the school is responsible,</li>\r\n<li>It has content,</li>\r\n<li>It is a system for dealing with people,</li>\r\n<li>It is planned,</li>\r\n<li>It is a series of courses to be taken by the students.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Prescriptive vs. Descriptive</strong></p>\r\n<ul>\r\n<li><strong>Prescriptive Curriculum </strong>definitions provide us with what &ldquo;ought&rdquo; to happen, and they more often than not take the form of a plan, an intended program, or some kind of expert opinion about what needs to take place in the course of study. (Ellis, 2004, p.4)</li>\r\n<li><strong>John Dewey (1902)</strong>- Curriculum is a continuous reconstruction, moving from the child&rsquo;s present experience out into the represented by the organized bodies of truth that we call studies&hellip; the various studies&hellip; are themselves experience &ndash; they are that of the race.</li>\r\n<li><strong> L. McBrien &amp; R. Brant (1997)</strong>- Curriculum refers to a written plan outlining what students will be taught (a course of study). Curriculum may refer to all the courses offered at a given school, or all the courses offered at a school in a particular area study.</li>\r\n<li><strong>Descriptive Curriculum</strong> goes beyond the prescriptive terms as they force thought about the curriculum &ldquo;not merely in terms of how things ought to be&hellip; but how things are in real classroom&rdquo; (Ellis, 2004, p.5). Descriptive curriculum is experience.</li>\r\n<li><strong>Thomas Hopkins (1941)</strong>- Those learning each child selects, accepts, and incorporates into himself to act with, in, and upon, in subsequent experiences.</li>\r\n<li><strong>Daniel Tanner &amp; Laurel Tanner (1995)</strong>- The reconstruction of knowledge and experience that enables the learner to grow in exercising intelligent control in subsequent knowledge and experience.</li>\r\n</ul>\r\n<p><strong>DISTINCTION BETWEEN CURRICULUM AND OTHER TERMINOLOGIES</strong></p>\r\n<p><strong>Curriculum and Syllabus</strong></p>\r\n<ul>\r\n<li>A syllabus is part of a curriculum but it is not the curriculum.</li>\r\n<li>Syllabus is the content of the school subjects offered in the school, and it is a sub-set of the curriculum.</li>\r\n</ul>\r\n<p><strong>Curriculum and Scheme of Work</strong></p>\r\n<ul>\r\n<li>The curriculum of a school is not the scheme of work.</li>\r\n<li>A scheme of work is the systematic arrangement of subject matter and activities within a given time period, such as a term or a semester.</li>\r\n</ul>\r\n<p><strong>Curriculum and Course of Study</strong></p>\r\n<ul>\r\n<li>A course of study refers mainly to a programme of learning that are offered to students &ndash;with various course contents &ndash; at the end of which they are awarded a certificate indicating the type of course.</li>\r\n</ul>\r\n<p><strong>Curriculum and Lesson Note</strong></p>\r\n<ul>\r\n<li>A lesson note is a guide for teachers to assist them in the orderly presentation of a lesson to the learners in order to facilitate learning.</li>\r\n<li>The lesson note is not a curriculum but it is an important aspect of curriculum implementation.</li>\r\n</ul>\r\n<p><strong>IBA PANG KAHULUGAN NG KURIKULUM</strong></p>\r\n<ul>\r\n<li>Curriculum is the crux of the whole educational process. Without curriculum, we cannot conceive any educational Endeavour. The curriculum in a literal sense, a pathway towards a goal.&nbsp; Curriculum is actually what happens during a course i.e., lecture, demonstrations, field visits, the work with the client and so on. &mdash; Curriculum also means a written description of what happens.</li>\r\n<li>Curriculum is an important element of education. Aims of education are reflected in the curriculum. In other words, the curriculum is determined by the aims of life and society. Aims of life and society are subject to constant change.</li>\r\n<li>Stenhouse (1980) &mdash;\"A curriculum is an attempt to communicate the essential principles and features of an educational proposal in such a form that it is open to critical scrutiny and capable of effective translation into practice.\"</li>\r\n<li>Cunningham - Curriculum is tool in the hand of the artist (teacher) to mould his material in accordance with his ideals in the school</li>\r\n<li>(Genn J, 1995) &ldquo;Everything that happens in relation to the educational programme.&rdquo;</li>\r\n<li>The secondary education commission says: A curriculum does not mean only the academic subjects traditionally taught in the school but it includes the totality of experiences that a public receives through the manifold activities that go on in the school, workshop, playground, library, laboratory and in the informal contacts between teachers and pupils.</li>\r\n<li>The whole life of the school becomes the curriculum which can touch the life of students at all points and help to form a balanced personality. A curriculum is the instructional program through the pupils achieve their goals</li>\r\n<li>&ldquo;A curriculum is an attempt to communicate the essential principles and features of an educational proposal in such a form that it is open to critical scrutiny and capable of effective translation into practice.&rdquo; Stenhouse (1975)</li>\r\n<li>Curriculum - Any document or plan that exists in a school or school system that defines the work of teachers, at least to the extent of identifying the content to be taught student and the methods to be used in the process (English, 2000).</li>\r\n</ul>\r\n<p><strong>Who owns the curriculum?</strong></p>\r\n<ul>\r\n<li>A teacher in a public school is an employee of the district, which is an educational entity of the state.</li>\r\n<li>It is the state, the governor, the legislature (the state dept. of education or state board of education) which has ultimate responsibility over the curriculum.</li>\r\n</ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Ang curriculum ay nagmula sa salitang Latin na currere ay nangangahulugang ito run the course of the race o magtabakbo ng isang kurso sapagkat ang kurikulum ang nagsisilbing fundasyon ng mga paaralan sa pagtuturo at pagkatuto. If the teacher is the guide the curriculum is the path ang gurio ang nagagabay sa atin tungo sa path o paroroonan na sinasabi ng kurikulum. Ang kurikulum ay umiiral na simula noong 1820. At ang mga kilalang curicuralist ay sina Hilda Taba at Ralph Tyler. Ang kurikulum raw ang pinaka kabuuan ng pinag-aaralan kumbaga nandito nakabatay ang lahat ng ituturo sa mga paaralan. Gayundin nandito nakalagay ang gabay sa mga kagamitan maging sa pamamaraan ng pagtuturo. Mula naman sa pahayag nina Ragan at Sheperd ang kurikulum ay isang daan at ang paaralan ang may responsibilidad sa pagsasabuhay o sa pag-aapply ng nilalaman ng kurikulum. Dahil sa pamamagitan nito ito ay tutulong sa mga mag-aaral upang matuto ng maayos at makatulong sa pagpapaunlad ng lipunan. Ito rin ay isang plano kung saan nakalagay ang dapat matutunan sa isang paaralan o kurso, narito rin ang dapat dsukatin ang kanilang mga natutunan maging ang mga pamamraan at estratehiya narito rin ang mga kwalipikasyon kung isa itong kurrikulum ng isang kurso nakalagay ang pamantayan at tinutukoy rin sa kurrikulum ang mga Kagamitang pampagtuturo na gagamitin.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Narito naman ang iba pang kahulugan ng Curriculum mula sa iba&rsquo;t ibang tao. Una binanggit na it is a plan for achieving goals kung saan ito ay mayroon layunin na binibigyang tuon na dapat maabot kung saan ito ay proseso at mga hakbang para makamit yung layunin o pakay. Ikalawa mula sa pahayag nui J. Galen Saylor sabi niya ito ay a plan for providing sets of learning opportunities for person to be educated. Kung saan ito ay nagbibigay ng oppurtunidad na matuto ang bawat tao. Mula naman sa pahayag ni David Prattsabi niya &ldquo;Curriculum is an organized set of formal education and/or training intentions.&rdquo; Ito ay may layunin at intensiyunal hindi lang basta napag-isipan ngunit ito ay ninanais na maabot at magkaroon ng bunga o resulta. Sinabi naman ni John Wiles and Joseph Bondipinaliwanag niya ang curriculum as &ldquo;a four-step plan involving purpose, design, implementation and assessment.&rdquo; kung saan ito ay may proseso una ay ang dahilan o kung para saan ang kurikulum ikatlo ay ang disenyo kung ano ang nilalaman o ano ang tinataglay nito ikatlo ay kung paano ito isasakatuparan at huli dahil naisakatuparan na ay paano ito tatasahi9n yung mga natutunan ng mga mag-aaral. Binigyang pakahulugan rin ang kurikulum na &ldquo;as dealing with the learner&rsquo;s experience&rdquo; sa pagkat nakatuon rin ang kurikulum sa mga bagay n na kanilang natututunan at nararanasan na nagmula sa paaralan. Gayundi nagbigay pakahulugan naman si Hollis Caswell and Doak Campbellat ipinaliwanag niya ang kurikulumna &ldquo;all the experiences children have under the guidance of teachers.&rdquo; Ito yung mga natutunan ng mga bata habang sila pa ay nasa paaralan yung mga nakukuha nalang kaalaman at naiinquire nila sa kanilang mga guro. Mula naman kay Gene Shepherd and William Ragan sinabi niya na &ldquo;The curriculum consists of the ongoing experiences of children under the guidance of the school.&rdquo; Katulad din ng nakailalim sa kanilang guro maging ano man ang kanilang gawain o nararanasan sa loob ng paaralan ay bahagi ng kurikulum hindi lamang sa loob ng klase subalit ano man ang mga ginagawa sa loob ng paaralan ay maituturing na bahagi ng kurikulum. Ipinaliwanag naman ni Collin Marsh and George Willis na &ldquo;experiences in the classroom that are planned and enacted.&rdquo; kung ano ang mga gawain sa paaralan na kanilang nakukuhanan ng kaalaman ay parte parin ng kurikulum. Ito rin ay a system for dealing with people. Sapagkat walang saysay ang kurikulum kung walang tao na magsasakatuparan nito. Sa pamamagitan ng kurrikulum nagkakaroon ng pakikipag-ugnayan sa bawat tao. Gayundin pinaliwanag rin ito bilangfield of study with its own foundations, knowledge domains, research, theory, principles, and specialist. Maari ding ipakahulugan ito sa pamamagitan ng mga asignatura dahil bawat asignatura ay isa ring kurikulum kung saan nagtataglay ng mga layunin pamamaraan at nilalaman para sa pagkatuto.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Narito naman ang bahagi ng kurikulum. Una ay ang aim o Balak o Pakay. Dito inilalahad kung para saan ang kabuuan ng isang kurikulum. Ikalawa naman ay rationale o makatwirang paliwanag, o ipinaliliwanag kung ano ba ang tatalakayin o ninanais ng kurikulum. Ikatlo naman ay ang objectives o yung layunin. Narito kung ano ba yung hangarin ng kurikulum at dito nakasalalay kung ano ba ang pinakahinahanap na bunga ng kurikulum.Ikaapat ay ang audience o yung mag-aarl kung kanino gagamitin ang nasabing kurikulum dahil kung walang nakalaang pag-aalayan nito ay wala ring saysay ang kurikulum. Ikalima ay ang materyales hindi maisasagawa ng maayos ang isang kurikulum kung walang materyales na gagamitin at sa pamamagitan ng materyales mas mapapadali ang pagsasakatuparan ng kurikulum. Ikaanim ay Instructional Plan kung saan naroon yung mga palano para sa pagkatuto narito yung mga pamamaraan o estratehiya na gagamitin para sa pagsasakatuparan ng kurikulum dito rin nakasalalay ang magandang bunga ng isang kurikulum. At huli ay ang Plan for assessment evaluation kung saan mga plano at pamamaraan kung paano tatayahin at tatasahin kung ano nga ba yung mga natuunan sa kabuuan ng mag-aaral.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Narito naman ang mga uri ng kurikulum mula kay Allan Glathorn. Una ay ang Recommended curriculum kung saan ito ang mga ibinibigay o mga suhestiyong mga scholars tulad ng DepEd CHED o DOST. Ikalawa naman ay ang written curriculumkung saan ito ang gabay maaring ito ay ang lesson plan daily lesson log course outline o maging syllabus. Ikatlo ay ang taught curriculum kung saan&nbsp; ang pagsasagawa o kung paano itinuturo na ang paksa o nilalaman ng isang kurikulum. Ikaapat ay angSupported curriculum kung saan ito ang mga tumutulong sa pampagkatuto ng bata maaring ito ay ang mga libro teaching guide o yung kagamitan tulad ng mga visual aids projecter na tumutulong sa mabilis na pagkatuto ng bata. Susunod ay ang ang Assessed curriculum kung saan ito ang pamamaraan kung paano tatayahin ang bata o tatasahin sa kanilang mga natutunan sa paksa maaring ito ay pasulat o maging pasalita. Susunod ay ang Learned curriculum kung saan yung mga natutunan sa kurikulum. At kung ano yung mga dulot t epekto sa kanila. At ang huli ay ang hidden curriculum kung saan ito yung mga bagay na natutunan nila ngunit hindi naman ito bahagi ng kurikulum. Maaring pansariling pagkatuto hinggil sa kakayahan pag-uugali at sa kanilang mga pananaw.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Sino nga ba ang responsable sa paggawa ng kurikulum? Ang kurikulum ay responsibilidad ng guro sapagkat malaki ang kanilang papel na gampanin ditto. Dito ang magtuturo sa mga mag-aaral ng mga subject na napagplanuhan sa paggawa. Sila rin ang magsisilbing gabay ng mga mag-aaral habang nasa loob ng paaralan. Bukod sa mga guro, mahalaga rin ang gampanin ng mga magulang. Sila ang dapat na naggagabay sa kanilang mga anak habang sila ay nasa kanilang mga tahanan. Malaki rin ang kanilang papel sa pagkabuo ng kurikulum sapagkat kung anong klase silang tao ay repleksyon o sumasalamin ito kung paano nila pinalaki ang kanilang mga anak. Bukod pa rito, ang mga magulang ang higit na nakaaalam kung ano ang nakabubuti para sa kanilang mga anak kung kaya&rsquo;t mahalaga na magkaroon sila ng kinalaman dito. Bukod pa sa kanila, ang ating gobyerno, pamahalan, mga mamababatas at maging ang lahat ng taong nakabilang sa isang lipunan. Silang lahat ay sangkot dito, sapagkat ano man ang mangyayari o nangyayari sa ating lipunan ang lahat ay kasangkot, na maaaring maging sanhi ng hindi pagkatuto o pagkatuto ng isang mag-aaral.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>Aktibiti 1</em></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Pangalan __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Petsa: _________</p>\r\n<p>Propesor __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Taon at Pangkat _______</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Marka _________</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Ilahad ang nilalaman ng mga sumununod na memorandum order/artikulo na may kinalaman sa kurikulum</strong></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Artikulo XIV, Sek. 7 ng 1987 konstitusyon -</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>DECS Order 25, s. 1974 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>DECS Order No. 50, s. 1975 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>MEC Order No. 22, s. 1978 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>DECS Order 52, s. 1987 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>CHED Memo Order 59, s. 1996 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>CHED Memo 04, s. 1997 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>CHED Memo Order 11, s. 1998 &ndash;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Sagutin ang mga sumusunod na mga katanungan batay pa rin sa kurikulum.</strong></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Ano ang mga kailangan sa pagbuo ng kurikulum? Ilahad.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li>Ano ang mga proseso sa pagsasagawa ng kurikulum?</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><u>Epektibong guro at malikhaing pagtuturo</u></strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Paano nga ba maging isang epektibong guro na siyang maging daan upang mabago ang buhay ng isang estudyante? Anu-ano ang mga katangian, personalidad at karakter ng isang epektibong guro?</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Ang tanong na ito ay umiikot sa isipan ng mga indbidwal noong sila ay estudyante pa lamang at sa mga guro na nais maging epektibo sa kanilang napiling propesyon. Ang babasahing ito ay naglalaman ng mga kasagutan kung paanu maging isang epektibong guro bilang propesyon.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Ang mga Katangian ng Epektibong Guro</strong></li>\r\n</ul>\r\n<p><strong>&nbsp;</strong></p>\r\n<ol>\r\n<li>Walang itinatangi. Hindi malilimutan ng mga mag-aaral kung ang guro\'y may paborito sa klase o angkanyang di pagkakapantay-pantay na pagtrato sa kanyang mga mag-aaral. Sa loob ng klase, dapat na siya\'y walang kinikilingan at mahalagang maging pantay ang kanyang pagtingin sa lahat ng mga mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li>May positibong ugali. NAsisiyahan ang mga mag-aaral kung sila\'y nabibigyan ng papuri at pagkakilala o rekognisyon. Malaki ang impak nito sa kanilang tiwala sa sarili at direksyon. Naniniwala at nasisiyahan siya sa tagumpay ang kanilang mga mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"3\">\r\n<li>May kahandaan. Ang kahusayan (competence) at kaalaman sa saklaw ng nilalaman ng mga paksang itinuturo ay kinikilala ng mga mag-aaral. Madaling makilala ng mga mag-aaral ang gurong organisado at handa nang magturo.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"4\">\r\n<li>May haplos-personal. Pinahahalagahan ng mga mag-aaral ang gurong may ugnayan sa kanila, yaong tumatawag sa kanilang pangalan, palangiti, nagtatanong tungkol sa kanilang nadarama at opinyon, tinutuklas ang kanilang interes at tinatanggap ang tunay nilang pagkatao. Ang pagkukwento ng guro ng mga kwentong may kinalaman sa aralin ay higit na nagugustuhan ng mga mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"5\">\r\n<li>Masayahin. Naaalala ng mga mag-aaral ang gurong masayahin sa klase. Ang dagling pagbibiro at pagpapatawa sa mga sitwasyong nahihirapan at napapahiya ang mga mag-aaral ay nakababawas sa paghihirap o kahihiyang dinaranas ng mga mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"6\">\r\n<li>Malikhain. Nagugunita ng mga mag-aaral ang kanilang gurong malikhain sa mga gawaing pangklasrum, lalo na sa oras na ginaganyak sila para sa isasagawang aralin, pati na ang pag-aayos sa klasrum ng kanilang guro.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"7\">\r\n<li>Marunong tumanggap ng kamalian. Nababatid ng mga mag-aaral kung nagkakamali ang kanilang guro lalo\'t sila ang labis na naaapektuhan bunga ng pagkakamaling ito. Nagiging modelo ang isang guro kung tinatanggap niya ang kanyang pagkakamali at buong pagpapakumbabang humingi siya ng kapatawaran sa pagkakamaling kanyang nagawa.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"8\">\r\n<li>Mapagpatawad. Kinalulugdan ng mga mag-aaral ang gurong marunong magpatawad sa kasalanang kanilang nagawa, lalo\'t yaong nauukol sa kanilang maling gawi at ikinilos. Ang guro ang tagabuo ng anumang tunggaliang nagaganap sa klase kaya\'t mahalagang maiwasan din niyang magbigay ng di-magandang puno ukol dito.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"9\">\r\n<li>May respeto. Ang kinalulugdang guro ay yaong marunong maglihim ng markang kanyang ibinigay sa kanyang mga mag-aaral o yaong kinakausap ang mag-aaral na may nagawang pagkakamali o kasalanan nang walang nakaririnig o nakakaalam, o yaong nagpapakita ng sensitibiti sa nadarama ng kanyang mga mag-aaral, nagiging marubdob ang mga mag-aaral na matupad ang kanyang mga tunguhin.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"10\">\r\n<li>May mataas na ekspektasyon. Ang di-malilimutang guro ay yaong nagpapakita ng napakataas na pamantayan lalo\'t hinahamon ang kanyang mga mag-aaral na gawin nang napakahusay ang kanyang ipinag-uutos. Madalas na nawawalan ng tiwala sa sarili ang mga mag-aaral. Kung maniniwala ang guro na may mga kakayahan ang kanyang mga mag-aaral, nagiging marubdob ang mga mag-aaral na matupad ang kanyang mga tunguhin.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"11\">\r\n<li>Mapagmahal. Kung aalamin ng guro kung bakit naalis sa isang laro, ang kanyang mag-aaral at kikilos siya upang makagawa ng paraan halimbawa para malutas ang suliranin nito ay naglalarawan ng pag-aalala at pagmamahal.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"12\">\r\n<li>Ipinadaramang kabilang ang bawat mag-aaral. Laging nasa isip ng mga mag-aaral na sila\'y kabilang sa klase. Nadarama nilang kapamilya ang kanilang guro. Ang pagtatanong at pagpapakita ng kasiyahan sa ipinakikitang mga gawad, pampamilyang album at iba pa ng mag-aaral ay nakabubuo ng pagkakaisa at mabuting pagsasamahan. Ang mahusay at epektibong guro ay yaong nakaiisip agad ng paraan upang hindi magkaroon ng hinanakitan ang kanyang mga mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Katangian, Karakter At Personalidad Ng Isang Magaling At Epektibong Guro</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong> Umaasa ng mataas o positibong personalidad</strong>. Ang mga magagaling na guro ay umaasang lahat ng kanilang estudyante ay magsisikap at gustong matuto.Kinikilala nila ang mga estudyante sa iba&rsquo;t-ibang yugto ng abilidad at katangian. Gayunpaman,sila ay naniniwala na lahat ng kanilang estudyante ay matuto,makakamtam ang tunay na progreso sa bawat na taon na pagdaanan at matamo ang mga pangunahing kakayahan tulad ng pagbasa,pagsulat at pagbilang ng numero.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li><strong> Pangangalaga</strong>. Ang mga gurong nangangalaga sa kanilang estudyante ay may malaking epekto kung ano ang ginagawa ng estudyante sa paaralan. Inaalagaan ng tunay ang estudyanteng ito bilang isang tao tulad ng isang magulang sa kanyang anak.Mabubuting guro ay mainit na nagmamahal, magalang at nakikidamay. Halimbawa, ang pagsasabi nila ng magandang araw sa mga estudyante sa tuwing nadadaanan nila. Ang mga guro ay hindi natatakot na magbigay ng matibay na pagmamahal sa kanilang estudyante. Kailangan mo lang maniwala sa iyong mga estudyante at subukin sila para manguna habang sunod-sunod silang suportahan para gawin ito.</li>\r\n<li><strong> Abilidad</strong>. Ang lahat ng ibang bagay ay magkapantay,matatalinong tao ginagawang magaling ang isang guro &ndash; at kung mas matalino ang tao mas mabuti.Ito&rsquo;y lumilipad sa paniniwala ng nakakarami.Pero ayon sa pananaliksik lumalabas na ang mataas na yugto ng kaalaman(IQ) ay nagreresulta ng mataas na kalidad sa paggawa sa lahat ng uri ng trabaho kabilang na ang pagtuturo.&rdquo;Ang tanging dahilan upang magkaroon ng ganap na progreso ang isang estudyante ay ang mataas na kalidad ng talino nang kanyang guro (Dylan Williams)&rdquo;.Hindi ito bago,kapag kinunsidera mo ang talinong kailangan upang sukatin ang abilidad na harapin ang pagsubok binibigyan nito ang pinaka-mainam na paraan para magpatuloy.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"4\">\r\n<li><strong> Pagmamahal sa tungkulin.</strong> Mga gurong epektibo ay nanghihimok sa kanilang propesyon na tulungang matuto ang kanilang mga estudyante. Kung wala ang pagmamahal na ito,walang kang lakas.Kung wala kang lakas,wala kang magagawa.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>5.Propesyonal na Kaalaman-upang maging magaling na guro kailangan niya ang mga sumusunod</strong>;</p>\r\n<p>&ndash; kaalaman sa nilalaman na ituturo</p>\r\n<p>&ndash; kurikulum,programa at materyal</p>\r\n<p>&ndash; populasyon ng estudyante</p>\r\n<p>&ndash; partikular na kontekstong edukasyonal</p>\r\n<p>&ndash; layunin at kahalagahan ng edukasyon</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"6\">\r\n<li><strong> Magaling sa komunikasyon. </strong>Isa sa mga pangunahing katangian ng isang epektibong guro ay ang galing niya sa komunikasyon.Kailangan ito upang maipaliwanag ang mga ideya,pag-uusapan na isyu,pagpapahayag ng paniniwala at kahalagahan sa pagtuturo.Ang mga guro kasi ay maraming ginagampanan sa loob ng silid-aralan at sa lugar ng trabaho.Kailangan sila ay maabilidad sa pagresolba ng mga sigalot.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"7\">\r\n<li><strong> Mapanuri sa paligid. </strong>Sa isang guro mahalaga ang pagiging mapanuri upang magkaroon ng sapat na kaalaman sa paligid nila(mga estudyante,paaralan,komunidad at kultura ng lugar ng trabaho).Para malaman ang nararapat na gawin sa isang sitwasyon.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"8\">\r\n<li><strong> Pangako sa habangbuhay na pagkatuto. </strong>Ito&rsquo;y kinikilala ng mga taong nagbibigay edukasyon, organisasyong nagbibigay akredistasyon o paniniwala,mangagawa at publiko na ang pinakaimportanteng kagalingan na dapat magkaroon ang bawat indibidwal.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"9\">\r\n<li><strong> Handang lagpasan lahat. </strong>Ang mga guro ay naniniwala sa kanilang kakayahan na magampanan nila ang kanilang tungkulin,upang gumawa ng pagbabago o direksyon sa buhay ng kanilang estudyante.Umaasa ng mataas upang mapukaw at mag-udyok sa kanilang estudyante bilang isang halimbawa.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"10\">\r\n<li><strong> Ang buhay sa labas ng paaralan. </strong>Ayon sa pag-aaral ang mga taong mayroon hilig na gawain at kaibigan ay mababa ang pakiramdam ng pagod at tumaas ang pagiging produktibo sa trabaho.Ang mga guro ay dapat humanap ng pagkakaabalahan na maglalarawan sa kanila sa labas ng paaralang tinuturuan.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>CODE OF ETHICS FOR PROFESSIONAL TEACHERS</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Pursuant to the provisions of paragraph (e), Article 11, of R. A,. No. 7836, otherwise known as the Philippines Professionalization Act of 1994 and Paragraph (a), section 6, P.D. No. 223, as amended, the Board for Professional Teachers hereby adopt the Code of Ethics for Professional Teachers.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PREAMBLE</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Teachers are duly licensed professionals who possesses dignity and reputation with high moral values as well as technical and professional competence in the practice of their noble profession, they strictly adhere to, observe, and practice this set of ethical and moral principles, standards, and values.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ARTICLE I</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>SCOPE AND LIMITATIONS</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. The Philippine Constitution provides that all educational institution shall offer quality education for all competent teachers committed of it&rsquo;s full realization The provision of this Code shall apply, therefore, to all teachers in schools in the Philippines.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 2. This Code covers all public and private school teachers in all educational institutions at the preschool, primary, elementary, and secondary levels whether academic, vocational, special, technical, or non-formal. The term &ldquo;teacher&rdquo; shall include industrial arts or vocational teachers and all other persons performing supervisory and /or administrative functions in all school at the aforesaid levels, whether on full time or part-time basis.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ARTICLE II</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>THE TEACHER AND THE STATE</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. The schools are the nurserles of the future citizens of the state; each teacher is a trustee of the cultural and educational heritage of the nation and is under obligation to transmit to learners such heritage as well as to elevate national morality, promote national pride, cultivate love of country, instill allegiance to the constitution and for all duly constituted authorities, and promote obedience to the laws of the state.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Section 2. Every teacher or school official shall actively help carryout the declared policies of the state, and shall take an oath to this effect.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 3. In the interest of the State and of the Filipino people as much as of his own, every teacher shall be physically, mentally and morally fit.</p>\r\n<p>Section 4. Every teacher shall possess and actualize a full commitment and devotion to duty.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 5. A teacher shall not engage in the promotion of any political, religious, or other partisan interest, and shall not, directly or indirectly, solicit, require, collect, or receive any money or service or other valuable material from any person or entity for such purposes</p>\r\n<p>&nbsp;</p>\r\n<p>Section 6. Every teacher shall vote and shall exercise all other constitutional rights and responsibility.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 7. A teacher shall not use his position or facial authority or influence to coerce any other person to follow any political course of action.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 8. Every teacher shall enjoy academic freedom and shall have privilege of expounding the product of his researches and investigations; provided that, if the results are inimical to the declared policies of the State, they shall be brought to the proper authorities for appropriate remedial action.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ARTICLE III</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>THE TEACHER AND THE COMMUNITY</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. A teacher is a facilitator of learning and of the development of the youth; he shall, therefore, render the best service by providing an environment conducive to such learning and growth.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 2. Every teacher shall provide leadership and initiative to actively participate in community movements for moral, social, educational, economic and civic betterment.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 3. Every teacher shall merit reasonable social recognition for which purpose he shall behave with honor and dignity at all times and refrain for such</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>activities as gambling, smoking, drunkenness, and other excesses, much less illicit relations.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 4. Every teacher shall live for and with the community and shall, therefore, study and understand local customs and traditions in order to have sympathetic attitude, therefore, refrain from disparaging the community.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 5. Every teacher shall help the school keep the people in the community informed about the school&rsquo;s work and accomplishments as well as its needs and problems.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 6. Every teacher is intellectual leader in the community, especially in the barangay, and shall welcome the opportunity to provide such leadership when needed, to extend counseling services, as appropriate, and to actively be involved in matters affecting the welfare of the people.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 7. Every teacher shall maintain harmonious and pleasant personal and official relations with other professionals, with government officials, and with&nbsp; the people, individually or collectively.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 8. A teacher posses freedom to attend church and worships as appropriate, but shall not use his positions and influence to proselyte others.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>ARTICLE IV</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>A TEACHER AND THE PROFESSION</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. Every teacher shall actively insure that teaching is the noblest profession, and shall manifest genuine enthusiasm and pride in teaching as a noble calling.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 2. Every teacher shall uphold the highest possible standards of quality education, shall make the best preparations for the career of teaching, and shall be at his best at all times and in the practice of his profession.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 3. Every teacher shall participate in the Continuing Professional Education (CPE) program of the Professional Regulation Commission, and shall pursue</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>such other studies as will improve his efficiency, enhance the prestige of the profession, and strengthen his competence, virtues, and productivity in order to be nationally and internationally competitive.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 4. Every teacher shall help, if duly authorized, to seek support from the school, but shall not make improper misrepresentations through personal advertisements and other questionable means.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 5. Every teacher shall use the teaching profession in a manner that makes it dignified means for earning a descent living.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ARTICLE V</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>THE TEACHERS AND THE PROFESSION</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. Teacher shall, at all times, be imbued with the spirit of professional loyalty, mutual confidence, and faith in one another, self sacrifice for the common good, and full cooperation with colleagues. When the best interest of the learners, the school, or the profession is at stake in any controversy, teacher shall support one another.</p>\r\n<p>&nbsp;</p>\r\n<p>Section2. A teacher is not entitled to claim credit or work not of his own, and shall give due credit for the work of others which he may use.</p>\r\n<p>&nbsp;</p>\r\n<p>Section3. Before leaving his position, a teacher shall organize for whoever assumes the position such records and other data as are necessary to carry on the work.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 4. A teacher shall hold inviolate all confidential information concerning associates and the school, and shall not divulge to anyone documents which has not been officially released, or remove records from the files without permission.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 5. It shall be the responsibility of every teacher to seek correctives for what he may appear to be an unprofessional and unethical conduct of any associates. However, this may be done only if there is incontrovertible evidence for such conduct.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 6. A teacher may submit to the proper authorities any justifiable criticism against an associate, preferably in writing, without violating the right of the individual concerned.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Section 7. A teacher may apply for a vacant position for which he is qualified; provided that he respects the system of selection on the basis of merit and competence; provided, further, that all qualified candidates are given the opportunity to be considered.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ARTICLE VI</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>THE TEACHER AND HIGHER AUTHORITIES IN THE PROFESSIONS</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Section 1. Every teacher shall make it his duties to make an honest effort to understand and support the legitimate policies of the school and the administration regardless of personal feeling or private opinion and shall faithfully carry them out.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 2. A teacher shall not make any false accusations or charges against superiors, especially under anonymity. However, if there are valid charges, he should present such under oath to competent authority.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 3. A teacher shall transact all official business through channels except when special conditions warrant a different procedure, such as when special conditions are advocated but are opposed by immediate superiors, in which case, the teacher shall appeal directly to the appropriate higher authority..</p>\r\n<p>&nbsp;</p>\r\n<p>Section 4. Every teacher, individually or as part of a group, has a right to seek redress against injustice to the administration and to extent possible, shall raise grievances within acceptable democratic possesses. In doing so, they shall avoid jeopardizing the interest and the welfare of learners whose right to learn must be respected.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 5. Every teacher has a right to invoke the principle that appointments, promotions, and transfer of teachers are made only on the basis of merit and needed in the interest of the service.</p>\r\n<p>&nbsp;</p>\r\n<p>Section 6. A teacher who accepts a position assumes a contractual obligation to live up to his contract, assuming full knowledge of employment terms and condition</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>&nbsp;</em></strong></p>\r\n<p><strong><em>&nbsp;</em></strong></p>\r\n<p><strong><em>Aktibiti 2</em></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Pangalan __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Petsa: _________</p>\r\n<p>Propesor __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Taon at Pangkat _______</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Marka _________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Ilarawan ang sarili 3 taon mula ngayon anong klaseng guro ka sa hinaharap. Bakit?</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>Aktibiti 3</em></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Pangalan __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Petsa: _________</p>\r\n<p>Propesor __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Taon at Pangkat _______</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Marka _________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Gabay na tanong:</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Ano-ano ang mga dapat unawain na karapatan at tungkulin ng pagiging isang guro?</li>\r\n<li>Bakit mahalagang malaman ang &ldquo;Code of Ethics&rdquo; lalo na sa ating mga guro?</li>\r\n<li>Ano ang isinasaad ng preamble? Ipaliwanag</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Disenyo ng malikhaing pagtuturo</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>METODO - Ito ang tawag sa panlahat na plano para sa isang sistematikong at epektibong pagtuturo ng isang aralin. May tiyak na hakbang na sinusunod ang bawat metodo o pamamaraan.</li>\r\n<li>ESTRATEHIYA - Sa wika, ito ang tawag sa mga kagamitan at gawaing ginagamit sa bawat hakbang ng pagtuturo. Halimbawa ay ang gamit ng mga awtentikong teksto, larawan, o larong pangwika.</li>\r\n</ol>\r\n<p>- ay isang pangmatagalang pagpla-plano o pagba-balak sa kung ano ang dapat gawin para makamit ang isang tiyak na layunin. Sa kasalukuyan, ang salitang \"estratehiya\" ay kadalasang ginagamit ng mga tao na maaaring tumutukoy o tumalakay sa lahat ng bagay na pinag-iisipan gaya ng \"estratehiya sa negosyo\", &ldquo;estratehiya sa pagtuturo&rdquo;, &ldquo;estratehiya sa paglalaro ng chess&rdquo;, &ldquo;estratehiya sa marketing&rdquo;, &ldquo;estratehiya sa pulitika&rdquo;, at iba pa.</p>\r\n<ol start=\"3\">\r\n<li>TEKNIK - Ay tawag sa paraan ng organisasyon ng interaksyong pangklase. Alinman sa mga kagamitang pagsasanay o gawain sa loob ng klsarum, upang maisakatuparan ang mga layuninng isang aralin.</li>\r\n<li>DULOG - Isang set ng pagpapahalagang hinggil sa kalikasan ng wika, pagkatuto at pagtuturo.</li>\r\n<li>PAMARAAN - Isang panlahat na pagplaplano para sa isang sistematikong paglalahad ng wika batay sa isang dulog.</li>\r\n<li>METODOLOHIYA - Ito&rsquo;y isang pag-aaral ng mga gawaing pedagohikal (kasama rito ang mga paniniwalang teoretikal at kaugnayan na pananaliksik). Ito&rsquo;y tumutugon din sa anumang konsiderasyon kaugnay ng tanong na &ldquo;paano ang pagtuturo.&rdquo;</li>\r\n</ol>\r\n<p>- Ito ay ang paraan o stratehiyang ginagamit ng mga mananaliksik upang mapatunayan at maipakita ang mga suliranin sa kanilang pag-aaral.</p>\r\n<ol start=\"7\">\r\n<li>SILABUS - Ito&rsquo;y isang disenyo sa paggawa ng isang particular na programang pangwika. Itinatampok dito ang mga layunin, paksang aralin, pagkasunod-sunod ng mga aralin at mga kagamitang panturo na makatutugon sa mga pangangailangang pangwika ng isang tiyak na pangkat ng mga mag-aaral.</li>\r\n</ol>\r\n<p><strong><u>&nbsp;</u></strong></p>\r\n<ul>\r\n<li><strong>Layunin ng Pagtuturo</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>MGA LAYUNIN NG PAGTUTURO</strong></li>\r\n</ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Ang hanguan ng mga layunin ng pagtuturo ay ang mga layunin ng edukasyon sa iba&rsquo;t ibang antas: elementarya, sekundarya at tersyarya. kaya&rsquo;t anuman ang asignatura at guro, dapat&nbsp; niyang isaisip na ang paglinang sa buong katauhan ng bata na siyang panlahat na layunin ng edukasyon.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Ano ang mga layunin sa pagtuturo? Ang mga ito ay mga tiyak na pagpapahayag ng mga inaasahang pagbabago sa panig ng mag-aaral. Ang mga pagbabagong inaasahang magaganap sa katauhan ng bata ay maaring mapangkat sa tatlong lawak: pangkaisipan o pangkabatiran (cognitive), pandamdamin (affective), at pampisikal o saykomotor (psychomotor).</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Sa pagbuo ng mga layuning pangkatauhan o pangkagaiwan (behavioral Objective), tandaan ang mga sumusunod na paalala:</p>\r\n<ol>\r\n<li>Banggitin ang gawi o Gawain ng mag-aaral ayon sa pananaw ng mga-aaral at hindi sa pananaw ng guro. Ang mga layunin sa pananaw ng guro ng nagsisimula sa matutuhan, maunawaan, maikintal, mapahalagang, atbp, ay dapat iwasan sapagka&rsquo;t ang mga ito ay walang sapat na kalinawan sa kung ano ang dapat gampanan o dapat ipamalas ng mag-aral. Ang mga salitang tulad ng mapaguri-uri, makapagmungkahi, makabuo, malinawan, atbp, ang higit na mabuti sapagkat ang mga ito ay tahasang nasasabi ng tiyak na gagawin ng mag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li>Bumuo ng mga layunin sa pamamagitan ng pagbanggit sa mga tiyak na gawi o gampanin na maaaring makita, marinig, maisip, maramdaman o maaaring bunga ng pagkaganap, gaya halimbawa ng. &rdquo;magunita ang mga karanasang may kinalaman sa nagdaang lindol;&rdquo; &ldquo;mabigkas ang mga salitang pares minimal nang malinaw at tumpak;&rdquo; o kaya&rsquo;y &ldquo;maawit ang Lupang Hinirang ng wasto at may damdamin.&rdquo;</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"3\">\r\n<li>Ang pagdaradag ng mga salitang nagsasaad ng antas o kasidhiang pagganap tulad ng &ldquo;mailarawang ganap,&rdquo; &ldquo;mabigkas nang may katamtamang bilis,&rdquo; ay ang nakapagdaragdag ng kalinawan sa layunin.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"4\">\r\n<li>Banggitin ang kaluwagan o kahigpitan ibibigay sa mag-aaral sa pagganap sa Gawain.</li>\r\n</ol>\r\n<p>Halimbawa: &ldquo;makaguhit ng iba&rsquo;t ibang anyo ng tatsulok sa tulong ng ruler;&rdquo; o kaya&rsquo;y &ldquo;makaguhit ng iba&rsquo;t ibang anyo ng tatsulok nang hindi gagamit ng ruler.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"5\">\r\n<li>Banggitin ang pinakamababa o pinakamataas na antas ng pagkaganap na maaaring tanggapin o pahalagahan.</li>\r\n</ol>\r\n<p>Halimbawa: Pagkatapos ng aralin, 100% ng panananagumpay ng matalinong mag-aaral, 80% ng karaniwang mag-aaral at 60% ng mahihinang mag-aaral ang inaasahang:</p>\r\n<ol>\r\n<li>Makapagpahayag nang maliwanag ng .</li>\r\n<li>Makipagbigay ng mga katunayan ng .</li>\r\n<li>Atbp.</li>\r\n</ol>\r\n<ul>\r\n<li><strong>Kasangkapan sa proseso ng pagtuturo</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Gawing malinaw at tiyak ang layunin mg pagtuturo</strong>. Bawat proseso ng pagtuturo ay nagsisimula sa pagtukoy ng guro sa mga layunin ng pagtuturo.</li>\r\n<li><strong>Iangkop sa paksang-aralin ang kagamitan</strong>. Kritikal sa pagpaplano ng pagtuturo ang pamimili ng kagamitang gagamitin</li>\r\n<li><strong>Kilalanin ang katangian at karanasan ng mga mag-aaral</strong>. Nararapat ding isaalang-alang ang katangian ng mga mag-aaral sa pamamagitan nito.</li>\r\n<li><strong>Tiyakin ang tagal ng panahon ng paggamit ng kagamitan</strong>. Mahalagang iayon sa haba o ikli ng pagtuturo ang inihandang kagamitan.</li>\r\n<li><strong>Alamin ang tamang paraan ng paggamit</strong>. May mga kagamitang sadya nang nakahanda upang gamitin sa pagtuturo tulad ng mga bagay na nabibili (tsart, modelo, interactive educational materials), elektronikong kagamitan (kompyuter, LCD projector, telebisyon) at iba pang kagamitan na hindi mismo ang guro ang gumawa at o naghanda.</li>\r\n<li><strong>Tiyaking may mapagkukunan at abot ng badget ang mga kagamitan</strong>. Kung magpaplanong gumamit ng mga kagamitan, kinakailangang tiyakin na may magagamit upang hindi masira ang nakaplanong pagtuturo.\r\n<ul>\r\n<li>Mahusay na kaalaman sa paksang aralin</li>\r\n<li>Malalim na pagkilala sa mga mag-aaral</li>\r\n<li>Mapag-isip ng iba&rsquo;t &ndash; ibang estratehiya sa pagtuturo</li>\r\n<li>Masining sa paglikha</li>\r\n<li>Masipag sa paggawa</li>\r\n<li>Maparaan sa panganagilangan</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Mga elemento ng mabuting pagtuturo</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong><em>Mga Katangian ng Mabuting Pamamaraan sa Pagtuturo</em></strong></li>\r\n</ul>\r\n<ol>\r\n<li>Ang mabuting pamaraan ng pagtuturo ay humuhubog sa mabuting pag-uugali at kaasalan ng mag-aaral.</li>\r\n</ol>\r\n<p>-Hindi diwa ng paglalaban o kompetisyon ang dapat malinang kundi ang diwa ng pag-unawa at pakikipagtulungan.</p>\r\n<ol start=\"2\">\r\n<li>Ang mabuting pamaraan ay nagbibigay ng mabuting bunga at kahihinatnan.</li>\r\n<li>Nakikitulong sa paglinang ng maraming kakayahan gaya ng</li>\r\n</ol>\r\n<p>-pananaw -pakikinig</p>\r\n<p>-paghipo -panlasa</p>\r\n<p>-pang-amoy</p>\r\n<p>&nbsp;</p>\r\n<p><em>nanasasangkot din ang</em></p>\r\n<p>-pang-unawa -pagpapahayag</p>\r\n<p>-pagsusuri -pagpapakahulugan</p>\r\n<p>-pagbibigay ng palagay -masusing pagmamasid</p>\r\n<ol start=\"4\">\r\n<li>Ang mabuting pamaraan ng pagtuturo ay humahamon sa kakayahan ng mag-aaral.</li>\r\n</ol>\r\n<p>-Gumaganyak ito sa mga mag-aaral sa pagsasakatuparan ng mga gawain.</p>\r\n<ol start=\"5\">\r\n<li>Ang guro ay tagasubaybay at tagapayo at papasok lamang sa bahaging hindi na kaya ng mag-aaral ang gawain.</li>\r\n<li>Ang isang mabuting pamaraan ng pagtuturo ay umaalisunod sa mga simulain ng pagkatuto at sa pilosopiya ng pagtuturo at sikolohiyang edukasyunal.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><em>Maaaring sabihing ang isang mabuting pamaraan ng pagtuturo ay magtaglay ng mga sumusunod:</em></p>\r\n<ul>\r\n<li><strong>May mga dapat isaalang-alang ang guro sa pagpili ng pamamaraang kanyang gagamitin.</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Angkop sa kakayahan at kawilihan ng mag-aaral</li>\r\n<li>Angkop sa paksang aralin at sitwasyon.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Ang mabuting pamaraan ng pagtuturo ay yaong payak at madaling isagawa.</li>\r\n</ol>\r\n<p>Hindi na mangangailangan ng mahabang araw ng paghahanda ng mga kagamitan at mga pantulong ang guro.</p>\r\n<ol start=\"2\">\r\n<li>Nasasangkot sa lahat ng mag-aaral sa mahahalagang gawain gaya ng</li>\r\n</ol>\r\n<p>-pagbabalak &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -pagsusuri</p>\r\n<p>-pagtatanong &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -pagtatalakayan</p>\r\n<p>-paghahambing at pageeksperimeto</p>\r\n<p>-pakikimatyag &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -pagpapasiya</p>\r\n<p>-paglalahat</p>\r\n<p>-pagsasanay at pagkakapit ng mga simulain</p>\r\n<p>-tuntunin at paglalahat na nabuo at natutuhan</p>\r\n<p>&nbsp;</p>\r\n<p><strong><u>Ang mga Kasanayang Pangwika sa Pagtatamo ng Kasanaayang Akademik</u></strong></p>\r\n<p>&nbsp;</p>\r\n<p>- Pinangunahan ng Kagawaran ng Edukasyon ang pagrereistrukturang kurikulum sa batayang edukasyon dahil sa mga sumusunod na dahilan:</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Higit namagiging malikhain o inobatibo sa interdisiplinari ang mga guro sa kanilang mga estratehiya sa pagtuturo.</li>\r\n<li>Higit namahahamon ang mgamag-aaral na makapag-isip nang kritikal upang mahikayat silang masikap namatamo angkanilang interes o pangarap sa buhay.</li>\r\n<li>Interaktib ang pinakaideyal na proseso ng pagtuturo at pagkatuto.</li>\r\n<li>Magkakaroon ng resiprokal na interaksyon ang mga guro at mga mag-aaral sa iba&rsquo;t ibang disiplina, sa mga gagamiting kagamitang paturo at multi-media sources.</li>\r\n<li>Kasangkapan ang wikang Filipino sa pakikipagkomunikasyong sosyal at interpersonal at ito&rsquo;y behikulo sapagtuturo ng mga disiplinang itinuturo sa Filipino.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><em>Sa ginawang pagrebyu ng DepEd sa dating kurikulum sa Filpino lumitaw ang mgasumusunod na obserbasyon:</em></p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Paulit-ulit lamang ang istrukturang gramatikal na itinuro mulaelementary hanggang tersyarya. Hindi pang-linggwistikaang pagsusuri at pag-aanalisang ginagawa</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Hindi maihanda ang mga mag-aaral tungo sa pagpapalawak ng kaalamang kailangan sa pag-aaral sa kolehiyo.</li>\r\n<li>Hindi lubusang nalilinang ang apat na komponent ng kasanayang komunikatibo (kaalamang gramatikal, kaalamang diskorsal, kaalamang istratedyik at kaalamang sosyo-linggwistik.)</li>\r\n<li>Hindi wastong natatalakay ang panitikan bilang isang disiplina.</li>\r\n<li>Hindi halos napagtutuunan ng pansin ang paglinang sa mga kasanayan at kaalaman sa maunawang pagbasa at malikhaing pagsulat.</li>\r\n<li>Hindi lubusang nakatutulong upang matutuhan ng mga mag-aaral ang iba pang sabdyek na ginagamitan ng Filipino bilang wikang panturo at</li>\r\n<li>Nananatiling napakababaang iskor sa NSAT (kabuuang 64% sa loob ng 3 taon)</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><em>Napagpasyahang magkaroon ng pagrepokus sa kurikulum ng Filipino sa batayang framework.</em></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>nilinaw na ang pangunahing mithiin sapagtuturo ng Filipino ay ang makalinang ng mag-aaral na pangkomunikasyon.(gramatikal, diskirsal,istratedyik at sosyo-linggwistik)</li>\r\n<li>Tiniyak na ang diskripsyon ng Filipino bilang isang sabdyek.</li>\r\n<li>bilang pantulong na sabdyek saelementary, bibigyan ng diin ang paglinang ng apat na kasanayang makro at kaisipang Pilipino.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><em>lebel 1-3, idedebelop ito samga komunikasyong sitwasyunal sa tulong ng iba&rsquo;t ibang awtentikong materyal. lebel 4-6, lilinang naman sa paggamit ng Filipino sa malikhain at kritikal napag-iisip</em></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Sa lebel sekundarya,makikilala bilang Filipino sa iskolarling pakikipagtalastasan.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Sa unang dalawang taon,ang pokus ay gramatikaat pagbasa (1-2) sa huling dalawang taon naman ay panunuring pampanitikan.(3-4)</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Maibubuod samga sumusunod nakatangian ng pagtuturo ng Filipino ayon sa bagong kurikulum.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>a) May integrasyon ng apat na makrong kasanayang pangkomunikasyon at mga kasanayan sa pag-aaral.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>b) Pinalalawak o pinayayaman sa pamamagitan ng integrasyon ng bokabularyo, mgapagpapahalaga o values at mgakompetensi mula sa Agham Panlipunan at iba pang lawak ng makabayan.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>c) Nakapokus sa paglinang ng mga kasanayan sa akademikong wika at mga kasanayan sa batayang komunikasyong interpersonal at sosyal.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>d) Nakasentro sa pagtulong samga mag-aaral na magkaroon ng akses namatutuhan ang nilalaman anuman ang anyo nito-teksto, grap, ilustrasyon at iba pa.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>e) May interaksyong mag-aaral-guro-teksto at multimedia.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>f) Humahamon sa mga mag-aaral upang mapag-isip ng kritikal at malikhain sa target na wika.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>g) Binibigyang-diin ang aktibasyon at integrasyon ng dating kaalaman, ginagamit ng mga alternatibong paraang ebalwasyon, kooperatib/kolaboratibong pagkatuto, scaffolding at paglinang ng mga estratehiyasa pag-aaral.</li>\r\n<li>h) Hinihikayat ang mga mag-aaral na magkaroon ng control sadisenyo ng pagkatuto at pag-oorganisang klase</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Sanggunian:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Flores, Marivic. &ldquo;Kurikulum sa Kurikulum K-&ldquo;. Nakuha ngayong Setyembre 8, 2020.</p>\r\n<p>&nbsp;<a href=\"https://www.academia.edu/36630160/Kurikulum_sa_Kurikulum_K_\">https://www.academia.edu/36630160/Kurikulum_sa_Kurikulum_K_</a></p>\r\n<p>Garcia, Theia. &ldquo;Kurikulum Written Report.docx&rdquo;. Nakuha ngayong Setyemyembre 8, 2020.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"https://www.academia.edu/35816310/Kurikulum_Written_Report_docx\">https://www.academia.edu/35816310/Kurikulum_Written_Report_docx</a></p>\r\n<p>Villafuerte, Patricinio V. at Rolando A. Bernales.&nbsp; 2008.&nbsp; Pagtuturo ng/sa Filipino: Mga</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Teorya at Praktika.&nbsp; Valenzuela City: Mutya Publishing House, Inc.</p>\r\n<p>GURO AKO ADMIN: &ldquo;Katangian, Karakter At Personalidad Ng Isang Magaling At Epektibong</p>\r\n<p>Guro&rdquo;. Nakuha ngayong Setyembre 8, 2020.</p>\r\n<p><a href=\"https://guroako.com/2017/09/05/katangian-ng-isang-magaling-na-guro/\">https://guroako.com/2017/09/05/katangian-ng-isang-ma'),(58,1067,'MODULE','Ang Pagtuturo ng Filipino sa E','?	Ang Pagtuturo ng Filipino sa Elementarya sa Batayang Edukasyon','<p><strong><u>Kasalukuyang Kalagayan ng Pagtuturo ng Filipino sa Batayang Edukasyon</u></strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Ang Pagtuturo ng Filipino sa Elementarya sa Batayang Edukasyon</strong></li>\r\n</ul>\r\n<p><u>&nbsp;</u></p>\r\n<table width=\"597\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" width=\"597\">\r\n<p><u>A. DESKRIPSYON</u></p>\r\n<p><u>&nbsp;</u></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"299\">\r\n<p><strong>MGA LAWAK O KASANAYAN</strong></p>\r\n<p><u>&nbsp;</u></p>\r\n</td>\r\n<td width=\"299\">\r\n<p><strong>SAKLAW NG MGA LAWAK O KASANAYAN</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"299\">\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang Filipino bilang isang aralin o asignatura ay lumilinang sa kasanayan sa PAKIKINIG, PAGSASALITA, PAGBASA, PAGSULAT at PAG-IISIP.</p>\r\n<p><u>&nbsp;</u></p>\r\n</td>\r\n<td width=\"299\">\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Para sa MABISANG PAGTUTURO, ang mga TIYAK NA KASANAYAN ay nililinang sa pamamagitan ng mga sitwasyon ng iba&rsquo;t-ibang kagamitan sa LUBUSANG PAGKATUTO.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"299\">\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Bukod sa kasanayan sa PAKIKINIG, PAGSASALITA, PAGBASA, PAGSULAT, ang FILIPINO bilang isang aralin ay lumilinang sa kasanayan ng PAG-IISIP.</p>\r\n<p><u>&nbsp;</u></p>\r\n</td>\r\n<td width=\"299\">\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; KONSEPTO NG SIBIKA AT KULTURA, ang NILALAMAN ng Filipino sa una hanggang ikatlong baitang</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a. Maaaring gamitin ng Filipino ang nilalaman ng SK/HKS. Ang pokus ay nasa PAGLILINANG ng mga kasanayan sa PAKIKIPAGTALASTA-SAN.</p>\r\n<p><u>&nbsp;</u></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b. Inaasahang ang mga </strong>BATAYANG KASANAYAN sa pagbasa ay matutuhan nang lubusan sa tatlong unang baitang.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><u>&nbsp;</u></p>\r\n<p><u>&nbsp;</u></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" width=\"590\">\r\n<ol>\r\n<li><u>PAGBABAGO SA MGA KASANAYAN O KOMPETENSI SA PAGKATUTO</u></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"19\">\r\n<p>1.</p>\r\n</td>\r\n<td width=\"571\">\r\n<p>Pagsasaayos, pagbabawas at pagpapangkat sa kasanayang magkakatulad upang maiwasan ang pag-uulit-ulit ng mga ito.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"19\">\r\n<p>2.</p>\r\n</td>\r\n<td width=\"571\">\r\n<p>Pagtuon sa mga tiyak o batayang kasanayan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"19\">\r\n<p>3.</p>\r\n</td>\r\n<td width=\"571\">\r\n<p>Pagbibigay diin sa PAGBASA at PAKIKIPAGTALASTASAN para sa pag-unawa sa mga BATYANG KAISIPAN O KONSEPTO SA MATEMATIKA AT AGHAM.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"590\">\r\n<ol>\r\n<li><u>MGA INAASAHANG BUNGA</u></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"590\">\r\n<p><strong>MITHIIN</strong></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"590\">\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>Nagagamit ang Filipino sa MABISANG PAKIKIPAGTALASTASAN (pasalita o pasulat) , nagpapamalas ng kahusayan&nbsp; sa pagsasaayos ng iba&rsquo;t-ibang impormasyon at mensaheng narinig at nabasa para sa KAPAKINABANGANG PANSARILI at PANGKAPWA at sa patuloy na pagkatuto upang makaangkop sa mabilis na pagbabagong nagaganap sa daigdig.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td colspan=\"4\" width=\"590\">\r\n<ol>\r\n<li><u>NAKALAAN/NAKATAKDANG ORAS SA PAGTUTURO NG FILIPINO</u></li>\r\n</ol>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"4\" width=\"590\">\r\n<p><strong>PAGBABAGO</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"148\">\r\n<p><strong>BAITANG</strong></p>\r\n</td>\r\n<td width=\"148\">\r\n<p><strong>NESC</strong></p>\r\n</td>\r\n<td width=\"148\">\r\n<p><strong>RBEC</strong></p>\r\n</td>\r\n<td width=\"148\">\r\n<p><strong>PAGBABAGO</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"148\">\r\n<p>I-III</p>\r\n</td>\r\n<td width=\"148\">\r\n<p>60</p>\r\n</td>\r\n<td width=\"148\">\r\n<p>80</p>\r\n</td>\r\n<td width=\"148\">\r\n<p>Dagdag na 20 minuto</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"148\">\r\n<p>IV-VI</p>\r\n</td>\r\n<td width=\"148\">\r\n<p>60</p>\r\n</td>\r\n<td width=\"148\">\r\n<p>60</p>\r\n</td>\r\n<td width=\"148\">\r\n<p>Walang dagdag</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"4\" width=\"590\">\r\n<p><strong>PAGBABAGO</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"4\" width=\"590\">\r\n<p><em>1. Para sa Baitang I-III, ang pang araw-araw na pagkakabahagi ng oras ay 80 minuto samantalang sa Baitang IV-VI ang nakabahagi ay 60 minuto</em></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"4\" width=\"590\">\r\n<p><em>2. May dagdag na 20 minuto sa Baitang I-III. Mula 60 minuto na naging 80 minuto. Walang dagdag sa Baitang IV-VI. </em></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"4\" width=\"590\">\r\n<p><em>3. Katulad ng sa ENGLISH, WALANG PAGTAAS NG BILANG NG MINUTO SA BAITANG IV-VI sa pagsasaalang-alang na ang BATAYANG KASANAYAN sa pag-aaral ay natutuhan na sa unang tatlong baitang..</em></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<ol>\r\n<li><u>MGA DAPAT ISINASAALANG &ndash;ALANG SA PAGTUTURO NG FILIPINO</u></li>\r\n</ol>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\" width=\"66\">\r\n<p><strong>1</strong>.</p>\r\n</td>\r\n<td colspan=\"4\" width=\"524\">\r\n<p><strong>PAMAMARAANG PAGSASANIB (INTEGRATIVE METHOD</strong></p>\r\n<p>Integrasyon o pagsasanib ng mga kasanayan/Lawak sa Filipino (Skills &ndash;Based Integration)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<p><strong>HULWARAN 1</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<p>May pagkakataon na maaaring maituro o mapag-ugnay ang limang kasanayan sa isang aralin, kung saan sama-sama o sabayang nalilinang ang limang kasanayan sa mga mag-aaral.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<p>Ang paglilinang na gawain ay PAKIKINIG tungo sa PAGSULAT sa paglinang ng mga kasanayan sa PAKIKINIG, PAGSASALITA, PAGSULAT AT PAG-IISIP.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<p>Isaalang &ndash;alang sa paglinang ng mga kasanayan ang ANTAS ng MASTERI O LUBUSANG PAGKATUTO.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<p><strong>HULWARAN 2</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<p>Sa pagsasanib ng mga kasanayan o lawak, hindi dapat na malinang ang lahat ang lawak o kasanayan nang sabay-sabay.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<p><strong>2.&nbsp; PAGSASANIB NG TIYAK NA KASANAYAN SA FILIPINO SA&nbsp;&nbsp;&nbsp; NILALAMAN O KONSEPTO NG IBANG ASIGNATURA (CONTENT-BASED INTEGRATION</strong></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<p><strong><u>TANDAAN</u></strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\" width=\"60\">\r\n<p>a.)</p>\r\n</td>\r\n<td colspan=\"5\" width=\"531\">\r\n<p><u>SA BAITANG I-III</u></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<p>Sibika at Kultura (SK) ang nilalaman ng Filipino Paglinang sa kasanayan sa Pakikipagtalastasan ang pokus.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\" width=\"60\">\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b.)</p>\r\n</td>\r\n<td colspan=\"5\" width=\"531\">\r\n<p>TEKSTO/BABASAHIN/PAKSANG ARALIN NG SK AT PAGPAPAHALAGA O EKAWP GINAGAMIT NA MGA KAGAMITANG PANLITERATURA (TULA, KWENTO, ALAMAT AT IBA PA)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ito&rsquo;y nagiging LUNSARAN/SPRING BOARD sa paglinang ng mga kasanayan sa Filipino.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"7\" width=\"590\">\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang gagamiting LUNSARAN ng ARALIN ay isang kwento. Ang PAKSA o NILALAMAN ng kwento ay nauukol sa SK at EKAWP , sa ganitong sitwasyon nalilinang hindi lamang kaalaman sa SK ngunit lalo&rsquo;t higit ang mga KASANAYAN sa FILIPINO.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"55\">\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>c.)</p>\r\n</td>\r\n<td colspan=\"6\" width=\"535\">\r\n<p><u>BIGYANG DIIN ANG GANITONG PAGSASANIB SA ORAS NG TALAKAYAN SA NILALAMAN NG MGA TEKSTO O KAGAMITANG PANLITERATURA NA GINAGAMIT NA LUNSARAN NG PAGLINANG NG KASANAYAN</u></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"55\">\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>3. </strong></p>\r\n</td>\r\n<td colspan=\"6\" width=\"535\">\r\n<p><strong>INTERAKTIBONG PAGDULOG (INTERACTIVE APPROACH) </strong></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"55\">\r\n<p><strong>&nbsp;</strong></p>\r\n<p>GURO</p>\r\n</td>\r\n<td colspan=\"4\" width=\"141\">\r\n<p>&nbsp;</p>\r\n<p>BATA</p>\r\n</td>\r\n<td width=\"188\">\r\n<p>&nbsp;</p>\r\n<p>BATA</p>\r\n</td>\r\n<td width=\"207\">\r\n<p>K-PANG</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"55\">\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n<td colspan=\"4\" width=\"141\">\r\n<p>&nbsp;</p>\r\n<p>1</p>\r\n</td>\r\n<td width=\"188\">\r\n<p>&nbsp;</p>\r\n<p>2</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"207\">\r\n<p>PAGTUTURO</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"55\">\r\n<p>&nbsp;</p>\r\n<p>a.)</p>\r\n</td>\r\n<td colspan=\"6\" width=\"535\">\r\n<p>Mahalaga para sa isang makabuluhan o makahulugang interaksyon (meaningful interaction)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"55\">\r\n<p>&nbsp;</p>\r\n<p>b.)</p>\r\n</td>\r\n<td colspan=\"6\" width=\"535\">\r\n<p>&nbsp;</p>\r\n<p>Isang gawaing sama-sama (collaborative activity)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"55\">\r\n<p>&nbsp;</p>\r\n<p>c.)</p>\r\n</td>\r\n<td colspan=\"6\" width=\"535\">\r\n<p>Pagkakaroon ng komunikasyon o pakikipagtalastasan</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"55\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td colspan=\"3\" width=\"36\">\r\n<p>&nbsp;</p>\r\n<p>1.)</p>\r\n</td>\r\n<td colspan=\"3\" width=\"499\">\r\n<p>Pagpaphayag ng sariling ideya</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"55\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td colspan=\"3\" width=\"36\">\r\n<p>&nbsp;</p>\r\n<p>2.)</p>\r\n</td>\r\n<td colspan=\"3\" width=\"499\">\r\n<p>Pag-unawa sa ideya ng iba</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"55\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td colspan=\"3\" width=\"36\">\r\n<p>&nbsp;</p>\r\n<p>3.)</p>\r\n</td>\r\n<td colspan=\"3\" width=\"499\">\r\n<p>Nakikinig sa iba</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"55\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td colspan=\"3\" width=\"36\">\r\n<p>&nbsp;</p>\r\n<p>4.)</p>\r\n</td>\r\n<td colspan=\"3\" width=\"499\">\r\n<p>Bumubuo ng kahulugan sa isang bigayang konteksto (shared context)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"58\">&nbsp;</td>\r\n<td width=\"5\">&nbsp;</td>\r\n<td width=\"7\">&nbsp;</td>\r\n<td width=\"24\">&nbsp;</td>\r\n<td width=\"94\">&nbsp;</td>\r\n<td width=\"171\">&nbsp;</td>\r\n<td width=\"195\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>Aktibiti 4</em></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Pangalan __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Petsa: _________</p>\r\n<p>Propesor __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Taon at Pangkat _______</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Marka _________</p>\r\n<p>Gabay na Tanong:</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Anu-anong mahahalagang kabatiran/kasanayan ang natutuhan mo sa araling ito?</li>\r\n<li>Paano ka magagabayan ng iyong natutuhan?</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Ang Pagtuturo ng Filipino sa Sekundarya sa Batayang Edukasyon</strong></li>\r\n</ul>\r\n<p><strong><em><u>&nbsp;</u></em></strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" width=\"590\">\r\n<p><strong>MGA PANGUNAHING MITHIIN SA PAGTUTURO NG FILIPINO SA SEKUNDARYA SA BATAYANG EDUKASYON</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"30\">\r\n<p><strong>1.</strong></p>\r\n</td>\r\n<td width=\"560\">\r\n<p>Ang makadebelop ng isang gradweyt na mabisang komyunikeytor sa Filipino, kinakailangang taglay niya angm mga kasanayang makro: ang pagbasa, pagsulat, pagsasalita, pakikinig at pag-iisip.</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"30\">\r\n<p><strong>2.</strong></p>\r\n</td>\r\n<td width=\"560\">\r\n<p>Ang makadevelop ng isang mahusay o sanay sa komunikatibong pakikipagtalastasan, nararapat na may kabatiran at kasanayan siya sa apat na komponent ng kasanayang komunikatib tulad ng diskorsal, gramatika, sosyo-linggwistik at istratedyik.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong><em><u>&nbsp;</u></em></strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"590\">\r\n<p><strong>Sa Unang Dalawang Taon</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"590\">\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang binibigyan ng pokus ang masusing pag aanalisa at pag aaral ng mga tiyak na istrukturang gramatikal ng Filipino bilang isang kasabay ng pagtatamo ng wastong kasanayan sa maunawang pagbasa. Upang matamo ang mga ito, pinagsanib ang mga interdisiplinaring paksa at ang makabagong nakapaloob sa iba&rsquo;t-ibang uri ng teksto tulad ng mga tekstong prosidyural, reperensyal, journalistic, literasi at politico-ekonomik at ang pagkatuto ng iba&rsquo;t &ndash;ibang istrukturang gramatikal.</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong><em><u>&nbsp;</u></em></strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"590\">\r\n<p><strong>Sa Huling Dalawang Taon </strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"590\">\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ang pokus ay ang pagtatamo ng mapanuring pag-iisip sa pamamagitan ng kritikal na pagbasa at pag-unawa sa iba&rsquo;t-ibang genre ng panitikan na nakasalin sa Filipino.</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>&nbsp;</strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"590\">\r\n<p><strong>Sa Bawat Taon</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"590\">\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Binibigyan ng tiyak na atensyon sa paglinang sa pasulat na komunikasyon sa pamamagitan ng eksposyur sa iba&rsquo;t-ibang uri ng komposisyon at malikhaing pagsulat. Ito ay pinagtutuunan ang isang liggong leksyon sa bawat markahan.</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>&nbsp;</strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"590\">\r\n<p><strong>Sa Apat na Taon</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"590\">\r\n<p>Binibigyan ng pansin ang pag-aaral ng Filipino ay ang pagtatamo ng kasanayan sa akademikong wika.</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>&nbsp;</strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td colspan=\"4\" width=\"590\">\r\n<p><strong>Mga Akdang Pampanitikan na Binibigyan ng Pansin sa bawat Taon </strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"148\">\r\n<p><strong>Unang Taon</strong></p>\r\n</td>\r\n<td width=\"148\">\r\n<p><strong>Ikalawang Taon</strong></p>\r\n</td>\r\n<td width=\"148\">\r\n<p><strong>Ikatlong Taon </strong></p>\r\n</td>\r\n<td width=\"148\">\r\n<p><strong>Ikaapat na Taon </strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"148\">\r\n<p>Ibong Adarna</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"148\">\r\n<p>Florante at Laura</p>\r\n</td>\r\n<td width=\"148\">\r\n<p>Noli Me Tangere</p>\r\n</td>\r\n<td width=\"148\">\r\n<p>El Filibusterismo</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kagamitan ng Kurso:</strong></p>\r\n<p><strong><u>Ang PROCEED at ang Bagong Kurikulum sa Paaralang Elementarya (NESC)</u></strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>ANG NESC AT TEEP CURRICULUM</strong></li>\r\n</ul>\r\n<p>PROCEED &ndash; Program for a Comprehensive Elementary Education</p>\r\n<p>- ito ay sampung taong programa para sa komprehensibong edukasyong elementarya.</p>\r\n<p>- Ito&rsquo;y iminumungkahi ni Dr. Minda C. Sutaria direktor ng Kawanihan ng Edukasyong Elementarya.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Siyam na Komponent ng PROCEED</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Misyon at Pagpapahalaga (Mission and Values)</li>\r\n<li>Paglinang ng Kurikulum ( Curriculum Development)</li>\r\n<li>Pagpapaunlad at Kagalingang Pangguro (Teacher Development and Welfare)</li>\r\n<li>Pagpapabuti ng mga Kagamitan (Facilities Development)</li>\r\n<li>Paghahanda ng mga Kagamitang Pampagtuturo (Instructional Materials Development)</li>\r\n<li>Pamamahala (Management)</li>\r\n<li>Pananalapi (Financing)</li>\r\n<li>Edukasyong Pangkalusugan (School Based Health Education)</li>\r\n<li>Edukasyon Bago Mag-elementarya (Pre-Elementary Education)</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>NESC &ndash; The New Elementary School Curriculum (MEC Order N. 6 s.1982)</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ito ay nabuo bilang bahagi sa pag-implementa ng PRODED.</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It was introduced grade by grade</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It is an outcome-oriented and not subject-oriented curriculum with its main focus being on the learning process, and not on the subjects.</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The 3R&rsquo;s is the core learning (reading, writing, arithmetic)</p>\r\n<p>&nbsp;</p>\r\n<p>Grade 1 to 4 &ndash; primary</p>\r\n<p>- had only four subjects</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Areas: English, Mathematics, Filipino, Civics &amp; Culture</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Civics &amp; Culture &ndash; incorporates History, Geography, Society, Politics &amp;</p>\r\n<p>Government</p>\r\n<p>&nbsp;</p>\r\n<p>Grade 5 to 6 - intermediate</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; had six subjects</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; believe that a child who masters the basic subjects will find no difficulty in learning the other subjects in the higher grades.</p>\r\n<p>&nbsp;</p>\r\n<p>The NESC focus on 4H</p>\r\n<ol>\r\n<li>Head (Ulo) o intelektwal</li>\r\n<li>Heart (Puso) o pagpapahalaga (values)</li>\r\n<li>Hands (Kamay) o batayang kasanayan sa paggawa</li>\r\n<li>Health (Kalusugan) o kagalingang pisikal at mental</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>Elementary Level Education &ndash; is the very foundation for the secondary and tertiary level and it is the only education which the masses generally could afford.</p>\r\n<p>&nbsp;</p>\r\n<p>The New Elementary School Curriculum</p>\r\n<p>&nbsp;</p>\r\n<p>Learning Areas&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;Daily Time Allotment</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Grade&nbsp;&nbsp; 1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 6</p>\r\n<p>Character Building Activity&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20-30&nbsp;&nbsp; 20-30&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20</p>\r\n<p>Pilipino&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;60&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60</p>\r\n<p>English&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;60&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60</p>\r\n<p>Mathematics&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Civics and Culture&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -</p>\r\n<p>History/Geography/Civics&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40</p>\r\n<p>Science and Health &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Arts &amp; Physical Education&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40</p>\r\n<p>Home Econ. &amp; Livelihood Educ.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 40</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Salient Features:</strong></li>\r\n</ul>\r\n<p>- fewer learning areas; emphasis on mastery learning</p>\r\n<p>- more time allotted to the development of the basic skills specifically the 3R&rsquo;s especially in the lower grades.</p>\r\n<p>- greater emphasis on the development of intellectual skills which are as important as work skills.</p>\r\n<p>- focus on the development of a sense of humanity and nationhood in the learning areas.</p>\r\n<p>- health values development infused into the whole curriculum, not only in the period for character-building activities and science and health.</p>\r\n<p>-&nbsp; The systematic development of competencies and values for social living.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Strengths of the NESC</li>\r\n</ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; The NESC curriculum is of great help to the Filipino children especially in molding them as human persons, as a good citizens and productive agents for economic, social and cultural development.&nbsp; The curriculum provides every Filipino child the basic preparation to become an enlightened, disciplined, nationalistic, self reliant, God-loving, creative, versatile and productive.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Weakness</li>\r\n</ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The NESC offers too many subjects. This will result in knowing more of the subjects and less of the content.&nbsp; With this number of subjects, the students will get bored and cannot concentrate well and even neglect their assignments.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>TEEP</strong> &ndash; The Third Elementary Education Project</p>\r\n<p>- start of implementation 1999</p>\r\n<p>- it is the flagship project of the DECS in response to the Social Reform Agenda (SRA) initiatives of the government.</p>\r\n<p>- The mandates of elementary schools to become effective instruments in improving the learning achievement and in enhancing the attainment of the following Philippine national goals for Filipino children.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>TEEP Interventions</strong></p>\r\n<p>- it utilizes several interventions that are designed to provide support system and resources to marginalized schools in poor provinces.&nbsp; The primary interventions of TEEP are:</p>\r\n<ol>\r\n<li>School building program (SBP) designed to address the acute need of schools for new classrooms of rehabilitation and repair of old school buildings;</li>\r\n<li>In-service training (INSET) to upgrade the teaching competencies of teachers and develop the managerial skills of school heads and school system administrators;</li>\r\n<li>Provision of textbooks and instructional material (MTEX) to increase the pupil-textbook ratio and assist the teachers in effective teaching;</li>\r\n<li>Student assessment (SA) to develop the school&rsquo;s capacity in determining pupil learning progress and in setting classroom instruction against such progress;</li>\r\n<li>Division education development planning (DEDP) to lay down the foundation for the direction of educational development and resource allocation in the future.</li>\r\n<li>Information system design, installation and operation for monitoring evaluation and decision-making on the operation of the school system; and</li>\r\n<li>Information, education, communication and advocacy program to enhance community participation for school-based management.</li>\r\n</ol>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; However there are many unique factors and school conditions that are not included nor will be addressed by the primary TEEP interventions.&nbsp; Therefore TEEP has designed intervention that will augment, enhance and support the primary interventions.&nbsp; This is the School Improvement and Innovation Facility or SIIF component of TEEP.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SIIF</strong> &ndash; School Improvement and Innovation Facility</p>\r\n<p>- it is a component of TEEP</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SIIF seeks to:</strong></p>\r\n<ol>\r\n<li>Complement standardized system-wide interventions with school-specific interventions;</li>\r\n<li>Promote creativity and innovation in all schools particularly those in the most disadvantage areas;</li>\r\n<li>Encouraged self-initiated and self implemented methods of instruction;</li>\r\n<li>Provide an opportunity for all children to learn and achieve their full potentials in school and;</li>\r\n<li>Serve as a tool for the social targeting of the most &ldquo;at risk&rdquo; schools within the TEEP provinces.</li>\r\n</ol>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>SEDP (Secondary Education Development Program)</strong></p>\r\n<p>-Ang SEDP ay tugon sa pangangailangan na ipagpatuloy ang pagkalinang ng mga mag-aaral na pinasimula ng PRODED</p>\r\n<p>*LAYUNIN NG SEDP..</p>\r\n<p>-Pagpapabuti ng uri ng edukasyon.</p>\r\n<p>-Palawakin ang access ng mga mamamayan sa may uring edukasyong sekondarya.</p>\r\n<p>-Itataguyod ang pagkapantay-pantay sa mga alokasyon ng mga resources lalo na sa mga kapantayang lokal.</p>\r\n<p><strong>*IMPORTANT FEATURES OF THE SEDP CURRICULUM</strong></p>\r\n<ul>\r\n<li>STUDENT- Centered and community.</li>\r\n<li>COGNITIVE-Effective -manipulative-based.</li>\r\n<li>Values education offered as a seperate subject aside from being integrated in the reading of the other subject areas.</li>\r\n<li>Desired learning competencies identified in each subject areas.</li>\r\n<li>Work experience concept integrated with values education and technology and home economics.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>*ANG MGA LAYUNING PANLAHAT NG ASIGNATURANG PILIPINO SA SEDP</strong></p>\r\n<p>-Linangin ang mga kakayahan sa paggamit ng filipino sa tulong ng mga tuntuning pambalarila upang matamo ang kasanayang makro.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><u>Ang SEDP (Secondary Education Development Program)</u></strong></p>\r\n<ul>\r\n<li><strong>Mga Kasanayan sa Filipino sa SEDP Kurikulum</strong></li>\r\n</ul>\r\n<p><strong>SEDP (Secondary Education Development Program)</strong></p>\r\n<p><strong>Layunin:</strong></p>\r\n<ul>\r\n<li>Maging matalino, malinang ang pagpapahalagang moral, ispiritwal at sosyo-kultural. Mapataas ang operasyon sa intelektwal, makapili ng bokasyunal, at mapahalagahan ang sining, agham at teknolohiya.</li>\r\n<li>Maihanda ang mga mag-aaral sa pagtatrabaho at sa pagpasok nila sa kolehiyo.</li>\r\n</ul>\r\n<p><strong>Legal na Pinagbasehan:</strong></p>\r\n<ul>\r\n<li>Ang 1987 Konstitusyon ng Republika ng Pilipinas</li>\r\n</ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Nakasaad sa Artikulo XIV, Seksyon 1: &ldquo;Dapat pangalagaan at itaguyod ng Estado ang karapatan ng lahat ng mga mamamayan sa mahusay na edukasyon sa lahat ng antas at dapat magsagawa ng angkop na mga hakbang upang matamo ng lahat ng gayong edukasyon.&rdquo;</p>\r\n<ul>\r\n<li>Ang Batas Pambansa Blg. 232 o mas kilala sa tawag na Educational Act of 1982</li>\r\n</ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Nakasaad dito na kailangan pa ng isang uri ng edukasyon na makapagpapatuloy ng sa general education na itinuturo sa elementarya para maihanda ang mga mag-aaral sa pagtutong nila sa tertiary at sa pagkakaroon nila ng trabaho.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Bakit kailangang palitan ang 1973 Revised Secondary Education Program?</strong></p>\r\n<ul>\r\n<li>Ang multi-disciplinary at inter-disciplinary approaches na tampok sa 1973 revised curriculum ay hindi angkop sa mga ginagamit na instructional material o pag-unlad sa pagtuturo sa klase.</li>\r\n<li>Ang pagnanais na mapaunlad pa ang magandang pag-uugali ng mga mag-aaral ay hindi naisasakatuparan.</li>\r\n<li>Ang conceptual approach sa pagsagot sa mga katanungan ng social science ay hindi epektibong paraan ng pagkatuto nito.</li>\r\n</ul>\r\n<p><strong>Pokus ng SEDP</strong></p>\r\n<ol>\r\n<li>Reporma sa kurikulum</li>\r\n<li>Kalidad ng panturong libro at mga guro (1:1 ratio)</li>\r\n<li>Science and Work Education Equipment (short at long term)</li>\r\n<li>Pag-unlad ng mga staff sa pamamahala</li>\r\n<li>Pananaliksik sa NCEE</li>\r\n<li>Makaabot ng tulong sa Edukasyong Pangsekondarya.</li>\r\n</ol>\r\n<table width=\"559\">\r\n<tbody>\r\n<tr>\r\n<td width=\"294\">\r\n<p><strong>Mga Asignatura</strong></p>\r\n</td>\r\n<td width=\"142\">\r\n<p><strong>Blg. ng Unit</strong></p>\r\n</td>\r\n<td width=\"124\">\r\n<p><strong>Blg. ng Minuto</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"294\">\r\n<p>English</p>\r\n</td>\r\n<td width=\"142\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"124\">\r\n<p>40</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"294\">\r\n<p>Filipino</p>\r\n</td>\r\n<td width=\"142\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"124\">\r\n<p>40</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"294\">\r\n<p>Mathematics</p>\r\n</td>\r\n<td width=\"142\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"124\">\r\n<p>40</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"294\">\r\n<p>Science and Technology</p>\r\n</td>\r\n<td width=\"142\">\r\n<p>1.5</p>\r\n</td>\r\n<td width=\"124\">\r\n<p>60</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"294\">\r\n<p>Araling Panlipunan</p>\r\n</td>\r\n<td width=\"142\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"124\">\r\n<p>40</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"294\">\r\n<p>Edukasyong Pangkatawan, Kalusugan at Musika Sining (III, IV); Technology (I, II); Home Economics (III, IV)</p>\r\n</td>\r\n<td width=\"142\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"124\">\r\n<p>40</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"294\">\r\n<p>Practical Arts (1989)</p>\r\n</td>\r\n<td width=\"142\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"124\">\r\n<p>60</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"294\">\r\n<p>Edukasyon sa Pagpapahalaga</p>\r\n</td>\r\n<td width=\"142\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"124\">\r\n<p>40</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>ENGLISH AT FILIPINO &ndash; mahasa ang &ldquo;critical thinking skills&rdquo; at &ldquo;communication competence&rdquo;</li>\r\n<li>ARALING PANLIPUNAN (SOCIAL SCIENCE) &ndash; Kasaysayan ng Pilipinas (First year); Kasaysayan ng Asya (Second year); Economics (Third year); World History (Fourth year)</li>\r\n<li>MATHEMATICS &ndash; mataas na antas ng competencies para mahanda ang mga mag-aaral sa tertiary.</li>\r\n<li>SCIENCE &ndash; General Science (First year); Biology (Second year); Chemistry (Third year); Physics (Fourth year)</li>\r\n<li>ARTS &ndash; idaragdag sa Third at fourth year kasama ang P.E, Health at Music.</li>\r\n<li>H.E &ndash; idaragdag depende sa eskwelahan.</li>\r\n</ul>\r\n<p><strong>SECONDARY EDUCATION DEVELOPMENT PROGRAM</strong></p>\r\n<p>SEDP --&gt; ito ay tugon sa pangangailangan na ipagpatuloy ang pagkalinang ng mga nag-aaral na pinasimulan ng PROCED.</p>\r\n<p>&nbsp;&nbsp; Layunin ng SEDP :</p>\r\n<p>-- Pagpapabuti ng uri ng edukasyon</p>\r\n<p>-- Palawakin ang access ng mga mamamayan sa may uring edukasyong sekondarya.</p>\r\n<p>Ang mga layuning panlahat ng asignaturang Filipino sa SEDP</p>\r\n<p>-- Linangin ang mga kakayahan sa paggamit ng Filipino sa tulong ng mga tuntunin pambarila upang matamo ang kasanayang makto.</p>\r\n<p><strong><u>Mga Kasanayan sa Filipino sa SEDP Kurikulum</u></strong></p>\r\n<p><strong>Mga kakayahan sa Filipino sa SEDP kurikulum </strong></p>\r\n<p>&gt; WIKA</p>\r\n<ol>\r\n<li>Pakikinig</li>\r\n</ol>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; * Napakalawak ang kasanayan sa pag-unawa, pagpapakahulugan, pagsusuri at pagbibigay halaga sa mga kaisipan o paksang napakinggan.</p>\r\n<ol>\r\n<li>Pagsasalita</li>\r\n</ol>\r\n<p>&nbsp;&nbsp; * Naipamamalas ang makahulugan at makulay na pagpapahayag para sa mabisang pakikipag talastasan.</p>\r\n<ol>\r\n<li>Pagbasa</li>\r\n</ol>\r\n<p>&nbsp;&nbsp; * Naipapakita ang kakayahang maiangkop ang kahusayan sa pagbasa sa layunin at antas ng kahirapan ng binasang materyal.</p>\r\n<ol>\r\n<li>Pagsulat</li>\r\n</ol>\r\n<p>&nbsp;&nbsp; * Naipapakita ang kakayahang pumili ng pamamaraan at batayang panretorika upang maipahayag ang salitang kaisipan, ideya, opinyon, damdamin at mga saloobin.</p>\r\n<ol>\r\n<li>Paggawa ng mga Tala</li>\r\n</ol>\r\n<p>&nbsp;&nbsp; * Naipamamalas ang kakayahang gumamit ng mga impormasyon at talang nalikon mula sa iba\'t ibang lawak ng pag-aaralan o pananaliksik.</p>\r\n<ol>\r\n<li>Kasanayang pansangunian</li>\r\n</ol>\r\n<p>&nbsp;&nbsp;&nbsp; * Naipapakita ang kakayahan sa paglikon ng mga datos at pinagkunang sanggunian.</p>\r\n<p><strong><u>Ang mga Komponets at Katangian ng Asignaturang Filipino sa Kurikulum ng 1989</u></strong><u>. </u></p>\r\n<ol>\r\n<li>Wika</li>\r\n<li>Magkahiwalay na ituturo ang wika at panitikang Filipino sa loob ng apatnapung minutong pagkaklase.</li>\r\n<li>Gagamitin ang pagdulog na nosyonal/ functional o ang istratehiyang komunikatibo.</li>\r\n<li>Bibigyang-diin sa pagtuturo ang tunay na gamit ng wika (use/function) sa tulong lamang ng mga kaalaman at tuntuning pambalarila, ayon sa konteksto ng hangarin, sitwasyon at pangangailangan.</li>\r\n<li>Gagamitin ang dulog na learner-centered sa pagtuturo at ang konsentrasyong pagtuturo at pag-aaral ay pagkakaroon ng kakayahan sa komunikasyon lalo na sa pakikipagtalastasan.</li>\r\n<li>Panitikan</li>\r\n<li>Maingat na binalangkas na papaunlad (spiral progression) ang mga ituturong anyo/ uri ng pan itikan kasama ang mga akda mula sa iba&rsquo;t ibang lalawigan/ relihiyon.</li>\r\n<li>Ginagamit ang mga akda bilang bukod na babasahin o paksang aralin upang magkaroon ng lubusang kasanayan (mastery) ang mga mag-aaral sa iba&rsquo;t inang sangay ng panitikan</li>\r\n<li>Kaalinsabay ng pagtatamo ng mga kasanayang pamapanitikan, matutuhan din kung paano ang pagsulat ng pinapaksang anyo o uri ng panitikan.</li>\r\n<li>Ituturo nang hiwalay upang lumawak ang kaisipan-karanasan ng mga mag-aaral upang magkaroon ng damdamin at malasakit sa sariling literature.</li>\r\n<li>Halagang pangkatauhan</li>\r\n<li>Palatuntunang Pampamahalaan</li>\r\n<li>Mga pag-aaral/ Pananaliksik</li>\r\n<li>Pagsasaling-wika</li>\r\n</ol>\r\n<p><strong><u>Ang kurikulum sa kasalukuyang panahon (2012) Ang Mother Tongue Based Multilingual Education</u></strong></p>\r\n<p><strong>House Bill No. 162 &ldquo;The Multi-Lingual Education and Literacy Act of 2010.&rdquo;</strong></p>\r\n<p>H.B. 162: Panukalang Batas na magpapataas sa kalidad ng edukasyon sa pamamagitan ng Mother Tongue Based Multi-Lingual Education (MTB-MLE). Sa MTB-MLE, gagamitin ng mga guro ang unang wika ng bata sa pagtuturo sa mga paaralan sa buong Pilipinas. Ayon sa mga pagsasaliksik ng mga dalubhasa sa Linguistics, ang unang wika ng bata ang pinakamabisang wikang pangturo dahil madaling nauunawaan ng mga bata ang aralin sa klase. Ito rin ang sinasabi ng UNESCO. Ito rin ay bahagi ng education agenda ng Aquino Administration.</p>\r\n<p>Ang pagtalakay sa isang panukalang batas, batas at mga kautusan ay maituturing na isang kritikal na gawain, ito ay dahil sa ilang kadahilanan, unang kadahilanan ay ang pagpasok ng ideolohiyang na may nakapaloob ritong legalidad at higit sa lahat ang kapasidad ng kaalamang tinataglay ng pagtatalakay sa usaping ito. Sadyang napakalaki at napakaraming kinakaharap na suliranin ng Pilipinas sa usapin sa senaryo ng ekonomiya, sa usapin ng kapayapaan, pangseguridad, sa usapin ng paggawa (employment), sa karapatang pantao at gayundin sa usapin ng edukasyon at literasiya ng bansa (Pilipinas). Kung pakasusuriin, napakalawak ng suliranin sa usapin ng edukasyon lalo na sa kasalukuyan, ang sinasabing &ldquo;nagdarahop&rdquo; na antas ng pagkatuto, ngunit ang malaking tanong, saan nga ba nag-uugat ang suliraning ito, may mga naging pag-aaral na iginigiit na kakulangan sa mga gamit sa eskuwela gaya ng mga libro, upuan, silid at maging sa kakulangan ng silid (classroom) na maituturing na napakabasiko. May mga naging pag-aaral rin naman na igigiit ang dahilang batay kalagayang pang-ekonomiya ng mga magulang ng isang bata, sinasabi na hindi nagagawang pumasok ng isang mag-aaral sa paaralan dahil sa kahirapan, walang pambaon (allowance), walang pamasahe at walang maging panggastos sa mga kinakailangan sa loob ng paaralan, bagamat libre ang edukasyon kono.</p>\r\n<p>Sa kasalukuyan, may isa pang rason kung bakit bumababa ang antas ng litersiya sa bansa, sa bahagi ng edukasyon, ito ay dahil sa kahirapan at pagakakaiba ng tinatawag na &ldquo;medium of instruction&rdquo;, lumalabas madalas na nag-uugat ang iliterasiya ng mga bata o ng isang mag-aaral ay dahil sa hirap at hindi wastong &ldquo;medium of instruction&rdquo; lalo na sa basic education partikular sa elementaryang antas.</p>\r\n<p>Sa mga pag-aaral at pananaliksik lumalabas na mas higit na nadadalian ang mga mag-aaral daan sa pagkatuto, particular na ang mga nagsisimula pa lamang na mag-aaral kung ang gagamiting wika sa pagtuturo ay ang wikang kanilang kinagisnan sapagkat ma madali nilang mauunawaan o maiinitindihan ang mahihirap na bagay at kung sisipatin ay mas mapapadali ang paraan ng pagkatuto dahil maituturo mo sa mas magaang paraan ang mga bagong ideya sa pamamagitan ng wikang kanilang kinagisnan na mas madaling paraan para sa kanilang pagkatuto taliwas sa ipinapatupad sa kasalukuyan na paggamit ng dalwang pangalawang wika particular ang Wikang Filipino at Wikang Ingles na pawing mga wikang hindi na galamay ng isang bata o isang mag-aaral.</p>\r\n<p>Kung ang wika sa tahanan ang gamit sa pagtuturo ay mas magiging bukas pa ang mga mag-aaral hindi lamang sa aspektong intelektuwal king hind imaging sa iba ppang mga aspeto ng kaniyang buhay lalo na sa bahaging emosyonal na bahagi rin naming ng pagkatuto.</p>\r\n<p>Sa kasalukyan, hindi naman ipinagbabawal ang pagtuturo ng Filipino at Ingles na pawang parehong pangalawang wika o iyong tinatawag na second language kung hindi ituturo ang unang wika o &lsquo;yong mother tongue language sapaklat naitataguyod nito ang mga basikong nalalaman ng bata/ mag-aaral sa kaniyang unang wika, hindi na mahirap upang matutunan at maunawaan niya ang iba pang wika at iba pang mga kaalaman gamit o instrument ang iba pang mga wika.</p>\r\n<p>Sa ganitong aspeto, nangingibabaw sa mga nagging pananaliksik ng iba&rsquo;t ibang institusyon at idinidikta na rin ng United Nation Educational, Scientific and Cultural Organization o UNESCO na mas higit na nauunawaan ng isang mag-aaral ang kaniyang inaaral na paksa kung ang ginagamit sa kaniyang wika sa anumang paksa ay ang kaniyang wika. Sa ganitong punto, nakuha ng House Bill 162 o ang The Multilingual Education ang Literacy Program ng buong pangkat sa pag-aakala at pagtataya na nakatutulong at nakapag-aambag nga ito tungo sa pagpapataas ng literasiya ng mga bata at/o mag-aaral sa bansa.</p>\r\n<p>Ang edukasyon ay ang pangunahing problema ng sangkatauhan. Kung mabigyan natin ng wastong anyo ng edukasyon at pagtuturo ang kahit isang henerasyon, matitiyak natin na ang lahat na mga darating na henerasyon ay mapalalaking maayos at mamumuhay sa sukdulan. Ito ay dahil sa ang bawat henerasyon na makatatanggap ng wastong paraan ng edukasyon na maaaring magkaroon ng sapat na kakayahang palakihin ang mga susunod pang henerasyon.Nakatutuwa na napakalaki ng pananaw natin sa Edukasyon dahil naniniwala tayo na ito ang magiging sandigan natin upang makapamuhay ng matiwasay at upang paunlarin ang ating sarili ngunit nakalulungkot isipin din na ang edukasyon, tayo mismo ang gumagawa ng paraan para hindi natin maunawaan ng mabuti. Masakit isipin na ang Wika ang nagpapahirap sa atin na maunawaan ang mga dapat ay itinuturo sa atin sa Wikang nauunawaan natin Ito ang mga pahayag na nadinig naming kay Prop. Nolasco ng amin siyang kapanayamin sa lagay ng edukasyon dito sa Pilipinas , sinabi niya na dapat ituro sa mga bata ang mga bagay na naiintindihan nila gamit ang kanilang mother tougue o ang L1 na wika na ginagamit nila sa komunidad na kinabibilangan nila. Sinabi niya na ang L1 ay sa wikang alam natin, nauunawaan natin at gusto nating matutunan iyan ang mga bagay na pagpapakahulugan niya sa L1. Binatikos din niya ang maling paraan ng pagtuturo gamit ang Bilinggual Education ang pagtuturo ng Filipino at ingles sa unang taon kaya nahihirapan sila sa pagkatuto na dapat itinuturo sa kanilang mother tougue isa pa ang mga aklat sa mga asignatura tulad ng math at science ngunit nasusulat sa sa ingles na lahat tayo alam natin na itinuturo sa Filipino kaya nawawalan ng silbi ang mga textbook na ito. Isa pa sa mga binatikos niya ang maling curriculum ng CHED na lalong nagpapahirap sa mga bata na matutunan ang mga asignatura.</p>\r\n<p><strong>Mother Tongue-Based Multilingual Education</strong></p>\r\n<p>Ang MTB-MLE ay unang inilunsad&nbsp;sa&nbsp;Pilipinas bilang pagtupad sa Kurikulum ng K-12, na ipinatupad noong 2012.</p>\r\n<p>Ang administrasyon&nbsp;ni&nbsp;dating Pangulong Benigno Simeon Cojuangco Aquno III ang siyang nagpatupad ng pagbabago na ito sa Sistema ng edukasyon sa Pilipinas.</p>\r\n<ul>\r\n<li>Dito nabuo ang mother tongue-based multilingual education na ang ibig sabihin ay ang unang salita na nakalakihan ng bata ang siyang unang gagamitin sa paaralan. Sinabing ito raw ang pagbabago na magaganap sa sistema ng edukasyon sa Pilipinas ngunit paano nga ba ito uunlad at mabibigyang pansin sa mga paaralan? Alamin natin.</li>\r\n</ul>\r\n<p>Ito ay inaasahang maipatupad&nbsp;sa&nbsp;lahat ng paaralan sa Pilipinas, partikular na sa mga batang may nag-aaral sa Kindergarten at unang tatlong taon sa elementarya. &nbsp;</p>\r\n<ul>\r\n<li>Ito ay magsisimula sa kindergarten hanggang sa unang tatlong taon sa elementary upang mas madebelop pa ang unang wika na alam ng bata.</li>\r\n</ul>\r\n<p>Ang mga kagamitan, at&nbsp;pagtuturo kailangang gamitin sa estilo ng pagtuturo na ito ay dapat nakabase sa &ldquo;Mother Tongue&rdquo; ng kanilang kinabibilangang rehiyon.&nbsp;Sa&nbsp;kabuuan, may labindalawang &ldquo;Mother Tongue&rdquo; na inaprubahan ng DepEd upang ituro sa mga kabataang Pilipino, na depende sa kanilang rehiyon.</p>\r\n<p>Ito ay ang mga sumusunod:</p>\r\n<p>Iloko, Pangasinan, Kapampangan, Tagalog, Bikol, Waray, Hiligaynon, Cebuano, Maranao, Chavacano, Maguindanaon, at Tausug.</p>\r\n<p>Ngunit&nbsp;sa kasalukuyan, may idinagdag ang DepEd na pito pang &ldquo;Mother Tongue&rdquo; ito ay: Ibanag, Ivatan, Zambal, Aklanon, Kiniray-a, Yakan, at Surigaonon.</p>\r\n<ul>\r\n<li>Ang mga rehiyong ito ang nanguna para sa pagpapatupad ng Mother Tongue-Based Multilingual Education dahil sa ang mga ito ay puno ng maraming wika na ginagamit sa kani-kanilang lugar.</li>\r\n</ul>\r\n<p><strong>DO 16, s. 2012<br />Guidelines on the Implementation of the Mother Tongue-Based- Multilingual Education (MTB-MLE)</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Starting School Year (SY) 2012-2013, the Mother Tongue-Based-Multilingual Education (MTB-MLE) shall be implemented in all public schools, specifically in Kindergarten, Grades 1, 2 and 3 as part of the K to 12 Basic Education Program. The MTB-MLE shall support the goal of \"Every Child-A-Reader and A-Writer by Grade 1.\"</p>\r\n<ul>\r\n<li>Sinasabi rito na ang layunin ng MTB-MLE ay upang ang mga bata ay mahasa ang kaniyang kakayanan sa pagbasa at pagsulat pagdating pa lamang ng Grade 1.</li>\r\n</ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; The Lingua Franca Project (1999-2001) and the Lubuagan Project (1999 to present) have provided valuable inputs in the implementation of the MTB-MLE. Nine hundred twenty-one (921) schools including those for children of indigenous people have been modeling MTB-MLE with support from the following:</p>\r\n<ol>\r\n<li>Basic Education Assistance for Mindanao (BEAM);</li>\r\n<li>Third Elementary Education Program (TEEP);</li>\r\n<li>Translators Association of the Philippines (TAP);</li>\r\n<li>Save the Children, and the Summer Institute of Linguistics (SIL).</li>\r\n</ol>\r\n<ul>\r\n<li>Sinasabi na sa Lubuagan project na isinagawa ay nagkaroon ng magandang resulta dahil sa mas natututo ang mga sa paggamit ng kanilang unang wika sa paaralan. Ang sumusunod na mga ahensya o samahan ang sumuporta at nagbigay ng maraming donasyon at opinyon para maisagawa ang proyektong ito para malaman kung epektibo nga ba ang paggamit ng Mother Tongue sa pag-aaral ng mga bata.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>DO 28, s. 2013 <br />Additional Guidelines to DepEd Order No. 16, s. 2012 (Guidelines on the Implementation of the Mother Tongue Based-Multilingual Education (MTB-MLE)</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; In addition to the languages of instruction mentioned in DepEd Order No. 16, s. 2012 entitled Guidelines on the Implementation of the Mother Tongue Based-Multilingual Education (MTB-MLE) under the K to 12 Basic Education Program, the following shall be used as the languages of instruction for Grade 1 pupils who speak the same languages.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; These languages will used in the specified regions and divisions starting school year (SY) 2013-2014:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Iloko, Pangasinan, Kapampangan, Tagalog, Bikol, Waray, Hiligaynon, Cebuano, Maranao, Chavacano, Maguindanaon, at Tausug. Idinagdag ang Ibanag, Ivatan, Zambal, Aklanon, Kiniray-a, Yakan, at Surigaonon.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; The MTB-MLE aims to improve the pupil&rsquo;s language and cognitive development, as well as his/her socio-cultural awareness as provided in the enclosure of DepEd Order No. 16, s. 2012. The child&rsquo;s language will serve as the fundamental language for literacy and learning.</p>\r\n<ul>\r\n<li>Dito nabigyang katuparan at naisabatas ang mga labindalawang wika na mayroon sa Pilipinas bilang midyum sa pagtuturo sa kindergarten hanggang unang tatlong taon sa elementary. Ito ang pangunahing wika na magiging batayan nila sa pagkatuto at pagtuturo ng mga sabdyek sa paaralan.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Pitong Tanong sa Multilingual Edudation </strong></p>\r\n<ul>\r\n<li>May Pitong Tanong na nilikha si Vilgilio Almario upang mag mapalawal pa ang talakayan sa usaping MTB-MLE. Ang tatlong naunang tanong ay naibahagi na sa klase. Sunod naman ay ang:</li>\r\n</ul>\r\n<p><strong>Ikaapat na Tanong</strong>: Gagamitin ba ang lahat ng unang wika ng Pilipinas sa MLE?</p>\r\n<p>Iyon ang ekspektasyong&nbsp;ibinunga ng pagpapalaganap ng DepEd, ng SIL, at ni Dr Nolasco sa resulta ng eksperimento sa Lubuagan. Isang munting nayon ang Lubuagan at may sariling diyalekto. Ngunit ipinakita diumano ng eksperimento na higit na mabilis natuto ang mga bat&agrave; sa Lubuagan dahil ginamit ang kanilang unang wika sa pagtuturo.</p>\r\n<p>May mahigit 150 wika&rsquo;t wikain sa buong Filipinas. Sa ilalim ng simulaing unang wika, at upang ganap na maging epektibo ang MLE, kailangang gamitin ang 150 wika&rsquo;t wikaing ito sa mga paaralan ng bansa. Kailangang maghanda ng mga kasangkapang panturo sa 150 wika&rsquo;t wikain.</p>\r\n<p>Kailangang magdeploy ng mga guro sa buong bansa na may kahandaan ang bawat isa sa isa sa 150 wika&rsquo;t wikain. Kailangan din pagkuwan na maghanda ng mga test sa 150 wika&rsquo;t wikain.</p>\r\n<ul>\r\n<li>Sinasabi lamang dito na hindi lahat ng wika sa Pilipinas ay magagamit sa pagkatuto ng isang bata. May labindalawang wika lamang ang inaprubahan ng gobyerno para MTB-MLE. Ngunit sinasabi na mas nagiging produktibo at mas mabilis natututo ang isang bata kung Mother Tongue ang gamit na midyum sa mga paaralan. Sinasabi rin na magkukulang ang mga materyales o ang mga libro at maging ang bilang ng mga guro na idedeploy sa mga paaralan kung lahat ng wikang ito ay isasabatas at gagamitin.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Ikalimang Tanong</strong>: Umaalinsunod ba sa tadhanang pangwika ng 1987 Konstitusyon</p>\r\n<p>ang MLE?</p>\r\n<p>Sa isang banda, at batay sa kasalukuyang target na mga wikang panturo ng DepEd, hindi. Sa loob ng Seksiyong 6-7 ng Artikulo XIV ng 1987 Konstitusyon ay may tadhanang &ldquo;The regional languages are the auxiliary official languages in the regions and shall serve as auxiliary media of instruction therein.&rdquo;</p>\r\n<p>Ang totoo, matagal na itong nangyayari sa mga silid-aralan sa labas ng Katagalugan. Matagal nang ginagamit ng mga guro sa Naga ang wikang Bikol, ng mga guro sa Mactan ang wikang Sebwano, ng mga guro sa Vigan ang wikang Iluko, o ng mga guro sa Iloilo ang wikang Hiligaynon, sa kanilang pagtuturo. Matagal nang alam ng mga guro at isinasapraktika ang MLE kahit walang DepEd Order No. 74.</p>\r\n<ul>\r\n<li>Sinasabi rito na hindi dahil ang wikang pambasa na Filipino dapat ang gagamitin sa pagtuturo sa mga paaralan. Ang mga pantulong o ang ibang mga wika sa Pilipinas ay magiging gabay lamang sa pagtuturo sa iba&rsquo;t ibang lugar sa Pilipinas. Ngunit matagal nap ala itong hindi nasusunod dahil sa ang ibang mga guro ay ginagamit na ang kanilang sariling wika sa pagtuturo sa paaralan.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Ikaanim na Tanong</strong>: May dagdag bang kabuluhan ang bill ni Congressman</p>\r\n<p>Guinigundo sa DepEd Order No. 74?</p>\r\n<p>Oo. Ibig ni Congressman Guinigundo na maging batas ang isang atas pangkagawaran at maging legal ang isang order na maaaring salungat sa tadhanang pangwika&rsquo;t pang-edukasyon ng Konstitusyon.</p>\r\n<ol start=\"6\">\r\n<li>Sa bill ni Congressman Guinigundo ay malinaw nang ang unang wika ang magiging wikang panturo mulang pre-school hanggang Grade 6. Pinalalaganap nit&oacute; ang mabuti ngunit mapanlinlang na impresyon na ang unang wika ay nangangahulugang ang lahat ng mahigit 150 wika&rsquo;t wikain ng Filipinas at ang mga ito ang gagamiting wikang panturo sa mga paaralan. Sa maikling salita, bahagi ang bill ng malaking kasinungalingan hinggil sa MLE ng DepEd Order No. 74.</li>\r\n</ol>\r\n<ul>\r\n<li>Sinasabi rito na oo sapagkat mas napapalawak ang mga wika sa Pilipinas kung ito ang gagamiting midyum kahit na hindi ito ang sinasabi ng batas o Konstitusypn. Itinataguyod lamang niya ang iba pang wika sa Pilipinas na mas magiging maunlad kung ito ang gagamiting midyum sa pagkatuto ng isang bata.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Ikapitong Tanong</strong>: Kailangan ba ang DepEd Order No. 74 at Guinigundo bill?</p>\r\n<p>Kung hindi rin lamang matutupad ang totoong simulain ng MLE, walang silbi ang DepEd Order No. 74 at ang Guinigundo bill. Ang planong pagpapatupad ng DepEd Order No. 74 ay malinaw nang nakasaad sa 1987 Konstitusyon at isinasapraktika ng mga guro para sa mas mabis&agrave;ng pagtuturo at para sa mas mabilis na pagkatuto ng mga bat&agrave;.</p>\r\n<p>Ang mas mainam at dapat gawin ng DepEd ay atasan ang mga superbisor at prinsipal na huwag bawalan at sa halip ay tulungan pa nga ang mga guro sa paggamit ng mga wikang rehiyonal bilang auxiliary language of instruction. Dapat bigyan ng laya ang mga guro ng Agham at Matematika na gumamit ng wikang mas alam nilang gamitin kung makatutulong iyon sa mas mabis&agrave;ng pagtuturo ng kanilang sabjek.</p>\r\n<ul>\r\n<li>Kinakailangan ito sapagkat dito nga mas napagyayaman ang kaalaman at kakayahan ng isang batang gamitin ang kanyang unang wika sa paaralan. Mas mabilis at mas madali para sa mga bata na magpaliwanag at ibigay ang kani-kanilang opinyon sa mga talakayan sa klase. Matagal na rin naman itong ginagamit at isinasagawa ng mga guro kaya&rsquo;t maayos lamang kung ito ay mas mapagyayaman pa.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Aklat para sa MTB-MLE</strong></p>\r\n<p><strong>ni Mildred F. Ruallo</strong></p>\r\n<p><em>Awtor/Editor</em></p>\r\n<ul>\r\n<li><strong>Mother Tongue Tagalog</strong></li>\r\n<li><strong>Ano ang sangguniang aklat na dapat na gamitin sa asignaturang Mother Tongue kung ikaw ay nakatira sa Katagalugan?</strong></li>\r\n</ul>\r\n<p>Sagot: Ang aklat na dapat mong gamitin ay nakasulat sa Wikang Filipino at tatawagin itong Mother Tongue Tagalog. Kung ikaw naman ay nakatira sa Bikol, ang tawag naman dito ay Mother Tongue Bikol, at kung ikaw naman ay nakatira sa Ilocos ang tawag dito ay Mother Tongue Ilokano at iba pang sinasalita sa buong Pilipinas.</p>\r\n<ul>\r\n<li>May iba&rsquo;t ibang tawag sa mga librong gagamitin sa MTB-MLE batay sa kung saang parte ng Pilipinas ito kabilang. Ito ang magiging basehan upang mas makilala at mapaunlad pa ang kakayahan ng isang bata sa kanyang unang wika.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Ano ang pinagbatayan ng aklat na Mother Tongue Tagalog?</strong></li>\r\n</ul>\r\n<p>Sagot: Ito ay ibinatay sa K to 12 Curriculum Guide sa Mother Tongue-Based Multilingual Education. Ang learning competencies ay isinalin sa Wikang Filipino upang mabuo ang aklat na nakabatay sa pamantayan o standard ng K to 12.</p>\r\n<ul>\r\n<li>Sinasabing ang libro sa MTB-MLE ay may pinagbatayan at ito ay sa K to 12 kurikulum dahil sa dito naman tutungo o patungo ang talakayan sa mga paaralan sa iba&rsquo;t ibang asignatura.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Ang Mother Tongue ay ituturo sa loob ng 50 minuto simula unang markahan hanggang ikaapat na markahan. Ang Filipino ay 30 minuto lamang ituturo at magsisimula sa ikalawang markahan hanggang ikaapat na markahan.\r\n<ul>\r\n<li>Ito ang mga oras ng bubunuin sa pagtuturo ng mother tongue sa mga paaralan. Ito ang batayan ng mga guro sa pagpapalawak ng kaalaman ng mga mag-aaral.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Saan nakakukuha ng kopya ng Curriculum Guide sa lahat ng subjects?</strong></li>\r\n</ul>\r\n<p>Sagot: Information age na ngayon. Madali ka na lang makakakuha ng mga impormasyon dahil sa technology. Downloadable na ito. I-type lamang ang www.deped.gov.ph sa Google at i-click ang resources, tapos i-click ang salitang K to 10 Subjects.</p>\r\n<ul>\r\n<li>Ito ang mga website na makakatulong upang mas mapalawak pa ang impormasyon tungkol sa MTB-MLE.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Ano-ano ang saklaw o content ng Mother Tongue na aklat?</strong></li>\r\n</ul>\r\n<p>Ang mga sumusunod ay ang nilalaman ng aklat:</p>\r\n<ul>\r\n<li>Wikang Binibigkas &ndash; Ipinakikita dito ang pasalitang pakikipagtalastasan sa iba&rsquo;t ibang nilalaman.</li>\r\n<li>Kasanayang Ponolohiya &ndash; Naipapamalas ang pang-unawa na ang mga salita ay mula sa mga tunog ng letra at mga pantig.</li>\r\n<li>Kaalaman sa Aklat at Iba Pang Limbag &ndash; Naipapamalas ang pang-unawa sa pangunahing katangian ng aklat at kung ano ang nagagawa ng limbag na siyang pangunahing kailangan upang matuto sa pagbasa.</li>\r\n<li>Palabigkasan at Pagkilala sa Salita &ndash; Naipakikita ang kaalaman sa alpabeto at pagbasa, pagsulat at pagbabaybay ng salita nang tama.</li>\r\n<li>Tatas &ndash; Naipakikita ang kakayahan sa pagbasa ng mga teksto sa bawat baitang na may ganap na kawastuhan, bilis, at pahayag sa sumusuporta sa pang-unawa.</li>\r\n<li>Komposisyon &ndash; Naipakikita ang kakayahan sa pagbalangkas ng ideya upang maging pangungusap o sa mas mahabang teksto na magagamit sa pagpapaunlad at maging pamantayan sa ispeling o pagbabaybay.</li>\r\n<li>Kamalayan sa Balarila &ndash; Naipakikita ang kamalayan sa wikang balarila at gamit nito kapag nagsasalita at nagsusulat.</li>\r\n<li>Pag-unlad sa Talasalitaan at Kaisipan &ndash; Naipakikita ang pagpapaunlad sa kaalaman at gamit ng akmang talasalitaan at kaisipan sa bawat baitang.</li>\r\n<li>Pag-unawa sa Pinakikinggan &ndash; Naipakikita ang pang-unawa sa salaysay at patalastas na pinakikinggan.</li>\r\n<li>Pag-unawa sa Binabasa &ndash; Naipakikita ang pang-unawa sa salaysay at patalastas na binabasa.</li>\r\n<li>Kaugalian sa Pagbabasa &ndash; Naipakikita ang positibong gawi sa wika, pagbasa, at panitikan.</li>\r\n<li>Estratehiya sa Pag-aaral &ndash; Naipakikita ang pangunahing kaalaman sa mga kasanayan sa pakikinig, pagbasa, at pagsulat para sa tiyak na mga layunin.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Ang mga nilalaman ng aklat na ito ay upang mas mapaunlad lamang ang kakayahan ng bata sa pananalita, pagsulat at pagbabasa. Dito mas matututo silang mapaunlad ang pakikipagkomunikasyon nang maayos sa iba at mapaunlad rin ang kaalaman sa wikang Filipino.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Bakit kinakailangang ituro ang Mother Tongue?</strong></li>\r\n</ul>\r\n<p>Sagot: Kinakailangang ituro ito, sapagkat bukod sa ito ay isang batas na dapat sundin, kapag Filipino lamang ang iyong itinuro, ang mga sumusunod na content ay wala sa Filipino kundi nasa Mother Tongue lamang.</p>\r\n<ul>\r\n<li>Ito ay upang mas mapalawak ang kaalaman ng mga bata sa kanilang unang wika maging sa wikang Filipino. Dito rin mahahasa ang kanilang kaalaman sa pagsunod sa mga batas na naiatas ng gobyerno.</li>\r\n<li>Ito ang mga kakahayang madedebelop ng isang bata kapag natutunan ang MTB-MLE&nbsp;:</li>\r\n</ul>\r\n<p><strong>&ndash; Mga kasanayan sa ponolohiya (Phonological Skills)</strong></p>\r\n<p><strong>&ndash;Tatas (Fluency)</strong></p>\r\n<p><strong>&ndash; Pang-unawa sa Napakinggan (Listening Comprehension)</strong></p>\r\n<p><strong>&ndash; Gawi sa Pagbabasa (Attitude Towards Reading)</strong></p>\r\n<ul>\r\n<li>Dahil sa MTB-MLE magkakaroon ang bata na madebelop ang kanilang pagsasalita, pakikinig, pagsusulat, at pagbabasa. Dito mas magiging alerto ang bata sa lahat ng aspeto na maaaring matutunan sa loob ng klase at paaralan.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>MOTHER TONGUE-BASED MULTILINGUAL EDUCATION</strong> refers to &ldquo;first-language-first&rdquo; education that is, schooling which begins in the mother tongue and transitions to additional languages particularly Filipino and English.</p>\r\n<ol>\r\n<li>Mother Tongue- ito ang nakagisnang wika na sinasalita ng bata.</li>\r\n<li>Native Language- ito ang wika na partikular na sinasalita sa isang particular na grupo o pangkat ng tao.</li>\r\n</ol>\r\n<p><strong>Goal of Mother Tongue-based Multilingual Education</strong></p>\r\n<ul>\r\n<li>Every Child- A- Reader and A &ndash;Writer&rdquo; by Grade 1.</li>\r\n</ul>\r\n<p>Bakit kaya ayan ang goal ng Mother Tongue-based Multilingual Education?</p>\r\n<ul>\r\n<li>enables her/ him to express him/herself easily</li>\r\n<li>there is no fear of making mistakes</li>\r\n<li>It encourages active participation by children in the learning process</li>\r\n<li>they can immediately construct and explain their world</li>\r\n<li>add new concepts to what they already know</li>\r\n</ul>\r\n<p><strong>DepEd Order No. 90?</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Guidelines on the Utilization of Downloaded Funds for Materials Development and Production of Mother Tongue-Based Multilingual Education&rdquo;</p>\r\n<p>Ito ang mga pondong nagmumula sa itaas na ibinibigay sa mga paaralan para sa pagpapatupad ng MTB-MLE. Ginagamit ang pondong ito para sa paglikha at pagpapahusay ng mga kagamitang panturo para sa implimentasyon ng Mother Tongue-based Multilingual Education.</p>\r\n<p><strong>The types of materials to be developed and reproduced are as follows:</strong></p>\r\n<p>* Story books, big and small book format and for listening;</p>\r\n<p>* Flash/Activity Cards (Letters/Numbers);</p>\r\n<p>* Basic Sight Words (Grade level words and picture dictionary); and</p>\r\n<p>*Thematic Picture Chart for Oral Literacy.</p>\r\n<p><strong>The following shall be the required percentage distribution of the downloaded funds for the materials development and production: </strong></p>\r\n<ol>\r\n<li>50% for the development and reproduction;</li>\r\n</ol>\r\n<ul>\r\n<li>Upang maging matagumpay ang implimentasyon ng Mother Tongue-based Multilingual Education kailangan nilang lumikha ng mga materyales na gagamitin sa pagtuturo ng Mother Tongue.</li>\r\n</ul>\r\n<ol>\r\n<li>20% for monitoring and evaluation;</li>\r\n</ol>\r\n<ul>\r\n<li>Kailangan din na subaybayan ang mga pagbabagong magaganap sa implimentasyon ng Mother Tongue-based Multilingual Education kung may pagbabago ba.</li>\r\n</ul>\r\n<ol>\r\n<li>15% for research; and</li>\r\n</ol>\r\n<p>-dahil buong Pilipinas ang sakop ng Mother Tongue-based Multilingual Education, kailangan din na saliksikin kung ano ang kahinaan at kalakasan ng ng implimentasyon.</p>\r\n<ol>\r\n<li>15% for transportation.</li>\r\n</ol>\r\n<ul>\r\n<li>Kailangan din ibilang sa paghahati ng pondo ang mga gagamitin para sa transpotasyon.</li>\r\n</ul>\r\n<p><strong>DepEd Order No. 18?</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Guidelines on the Conduct of Mother Tongue-Based Multilingual Education Training&rdquo;</p>\r\n<p>Dito nakasaad kung sino ang mga guro na kinakailangang makilahok sa mga trainings. Nakasaad din dito ang mga paksa na tatalakayin nila.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Topics for the Training </strong></p>\r\n<ol>\r\n<ol>\r\n<li>The topics under Theoretical Foundations to MTB-MLE shall include both the learning theories and the language acquisition theories.<br />(1.1) Learning Theories</li>\r\n<ol>\r\n<li>Piaget&rsquo;s Developmental Theory</li>\r\n<li>Bandura&rsquo;s Social Theory</li>\r\n<li>Vygotsky&rsquo;s Social Constructivist Theory</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><strong>Selection of Participants</strong></p>\r\n<p>Participants to any training shall come from the schools implementing MTB-MLE;</p>\r\n<ul>\r\n<li>Kindergarten teachers</li>\r\n<li>Grade I teachers</li>\r\n<li>Grade II teachers</li>\r\n<li>Grade III teachers.</li>\r\n</ul>\r\n<p><strong>Who is the speaker?</strong></p>\r\n<ul>\r\n<li>A native speaker of the language</li>\r\n</ul>\r\n<p><strong>DepEd Order No. 74?</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Sa batayang pang-edukasyon at pangwika, wala. Inulit lang ang alam na ng lahat na (1) mas mabilis matutong bum&aacute;sa ang bat&agrave; pag unang wika ang ginamit; (2) ang bat&agrave;ng natutong bum&agrave;sa at sumulat sa unang wika ay mas mabilis matutong bum&agrave;sa, sumulat, at magsalita sa ikalawa at kahit ikatlong wika; (3) ang bat&agrave;ng natutong bum&aacute;sa at sumulat sa unang wika ay mas mabilis matuto ng ibang kompetensi.</p>\r\n<p><strong>NAKALAANG ORAS PARA SA PAGTUTURO GAMIT ANG MTB-MLE</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Ang Mother Tongue sa Grade 2 ay 50 minuto na itinuturo mula unang markahan hanggang ikaapat na markahan. Ang Filipino naman ay itinuturo rin ng 50 minuto mula uang markahanhanggang ikaapat na markahan.</p>\r\n<p><strong><em>&nbsp;</em></strong></p>\r\n<p><strong><em>&nbsp;</em></strong></p>\r\n<p><strong><em>Aktibiti 5</em></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Pangalan __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Petsa: _________</p>\r\n<p>Propesor __________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Taon at Pangkat _______</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Marka _________</p>\r\n<ol>\r\n<li>Ano'),(59,1067,'MODULE 1','TEORYA NG PAGSASALIN','TEORYA NG PAGSASALIN','<p>&nbsp;</p>\r\n<h2>PANIMULANG PAGTATAYA</h2>\r\n<ol>\r\n<li>Panuto: Basahing mabuti ang mga sumusunod na tanong. Isulat ang titik ng tamang sagot sa dahon ng pagsasanay.</li>\r\n</ol>\r\n<p>Panuto: Lagyan ng tsek (/ ) kung ang mga salitang Ingles ay angkop na katumbas/salin ng salitang Filipino at ekis ( x ) kung hindi.&nbsp;</p>\r\n<p>_____ 1. tagumpay ( victory, success, triumph )</p>\r\n<p>&nbsp;_____ 2. talino ( wisdom, knowledge, ignorance )&nbsp;</p>\r\n<p>_____ 3. halaga ( cost, price, worth )&nbsp;</p>\r\n<p>_____ 4. kaibigan ( friend, companion, enemy )&nbsp;</p>\r\n<p>_____ 5. kayamanan ( wealth, abundance, poverty )&nbsp;</p>\r\n<p><strong>Sinaunang Roma</strong></p>\r\n<p><br />&nbsp; Naging maimpluwensiya sa pagbubuo ng mga unang gabay sa pagsasalin ang mga tinitingalang mananalumpati na sina Cicero, Pliny the Younger, at <br />Quintilian na naniwalang kapaki-pakinabang na kasanayan ang pagsasalin sa kanilang propesyon. Mahalaga para sa kanila ang pagsasalin bilang bahagi ng retorika, ang sining ng mabisang ang pagpapahayag. Sa kanilang mga talumpati, ginamit ng mga ito ang dayuhang kaisipan ng mga Griyego sa paniwalang nagiging higit na mapuwersa, mabisa sa at masining ang mga pahayag kapag nilangkapan ng mga sipi mula mga Griyego. Ngunit sa pagsasalin ng mga bahaging sipi sa mg Griyego, napapanatili nila ang natural na daloy ng sarili nilang wikang Latin. Ito naman ay pagiggit ng kakanyahan bilang mga Romano, na bagama\'t sumipi sila sa mga Griyego, ipinahayag naman nila ito sa sarili nilang pamamaraan. Bagamat nilupig ng mga Romano ang mga Griyego, sa aspektong pangkultura ay tinanggap ng mga mananakop na Romano na mas maunlad at sopistikado ang kultura ng mga mamamayang sinakop nila. Ipinamalas ng mga Romano ang paghanga at pagpapahalaga sa kahusayan sa panitikan ng mga Griyego sa pamamagitan ng mga salin, adaptasyon, at muling pagsulat ng literaturang Griyego. Sa gayon, ang mga salin ay nagbunga ng mga akdang maysariling kakanyahan bilang panitikang Romano.</p>\r\n<p><br /><strong>Ang pagsasalin ng Bibliya</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; Ang Bibliya ay isa sa mga unang tekstong isinakin kaya mayroon nang mahabang kasaysayan ng pagsasalin ng aklat na ito. Sa kanyang De <br />Doctrina Christiana (428 AD), iginiit ni Augustine na sadyang wasto ang Septuagint, ang bersiyong Griyego ng Ebanghelyo ng mga Ebreo dahil ayon <br />sa alamat, 70 Griyegong Hudyo ang nagsalin nito ngunit nagkaisa lahat sila salin bagama\'t magkakahiwalay silang nagsalin. Para naman kay Jerome, sa kanyang Letter to Pammachius (395 AD), masinaboran niya ang salita-sa-salitang salin ng Bibliya dahil \"ang mismong paghahanay ng mga salita ay isang misteryo.\" Ngunit kinilala pa rin niya ang awtoridad ng Ebanghelyo sa kabila ng ilang malayang pagtutumbas na naiibasa Septuagint. Sa bandang huli, tinanggap niya na sa pagsasalin ng Luma at Bagong Tipan, kahulugan at hindi salita ang tinutumbasan</p>\r\n<p>Para naman kay Jerome, sa kanyang Letter to Pammachius (395 AD), mas inaboran niya ang salita-sa-salitang salin ng Bibliya dahil \"ang mismong paghahanay ng mga salita ay isang misteryo.\" Ngunit kinilala pa rin niya ang awtoridad ng Ebanghelyo sa kabila ng ilang malayang pagtutumbas na naiiba sa Septuagint. Sa bandang huli, tinanggap niya na sa pagsasalin ng Luma at Bagong Tipan, kahulugan at hindi salita ang tinutumbasan.</p>\r\n<p>Bagama\'t salita-sa-salita at kahulugan-sa-kahulugan ang pinag-uusapang paraan ng pagsasasalin, sa pagsasalin ng Bibliya ay pumasok din ang interpretasyon ng mga tagasalin. Kaya may \"pakikialam\" ding ginawa ang mga tagasalin sa pagbibigay ng interpretasyong Kristiyano sa ilang bahagi.</p>\r\n<p><strong>Iba pang mga teorya sa pagsasaling pampanitikan</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>Isa sa mga unang manunulat na bumuo ng teorya sa pagsasalin ay ang French humanist na si Etienne Dolet (1509-46) na nilitis at nahatulan ng kamatayan sa pagiging isang erehe dahil sa maling pagsalin ng isa sa mga diyalogo ni Plato, na nagpapahiwatig ng hindi paniniwala sa imortalidad. Naniniwala si Dolet na kailangang maunawaan ng tagasalin ang kahulugan ng orihinal na awtor bagama\'t may kalayaan siya (ang tagasalin) na linawin ang mga bahaging malabo. Sinabi rin ni Dolet na iwasan ng tagasalin ang salita-sa-salitang tumbasan.</p>\r\n<p>Ganito rin ang ideyang ipinahayag ni George Chapman (1559-1634), ang nagsalin kay Homer, na nagsabing kailangang \"mahuli\" ng tagasalin ang diwa ng orihinal. Batay ito sa paniniwalang posibleng ilipat ang diwa at tono ng orihinal sa ibang kontekstong kultural, sa pamamagitan ng isang tagasalin na singhusay ng orihinal na awtor at may tungkulin at responsibilidad hindi lamang sa kanyang pinag- uukulang tagabasa kundi maging sa orihinal na awtor.</p>\r\n<p>Sina Wyatt (1503-42) at Surrey (1517-47), na kilala sa kanilang mga salin ng mga tula ng Italyanong makatang si Petrarch, ay nagsabing hindi lamang ang kahulugan ng orihinal ang dapat maisalin kundi pati ang epekto at tungkulin nito sa orihinal na mambabasa.</p>\r\n<p>Si Philemon Holland (1552-1637), na nagsalin kay Livy, ay gumamit ng mga kontemporanyong terminolohiya kaya ang patres et plebs ay naging nobles and commons, at nagdagdag pa siya ng mga paliwanag sa mga bahaging malabo.</p>\r\n<p>Para kay John Dryden (1631-1700), may tatlong uri ng salin: (1) metaphrase, o, salita-sa-salitang tumbasan; (2) paraphrase, o pagsasalin ngkahulugansakahulugan; at (3) imitation, o napakalayang salin, na maaaring baguhin ng tagasalin ang orihinal sa ano mang paraang sa palagay niya&rsquo;y tama</p>\r\n<p>Sinunod ni Dryden ang pangalawa, at idinagdag pa na ang tagasalin ay kailangang makatugon sa ilang pamantayan: kailangang siya ay isa ring makata; mahusay siya sa dalawang wikang sangkot sa pagsasalin; at nauunawaan niya ang diwa at katangian ng orihinal na makata bukod sa umaayon siya sa mga pamantayang pampanulaan ng kanyang sariling panahon.</p>\r\n<p>Ganito rin ang pananaw ni Alexander Pope (1688-1744), na nagbigay- diin din sa estilo ng orihinal at sa pagpapanatiling buhay sa \"apoy\" ng tula.</p>\r\n<p>&nbsp;</p>\r\n<h3>UNANG PANAHON</h3>\r\n<p>Nagsisimula sa pahayag ni Cicero na hindi dapat magsalun nang <em>verbum pro verbo </em>at sa pagsuporta ni Horace sa ganito ring ideya may 20 taon pagkaraan, hanggang sa matalinghagang komentaryo ni Holderlin sa sariling salin niya kay Sophocles noong 1804. Sa mahabang panahong saklaw nito, ang mga pagsusuri at pahayag ay galing mismo sa mga tagasalin. Kabilang sa panahongito ang mga obserbasyon at polemika ni St. Jerome, ang mga paliwanag ni Dryden tungkol kina Horace, Quintilian at Jonson, ang mga teorya ni Pope tungkol sa pagsasalin kay Homer, at iba pa. May mahahalagang teksto tungkol sa teorya tulad ng De Interpretatione Recta (1420) ni Leonardo Bruni ngunit ang pangunahing katangian ng panahong ito ay ummediate empirical focus\". Nagwawakas ang panahong ito sa paglabas ESSay on the Principles of Translation (1792) ni Alexander Fraser mapagpasyang sanaysay ni Friedrich Schleiermacher noong 1813</p>\r\n<h3>PANGALAWANG PANAHON<strong>&nbsp;</strong></h3>\r\n<p>Ito ay panahon ng hermene1utic inquiry- ang pagsasalin ay iniugnay sa mas pangkalahatang teorya ng wika at isipan. Nagkaroon ito ng sariling bokabularyo at metodolohiya. Ang panahong ito na tinawag ni Steiner na \"age of philosophic-poetic theory and definition\" ay nagwakas sa pagkalathala ng Sous L\'invocation de Saint Jerome ni Valery Larbaud noong 1946.</p>\r\n<h3>PANGATLONG PANAHON.</h3>\r\n<p>Nagsimula ito sa paglalathala ng mga unang papel tungkol sa machine translation noong mga 1940s; nang panahong ito pumasok ang structural linguistics at teorya ng komunikasyon sa pag- aaral tungkol sa pagsasalin.</p>\r\n<p>Maraming journal tungkol sa pagsasalin nagsimulang lumabas sa panahong ito at ang mga propesyonal na tagasalin ay kasapi na ngayon ng mga samahang internasyonal. Ang mga bagong direksyon sa pagsasalin ay tinalakay sa dalawang aklat: On Translation na inedit ni Reuben A. Brower at inilathala ng Harvard noong 1959 at 7he Craft and Context of Translation: A Critical Symposium na inedit nina William Arrowsmith at Roger Shattuck para sa University of Texas Press noong 1961.</p>\r\n<h3>PANG-APAT NA PANAHON.</h3>\r\n<p>Kasabay itong umiiral ng pangatlo at nagsimula noong kapapasok ng dekada 60 Ang \"pagkatuklas\" sa papel ni Walter Benjamin na pinamagatang Die Aufgabe des. Ubersetzers na unang nalathala noong 1923 at ang impluwensiya nina Heidegger at Hans-Georg Gadamer ay nagpapakita ng pagbalik sa hermeneutic at halos metapisikal na pagsisiyasat sa pagsasalin at interpretasyon.</p>\r\n<p>Ayon kay Steiner, marami nang publikasyong lumabas, at marami nang mahuhusay na mga awtor ang tumalakay sa sining at teorya ng pagsasalin. Ngunit sa kabila nito, kakaunti pa rin ang orihinal at makabuluhang mga ideya tungkol sa larangang ito. Ang dalawang tanong ni Ronald Knox ay buod ng mga isyu: (1) alin ang dapat mau&ntilde;a, ang bersiyong literari o ang literal; at (2) may laya ba ang tagasalin na ipahayag ang kahulugan ng orihinal sa alinmang estilo at idyomang mapipili niya? Angkop ang mga tanong ni Knox, ayon kay Steiner, bagama\'t labis na pinasisimple ang isyu; sa katotohanan, sa nakalipas na dalawang, libong taon, pabalik-balik lamang ang mga paniniwala at magkakas&auml;lungatang mga ideya mula noong panahon nina Cicero at Quintilian hanggang sa kasalukuyan.</p>\r\n<p><strong>Mga Teorya sa Pagsasalin ng Siglo 20</strong></p>\r\n<p>Sa pagpasok ng Siglo 20, may mga bagong ideyang lumutang kaugnay ng pagsasalin. Tinalakay ni Venuti sa kanyang The Translation Studies Reader (2000) ang mga ito sa historikal na paraan: Itinala niya ang ibat ibang ideya at ang mga taong nagsulong ng mga ito. Hinati niya ang Siglo 20 ayon sa mga dekada kung kailan umiral ang isang partikular na ideya.</p>\r\n<ol>\r\n<li>1900-1930. Nang mga panahong ito, nagkaroon ng bagong pananaw tungkol sa wika. Ang wika ay hindi na lamang itinuturing na kasangkapanng komunikasyon, kundi may malikhain itong kapangyarihan dahil ito ang tagapahayag ng mga kaisipan at ng realidad. Ang Tagasalin ay bumubuo ng isanh bagong teksto. batay sa kanyang pagpapakahulugan o interpretasyon ng orihinal. Sa proseso ng muling pagsulat ng dayuhang teskto, pagkakaroon ito ng bagong anyo ng ibang-iba na sa orihinal, maliban na lamang sa mensahe.</li>\r\n</ol>\r\n<ol start=\"2\">\r\n<li>1940-1950. Nang mga dekadang ito, naging paksa ng mga debate sa larangan ng pilosopiya, panunuring pampanitikan, at lingguwistika ang problema ng translatability-posible kayang maging tulay ang pagsasalin upang pag-ugnayin ang mga wika at kultura?</li>\r\n</ol>\r\n<p>Sa kanyang On Linguistic Aspects of Translation (1959). binanggit ni Roman Jakobson ang papel ng semiotika sa pagsasalin. Sinabi niya na may tatlong uri ng pagsasalin:</p>\r\n<ol>\r\n<li>muling pagpapahayag (intralingual. Ito ay interpretasyon ng mga pasalitang pahayag sa isang wika. Maaaring gumamit dito ng mga salitang magkasingkahulugan, o pariralang nagpapahayag ng kaparehong</li>\r\n<li>pagsasalin mula sa isang wika tungo sa isa pang wika (interlingualy. Dalawang wika ang kalahok sa pagsasalin, at ang mensahe sa\' unang wika, ang SL, ay tinutumbasan ng katapat ding mensahe sa isa pang wika, ang TL. Samakatuwid, ang pagsasalin ay recoding: \"Thus, translation involves two equivalent messages in two different codes.\" interpretasyon ng mga pasalitang simbolo sa pamamagitan ng mga simbolong hindi pasalita (intersemiotic).</li>\r\n</ol>\r\n<ol start=\"3\">\r\n<li>1960-1970. Ang problema ng pagtutumbas ang pinagtuunan ng mga teorisyan at praktisyoner ng mga dekadang ito. Magkakaiba man ang mga wika at kultura ng mga bansa; posibleng tumbasan sa ibang wika ang mga konseptong ipinapahayag ng isang wika dahil sa mga \"unibersal\" ng wika at kultura. Upang maihanap ng sapat na katumbas sa ibang wika ang isang dayuhang teksto, kailangang suriin ang gamit ng mga salita, ang balarila nito, at pati estilo</li>\r\n</ol>\r\n<p>Batay sa mga saliksik ng American Bible Society, naniniwala si Eugene Nida na ang tagasalin ay kailangang magtaglay ng sapat na kaalaman sa dalawang wikang kalahok sa pagsasalin. Ipinaliwanag niya ang kakaiba ng formal equivalence at <strong><em>dynamic equivalence</em></strong>. Ang salin na batay sa, una ang <strong><em>formal equivalence</em></strong>, ay tapat sa estruktura ng SL. Ito ang tinatawag tunog-salin dahil pinapananatili ang mga katangian ng wika at kultura ng SL.</p>\r\n<p>Ang <strong>dynamic equivalence </strong>naman, na tinawag na functional equivalence sa kalaunan, ay pagsasalin ng mensahe ng simulaang teksto, na iniaangkop ang salin sa wika at kultura ng TL. Madulas, idyomatiko, natural ang daloy, hinidi tunog-salin\", ang saling ginabayan ng teoryang ito. Parang orihinal na sinulat TL. Ganito ang pinairal na paraan ng pagsasalin ng Bibliya ni Nida at mga ama niya.</p>\r\n<ol start=\"4\">\r\n<li>Nalathala nang taong ito ang Translation Studies ni Susan Bassnett, Tapatan isang manipis na aklat na siksik sa maraming saliksik sa pagsasalin. Mga teorya sa pampanitikang salin ang pokus ng aklat, at sinabi rito na mahalaga ang mga saliksik at kritisismo ng salin, na tinawag niyang translation studies bilang hiwalay na disiplina. Ipinahayag din ng aklat ang paniwala ng marami nang panahong iyon tungkol sa awtonomiya ng tekstong salin, na ang tekstong salin ay may sariling buhay, isang malayanganyo ng pagsulat na naiiba sa pinaghanguang teksto. Binigyang- diin din na ang pagsasalin ay proseso hindi lamang produkto; ito\'y isang hakbang-hakbang na gawain kaya\'t hindi lamang ang tapos nang salin ang dapat pag-aralan kundi pati ang proseso kung paano isinagawa ang salin</li>\r\n</ol>\r\n<ol start=\"5\">\r\n<li>1990 pataas. Nang mga taong ito, marami nang mga institusyon para sa pagsasanay at pagsasagawa ng mga salin at marami ring mga iskolarling lathala tungkol sa mga salin at pamamaraan ng pagsasalin. Masiglang-masigla ang pagsasalin hindi lamang sa panitikan kundi maging sa medisna, batas, siyensiya at teknolohiya, at marami pang ibang larangann. Malaki ang papel ng lingguwistika sa mga pagsasanay ng mga tagasalin ng iba&rsquo;t ibang uri ng teksto.</li>\r\n</ol>\r\n<h3>ISAGAWA</h3>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>GAWAIN: PAG-UNAWA</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<ol>\r\n<li>Ipaliwanag ang kahulugan ng &ldquo;teorya sa pagsasalin&rdquo;.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </u>_</p>\r\n<p><u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbs